	(14,'Buku ini disusun untuk menyambut lahirnya keputusan Mendiknas No. 232/U/2000 dan No. 045/U/2002 tentang Pedoman Penyusunan Kurikulum Pendidikan Tinggi, di mana ISBD merupakan salah satu mata kuliah yang terhimpun dalam rumpun mata kuliah Berkehidupan Bermasyarakat. Selanjutnya, untuk memenuhi kebutuhan perkuliahan, maka kami menyusun buku pegangan yang menjadi pedoman perkuliahan bagi semua mahasiswa.','13','KENCANA','JAKARTA',2017,'978-602-7985-35-3',1224,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(15,'pelayanan publik berdasarkan Surat Keputusan Menteri Pendayagunaan Aparatur Negara No: 63/KEP/M.PAN/7/2003 sebagai berikut: Pelayanan publik adalah segala kegiatan pelayanan yang dilaksanakan oleh penyelenggara pelayanan publik sebagai upaya pemenuhan kebutuhan penerima pelayanan maupun pelaksanaan ketentuan peraturan perundang-undangan. Menteri Pendayagunaan Aparatur Negara dalam keputusan No.63 tahun 2003 tentang Pedoman Umum Penyelenggaraan Pelayanan Publik menyatakan bahwa ‘hakikat layanan publik adalah pemberian layanan prima kepada masyarakat yang merupakan perwujudan dari kewajiban aparatur pemerintah sebagai abdi masyarakat’.','1','UMJ PRESS','TANGERANG SELATAN',2018,'-',1228,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(16,' Pengertian Bisnis dan Jenisnya Bisnis adalah serangkaian usaha yang dilakukan satu orang atau kelompok dengan menawarkan barang dan jasa untuk men- dapatkan keuntungan/laba atau bisnis juga bisa dikatakan me- nyediakan barang dan jasa untuk ke lancaran sistem pereko- nomian. Mereka harus siap untung & siap rugi, bisnis tidak hanya tergantung dengan modal uang, tetapi banyak faktor yang men- dukung terlaksananya sebuah bisnis, misalnya: Reputasi, ke- ahlian, ilmu, sahabat & kerabat dapat menjadi modal bisnis. Menurut Griffin & Eber bisnis merupakan suatu organisasi yang menyediakan barang atau jasa yang bertujuan untuk mendapat- kan keuntungan. Bisnis dalam arti luas adalah istilah umum yang meng- gambarkan semua aktifitas dan institusi yang memproduksi ba- rang & jasa dalam kehidupan sehari-hari. Bisnis sebagai suatu sistem yang memproduksi barang dan jasa untuk memuaskan ke- butuhan masyarakat (bussinessis then simply a system that pro- duces goods and service to satisfy the needs of our society) [Huat, T Chwee, 1990]. Dari pendapat di atas dapat disimpulkan bahwa bisnis ada- lah kegiatan yang dilakukan oleh individu dan sekelompok orang (organisasi) yang menciptakan nilai (create value) melalui pencip- taan barang dan jasa (create of good and service) untuk memenuhi kebutuhan masyarakat dan memperoleh keuntungan melalui transaksi. Kegiatan bisnis sebagai sebuah organisasi ialah: 1. Produksi: Penciptaan barang dan jasa. 2. Keuangan: Kegiatan mencari dana yang dibutuhkan untuk me- laksanakan kegiatan dagang. 3. Pemasaran: Kegiatan untuk menginformasikan barang dan ja- sa, mengidentifikasikan keinginan konsumen. 4. Pengelolaan sumber daya manusia (SDM): Kegiatan mencari tenaga kerja dan meningkatkan kemampuannya','1','INSAN CENDIKIA MANDIRI','SUMATRA BARAT ',2021,'978-623-6090-52-7',1234,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(17,'-','-','-','JAKARTA',2014,'-',1230,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(18,'Tesis yang diserahkan untuk gelar Doctor of Philosophy dari The Australian National University, Southeast Asia Centre Fakultas Studi Asia, Juli 2006. (A thesis submitted for the degree of Doctor of Philosophy of The Australian National University, Southeast Asia Center Faculty of Asian Studies, July 2006)','1','ANU E PRESS','AUSTRALIA',2008,'9781921536243',1235,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(19,'Dengan berlandaskan pada prinsip-prinsip dasar GCG, Pupuk Kaltim menghasilkan produk berkualitas sesuai standar serta mengedepankan sikap saling menghargai dalam membina kerja sama dan berusaha mencapai yang terbaik.','-','PT. PUPUK KALIMANTAN TIMUR','-',2016,'-',1233,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(20,'Bunga Rampai ini menggambarkan kondisi lingkungan strategis administrasi publik, yang meliputi isu sosial, demografi, politik dan hukum. Kondisi sosial dan demografi menggambarkan karakteristik dan konstruksi relasi negara/pemerintah dan masyarakat yang terbentuk oleh nilai dominan, perilaku, kepercayaan, tradisi sosial serta kondisi demografis yang tercermin dalam karakteristik populasi (seperti umur, jenis kelamin, ras, etnis dan agama).','-','PUSAT KAJIAN SISTEM DAN HUKUM ADMINISTRASI NEGARA','JAKARTA',2018,'Pusat Kajian Sistem dan H',1238,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(21,'Perimbangan keuangan pusat dan daerah merupakan konsekuensi dari desentralisasi penyerahan urusan pusat dan daerah. Prinsip money follow function yang bermakna pendanaan harus mengikuti pembagian urusan dan tanggung jawab dari masing-masing tingkat Pemerintahan.','1','TIFA','JAKARTA SELATAN',2012,'-',1236,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(22,'Buku ini membahas tentang ruang lingkup dan lingkungan bisnis, globalisasi dan bisnis internasional, bentuk organisasi bisnis, pengelolaan dan pengorganisasian bisnis, manajemen sumber daya manusia, motivasi kerja, kepemimpinan, manajemen pemasaran, manajemen keuangan, manajemen operasi dan produksi. Penggunaan buku ini juga dapat menunjang kegiatan proses pembelajaran bagi mahasiswa terutama pada mata kuliah pengantar bisnis dan bagi mahasiswa yang sedang menyelesaikan tugas akhir/skripsi. Penulis berharap buku tentang pengantar bisnis ini dapat digunakan sebagai acuan dalam pengembangan ilmu pengetahuan sehingga memberikan kontribusi keilmuan dan informasi yang bernilai guna dan berdaya guna bagi kehidupan umat manusia dimasa yang akan datang. Penulis menyadari bahwa masih banyak terdapat kekurangan dan keterbatasan yang ada dari penulis, untuk itu kritik dan saran yang membangun sangat penulis harapkan demi sempurnanya buku ini','1','CV. LADUNY ALIFATAMA','LAMPUNG ',2020,'978-623-7829-36-2',1237,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(23,'matematika bisnis ','1','LP3M UNIVERSITAS PAKUAN ','BOGOR ',2019,'978-623-97228-3-6',1251,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(24,'uku ini berisi tentang penjelasan secara sederhana tentang lingkungan akuntansi. Pembahasan modul ini dimulai dari ruang lingkup, modul ini disajikan dengan bahasa yang sederhana agar mudah dipahami bagi pemula maupun sebagai bahan referensi bagi para mahasiswa maupun professional, dimana buku ini menyajikan materi yang secara sistematis dan sesuai dengan kurikulum berbasis kompetensi, sehingga mudah dipahami dan diaplikasikan di lapangan pekerjaan Dukungan dan bantuan dari berbagai pihak juga sangat berarti sehingga penulis berhasil menyelesaikan buku ajar Pengantar Akuntansi. Penulis mengharapkan ide-ide, masukan, dan kritik dalam penyempurnaan penerbitan ke buku ajar nantinya. Besar harapan penilis, buku ini dapat bermanfaat dalam memotivasi dan memenuhi kebutuhan pengguna untuk berlatih dan mahir dalam menyelesaikan laporan keuangan serta analisisnya. Penulis Siti Rahmi SE,.M.Acc,.Ak,.CA D','1','LPPM UNIVERSITAS BUNG HATTA ','SUMBAR ',2021,'978-623-95326-6-6',1249,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(25,'1 I. PENGANTAR WIRAUSAHA A. Definisi Wirausaha Pengertian wirausaha sendiri berkembang sesuai dengan sudut pandang seseorang terhadap sepak terjang seorang wirausaha. Seperti halnya pengertian wirausaha yang diungkapkan oleh Joseph Schumpeter: ” entrepreneur as the person who destroys the existing economic order by introducing new products and services, by creating new forms of organization, or by exploitation new raw materials” (Bygrave, 1994). Dari definisi atas dapat diartikan wirausaha adalah orang yang mendobrak system ekonomi yang ada dengan memperkenalkan barang dan jasa yang baru, dengan menciptakan bentuk organisasi baru atau mengolah bahan baku baru. Pengertian wirausaha yang lebih luas tercantum dalam buku “The portable MBA In Entrepreneurship”. Secara lengkap definisinya sebagai berikut Entrepreun is the person who perceives on opportunity and creates an organization ro pursue it (Bygrave,1994). Dalam definisi ini ditekankan bahwa s','1','JARING INSFIRATIF ','YOGYAKARTA',2012,'-----',1250,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(26,'-','1','SAH MEDIA','MAKASSAR',2017,'978-602-6928-12-2',1242,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(27,'emahaman akan konsep bisnis secara menyeluruh adalah merupakan dasar pengetahuan dan ketrampilan utama bagi peserta didik jurusan Adminstrasi Bisnis program studi Manajemen Bisnis Politeknik Negeri Manado. Sebagai institusi pendidikan vokasi manajemen bisnis dituntut untuk memberi bekal pengetahuan bisnis dan praktek pelaksanaan adalah merupakan inti sari pembelajaran di program studi ini. Pengertian umum dari Bisnis adalah merupakan suatu usaha yang mengelola faktor-faktor produksi untuk menghasil barang (goods) dan jasa (service untuk mendapatkan laba (profit). Banyak ahli yang mendefisisikan bisnis namun pemahamannya cenderung sama yaitu untuk menciptakan laba (profit). Hopper menyatakan bahwa bisnis adalah keseluruhan yang lengkap pada berbagai bidang seperti industri dan penjualan termasuk didalamnya lindustri dasar, industri manufaktur , jaringan distribusi, perbankan, asuransi dan jasa, transportasi yang melayani kebutuhan konsumen untuk mendapatkan manfaat didalamnya. Sementara Petterson dan Plowman myatakan bahwa bisnis adalah merupakan serangkaian kegiatan yang berhubungan dengan pembelian ataupun penjualan barang dan jasa yang dilakukan secara berulang-ulang untuk mendapatkan manfaat melalui kegiatan ini. Adapun fungsi dari bisnis adalah menciptakan nilai/kegunaan (utility) suatu produk baik barang maupun jasa yang seula kurang bernilai, setelah diolah/dirubah dengan cara tertentu menjadi lebih berguna/bernilai untuk memenuhi kebutuhan konsumen. Nilai kegunaan (utility value) yang diciptakan oleh kegiatan bisnis dapat disimpulan sebagai fungsi bisnis','1','POLIMDO PRESS','MANADO',2020,'978-623-7580-43-0',1241,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(28,'Negara kita wirausahawan baru telah memperkaya pasar dengan produk-produk yang inovatif dan juga mulai menyebarluaskan pengetahuan tentang kewirausahaan. Perguruan Tinggi mewajibkan semua jurusan untuk memberikan mata kuliah kewirausahaan yang bertujuan agar lulusan perguruan tinggi tidak bingung dan canggung terjun ke masyarakat, mereka memiliki mental wirausaha dan dapat mengenal pepohonan wirausaha yang akan dirintis, tidak gelap lagi seperti melihat hutan rimba, tidak tahu arah tujuan. Tidak lagi menyalahkan perguruan tingginya, yang menghasilkan lulusan menjadi penganggur. Kewirausahaan atau entrepreneurship adalah suatu intangible culture, suatu kemampuan struktural non fisikal yang mampu menggerakkan sosok fisikal. Seorang wirausaha yang unggul memiliki sifat-sifat kreatif, inovatif, originalitas, berani mengambil risiko, berorientasi ke depan dan mengutamakan prestasi, tahan uji, tekun, tidak gampang patah semangat, bersemangat tinggi, berdisiplin baja dan teguh dalam pendirian. Buku ini ditulis dalam upaya memberikan konstribusi bagi pemenuhan kebutuhan referensi yang berkaitan dengan kepentingan umum dan dunia pendidikan. Oleh sebab itu, penulis mencoba menyusun buku kewirausahaan dasar sebagai buku penuntun bagi seseorang yang ingin menjadi wirausahawan dan juga untuk perkuliahan di Perguruan Tinggi. Penulis menyampaikan terima kasih kepada semua pihak yang telah memungkinkan buku ini terbit. Terutama kepada para pakar yang bukunya penulis kutip. Kritik dan saran yang membangun penulis nantikan dengan tangan terbuka untuk menyempurnakan buku ini. Semoga buku ini bermanfaat bagi masyarakat pada umumnya dan bagi dunia pendidikan pada khususnya, Surabaya, Se','1','CV. AA. RIZKY ','JAKARTA ',2019,'978-623-7893-14-1',1246,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(29,'Keseluruhan materi dalam buku ini disajikan dengan bahasa yang mudah dipahami dan terbagi dalam 14 bab sebagai berikut: Bab 1 Dasar-Dasar Teknologi Informasi Bab 2 Etika IT Bab 3 Sejarah Teknologi Informasi Bab 4 Sistem Perangkat Lunak Teknologi Informasi Bab 5 Sistem Komputer Bab 6 Input dan Output Device Bab 7 Media Penyimpan Eksternal Bab 8 Perangkat Lunak Sistem Bab 9 Perangkat Lunak Aplikasi Bab 10 Kecerdasan Buatan Bab 11 Teknologi Komunikasi dan Jaringan Bab 12 Internet Bab 13 Basis Data Bab 14 Sistem Informasi','1','YAYASAN KITA MENULIS ','JAKARTA ',2021,'978-623-6840-56-6',1239,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(30,'Tujuan : Pada bab ini akan diperkenalkan tentang pengertian, sejarah, komponen dan pemanfaatan teknologi informasi di berbagai bidang 1.1. Sejarah Pada awal sejarah, manusia bertukar informasi melalui bahasa. Maka bahasa adalah teknologi, bahasa memungkinkan seseorang memahami informasi yang disampaikan oleh orang lain. Tetapi bahasa yang disampaikan dari mulut ke mulut hanya bertahan sebentar saja, yaitu hanya pada saat si pengirim menyampaikan informasi melalui ucapannya itu saja. Setelah ucapan itu selesai, maka informasi yang berada di tangan si penerima itu akan dilupakan dan tidak bisa disimpan lama. Selain itu jangkauan suara juga terbatas. Untuk jarak tertentu, meskipun masih terdengar, informasi yang disampaikan lewat bahasa suara akan terdegradasi bahkan hilang sama sekali. Setelah itu teknologi penyampaian informasi berkembang melalui gambar. Dengan gambar jangkauan informasi bisa lebih jauh. Gambar ini bisa dibawa- bawa dan disampaikan kepada orang lain. Selain itu informasi yang ada akan bertahan lebih lama. Beberapa gambar peninggalan zaman purba masih ada sampai sekarang sehingga manusia sekarang dapat (mencoba) memahami informasi yang ingin disampaikan pembuatnya. Ditemukannya alfabet dan angka arabik memudahkan cara penyampaian informasi yang lebih efisien dari cara yang sebelumnya. Suatu gambar yang mewakili suatu peristiwa dibuat dengan kombinasi alfabet, atau dengan penulisan angka, seperti MCMXLIII diganti dengan 1943. Teknologi dengan alfabet ini memudahkan dalam penulisan informasi itu. (Cangara, 1998) Kemudian, teknologi percetakan memungkinkan pengiriman informasi leb','1','YAYASAN PRIMA AGUS TEKNIK ','SEMARANG ',2021,'-----',1252,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(31,'Setelah mempelajari materi yang ada dalam bab ini, diharapkan dapat : 1. Mengetahui dan memahami jenis dan bentuk perusahaan 2. Mengetahui pihak-pihak yang berkepentingan dalam bisnis 3. Menguraikan peran etika dalam bisnis 4. Memahami pengertian akuntansi dan tujuannya. 5. Memahami konsep dalam penyusunan laporan keuangan 6. Menguraikan profesi akuntansi','1','CV. PENA. PERSADA ','JAWA TENGAH ',2021,'978-623-315475-8',1240,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(32,'-','-','-','-',2015,'-',1245,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(33,'Perkembangan bisnis di Indonesia mengalami pertumbuhan yang baik. Dewasa ini semakin banyak orang yang ingin memulai usaha termasuk anak muda. Perkembangan teknologi yang semakin canggih setiap harinya ditambah sosial media yang semakin masif di masyarakat. Sosial media memberikan informasi yang begitu cepat dalam hitungan detik sehingga seluruh masyarakat dapat mengetahui informasi dari seluruh belahan dunia. Perkembanga sosial yang semakin masif menambah informasi masyarakat tentang perkembangan seluruh belahan dunia. Selain sosial media market place juga semakin menjamur. Market place menjadi lahan bagi masyarakat untuk memulai usahanya mulai dari yang terkecil. Perkembangan market place yang semakin menjamur dan beberapa market place raksasa seperti Tokopedia, Lazada, Blibli dan lain sebagainya memberikan akses untuk masyarakat dalam melakukan penjualan maupun pembelian terhadap suatu produk. Pengguna sosial media yang mendapat informasi dari banyak tempat dapat memberikan informasi dan peluang terhadap suatu bisnis dan kemudahan dalam melakukan penjualan pada market place memberikan ruang bagi siapa saja untuk melakukan transaksi jual beli sehingga dewasa inisemakin banyak dan semakin menjamur anak-anak muda melakukan transaksi jual beli di market place. Pelaku bisnis semakin bertambah ke kalangan muda.','1','EF PRESS DIGIMEDIA ','SEMARANG ',2019,'978-602-0962-71-9',1247,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(34,'D PRAKATA EDISI KEENAM alam edisi keenam buku ini, penulis melakukan penyesuaian judul buku, dari judul semula “ Cara Mudah Memahami Matematika Ekonomi” menjadi “Cara Mudah Memahami Matematika Ekonomi dan Bisnis”. Seperti edisi sebelumnya, edisi keenam Cara Mudah Memahami Matematika Ekonomi dan Bisnis, dimaksudkan sebagai buku pengantar bagi mahasiswa ekonomi dan bisnis dan pemakai lainnya yang sungguh- sungguh berminat mempelajari dan mendalami metematika ekonomi dan bisnis yang merupakan terapan matematika dalam ekonomi dan bisnis. Sejak pertama kali diterbitkannya, buku ini banyak diminati dan digunakan oleh para mahasiswa ekonomi dan bisnis maupun pengajar. Saran- saran dan koreksi dari mereka mengenai edisi-edisi sebelumnya dan edisi ini, menjadikan buku ini lebih baik. Terdapat beberapa alasan buku ini disusun atau ditulis. Pertama, ikut serta menambah jumlah referensi buku matematika ekonomi dan bisnis dalam bahasa Indonesia. Kedua, belum banyak buku matematika ekonomi dan bisnis dalam bahasa Indonesia yang dilengkapi dan diperkaya dengan contoh/contoh soal dan soal-soal latihan sedemikian banyak dan bervariasi. Ketiga, membantu dan memudahkan penulis dalam mengantarkan mata kuliah ini di Fakultas Ekonomi dan Bisnis Universitas Udayana. Keempat, membantu mahasiswa belajar lebih mudah dan efisien serta mandiri. Dalam edisi ini, penulis melakukan perubahan yang berarti dengan adanya penambahan satu pokok bahasan yaitu fungsi multivariabel dan aplikasinya dalam ekonomi dan bisnis (Bab 12). Dengan demikian edisi ini terdiri atas 12 bab, seperti tercantum dalam daftar isi. Selain penambahan bab, juga dilakukan koreksi atas beberapa kekurangan dan kesalahan yang terdapat dalam edisi 5. Sementara itu, cara penyajian materi dalam edisi ini tetap dipertahankan seperti dalam edisi sebelumnya. Sasaran yang ingin dicapai adalah hasil perkuliahan yang optimal, terutama dalam mata kuliah ini. Sementara keunggulan buku ini dari buku sejenis lainnya adalah  buku ini disajikan dalam bentuk yang sederhana, ringkas, padat isi dan sistematis  serta dilengkapi dengan 224 contoh/ contoh soal dan 152 soal-soal latihan yang sebagian besar merupakan terapan dalam ekonomi dan bisnis. Oleh karena materi yang terkandung dalam buku ini untuk satu semester, maka disarankan kepada kolega dosen, agar materi Bab 2 sampai dengan Bab 6 diberikan sebagai bahan Ujian Tengah Semester dan sisanya, yaitu materi Bab 7 sampai dengan Bab 12 sebagai bahan Ujian Akhir Semester. Edisi keenam Cara Mudah Memahami Matematika Ekonomi dan Bisnis ini, sesungguhnya merupakan hasil dari usaha banyak orang. Para mahasiswa, rekan sejawat (kolega dosen), pemeriksa, dan penerbit semuanya memiliki kontribusi yang cukup besa','6','KERARAS EMAS ','DENPASAR ',2019,'978-602-6896-12-4',1244,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(35,'Dalam perkembangan teknologi yang begitu pesat, saat ini ba- nyak bermunculan para technopreneur muda yang inovatif dan mampu menggerakkan roda perekonomian Indonesia menjadi lebih baik. Untuk menjadi technopreneur yang sukses harus memiliki keahlian di bidang bisnis dan juga keahlian di bidang teknologi. Menurut Wisaksono dan Nurmida (2017), pengem- bangan technopreneurship membutuhkan keahlian bisnis (business skills), seperti kewirausahaan, pemasaran, peren- canaan bisnis, dan manajemen bisnis, disamping itu dibutuh- kan juga keahlian dalam bidang teknologi (technology skills) seperti inovasi, penawaran dan permintaan teknologi, mana- jemen hak milik, atau HaKI dan desain produk atau kemasan (Wisaksono & Nurmida, 2017).','1','ANGGOTA IKAPI ','SUMATRA BARAT ',2022,'978-623-5995-07-6',1248,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(36,'ampak pasar bebas dunia dan wabah Covid-19 sudah mulai terasa. Perkembangan ekonomi global yang begitu pesat telah meningkatkan hubungan saling ketergantungan dan mempertajam persaingan yang menambah semakin rumitnya strategi pembangunan yang mengandalkan ekspor. Ditinjau dari dampak pandemic Covid-19 yang terjadi mulai awal Maret tahun 2020, berbagai sector mulai terdampak. Pembatasan aktivitas masyarakat berpengaruh pada aktivitas bisnis yang kemudian berimbas pada perekonomian. Pengangguran menjadi salah satu masalah yang terjadi sebagai dampak efisiensi tenaga kerja oleh para pelaku bisnis. Berbagai permasalahan yang terjadi pada bangsa Indonesia sesungguhnya menjadi tanggungjawab kita bersama. Seorang pendidik harus mampu mempersiapkan para generasi muda untuk siap menghadapi perkembangan zaman. Salah satunya dengan adanya mempersiapkan generasi juda yang kuat mental, kreativ dan inovatif, solutif, serta mampu bangkit dari segala jenis situasi Dalam perguruan tinggi, sudah diterapkan mata kuliah kewirausahaan. Pendidikan kewirausahaan di perguruan tinggi diharapkan bisa menyiapkan mahasiswa untuk berani mandiri, tidak lagi terfokus menjadi pencari kerja. Apalagi data pengangguran terdidik di Indonesia menunjukkan, semakin tinggi pendidikan seseorang, semakin rendah kemandirian dan semangat kewirausahaannya. Pendidikan kewirausahaan mesti berjalan secara berkesinambungan dan menjadi bagian yang tidak','1','CV. AA RIZKY ','BANTEN ',2020,'978-623-6505-64-6',1254,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(37,'Tujuan kebijakan publik yang dibuat pemerintah tidak lain adalah untuk mengatur kehidupan bersama agar masyarakat menjadi lebih tertib, lebih nyaman hidupnya, dan dapat menikmati kesejahteraan secara maksimal. Agar tujuan tersebut tercapai, maka pemerintah dapat meminta masukan dari masyarakat dan kalangan bisnis untuk membuat naskah akademik mengenai rancangan kebijakan tertentu, agar kebijakan tersebut tepat sasaran dan menghasilkan manfaat (benefit) yang sebesar-besarnya kepada masyarakat.','1','WIDYA KARYA','SEMARANG',2012,'978-602-8517-64-5',1243,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(38,'13 KEWIRAUSAHAAN DAN MANAJEMEN USAHA KECIL BAB I PENDAHULUAN Al.Quran merupakan petunjuk untuk semua ilmu pengetahuan, diturunkan dengan perantara Malaikat Jibril kepada manusia utama, Rasulullah Muhammad SAW Ketika Nabi SAW mewartakan Al-Quran kepada umatnya, maka dari situlah para sahabat dan tokoh- tokoh Islam mulai melakukan kajian, sehingga memunculkan beragam temuan ilmiah yang sangat bermanfaat bagi kehidupan. Islam telah meletakkan dasar-dasar aturan kehidupan ekonomi dan dunia usaha untuk mengorganisasikan kehidupan masyarakat. Prinsip prinsip dasar dan pola ekonomi dalam Islam sangat bermaslahat, sehingga tidak menimbulkan pertentangan antara kebebasan pribadi dan kepentingan masyarakat banyak. Allah SWT. telah menjamin bahwa segala sesuatu di muka bumi ini diciptakan untuk kepentingan manusia. Hal itu termaktub dalam Al-Quran sebagai berikut: Kepunyaan-Nya- lah kerajaan langit dan bumi. Dan kepada Allah-lah dikembalikan segala urusan” (QS. Al-Hadid [571:29). Coba kita cermati kalimat dalam ayat di atas, Dan kepada Allah- lah dikembalikan segala urusan. Allah telah menegaskan untuk mengembalikan atau menyerahkan Segala urusan kepada-Nya. Kalimat segala urusan” bermakna sangat luas. Semua urusan yang melekat pada seorang hamba diminta Oleh Allah agar dikembalikan kepada-Nya Allah akan menydesaikan','1','PERDANA PUBLISHING ','MEDAN ',2022,'978-623-411-031-9',1253,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(39,'Definisi akuntansi dapat dirumuskan melalui 2 (dua) sudut pandang, yakni 1. Definisi dari sudut pandang pengguna jasa akuntansi dan 2. Definisi dari sudut pandang proses kegiatannya Sudut Pandang Pengguna Jasa Akuntansi Suatu disiplin ilmu dan atau aktivitas jasa Yang menyediakan informasi yang diperlukan Untuk melaksanakan kegiatan secara efisien dan mengevaluasi kegiatan suatu entitas atau Transaksi yang bersifat keuangan (financial).','1','PENEBAR MEDIA PUSTAKA ','YOGYAKARTA',2020,'978-623-6875-07-0',1255,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(40,'Administrasi Publik (Inggris:Public Administration) atau Administrasi Negara adalah suatu bahasan ilmu sosial yang mempelajari tiga elemen penting kehidupan bernegara yang meliputi lembaga legislatif, yudikatif, dan eksekutif serta hal- hal yang berkaitan dengan publik yang meliputi kebijakan publik, manajemen publik, administrasi pembangunan, tujuan negara, dan etika yang mengatur penyelenggara negara.','CETAKAN PERTAMA','EUREKA MEDIA AKSARA','JAWA TENGAH',2021,'978-623-5896-10-6',1256,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(41,'Geografi penduduk merupakan salah satu cabang ilmu geografi manusia yang mempelajari tentang perbedaan dan persamaan aktivitas manusia dalam ruang sebagai hasil dari interaksi antar manusia dalam memanfaatkan lingkungan','CETAKAN PERTAMA','PENERBIT EDIIDE INFOGRAFIKA','KOTA MALANG',2020,'978-623-90310-6-0',1257,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(42,'Tujuan Negara Indonesia terdapat dalam Pembukaan UUD1945, yaitu melindungi seluruh tumpah darah Indonesia, memajukan kesejahteraan umum, mencerdaskan kehidupan bangsa, dan ikut serta dalam ketertiban dunia. Tujuan negara yang terdapat dalam Pembukaan UUD1945 tersebut, saling terkait, tujuan yang satu menjadi pra syarat bagi terwujudnya tujuan lainnya. Wujud nyata negara mampu melindungi warganya adalah negara mampu meningkatkan kecerdasan dan kesejahteraan masyarakat. Kecerdasan dan kesejahteraan masyarakat ini menjadi pendukung bagi keterlibatan negara Indonesia dalam perdamaian dunia','CETAKAN PERTAMA','UAD PRESS','YOGYAKARTA',2019,'978-602-0737-25-6',1258,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(43,'Sejak mahasiswa, DR. Taufiqurokhman, S.Sos., M.Si., sudah aktif di berbagai organisasi kemahasiswaan, antara lain sebagai Ketua Umum Senat Mahasiswa STKS Bandung (1993), Pengurus Pusat dan Ketua Badan Mandiri Kerjasama Mahasiswa di Ikatan Pekerja Sosial Profesional Indonesia (IPSPI), dan Ketua Umum Gerakan Mahasiswa Kosgoro. Karena kepiawaiannya dalam memimpin, sejak tahun 2010 hingga sekarang Taufik dipercaya menjadi Ketua IKA STKS, Bandung dan menjadi Pengurus IKA Universitas Padjajaran Bandung mulai 2009-2014. Kegemarannya berorganisasi akhirnya membawa dirinya mengenal lebih jauh dunia luar melalui dunia pers.','1','FAKULTAS ILMU SOSIAL DAN ILMU POLITIK UNIVERSITAS MOESTOPO BERAGAMA (PERS)','JAKARTA',2014,'602-9006-07-0',1259,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(44,'Buku ini akan menjawab secara mudah pertanyaan-pertanyaan di ata, baik secara teori maupun secara praktis bagi para peminat kebijakan publik, seperti : praktisi pemerintah, mahasiswa, peneliti keibjakan publik,, dan NGOs.','1','VC. AA. RIZKY','BANTEN',2019,'978-623-7411-21-5',1260,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(45,'Penulis menyadari bahwa selesainya Buku Manajemen Pemerintah Daerah ini adalah berkat bantuan semua pihak, baik secara langsung maupun tidak langsung. Oleh karena itu pada kesempatan ini penulis menyampaikan ucapan terima kasih yang sebesar-besarnya kepada yang terhormat: 1. Bapak Prof. Dr. Djoko Mursinto, SE, M.Ec. Guru Besar Ekonomi selaku Pembimbing Pembuatan Buku Manajemen Pemerintahan Daerah. 2. Semua pihak yang telah membantu demi terselesaikannya penulisan Buku Manajemen Pemerintahan Daerah.','1','PUSTAKA RADJA','SURABAYA',2014,'978-602-7567-90-0',1263,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(46,'. Kata filsafat yang akrab dengan setiap insan akademis, insan yang berkecimpung di perguruan tinggi, baik sebagai mahasiswa mapupun sebagi dosen. Namun mungkin kita sangat jarang mengetahui apa filsafat itu. ','CETAKAN PERTAMA',' IDEAS PUBLISHING','GORONTALO',2023,' 978-623-234-275-0',1261,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(47,'Ada berbagai istilah di dalam penyebutan Hukum Administrasi Negara yang merupakan terjemahan dari Administratiefrecht yang dikenal di Negara Belanda, Verwaltungsrecht di Jerman, Droit Administratif di Perancis, Administratif Law di negara Inggris dan Amerika. Sebagaimana kita ketahui bahwa Indonesia dahulu merupakan bekas jajahan Belanda, sehingga Hukum Administrasi Negara Indonesia merupakan terjemahan dari Administratiefrecht.','CETAKAN PERTAMA','LEMBAGA PENELITIAN DAN PENGABDIAN MASYARAKAT, UNIVERSITAS PAKUAN','BOGOR',2021,'978-623-95736-5-2',1262,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(48,'We wish to thank all authors for their contributions to this volume and cooperation in expediting the editorial processes. We also thank the publishers and conference organizers for permitting us to include revised and updated versions of some papers in this book. Th anks are also due to colleagues in UN-DESA, especially Meriam Gueziel, for the assistance in the preparation of this volume. We particularly want to acknowledge the support and encouragement of our colleague Diane Loughran, Senior Information Offi cer, UN-DESA, and Valentina Kalk, Chief, United Nations Publications, as well as those responsible at Bloomsbury Academic. It would not have been possible to publish this volume without all their contributions.','1','BLOOMSBURY ACADEMIC','NEW YORK',2012,'978-1-78093-250-7',1267,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(49,'-','-','-','BANTEN',2017,'-',1264,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(50,'','','Pusat Kajian Manajemen Pelayanan LAN','',2009,'978-602-95141-0-0',1265,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(51,'','','Gava Media','',2012,'978-602-8545-87-7',1266,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(52,'','1 ','MITRA CENDIKIA ','YOGYAKARTA ',2018,'978-602-5747-20-5',1268,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(53,'Administrasi diartikan sebagai suatu proses pengorganisasian sumber-sumber sehingga tugas pekerjaan dalam organisasi tingkat apa pun dapat dilaksanakan dengan baik. Proses administrasi akan melaksanakan tiga fungsi utama yang berhubungan erat dengan tiga tingkatan umum dalam hierarki formal. Di tingkat atas, yaitu fungsi pengarahan organisasi, terutama berkaitan dengan proses perencanaan jangka panjang dari suatu tujuan yang akan dicapai. Di tingkat menengah, yaitu fungsi manajemen organisasi, terutama berkaitan dengan upaya mempertahankan organisasi sebagai suatu pekerjaan yang terus berlangsung lama, ilim yang diperlukan oleh staf teknis atau profesional yang terlibat dalam proses produksi (hasil). Di tingkat bawah adalah fungsi pengawas.','CETAKAN PERTAMA','UNIMAL PRESS','SULAWESI',2019,'978-602-464-061-3',1269,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(54,'Sumber daya manusia adalah kemampuan terpadu dari daya pikir dan daya fisik yang dimiliki individu, perilaku dan sifatnya ditentukan oleh keturunan dan lingkungannya, sedangkan prestasi kerjanya dimotivasi oleh keinginan untuk memenuhi kepuasannya. Sumber daya manusia merupakan aset dalam segala aspek pengelolaan terutama yang menyangkut eksistensi organiasi.','1','ZAHR PUBLISHING','YOGYAKARTA',2017,'978-602-61253-3-0',1270,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(55,'\"Partai Politik, Pemilihan Umum dan Ketimpangan Sosial dan Ekonomi di Indonesia','3','INFID','MAKASSAR',2014,'-',1271,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(56,'Pengetahuan merupakan keseluruhan hal yang diketahui dan diperolehsetelah memalului serangkai pengamatan ','1 ','SAMUDRA BIRU ','YOGYAKARTA ',2021,'978-623-261-256-3',1272,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(57,'Sebelum duduk sebagai Wakil Rektor III di Universitas Prof. Dr. Moestopo (Beragama), Dr. Andriansyah., M.Si, sudah memiliki segudang pengalaman, baik di dunia pendidikan, dunia usaha, hingga dunia politik. Selain concern pada dunia pendidikan, pria kelahiran Jakarta, 01 Oktober 1971 ini sangat aktif mengikuti berbagai organisasi, seperti menjadi Sekretaris Umum Senat Mahasiswa Fakultas Ilmu Sosial dan Politik Universitas Prof. Dr. Moestopo (Beragama) Tahun 1992-1993, memangku jabatan sebagai Ketua Umum Senat Mahasiswa Fakultas Ilmu Sosial dan Ilmu Politik Universitas Prof. Dr. Moestopo (Beragama) Tahun 1993-1994, Ketua Bidang I SMPT Universitas Prof. Dr. Moestopo (Beragama) tahun 1994-1995, dan menjadi Sekretaris Kompartemen Hubungan Luar Asosoasi Perguruan Tinggi Swasta Indonesia (APTISI) Wilayah III DKI Jakarta 2007-2011.','1','FAKULTAS ILMU SOSIAL DAN ILMU POLITIK UNIVERSITAS PROF. DR. MOESTOPO BERAGAMA','JAKARTA',2015,'978-602-9006-08-7',1273,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(58,'Selama kurun waktu dua tahun terakhir ini, penyelenggaraan desentralisasi dan otonomi di Indonesia berlangsung dalam dinamika yang begitu tinggi. Terbitnya UU Nomor 23 tahun 2014 tentang Pemerintah Daerah sebagai revisi atas UU Nomor 32 tahun 2004 menjadi momentum perubahan arah kebijakan terkait pelaksanaan desentralisasi dan otonomi daerah. Seperti diketahui, oleh pemerintah, UU No. 32 tahun 2004 dipecah menjadi tiga substansi besar yang diundangakan yaitu UU Nomor 6 tahun 2014 tentang Desa, UU Nomor 22 tahun 2014 tentang Pemilihan Gubenur, Bupati, dan Walikota, dan UU Nomor 23 tahun 2014 sendiri. Terkait UU Desa, keberhasilan pelaksanaan UU ini sangat bergantung pada kemampuan kapasitas pemerintah desa dalam menjalankan pembangunan desa. Oleh karena itu, kajian terhadap upaya pengembangan kapasitas pemerintah desa menjadi sangat penting. Kemudian mengenai UU Pilkada. Perubahan format pilkada menjadi serentak mulai tahun 2015 menjadi momentum penguatan demokrasi di tingkat lokal. Menarik untuk dilihat bagaimana kesiapan seluruh pihak terkait seperti KPU, KPUD, Bawaslu, Kepolisian, hingga Mahkamah Konstitusi dalam penyelenggaraan pilkada serentak.','1','PUSAT KAJIAN DESENTRALISASI DAN OTONOMI DAERAH','JAKARTA',2015,'978-979-1301-32-9',1274,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
