	(69,'administras pembangunan ini terdiri dari atas 15 bab yang dijelaskan secara rinci dalam pembahasan mengenai konsep dan strategi dan analisis diantaranya : konsep teori dalam studi ilmu administrasi pembangunan ','1','MEDIA SAINS INDONESIA','BANDUNG ',2024,'9786235121321',1285,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(70,'Konsep komunikasi organisasi merupakan sebuah hal yang sangat penting untuk di pahami dan dipelajari. Karena tanpa adanya konsep komunikasi maka organisasi tidak akan mungkin bisa berjalan dengan baik. Dalam sebuah organisasi, komunikasi menjadi nafas dalam keberlangsungan. Itu karena tanpa adanya komunikasi, organisasi tidak akan berjalan. Kondisi inilah yang menjadi latar belakang pemahaman mengenai komunikasi organisasi','CETAKAN PERTAMA','UNIVERSITAS ISLAM KALIMANTAN MUHAMMAD ARSYAD AL-BANJARY BANJARMASIN','BANJARMASIN',2022,' 978-623-7583-92-9',1286,'2025-06-05 15:07:34','2025-06-05 15:07:34'),
	(71,'Buku ini membahas pengertian dan konsep dasar reformasi  birokrasi, reformasi  reformasi birokrasi mengenai penataan dan penguatan organisasi,  arah perubahan reformasi birokrasi dalam penerapan good  governance dan pelayanan publik dalam organisasi pemerintahan,  fokus perubahan reformasi birokrasi dalam bidang penataan tata laksana, arah perubahan reformasi birokrasi dalam penataan  sistem Sumber Daya Manusia (SDM), arah perubahan reformasi  birokrasi dalam akuntabilitas kinerja Aparatur Sipil Negara (ASN)  dan fokus perubahan reformasi birokrasi dalam penguatan  pengawasan. birokrasi dalam pemerintahan, perkembangan  metodologi dalam reformasi birokrasi, patologi dan permasalahan  dalam birokrasi pemerintahan, paradigma dalam reformasi  birokrasi, visi, misi, dan strategi reformasi birokrasi, arah  kebijakan, sasaran, manajemen perubahan, ruang lingkup, dan  penataan peraturan perundang-undangan, arah perubahan ','1','PENERBIT EJA','MAKASSAR ',2023,'9786239958787',1287,'2025-06-05 15:07:34','2025-06-05 15:07:34');
