	(900,'INDRY ARDIANTI, 20171078. Pengaruh Tunggakan Piutang Pelanggan Perusahaan Daerah Air Minum (PDAM) Terhadap Efektivitas Pelayanan Di Kecamatan Barru Kabupaten Barru. pembimbing : Mukmin Muhammad dan Muliati.  \r\nPenelitian ini bertujuan untuk mengetahui Pengaruh Tunggakan Piutang Pelanggan Perusahaan Daerah Air Minum (PDAM) Terhadap Efektivitas Pelayanan Di Kecamatan Barru Kabupaten Barru dan untuk mengetahui faktor-faktor yang mempengaruhi tunggakan piutang pelanggan PDAM. Perusahaan Daerah Air Minum (PDAM) merupakan instansi pemerintah yang kegiatan utamanya bergerak dalam bidang pengelolaan dan pendistribusian. Sumber data berupa Angket, Wawancara, Observasi dan Dokumentasi. Metode penelitian yang digunakan yaitu metode penelitian kuantitatif. Analisis data menggunakan aplikasi SPSS versi 25 for windows. Hasil penelitian menghasilkan nilainilai instrumen yang valid dari semua kuesioner karna r tabel < r hitung  atau nilai signifikansi < 0,05 maka dinyatakan valid. Uji analisis regresi diperoleh angka signifikansi/probabilitas 0,00 < 0,05 jadi nilai signifikansi berada dibawah 0,05 dan nilai yang diperoleh adalah 91,9% sehingga disimpulkan bahwa tunggakan piutang pelanggan memberikan pengaruh terhadap efektivitas pelayanan. \r\n','STIA AL-GAZALI BARRU',1,2021,1,900,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(901,'Anwar 20181259, Impelementasi Kebijakan Kartu Keluarga Sejahtera (KKS) Dalam Penurunan\r\nKemiskinan Kelurahan Bontomatenne Kecamatan Segeri Kabupaten Pangkajenne Kepulauan.\r\nPembimbing Dr. H. Abd. Mannang, SH, M.Si Dan Dian Pratiwi, SKM.,M. Kes\r\nPenelitian ini bertujuan untuk mengetahui proses Impelementasi Kebijakan Kartu\r\nKeluarga Sejahtera (KKS) Dalam Penurunan Kemiskinan Kelurahan Bontomatenne Kecamatan\r\nSegeri Kabupaten Pangkajenne Kepulauan. Selain itu juga bertujuan untuk mengetahui hambatan –\r\nhambatan yang terjadi saat pelaksanaan Kartu Keluarga Sejahtera di kelurahan Bontomatene. Tipe\r\npenelitian yang digunakan adalah kualitatif. Sumber data diperoleh dengan cara observasi,\r\nwawancara dan dokumentasi. Kemudian teknik analisis data adalah Reduksi data, Penyajian Data,\r\ndan Pengambilan Kesimpulan.\r\nHasil dari penelitian ini menunjukkan bahwa Impelementasi Kebijakan Kartu Keluarga\r\nSejahtera (KKS) Dalam Penurunan Kemiskinan Kelurahan Bontomatenne Kecamatan Segeri\r\nKabupaten Pangkajenne Kepulauan.sudah cukup baik. Kesimpulan ini didasarkan atas\r\nterpenuhinya seluruh indikator penelitian yaitu komunikasi, Sumber Daya, Disposisi, dan\r\nBirokrasi sehingga bantuan KKS bisa tepat sasaran. Namun bantuan tersebut belum bisa untuk\r\nmenurungkan kemiskinan. Kemudian hambatan yang terjadi saat pengimplementasian Kartu\r\nKeluarga Sejahtera di kelurahan Bontomatene adalah masalah jaringan ,dan tingkat valid tidaknya\r\ndata penerima. Serta hambatan lain yang di alami oleh kelurahan adaalah pengakuan masyarakat\r\nyang mengaku tidak mampu.','STIA AL-GAZALI BARRU',1,2022,3,901,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
