	(906,'Muhammad Ikhsan. 20171045. Implementasi Program Bantuan Stimulan Perumahan Swadaya (BSPS) Terhadap Masyarakat Berpenghasilan Rendah \r\nDi Dinas Perumahan Dan Kawasan Pemukiman Kabupaten Barru. Pembimbing: Mukmin Muhammad dan Asriani. \r\n        Penelitian ini bertujuan untuk mengetahui: Implementasi program bantuan stimulan perumahan swadaya (BSPS) dalam memberikan bantuan rumah swadaya dan meningkatkan kualitas rumah masyarakat berpenghasilan rendah di Kabupaten Barru. Dan untuk mengetahui faktor-faktor yang mempengaruhi ketercapaian implementasi program bantuan stimulan perumahan swadaya (BSPS) dalam memberikan bantuan rumah swadaya dan meningkatkan kualitas rumah masyarakat berpenghasilan rendah di Kabupaten Barru. Metode penelitian yang digunakan adalah metode penelitian kualitatif, Sumber data diperoleh dengan cara Survei, Wawancara, Observasi, dan Dokumentasi. Analisis data menggunakan Reduksi Data, Penyajian data dan Penarikan Kesimpulan. Hasil penelitian ini menunjukkan bahwa implementasi program bantuan stimulan perumahan swadaya (BSPS) bisa meningkatkan kualitas rumah masyarakat berpenghasilan rendah di Kabupaten Barru. Dan untuk faktor pendukung ketercapaian dari implementasi program bantuan stimulan perumahan swadaya (BSPS) yaitu faktor partisipasi pemerintah dan masyarakat, sumber daya, komunikasi, dan bantuan perumahan swadaya yang dapat meningkatkan kualitas rumah masyarakat. \r\n','STIA AL-GAZALI BARRU',1,2022,1,907,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(907,'','STIA AL-GAZALI BARRU',1,1981,1,906,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(908,'CITRAYANA, 20161153. Hubungan Kepuasan kerja Dengan Kinerja Karyawan Pembangkit  Listrik Tenaga Uap (PLTU) Kabupaten Barru. Pembimbing: Saharuddin A. Tappu, dan  Masyitah. \r\n \r\nPenelitian ini bertujuan untuk mengetahui hubungan antara kepuasan kerja dengan kinerja karyawan serta untuk mengetahui faktor-faktor yang mempengaruhi kepuasan kerja terhadap kinerja karyawan pembangkit listrik tenaga uap (PLTU) Bawasalo Kabupaten Barru. Adapun metode penelitian kuantitatif dimana sampel jenuh sebesar 50 , teknik pengumpulan data observasi dan koisioner dan pengelolaan data menggunakan SPSS. \r\n \r\nHasil penelitian ini menunjukkan bahwa kepuasan kerja sangat berpengaruh dengan kinerja karyawan yang ditunjukkan dengan gaji, promosi, rekan kerja, atasan dan pekerjaan itu sendiri berbanding lurus dengan kualitas, kuantitas, dan ketetapan waktu yang tinggi. Sedangkan psikologis,sosial, fisik dan finansial merupakan faktor yang sangat berpengaruh terhadap hubungan kepuasan kerja dan kinerja karyawan. \r\n \r\n','STIA AL-GAZALI BARRU',1,2021,1,911,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(909,'','STIA AL-GAZALI BARRU',1,2016,1,909,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(910,'','STIA AL-GAZALI BARRU',1,2016,1,908,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(911,'Artis 20151159 Analisis Terhadap tingkat pertumbuhan ekonomi masyarakat di Desa Libureng Kecamatan Tanete Riaja Kabupaten Barru, Pembimbing Dr. H. Kamaruddin Hasan dan Wahyu azikin.\r\n\r\nPenelitian ini bertujuan untuk mengetahui: Bagaimana peran pemerintah terhadap tingkat pertumbuhan ekonomi dan faktor-faktor pendukung dan penghambat yang dihadapi dalam pertumbuhan ekonomi masyarakat di Desa Libureng Kecamatan Tanete Riaja Kabupaten Barru. Sumber data diperoleh dengan cara wawancara, observasi dan dokumentasi. Analisis data menggunakan model interaktif (Reduksi Data, PenyajianData, penyimpulan dan Verifikasi, kesimpulanakhir. Hasil penelitian ini menunjukkan bahwa Peran pemerintah Desa Libureng dalam peningkatan ekonomi masyarakat sudah baik. Faktor pendukung dalam meningkatkan pertumbuhan ekonomi masyarakat Desa Libureng Kecamatan Tanete Riaja Kabupaten Barru, adalah: peran pemerintah, partisipasi masyarakat, hasil pertanian, dan perkebunan. Faktor penghambat peningkatan pertumbuhan ekonomi masyarakat Desa Libureng Kecamatan Tanete Riaja Kabupaten Barru, adalah: Sumber Daya Manusia (SDM) yang terbatas.\r\n\r\nKata Kunci : Peran pemerintah, pertumbuhan ekonomi masyarakat','STIA AL-GAZALI BARRU',1,2021,1,910,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(912,'','STIA AL-GAZALI BARRU',1,2016,1,912,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(913,'Muh. Aswan.20171106. Implementasi Instruksi Presiden (INPRES) No. 1 \r\nTahun 2017 Tentang Gerakan Masyarakat Hidup Sehat (GERMAS) Di \r\nWilayah Kerja Puskesmas Lisu Kecamatan Tanete Riaja Kabupaten Barru, Pembimbing A.Russeng, dan Sukmiah \r\nPenelitian ini bertujuan untuk mengetahui implementasi instruksi presiden \r\n(INPRES) No. 1 Tahun 2017 Tentang Gerakan Masyarakat Hidup Sehat \r\n(GERMAS) di wilayah kerja Puskesmas Lisu Kecamatan Tanete Riaja Kabupaten Barru, dan untuk mengetahui faktor-faktor yang menghambat dalam implementasi Instruktur Presiden No. 1 Tahun 2017 tentang Germas di Puskesmas Lisu Kecamatan Tanete Riaja Kabupaten Barru. \r\nPenelitian ini mengunakan tipe penelitian deskriptif kualitatif, jenis data kualitatif, sumber data data premier dan sekunder. Pengumpulan dilakukan dengan cara observasi, wawancara, dan dokumentasi. Teknis analisis data dilakukan melalui tahap reduksi data, penyajian data dan penarikan kesimpulan/verivikasi. \r\nHasil penelitian ini menunjukan bahwa implementasi Instruksi Presiden Tentang Gerakan Masyarakat Hidup Sehat di Wilayah Kerja Puskesmas Lisu cukup baik, faktor-faktor penghambat adalah dampak pandemi covid-19 yang sangat mempengaruhi setiap kegiatan GERMAS di wilayah kerja puskesmas lisu. \r\nKata Kunci : Implementasi, Gerakan Masyarakat Hidup Sehat \r\n','STIA AL-GAZALI BARRU',1,2022,1,913,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(914,'','STIA AL-GAZALI BARRU',1,2016,1,914,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(915,'','STIA AL-GAZALI BARRU',1,2016,1,915,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(916,'Fahira. 20181083. Analisis Tingkat Kepuasan Masyarakat Terhadap Kualitas Pelayanan Pejabat Pembuat Akta Tanah (PPAT) Pada Kantor Notaris Andi Mindaryani Yunus, St., Sh. M. Kn. Pembimbing : Mukmin Muhammad dan M. Alwi A.  Buraerah.  \r\nPenelitian ini bertujuan untuk mengetahui kualitas pelayanan dan faktor-faktor yang mempengaruhi kualitas pelayanan Pejabat Pembuat Akta Tanah (PPAT) Pada Kantor Notaris Andi Mindaryani Yunus ST., SH., M. Kn. Dalam penelitian ini digunakan tipe penelitian kualitatif, jenis data yang digunakan terdiri dari data primer dan sekunder. Teknik pengumpulan data yang diterapkan yaitu observasi, wawancara, dan dokumentasi. Teknik analisis data melalui tahap pengumpulan data, reduksi data, penyajian data, dan penarikan kesimpulan/verifikasi.   \r\nHasil penelitian menunjukkan bahwa Kualitas pelayanan di Kantor Notaris Andi \r\nMindaryani Yunus ST., SH., M. Kn dari 5 indikator seperti Bukti Fisik, Kehandalan, Ketanggapan, Jaminan, dan Empati menunjukan bahwa kualitas pelayanan sudah cukup baik,  namun perlu adanya perbaikan seperti masih sering terjadi keterlambatan dalam proses pelayanan kepada pelanggan ataupun masyarakat yang melakukan pengurusan sertikat tanah di Kantor Notaris pelayanan yang di berikan kepada masyarakat untuk lebih ditingkatkan sehingga masyarakat bisa lebih puas dalam pelayanan dan Faktor-faktor yang mempengaruhi kualitas pelayanan publik yang menghambat pelaksanaan pelayanan publik di Kantor Notaris Andi Mindaryani Yunus ST., SH., M. Kn. adalah kurangnya tenaga staf atau SDM sehingga berdampak pada kualitas pelayanan, sedangkan faktor pendukungnya adalah kemudahan akses masyarakat untuk datang ke Kantor Notaris  dan fasilitas yang diberikan Kantor Notaris Kn sangat nyaman bagi pengguna layanan.','STIA AL-GAZALI BARRU',1,2023,1,916,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(917,'ABSTRAK\r\n\r\nSupriyono Napen Susanto. 20161234. Implementasi Analisis Jabatan (Anjab) Dalam Penentuan Petugas Teknis Pemadam Kebakaran Pada Kantor Dinas Pemadam Kebakaran Dan Penyelamatan Kota Parepare. Pembimbing: Kamaruddin Hasan dan Suriyati Hasan.\r\nPenelitian ini berfokus kepada bagaimana implementasi analisis jabatan dalam penentuan petugas teknis pemadam kebakaran dan penyelamatan, serta faktor yang mempengaruhi implementasi analisis jabatan pada kantor Dinas Pemadam Kebakaran dan Penyelamatan Kota Parepare.\r\nPenelitian ini menggunakan tipe penelitian deskriptif kualitatif, teknik Pengumpulan data diperoleh dengan cara observasi, dokementasi, wawancara, dan teknik Analisis data menggunakan analisis model pengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan.\r\nHasil Penelitian ini menunjukkan bahwa: (1) implemetasi analisis jabatan (ANJAB) dalam penentuan petugas teknis yakni analisis jabatan memberikan tingkat keberhasilan yang baik dalam anjab, dipengaruhi oleh komunikasi, sumber daya, disposisi dan struktur birokrasi. (2) Faktor-faktor yang mempengaruhi analisis jabatan dalam menentukan petugas teknis yaitu Rekrutmen Pegawai/ Petugas Teknis, skill atau keterampilan kemudian rotasi atau pergesaran pegawai.\r\n','STIA AL-GAZALI BARRU',1,2022,1,917,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(918,'ABSTRAK \r\n \r\nRiskawati. 20161296. Strategi Pemerintah Desa Dalam Pengembangan Usaha \r\nMikro Di Desa Alesipitto Kecamatan Ma’rang Kabupaten Pangkep, Pembimbing Hj. A. Tenriningsih dan Asriani \r\nPenelitian ini bertujuan untuk mengetahui strategi pemerintah desa dalam pengembangan usaha mikro dan untuk mengetahui faktor-faktor yang mempengaruhi strategi pemerintah desa dalam pengembangan usaha mikro di Desa  Alesipitto Kecamatan Ma’rang Kabupaten Pangkep,Tipe penelitian ini menggunakan tipe penelitian kualitatif, teknik pengumpulan data yaitu observasi, wawancara dan dokumentasi, dan teknik analisis data yaitu reduksi data, penyajian data dan penarikan kesimpulan, jenis data yang digunakan adalah data kualitatif dan sumber data yakni data primer dan sekunder \r\nHasil penelitian ini menunjukkan bahwa peningkatan kemampuan finansial, pengembangan pemasaran, pengembangan sumber daya manusia serta pengaturan dan pengendalian telah berjalan dengan baik, dan faktor-faktor yang mempengaruhi strategi pemerintah desa dalam pengembangan usaha mikro terbukti mempengaruhi strategi pemerintah desa dalam pengembangan usaha mikro meskipun masih bisa ditingkatkan dalam pelaksanaanya. \r\nKata Kunci : Strategi, Pemerintah Desa, Usaha Mikro \r\n \r\n','STIA AL-GAZALI BARRU',1,2021,2,918,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(919,'ABSTRAK \r\nNurul Amaliah. 20181189. Upaya Peningkatan Kualitas Pelayanan Jasa Pada Terminal \r\nPenumpang Pelabuhan Laut Awerange Kecamatan Soppeng Riaja Kabupaten Barru. Pembimbing : H.A.Russeng dan H. Arifin K. \r\n \r\nTujuan penelitian ini untuk mengetahui upaya peningkatan kualitas pelayanan jasa pada Terminal Penumpang Pelabuhan Laut Awerange Kecamatan Soppeng Riaja Kabupaten Barru. Dan untuk mengetahui faktor-faktor yang mempengaruhi upaya peningkatan  kualitas pelayanan jasa pada Terminal Penumpang Pelabuhan Laut Awerange Kecamatan Soppeng Riaja Kabupaten Barru. Metode penelitian yang digunakan dalam penelitian adalah tipe penelitian deskriptif kualitatif, jenis data yang digunakan terdiri dari data primer dan sekunder, disertai teknik pengumpulan data yaitu, observasi, wawancara dan dokumentasi. Adapun teknik yang digunakan yaitu, melalui tahap pengumpulan data, mereduksi data, penyajian data dan penarikan kesimpulan. \r\n  \r\nHasil penelitian ini menunjukkan bahwa Upaya peningkatan kualitas pelayanan jasa pada Terminal Penumpang Pelabuhan  Laut Awerange Kecamatan Soppeng Riaja Kabupaten Barru sudah baik, yang didasarkan pada analisis data indikator, bukti fisik (tangibles), kehandalan (reliability), daya tanggap (responsiveness), jaminan dan kepastian (assurance), dan empati (empathy), serta faktor-faktor yang mempengaruhi upaya peningkatan kualitas pelayanan jasa pada Terminal Penumpang Pelabuhan Laut Awerange  Kecamatan Soppeng Riaja Kabupaten Barru,  adalah kepemimpinan, semangat kerja tim, kepuasan kerja petugas, dan teknologi. \r\n \r\nKata Kunci : Kualitas Pelayanan, Pelayanan Jasa, Pelabuhan. \r\n','STIA AL-GAZALI BARRU',1,2022,1,919,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(920,'Ayu Ashari, 20161169. Pelaksanaan Verifikasi Lapangan Usaha Mikro Kecil dan Menengah (UMKM) oleh perekonomian Setda Barru yang terdampak Covid-19 di Kecamatan Barru di Kabupaten barru di bimbing: H. A. Russeng dan Masyitah \r\nPenelitian ini bertujuan untuk mengetahui pelaksanaan verifikasi lapangan UMKM yang terdampak covid-19 di Kecamatan Barru Kabupaten Barru, dan untuk mengetahui faktor-faktor yang menghambat dalam pelaksanaan verifikasi lapangan terhadap UMKM yang terdampak covid-19 di Kecamatan Barru Kabupaten Barru. Penelitian ini menggunakan penelitian kualitatif, pengumpulan data dilakukan dengan tehnik observasi, wawancara dan dokumentasi. Analisis data dilakukan dengan tehnik pengumpulan data, konsensasi data, penyajian data dan penarikan kesimpulan.  \r\nHasil penelitian ini menunjukkan bahwa: Pelaksanaan verifikasi lapangan UMKM yang terdampak covid-19 di Kecamatan Barru Kabupaten Barru dengan melakukan pemantauan dari kantor prrekonomian SETDA Barru, memberikan sosialisasi mengenai covid -19 memerintahkan para UMKM untuk tetap mematuhi protokol kesehatan demi keselamatan bersama, beberapa hambatan dalam pelaksanaanya seperti masih banyak pelaku UMKM yang belum memahami tentang pentingnya syarat prokes yang ditetapkan oleh pemerintah. selain itu beberapa hambatan dalam pelaksanaan verifikasi terutama pada hal jam kantor yang selalu bertabrakan dengan jadwal pemantauan dilapangan. \r\n','STIA AL-GAZALI BARRU',1,2022,1,922,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(921,'ABSTRAK \r\nSukardi. 20171215. DAMPAK PROGRAM PADAT KARYA TUNAI (PKT) BAGI MASYARAKAT DESA BARING KECAMATAN SEGERI KABUPATEN PANGKAJENE DAN KEPULAUAN.  \r\nPembimbing: H. Surasno Taliki dan Hj. Sukmiah. \r\nPenelitian ini bertujuan untuk mengetahui faktor pendukung dan penghambat program Padat Karya Tunai (PKT) bagi masyarakat Desa Baring Kecamatan Segeri Kabupaten Pangkajene dan Kepulauan, dan untuk mengetahui dampak program \r\nPadat Karya Tunai (PKT) bagi masyarakat Desa Baring Kecamatan Segeri Kabupaten Pangkajene dan Kepulauan. Tipe penelitian ini termasuk tipe penelitian kualitatif, sumber data diperoleh melalui dokumentasi, observasi, wawancara dan triangulasi. Teknik analisis data yang digunakan yaitu pengumpulan data, reduksi data, penyajian data, kesimpulan dan verifikasi. \r\nHasil penelitian ini menunjukkan faktor yang pendukung program Padat Karya Tunai (PKT) bagi masyarakat Desa Baring yaitu kebijakan pemerintah, kelembagaan desa dan kesediaan tenaga kerja. Sedangkan faktor yang menghambat program Padat Karya Tunai (PKT) bagi masyarakat Desa Baring yaitu anggaran dana desa dan skill atau keahlian pekerja. Adapun dampak program Padat Karya Tunai (PKT) bagi masyarakat Desa Baring dapat diketahui dari dampak ekonomi sudah ada peningkatan, dampak sosial sebagian masyarakat belum bisa menguatkan rasa kebersamaan seperti gotong royong dan dampak budaya tetap menjaga kearifan budaya masyarakat. \r\n \r\nKata Kunci: Program Padat  Karya Tunai \r\n','STIA AL-GAZALI BARRU',1,2021,2,920,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(922,'ABSTRAK \r\nNormah, 2021. Faktor- Faktor Yang Mempengaruhi Konsumsi Air Bersih Pdam \r\nGolongan Pelanggan Rumah Tangga Di Btn Coppo Kecamatan Barru Kabupaten \r\nBarru di bimbing: Hj Andi Tenriningsih, H.Arifin \r\n \r\nPenelitian ini bertujuan untuk mengetahui: Pengaruh konsumsi Air bersih PDAM golongan pelanggan rumah tangga di BTN Coppo Kecamatan Barru, Kabupaten Barru. Faktor-faktor yang mendukung dan menghambat konsumsi air bersih PDAM golongan pelanggan rumah tangga di BTN Coppo Kecamatan Barru, Kabupaten barru. \r\nPenelitian ini menggunakan penelitian kualitatif.Pengumpulan data dilakukan dengan tehnik observasi,wawancara dan dokumentasi.Analisis data dilakukan dengan tehnik pengumpulan data,konsensasi data,penyajian data dan penarik kesimpulan.. \r\nHasil penelitian ini menunjukkan bahwa: Konsumsi air bersih PDAM di BTN Coppo memiliki pengaruh  besar terhadap permintaan air bersih PDAM, karna menjadi sumber utama dalam pemakaian air bersih. Faktor Pendukung dan penghambat dalam pelayanan PDAM, yaitu karena banyaknya fasilitas penambahan baru yang diberikan seperti pembayaran melalui sistem online guna menunjang keamanan dan kenyamanan para konsumennya. Sedangkan faktor penghambatnya yaitu karena kurangnya perhatian dan pengawasan para petugas terhadap instalasi PDAM sehingga sering terjadi kebocoran pipa yang mengakibatkan proses pendistribusian air menjadi terhambat. \r\n \r\nKata Kunci: Faktor, Pengaruh, PDAM \r\n ','STIA AL-GAZALI BARRU',1,2021,1,921,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(923,'Sartika .20171044. Partisipasi Masyarakat Dalam Mendukung Pembangunan Pengendalian Banjir Dan Perkuatan Tebing Sungai Bottoe Kecamatan Tanete Rilau Kabupaten Barru. Pembimbing: H. Kamaruddin Hasan dan Marsuki. \r\nPenelitian ini bertujuan untuk mengetahui Partisipasi Masyarakat Dalam Mendukung  Pembangunan  Pengendalian Banjir Dan Perkuatan Tebing Sungai Bottoe Kecamatan Tanete Rilau Kabupaten Barru. Dengan Menggunakan tipe penelitian  Deskriftif Kualitatif jenis data  yang digunakan terdiri dari data primer dan data sekunder disertai termasuk pengumpulan data yang diterapkan yaitu observasi, wawancara dan dokumentasi , sedangkan teknik analisis data melalui tahap pengumpulan data , reduksi data, penyajian data dan penarikan kesimpulan atau verifikasi. \r\nHasil penelitian tersebut menunjukan bahwa masyarakat sering berpartisipasi dalam mengurangi risiko banjir dengan cara membersihkan saluran drainase, pengaturan pembuangan sampah yang tepat, membuat tanggul atau benteng penahan banjir dan menanam pohon sehingga mendukung  pembangunan  pengendalian banjir dan perkuatan tebing Sungai Bottoe.  \r\n','STIA AL-GAZALI BARRU',1,2022,1,923,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(924,'','STIA AL-GAZALI BARRU',1,2017,1,924,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(925,'Nurfitri. 20161340. Implementasi Kebijakan Bantuan Pangan Non Tunai di Desa Nepo Kecamatan Mallusetasi Kabupaten Barru. Pembimbing: Zaid \r\nZainal dan Musdalifa \r\nPenelitian ini bertujuan untuk mengetahui: Bagaimana Implementasi kebijakan bantuan pangan non tunai di Desa Nepo Kecamatan Mallusetasi Kabupaten Barru yang mengunakan indikantorn  Indikator yaitu struktur biokrasi, komunikasi, sumber daya, dan disposisi dan untuk mengetahui faktor penghambat dari pelaksanaan bantuan pangan non tunai di Desa Nepo yang mengunakan indikator yaitu sarana prasarana, sumber daya manusia, implementasi dan waktu. Metode yang digunakan adalah kualitatif dan sumber data di peroleh dengan cara wawancara, dokumentasi.  \r\nHasil penelitian ini menunjukan bahwa Implementasi kebijakan bantuan pangan non tunai di Desa Nepo yaitu dilakukan dengan penyerahan data menerima manfaat, persiapan E- warong, edukasi dan sosialisasi, penyaluran serta pemanfatan selanjutnya faktor penghambat yaitu ketidak tepatan penerima bantuan, bantuan yang diterima masih dirasa kurang, tidak tepatnya waktu pembagian dan adanya peresepsi masyarakat yang tidak merasa adil. \r\n \r\nKata Kunci: Implementasi, Kebijakan, Bantuan Non Tunai \r\n','STIA AL-GAZALI BARRU',1,2021,1,925,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(926,'Sari Bulan.20161035. Faktor-Faktor yang Berpengaruh Terhadap Daya Saing Layanan Jasa Pengiriman Barang di Kantor Pos Cabang Barru Kabupaten Barru. Pembimbing: Chaliddin dan Rosdiana\r\nPenelitian ini bertujuan untuk mengetahui faktor-faktor yang berpengaruh terhadap daya saing layanan jasa pengiriman barang di kantor Pos Cabang Barru Kabupaten Barru. Dengan menggunakan tipe penelitian kualitatif. Dengan jenis sumber primer dan sekunder dan data yang diperoleh melalui teknik observasi, wawancara dan dokumentasi. Sedangkan teknik analisis data melalui tahap pengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan.\r\nHasil penelitian menunjukan bahwa faktor-faktor yang mempengaruhi daya saing jasa pengiriman barang dikantor pos kabupaten barru meliputi faktor kehandalan, fasilitas fisik, daya tanggap, jaminan, kepedulian, daya saing layanan jasa pengiriman barang dan keunikan produk, kualitas produk, dan harga bersaing namun sudah terlaksana dengan baik.\r\n','STIA AL-GAZALI BARRU',1,2021,1,926,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(927,'Nurfadillah. 20171134. Implementasi Program Kartu Keluarga Sejahtera Dalam Usaha Meningkatkan Kesejahteraan Masyarakat di Desa Kamiri Kecamatan Balusu. Pembimbing Dr. Kamaruddin Hasan, M.Pd dan Anshar A. Abidin, S.IP., M.Pd. \r\nPenelitian ini bertujuan untuk mengetahui bagaimana implementasi program kartu keluarga sejahtera di Desa Kamiri Kecamatan Balusu serta dampak terhadap peningkatan kesejahteraan masyarakat di Desa Kamiri Kecamatan Balusu.. Teknik pengumpulan data yang digunakan adalah observasi, wawancara, dokumentasi, dan arsip dengan menggunakan teori dari David C Kourten. \r\nHasil penelitian menunjukkan: Implementasi program kartu keluarga sejahtera di Desa Kamiri Kecamatan Balusu meliputi empat indikator, yakni sosialisasi, pendataan, penetapan penerima, dan pencairan dana dengan menggunakan teori dari David C Kourten yaitu kesesuaian anatara program dengan pemanfaat, kesesuaian antara program dengan organisasi pelaksana, dan kesesuaian antara organisasi pelaksana dengan kelompok pemanfaat dan terbukti sesuai pada ketiganya. Dampak Kartu Keluarga Sejahtera ialah sangat bermanfaat bagi masyarakat yang kurang mampu terbukti dengan merasa terbantunya masyarakat dengan adanya program Kartu Keluarga Sejahtera ini. \r\n','STIA AL-GAZALI BARRU',1,2022,1,927,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(928,'','STIA AL-GAZALI BARRU',1,1981,1,928,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(929,'ABSTRAK \r\nHajrana. 20181009. Implementasi Tugas Pokok dan Fungsi Satuan Polisi Pamong Praja\r\n(Satpol PP) dalam Penegakan Peraturan Daerah di Kabupaten Barru. Pembimbing H. A.\r\nRusseng dan Muliati. \r\nPenelitian ini bertujuan untuk mengetahui Implementasi tugas pokok dan fungsi Satpol PP\r\ndalam penegakan Peraturan Daerah di Kabupaten Barru, dan untuk mengetahui faktor-faktor yang\r\nmenghambat implementasi tugas pokok dan fungsi  Satpol PP dalam Penegakan Peraturan Daerah\r\ndi Kabupaten Barru. Tipe penelitian yang digunakan adalah penelitian kualitatif. Jenis data\r\nkualitatif, sumber data primer dan sekunder. Tehnik pengumpulan data dengan cara, observasi,\r\nwawancara dan dokumentasi. Tehnik analisis data melalui, pengumpulan data, reduksi data,\r\npenyajian data,  dan penarikan kesimpulanverifikasi. \r\nHasil penelitian ini menunjukkan bahwa Implementasi tugas pokok dan fungsi Satpol PP\r\ndalam penegakan Peraturan Daerah di Kabupaten Barru yang meliputi menegakan Peraturan\r\nDaerah, penyusunan program penegakan Peraturan Daerah, pelaksanaan kebijakan penegakan\r\nPeraturan Daerah, pelaksanaan koordinasi penegakan Peraturan Daerah, dan pengawasan atas\r\npelaksanaan Peraturan Daerah sudah terlaksana dengan cukup baik. Sedangkan faktor-faktor yang\r\nmenghambat implementasi tugas pokok dan fungsi Satpol PP dalam penegakan Peraturan Daerah\r\ndi Kabupaten Barru meliputi, keterbatasan sumber daya manusia (SDM), keterbatasan sarana dan\r\nprasarana, kurangnya pemahaman masyarakat, belum terbangunnya koordinasi antar Satuan Kerja\r\nPerangkat Daerah (SKPD), dan kurangnya anggaran.','STIA AL-GAZALI BARRU',1,2023,3,929,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(930,'','STIA AL-GAZALI BARRU',1,2021,1,933,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(931,'Wahyudi. A. 20171102. Implementasi Peraturan Daerah Nomor 7 Tahun 2019 \r\nTentang Pengelolaan Air Limbah Domestik pada Dinas Perumahan dan Kawasan Pemukiman di Kabupaten Barru. Pembimbing : Dr. Mukmin Muhammad Dan Hj. Aidah. \r\n \r\nPenelitian ini bertujuan untuk mengetahui : perananan Kantor Dinas \r\nPerumahan dan Kawasan Pemukiman dan faktor penghambat kantor Dinas \r\nPerumahan dan Kawasan Pemukiman   dalam Implementasi Peraturan Daerah Nomor 7 Tahun 2019 Tentang Pengelolaan Air Limbah Domestik Di Kabupaten Barru. Sumber data diperoleh dengan cara observasi, wawancara, dan dokumentasi. Metode penelitian yang digunakan adalah kualitatif. \r\n \r\nBerdasarkan hasil penelitian menunjukan bahwa implementasi kebijakan pengelolaan air limbah domestik di Kabupaten Barru dijelaskan dengan menggunakan 4 faktor yaitu komunikasi, disposisi, sumber daya, dan struktur birokrasi. Secara umum implementasi kebijakan pengelolaan air limbah domestik dapat dikatakan baik. Faktor penghambat dalam pelaksanaan kebijakan pengelolaan air limbah domestik yaitu kurangnya tingkat pemahaman masyarakat terhadap pentingnya pengelolaan air limbah dan minimnya sumber daya manusia oleh pihak implementor dalam pelaksanaan kebijakan. \r\n','STIA AL-GAZALI BARRU',1,2022,1,930,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(932,'Mirna, 20181073. Partisipasi Badan Permusyawaratan Desa (BPD) Dalam Menyusun Regulasi Desa Berbasis Masyarakat Di Desa Madello Kecamatan Balusu Kabupaten Barru. Pembimbing Chaliddin Dan Muliati. \r\nPenelitian ini bertujuan untuk mengetahui Partisipasi Badan Permusyawaratan Desa (BPD) dan faktor-faktor yang mempengaruhi patisipasi badan permusyawaratan desa dalam menyusun regulasi desa berbasis masyarakat di desa Madello Kecamatan Balusu Kabupaten Barru. Metode penelitian yang digunakan adalah penelitian kualitatif. Jenis data yang digunakan terdiri dari data primer dan data sekunder. Teknik pengumpulan data yang diterapkan melalui observasi, wawancara, dan dokumentasi. Sedangkan teknik analisis data melalui tahap pengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan. \r\nHasil penelitian tersebut menunjukkan bahwa partisipasi badan permusyawaratan desa dalam Menyusun Regulasi Desa Berbasis Masyarakat Di Desa Madello Kecamatan Balusu Kabupaten Barru cukup baik, termasuk partisipasi dalam pengambilan keputusan, pelaksanaan kegiatan, perencanaan pembangunan, pemantauan dan hasil pembangunan sedangkan faktor-faktor yang mempengaruhi yaitu faktor jenis kelamin, faktor pendidikan, faktor lamanya tinggal. Dan faktor-faktor yang tidak berpengaruh yaitu faktor usia dan faktor pekerjaan dan penghasilan. \r\n','STIA AL-GAZALI BARRU',1,2022,1,932,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(933,'Musdalifah. Implementasi E-Service Quality Dalam Meningkatkan Kepuasan Pelanggan Pada Pt Pln Ulp (Unit Layanan Pelanggan) Kecamatan Barru Kabupaten Barru. Pembimbing : H. A. Russeng Dan A. Ariyadi. \r\nPenelitian ini bertujuan untuk mengetahui implementasi E-Service Quality dalam meningkatkan kepuasan pelanggan pada PT PLN ULP (Unit Layanan Pelanggan) Kecamatan Barru dan untuk mengetahui faktor-faktor penghambat implementasi E-Service Quality dalam meningkatkan kepuasan pelanggan pada PT PLN ULP (Unit Layanan Pelanggan) Kecamatan Barru Kabupaten Barru. Penelitian ini menggunakan tipe penelitian kualitatif, jenis data kualitatif, sumber data primer dan sekunder. Teknik pengumpulan data observasi, wawancara, dan dokumentasi, serta teknik analisis data melalui pengumpulan data, reduksi data, penyajian data, dan penarikan kesimpulan/verifikasi.   \r\nHasil penelitian menunjukkan bahwa   Implementasi E-Service Quality dalam meningkatkan kepuasan pelanggan pada PT PLN ULP (Unit Layanan Pelanggan) Kecamatan Barru Kabupaten Barru melalui  indikator Tangibles (Bukti Fisik), Reability (Kehandalan), Responsiviness (Ketanggapan), Assurance (Jaminan), dan Emphaty (Empati) sudah cukup baik.dan faktor-faktor yang menghambat implementasi E-Service Quality dalam meningkatkan kepuasan pelanggan pada PT PLN ULP (Unit Layanan Pelanggan) Kecamatan Barru Kabupaten Barru adalah Ketidak jelasan informasi pengaduan pelanggan, Jaringan komunikasi pelanggan terganggu, Sarana transportasi kurang memadai dan alat komunikasi kurang memadai. \r\n','STIA AL-GAZALI BARRU',1,2023,1,931,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(934,'Jumriani, 20161152. Program Strategi Pemerintah Dalam Upaya Penyediaan Lapangan  Kerja di Kabupaten Barru. Pembimbing : Nurlia dan Nurul Mukhlisa \r\n \r\nPenelitian ini bertujuan untuk mengetahui : Program Strategi Pemerintah Dalam Upaya \r\nPenyediaan  Lapangan Kerja Dikabupaten Barru dan untuk mengetahui kendala-kendala \r\nProgram Strategi Pemerintah Dalam Upaya Penyediaan Lapangan Kerja Dikabupaten Barru. Sumber data diperoleh dengan cara Observasi, Wawancara, Dokumentasi dan Triangulasi. Metode penelitian menggunakan Deskriptif Kualitatif . \r\n \r\nBerdasarkan hasil penelitian menunjukkan bahwa, Program Strategi Pemerintah Dalam Upaya Penyediaan Lapangan Kerja Dikabupaten Barru sudah dilaksanakan sesuai dengan visi, misi dan Program Kepala Daerah dan Wakil Kepala Daerah terpilih.Visi Bupati dan Wakil Bupati terpilih yang dituangkan dalam Rencana Pembangunan Jangka Menengah Daerah Kabupaten Barru tahun 2016/2021. Dan sudah melakukan beberapa upaya-upaya dalam menanggulangi kendala atau hambatan selama program tersebut dijalankan. Adapun kendala-kendala yang muncul yaitu : Penyuluhan pembinaan tenaga kerja, instruktur pelatihan, dan penerbitan izin usaha jasa tenaga kerja baru. \r\n \r\n','STIA AL-GAZALI BARRU',1,2021,1,934,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(935,'Aryanti. 20171083. Implementasi Pengelolaan Aplikasi Sistem Informasi Perizinan dan Penanaman Modal Secara Electronik (OSS) pada Dinas Penanaman Modal Pelayanan Terpadu Satu Pintu dan Tenaga Kerja Kabupaten Barru. Pembimbing :  Mukmin Muhammad dan Hj. Aidah. \r\n \r\nPenelitian ini bertujuan untuk mengetahui Implementasi Pengelolaan Aplikasi Sistem Informasi Perizinan dan Penanaman Modal Secara Electronik (OSS). Dan untuk mengetahui fakto-faktor yang mempengaruhi Implementasi Pengelolaan Aplikasi Sistem Informasi Perizinan dan Penanaman Modal Secara Electronik (OSS) pada Dinas Penanaman Modal Pelayanan Terpadu Satu Pintu dan Tenaga Kerja Kabupaten Barru. Penelitian ini menggunakan tipe penelitian deskriptif kualitatif, sumber data terdiri dari data primer dan data skunder, teknik pengumpulan data meliputi observasi, wawancara, dan dokumentasi. \r\n        Hasil penelitian ini menunjukkan bahwa implementasi pengelolaan aplikasi  OSS sudah terimplementasi guna meningkatkan kualitas perizinan yang lebih baik dengan indikator penelitian menurut Edwards yaitu komunikasi, sumber daya, disposisi dan struktur birokrasi. Sedangkan faktor-faktor yang mempengaruhi implementasi pengelolaan aplikasi OSS terbagi menjadi dua yaitu faktor penghambat yang meliputi sarana dan prasarana, dan jaringan internet bermasalah dan faktor pendorong yang meliputi kemudahan penerbitan perizinan usaha, layanan sudah dekat dan dapat diakses dimana-mana. \r\n','STIA AL-GAZALI BARRU',1,2022,1,935,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(936,'','STIA AL-GAZALI BARRU',1,2017,1,938,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(937,'Nasriani, 20181137, Pengaruh Predikat Wajar Tanpa Pengecualian (WTP) Dari Badan Pemeriksa Keuangan Republik Indonesia (BPK-RI) Terhadap Pengelolaan Keuangan Pada Badan Pengelola Keuangan Dan Aset Daerah Kabupaten Barru. Pembimbing : Nurlia dan Andi Ariyadi \r\n \r\nPenelitian ini bertujuan untuk mengetahui pengaruh Predikat Wajar Tanpa Pengecualian (WTP) dari Badan Pemeriksa Keuangan Republik Indonesia (BPK-RI) Terhadap Pengelolaan Keuangan pada Badan Pengelola Keuangan dan Aset Daerah Kabupaten Barru. Dan untuk mengetahui seberapa besar pengaruh Predikat Wajar Tanpa Pengecualian (WTP) dari Badan Pemeriksa Keuangan Republik Indonesia (BPK-RI) Terhadap Pengelolaan Keuangan pada Badan Pengelola Keuangan dan Aset Daerah Kabupaten Barru. Jenis data yang digunakan adalah data kuantitatif yang dibagi menjadi dua yaitu data primer dan data sekunder. Sumber data diperoleh dengan memberikan kuesioner dengan menggunakan instrument penelitian dari sampel penelitian. \r\n \r\nHasil ini menunjukkan bahwa adanya pengaruh Predikat Wajar Tanpa Pengecualian (WTP) dari Badan Pemeriksa Keuangan Republik Indonesia (BPK-RI) Terhadap Pengelolaan Keuangan pada Badan Pengelola Keuangan dan Aset Daerah Kabupaten Barru. Hasil uji Regresi Linear Sederhana ini diperoleh nilai adalah 1,96 %. Sehingga dapat ditafsirkan bahwa Predikat Wajar Tanpa Pengecualian (WTP) memiliki pengaruh kontribusi sebesar 1,96 % terhadap Pengelolaan Keuangan.  \r\n \r\n','STIA AL-GAZALI BARRU',1,2022,1,936,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(938,'ABSTRAK \r\nFADHEL MUHAMMAD 20171234: Transparansi Dan Akuntabilitas Pengelolaan \r\nDana Bantuan Oprasional Sekolah (Bos) Di Madrasah Tsanawiyah DDI Bonto-\r\nBonto Kelurahan Bonto-Bonto Kecamatan Ma’rang Kabupaten Pangkep. \r\nPembimbing: Chaliddin dan Hj. Sukmiah \r\nPenelitian ini bertujuan untuk mengetahui Penerapan transparansi dan akuntabilitas serta faktor-faktor yang mempengaruhi pengelolaan dana bantuan operasional sekolah (BOS) di Madrasah Tsanawiyah  DDI Bonto-Bonto Kelurahan \r\nBonto-Bonto Kecamatan Ma’rang Kabupaten Pangkep, Adapun tipe penelitian yang digunakan yaitu pendekatan deskriptif kualitatif, jenis data yang digunakan yaitu data primer dan skunder disertai dengan teknik pengumpulan data yang diterapkan yaitu  observasi, wawancara, dan dokumentasi, sedangkan teknik analisis data melalui tahap pengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan atau verifikasi. \r\nHasil penelitian menunjukkan bahwa penerapan prinsip transparansi dan akuntabilitas pengelolaan dana bantuan operasional sekolah (BOS) Madrasah Tsanawiyah  DDI Bonto-Bonto cukup baik, karena sudah sesuai dengan indikator transparansi serta indikator akuntabilitas dengan keterlibatan semua pihak yang berkepentingan, serta faktor-faktor yang mempengaruhi Transparansi dan Akuntabilitas Pengelolaan Dana Bantuan Oprasional Sekolah (BOS) Di Madrasah Tsanawiyah DDI Bonto-Bonto yaitu kurangnya media informasi, sumber daya manusia, jumlah siswa yang dimiliki, sarana dan prasarana terbatas serta sumber dana yang dimiliki belum cukup untuk memenuhi kebutuhan madrasah. \r\n \r\n \r\nKata Kunci : Transparansi, akuntabilitas, pegelolahan, Dana Bantuan Oprasional Sekolah \r\n(BOS) \r\n \r\n','STIA AL-GAZALI BARRU',1,2021,2,939,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(939,'Serly Utami Putri. Analisis Kualitas Pelayanan Publik Di Kantor Kelurahan\r\nMangempang Kabupaten Barru. Pembimbing : H. Hafid Abdul Razak dan Ibu Hj.\r\nAidah.\r\nPenelitian ini bertujuan untuk mengetahui kualitas pelayanan publik dan faktor-\r\nfaktor yang mempengaruhi kualitas pelayanan publik di Kantor Kelurahan Mangempang\r\nKabupaten Barru. Dalam penelitian ini digunakan tipe penelitian kualitatif, jenis data yang\r\ndigunakan terdiri dari data primer dan sekunder. Teknik pengumpulan data yang diterapkan\r\nyaitu observasi, wawancara, dan dokumentasi. Teknik analisis data melalui tahap\r\npengumpulan data, reduksi data, penyajian data, dan penarikan kesimpulan/verifikasi.\r\nHasil penelitian menunjukkan bahwa Kualitas pelayanan di Kantor Kelurahan\r\nMangempang dari 5 indikator seperti Tangibles (Bukti Fisik), Reability (Kehandalan),\r\nResponsiviness (Ketanggapan), Assurance (Jaminan), dan Emphaty (Empati) menunjukan\r\nbahwa kualitas pelayanan sudah cukup baik, namun perlu adanya perbaikan seperti\r\nkeyamanan tempat pelayanan, keahlian pegawai dalam menggunakan alat pelayanan dan\r\nketidakramahan dalam melayanan pengguna layanan. Faktor-faktor yang mempengaruhi\r\nkualitas pelayanan publik yang menghambat pelaksanaan pelayanan publik di Kantor\r\nKelurahan Mangempang adalah kurangnya SDM dan masih kurangnya sarana dan\r\nprasarana sedangkan faktor pendukungnya adalah semangat yang diberikan pegawai satu\r\nsama lain, mengadakan rapat kooordinasi atau melakukan evaluasi setiap tiga bulan,\r\nkemudian memberikan penanaman kesadaran kepada masyarakat.','STIA AL-GAZALI BARRU',1,2022,3,940,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(940,'Sri Hasmulia, 20171148. Pengaruh Penggunaan Mobile Banking Terhadap Tingkat Kepuasan Nasabah Pada Bank Rakyat Indonesia (BRI) Unit Tanete Riaja Kabupaten Barru. Dibimbing: H. A. Russeng dan Herlina Amrianah.\r\nPenelitian ini untuk mengetahui adakah pengaruh penggunaan mobile banking terhadap tingkat kepuasan nasabah dan untuk mengetahui seberapa besar pengaruh penggunaan mobile banking terhadap tingkat kepuasan nasabah pada Bank Rakyat Indonesia (BRI) Unit Tanete Riaja Kabupaten Barru.Tipe penelitian ini adalah penelitian kuantitatif, dengan teknik pengumpulan data menggunakan kuesioner, observasi, wawancara dan dokumentasi. Sampel berjumlah 85 responden, menggunakan uji analisis statistik deskriptif, uji validitas dan reliabilitas, uji normalitas, dan uji regresi linear sederhana. Untuk pengolahan data menggunakan program SPSS versi 16.0 for windows.\r\nHasil penelitian menunjukkan Ada pengaruh penggunaan mobile banking terhadap tingkat kepuasan nasabah pada Bank Rakyat Indonesia (BRI) Unit Tanete Riaja Kabupaten Barru yang artinya H1 diterima, dimana berdasarkan uji validitas dan reliabilitas semua instrumen dikatakan valid dan reliabel. Hasil tersebut berarti pernyataan yang digunakan benar- benar handal dan mengukur apa yang ingin diketahui oleh peneliti. Pada uji validitas semua item memperoleh rhitung lebih besar dari rtabel (0.213) dan pada uji reliabilitas variabel pengaruh penggunaan mobile banking (X) dan variabel tingkat kepuasan nasabah (Y) mendapatkan nilai Cronbach’s Alpha diatas 0.60. Besarnya pengaruh penggunaan mobile banking terhadap tingkat kepuasan nasabah sebesar 65.5% dan berdasarkan uji analisis regresi linear sederhana menyatakan bahwa pengaruh tersebut kuat sesuai dengan tingkat hubungan nilai koefisien korelasi.\r\nKata Kunci: Mobile Banking, Kepuasan Nasabah\r\n','STIA AL-GAZALI BARRU',1,2022,1,937,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(941,'Muh. Aldi Munawar.. 20171220. Manfaat Pendidikan Dan Pelatihan Dalam  \r\nPeningkatan Produktivitas Kerja  Pegawai Di Kantor Desa Lasitae Kecamatan Tanete  Rilau Kabupaten Barru. Dibimbing oleh H. A. Russeng dan Kasmiah Ali \r\n        Penelitian ini bertujuan untuk mengetahui manfaat pendidikan dan pelatihan dalam  peningkatan produktivitas kerja  pegawai di Kantor Desa Lasitae Kecamatan Tanete  Rilau Kabupaten Barru. Tipe penelitian yang digunakan adalah deskriftif kualitatif. Sumber data terdiri dari data promer dan data skunder. Teknik pengumpulan data adalah: observasi, wawancara dan dokumentasi kemudian teknis analisis data melalaui  tahap reduksi data, penyajian data, dan penarikan kesimpulan (verification) \r\n         Hasil penelitian menunjukan bahwa manfaat pendidikan dan pelatihan dalam meningkatkan produktivitas kerja pegawai di Kantor Desa Lasitae Kecamatan Tanete  Rilau Kabupaten Barru yang meliputi indikator penelitian; meningkatkan pengetahuan dan keterampilan, membantu meningkatkan kepuasan dan produktivitas kerja, dan membantu menghilangkan rasa takut melaksanakan tugas baru, sudah cukup baik. Sedangkan faktor-faktor yang berpengaruh terhadap manfaat pendidikan dan pelatihan dalam peningkatan produktivitas kerja pegawai di kantor Desa Lasitae, Kecamatan Tanete Rilau Kabupaten Barru  adalah  ketersediaan dana desa  dan kebijakan kepala desa.  \r\n','STIA AL-GAZALI BARRU',1,2022,1,943,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(942,'Dian Eka Novita Sari. 20161345. Analisis Penerapan Sistem Kerja Kontrak  Karyawan di PT Phillips Seafood Indonesia di Kelurahan Bojo Baru Kecamatan Mallusetasi  Kabupaten Barru. Pembimbing: Zaid Zainal dan M. Alwi A. Buraerah \r\nPenelitian ini bertujuan untuk mengetahui: Bagaimana mekanisme sistem kerja kontrak karyawan di Kabupaten Barru dan penerapan sistem kerja kontrak karyawan di PT. Phillips Seafood Indonesia. Metode yang digunakan adalah kualitatif dan data di peroleh dengan cara Observasi, Wawancara, Dokumentasi \r\nHasil penelitian ini menunjukan bahwa mekanisme sistem kerja kontrak karyawan di Kabupaten Barru adalah perjanjian kerja untuk waktu tertentu dibuat secara tertulis, upah diberikan sesuai upah minuman yang berlaku di provensi, Setiap pekerja/buruh dan keluarganya berhak untuk memperoleh Jaminan Sosial selanjutnya  dalam penerapan sistem kerja kontrak karyawan di PT. Phillips Seafood Indonesia  yaitu proses rekrutmen karyawan, Pemberian upah dan jaminan sosial, Pemberlakuan libur, cuti dan aturan jam kerja, pelaksanaan perjanjian waktu tertentu (PKWT) terkait dengan pemenuhan hak dan kewajiban  serta  Jangka waktu perjanjian. \r\n','STIA AL-GAZALI BARRU',1,2021,1,942,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(943,'','STIA AL-GAZALI BARRU',1,2016,1,941,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(944,'Nur Hikmah, 20171156, Partisipasi Masyarakat Dalam Pengelolaan Sampah Di Pasar Tradisional Modern Pekkae Kelurahan Lalolang Kacamatan Tanete Rilau  Kabupaten Barru. Pembimbing : Chaliddin dan H. Ismail Hannanong . \r\n        Skripsi ini bertujuan untuk mengetahui partisipasi masyarakat dalam pengelolaan sampah serta faktor pendukung dan penghambat partisipasi tersebut di pasar tradisional modern Pekkae Kelurahan Lalolang Kecamatan Tanete Rilau kabupaten Barru. Tipe penelitian menggunkan dekriptif kualitatif, jenis data yang digunakan yaitu data primer dan skunder di sertai teknik pengumpulan data yang di terapkan yaitu obsevasi, wawancara dan dokumentasi, sedangkan teknik analisis data melalui tahap pengumpulan data, reduksi data, penyajian data, dan penarikan kesimpulan atau verifikasi  \r\n         Hasil menunjukkan bahwa partisipasi masyarakat dalam pengelolaan sampah di pasar tradisional modern Pekkae di Kelurahan Lalolang Kecamatan Tanete Rilau Kabupaten Barru dari indikator: partisipasi langsung, partisipasi berupa pembiayaan/iuran, partisipasi dalam proses pengambilan keputusan, partisipasi dengan memberikan kepercayaan kepada pihak berwenang seperti tindakan petugas dan peraturan cukup rendah hal ini di sebabkan kurangnya kesadaran dan minimya pengetahuan masyarakat dalam pengelolaan sampah, akibat yang ditimbulkan oleh sampah dan peluang memamfaatkanya. Fakrto-faktor yang mendukung partisipasi masyarakat dalam pengelolaan sampah di pasar tradisional modern Pekkae Kelurahan Lalolang Kecamatan Tanete Rilau Kabupaten Barru yaitu: Adanya upaya meningkatkan fasilitas sarana dan prasarana kebersihan pasar, sedangkan faktor penghambatnya yaitu: Kurangmya pengawasan, kurangnya fasilitas persampahan masyarakat dan pedagang dan sistem penegelolaan sampah yang kurang efektif. \r\n','STIA AL-GAZALI BARRU',1,2022,1,944,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(945,' \r\nSanti, 20171075. Penerapan Standar Operasional Prosedur (SOP) Dalam Meningkatkan Kualitas Pelayanan Di Pusat Kesehatan Masyarakat (Puskesmas) Ralla Kecamatan Tanete Riaja Kabupaten Barru. Pembimbing : Drs. H. Hafid Abdul Razak M.si dan M. Alwi A. Buraerah, SE, M.Si \r\nPenelitian ini bertujuan untuk mengetahui : Penerapan Standar \r\nOperasional Prosedur (SOP) dalam meningkatkan kualitas pelayanan di Pusat Kesehatan Masyarakat (Puskesmas) Ralla Kecamatan Tanete Riaja Kabupaten \r\nBarru. Jenis data penelitian yang di gunakan adalah tipe peneltian kualitatif, Sumber data terdiri dari data primer dan data sekunder, Teknik pengumpulan data meliputi Survey, Wawancara, Observasi, dan Dokumentasi. Analisis data melalui Tahap Reduksi Data, Penyajian Data dan Penarikan Kesimpulan/Verifikasi. \r\nHasil penelitian ini menunjukkan bahwa Penerapan Standar Operasional Prosedur (SOP) dalam meningkatkan kualitas pelayanan di Pusat Kesehatan Masyarakat (Puskesmas) Ralla Kecamatan Tanete Riaja Kabupaten Barru, sudah berjalan dengan baik sesuai dengan SOP yang telah diterapkan di masing-masing bagian pelayanan, Sedangkan faktor-faktor yang menghambat kualitas pelayanan yaitu  masih kurangnya tenaga medis dalam pelayanan serta sarana prasarana yang masih belum memadai. \r\n','STIA AL-GAZALI BARRU',1,2022,1,946,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(946,'Deni Kadir, 20171219, RESPON NELAYAN TERHADAP PROGRAM BANTUAN ALAT TANGKAP IKAN OLEH PEMERINTAH DAERAH DI \r\nDESA LASITAE KECAMATAN TANETE RILAU KABUPATEN BARRU \r\nPembimbing : Chaliddin dan A, Aminah. \r\n Penelitian ini bertujuan untuk mengetahui respon nelayan dan faktor-faktor yang berpengaruh terhadap program bantuan alat tangkap ikan oleh Pemerintah Daerah  di Desa Lasitae Kecamatan Tanete Rilau Kabupaten Barru, dengan menggunakan Tipe penelitian kualitatif, jenis data yang digunakan terdiri dari data primer dan sekunder disertai teknik pengumpulan data melalui observasi, wawancara dan dokumentasi, sedangkan teknik analisis  data melalui tahap pengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan dan verifikasi. \r\nHasil penelitian ini menunjukkan  bahwa Respon nelayan di Desa Lasitae Kecamatan Tanete Rilau cukup tinggi terhadap program bantuan alat tangkap ikan kepada nelayan oleh Pemerintah Daerah melalui Dins Perikanan dan Kelautan Kabaupaten Barru, karena  cukup berpengaruh secara positif dalam meningkatkan produksi dan kesejhteraan nelayan. Faktor-faktor berpengaruh terhadap pemberian bantuan alat tangkap ikan kepada nelayan oleh Pemerintah Daerah melalui Dinas Perikanan dan Kelautan di Desa Lasitae Kecamatan Tanete Rilau Kabupaten Barru adalah kemampuan kelompok nelayan membina anggota, penyuluhan perikanan, cuaca dan harga ikan yang berpluktuasi.   \r\n','STIA AL-GAZALI BARRU',1,2021,1,947,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(947,'Humairah. 20171178. Analisis Sistem Penerimaan Kas atas Pendapatan \r\nKlaim BPJS dan Non BPJS pada RSUD A. Makkasau Kota Parepare. Pembimbing: Dr. Rasidin Calundu, M.Kes., M.Si. dan Nurul Mukhlisa, S.Pd., M.Pd. \r\nPenelitian ini bertujuan untuk mengetahui sistem penerimaan kas atas pendapatan klaim Badan Penyelenggara Jaminan Sosial (BPJS) dan non BPJS dan mengetahui perbandingan sistem klaim BPJS dan non BPJS pada RSUD A. Makkasau Kota Parepare. Jenis penelitian yang digunakan pada penelitian ini adalah penelitian deskriptif dengan pendekatan kualitatif. Teknik pengumpulan data dalam penelitian ini yaitu observasi, wawancara dan dokumentasi. Sumber data diperoleh dengan cara observasi, wawancara, dan dokumentasi oleh kepala bidang Casemix (BPJS) dan kepala sub bidang penganggaran. Teknik analisis data yang digunakan peneliti yaitu kondensasi data, penyajian data, dan kesimpulan. Hasil penelitian menunjukkan sistem penerimaan BPJS, pihak BPJS harus melakukan pembayaran kepada pihak rumah sakit  maksimal 15 hari dari keluarnya BAHV (Berita Acara Hasil Verifikasi) oleh BPJS dan dikenakan denda sebesar 1% dari total klaim jika lebih dari 15 hari, sedangkan sistem penerimaan Non BPJS yaitu dokumen klaim diajukan ke Badan Keuangan Daerah (BPD) Kota Parepare, paling lambat 3 hari klaim harus sudah diproses untuk pembayaran ke pihak rumah sakit. Adapun perbandingan sistem klaim BPJS dan Non BPJS sudah berjalan sesuai dengan ketentuan yang telah ditetapkan dimana prosedur Klaim BPJS harus memperlihatkan kartu BPJS dan menyertakan rujukan serta pendapatannya dibayarkan oleh pihak BPJS, sedangkan prosedur klaim Non BPJS harus memperlihatkan KTP dan kartu keluarga serta menyertakan rujukan yang pendapatannya dibayarkan oleh pihak Badan Keuangan Daerah (BPD) Kota Parepare  \r\n \r\n','STIA AL-GAZALI BARRU',1,2022,1,945,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(948,'Andi Inaeni .20171051. Implementasi Peraturan Daerah Kabupaten Barru Nomor 2 Tahun 2009 Tentang Pengelolaan Kebersihan Pada Dinas Perumahan Dan Kawasan Pemukiman Kabupaten Barru. Pembimbing:  H. A. Russeng dan Wahyul Azikin. \r\nPenelitian ini bertujuan untuk mengetahui bagaimana impelementasi Peraturan Daerah Kabupaten Barru Nomor 2 Tahun 2009 tentang pengelolaan kebersihan pada Dinas Perumahan Dan Kawasan Pemukiman Kabupaten Barru dan faktor-faktor yang menghambat dalam implementasinya dan penelitian ini menggunakan tipe penelitian kualitatif, data yang digunakan dalam penelitian ini adalah data kualitatif dan sumber data  terdiri atas data primer dan  data sekunder, teknik pengumpulan data melalui  observasi,wawancara, dokumentasi, teknik analisis data melalui tahap reduksi data, penyajian data, penarikan kesimpulan/verifikasi. \r\nHasil Penelitian menunjukan bahwa Implementasi Peraturan Daerah Nomor 2 Tahun 2009  tentang  pengelolaan kebersihan pada Dinas Perumahan dan Kawasan Pemukiman Kabupaten Barru yang meliputi proses dari pengumpulan sampah, penjemputan sampah, pengolahan sampah, pembuangan sampah, pelaksanaan pengawasan dan pengendalian, hingga etika kebersihan lingkungan. Adapun faktorfaktor yang menghambat dalam implementasi adalah kurang adanya peran serta masyarakat dalam sosialisasi pengelolaan kebersihan, dan kurangnya partisipasi masyarakat dalam kerja bakti. \r\n','STIA AL-GAZALI BARRU',1,2022,1,949,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(949,'ABSTRAK \r\nJoeharni, 20171202. Kebijakan Pemerintah Desa Dalam Pengelolaan Wisata Baruttunge Di Desa Lalabata Kecamatan TANETE RILAU Kabupaten Barru. Pembimbing: Mukmin Muhammad dan A.Aminah \r\n \r\n \r\nUntuk mencapai kesejahteraan masyarakat, maka wisata desa digunakan sebagai sumber kehidupan bersama, sehingga wisata desa harus dimanfaatkan untuk semua  masyarakat  sebagai  sumber  kehidupan  yang  berkelanjutan.  Pemerintah desa sebagai penyelenggara proses pemerintahan di desa mempunyai peran yang sangat dominan terkait pengelolaan wisata desa. Tujuan penelitian ini yaitu untuk mengetahui kebijakan pemerintah Desa dalam pengelolaan wisata Baruttuttunge dan untuk mengetahui faktor pendukung dan penghambat kebijakan pemeritah desa dalam pengelolaan wisata Baruttunge Desa Lalabata Kecamatan Tanete Rilai Kabupaten Barru. \r\n \r\nPenelitian ini dilaksanaan di Kantor Desa Lalabata dan Bumdes Desa Lalabata Kecamatan Tanete Rilau Kabupaten Barru selama tiga bulan yaitu dimulai dari Desember 2021-Februari 2022. Dengan metode penelitian yang digunakan yaitu penelitian kualitatif. \r\nHasil penelitian yang diperoleh yaitu kebijakan pengelolaan wisata Baruttunge memiliki tujuan untuk peningkatan perekonomian masyarakat yang dapat dilihat dari implementasi tujuan kebijakan itu dibuat. Yang menjadi faktor yang mendukung kebijakan pengelolaan wisata adalah banyaknya objek wisata dan sarana prasarana yang cukup memadai. Faktor penghambatnya yaitu kurangnya partisipasi masyarakat dan kurangnya sumber daya manusia yang berkulitas \r\n \r\n','STIA AL-GAZALI BARRU',1,2022,1,951,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(950,'Salmawati, 20171019, Kebijakan Pemerintah Terhadap Partisipasi Perkumpulan Petani \r\nPemakai Air P3A Dalam Pengelolaan Air Irigasi Di Desa Palakka Kecamatan Barru \r\nKabupaten Barru: Pembimbing Chaliddin dan  Hj Aidah \r\n \r\nTujuan penelitian untuk mengetahui Kebijakan Pemerintah Terhadap Partisipasi Anggota \r\nPerkumpulan Petani Pemakai Air (P3A) di desa palakka kecamatan barru kabupaten barru dan Penerapan Kebijakan Pemerintah Terhadap Partisipasi Anggota Perkumpulan Petani Pemakai Air (P3A) di Desa Palakka Kecamatan Barru Kabupaten Barru. Penelitian ini menggunakan tipe penelitian kualitatif, jenis data yang digunakan terdiri dari data primer dan data sekunder yang disertai dengan teknik pengumpulan data yang diterapkan yaitu observasi, wawancara, dan dokumentasi, sedangkan teknik analisis data melalui tahap pengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan. \r\nHasil penelitian ini menunjukan bahwa Kebijakan pemerintah terhadap partisipasi anggota perkumpulan petani pemakai air (P3A) sudah baik yang didasarkan pada analisis data melalui indikator penelitian yaitu sumber daya pembiayaan, sumber daya lingkungan/alam, sumber daya manusia, kejelasan kelompok sasaran dan yang tidak terpenuhi kualitas sumber daya manusia (P3A). Adapun  penerapan kebijakan pemerintah terhadap partisipasi anggota perkumpulan petani pemakai air (P3A) dalam pengelolaan air irigasi di Desa Palakka Kecamatan Barru Kabupaten Barru. Sebagaimana dari program pelaksanaan kebijakan yaitu rehabilitasi irigasi, pembiayaan, pemanfaatan irigasi sedangkan capaian target yaitu pembuatan irigasi baru, dan pengawasan yaitu sesuai standar oprasional prosedur (SOP). \r\n','STIA AL-GAZALI BARRU',1,2022,1,950,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(951,'Anto Wijaya. 20161042. Implementasi Peraturan Bupati Nomor 20 Tahun 2020 Tentang Pedoman Pelaksanaan Tatanan Normal Baru  Pada Masa Pandemi Covid -19  di Alun-Alun  Kabupaten Barru. Dibimbing oleh H. A. Russeng  dan Kasmiah Ali \r\n          Penelitian ini bertujuan untuk mengetahui Impementasi Peraturan Bupati Nomor 20 Tahun 2020 Tentang Pedoman Pelaksanaan Tatanan Normal Baru Pada Masa Pandemi Covid -19 di Alun-Alun  Kabupaten Barru. Untuk tujuan tersebut digunakan indiaktor penelitian :komunikasi, sumber daya, disposisi, dan struktur birokrasi. Kemudian tujuan kedua dari penelitian ini adalah untuk mengetahui faktor-faktor yang menghambat penerapan Peraturan Bupati Nomor 20 Tahun 2020 Tentang Pedoman Pelaksanaan Tatanan Normal Covid -19 di Alun-Alun Kabupaten Barru. selanjutnya untuk tujuan kedua ini digunakan indikator penelitian yaitu: Masyarakat kurang memperdulikan aturan yang ada, Tipe penelitian yang digunakan adalah dekriftif kualitatif. Sumber data diperoleh dengan cara observasi, wawancara, dan dokumentasi. Kemudian teknik analisis data adalah teknik Miles dan Heberman. \r\n \r\nHasil penelitian ini menunjukkan bahwa  Implementasi Peraturan Bupati Nomor 20 Tahun 2020 Tentang  Pedoman pelaksanaan Tatanan Normal Baru Di Masa Pandemik Covid-19 di Alun-Alun Kota Kabupaten Barru dikategorikan sudah berjalan dengan cukup baik. Sedangkan Faktor-faktor yang menghambat  implementasi Peraturan Bupati Nomor 20 Tahun 2020 Tentang  Pedoman pelaksanaan Tatanan Normal Baru Pada Masa Pandemi Covid-19 di Alun-Alun Kota Kabupaten Barru adalah : Masyarakat kurang memperdulikan aturan yang ada. \r\n','STIA AL-GAZALI BARRU',1,2021,1,948,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(952,'Emil Burhan. 20171188. Analisis Laporan Pengelolaan Aset Desa Di Desa Batupute Kecamatan Soppeng Riaja Kabupaten Barru. Pembimbing: H. A. Russeng,SH., M.H dan Drs. H.Arifin K., M.Pd \r\n        Penelitian ini bertujuan untuk mengetahui laporan pengelolaan aset desa dan mengetahui faktor-faktor yang menghambat pengelolaan aset desa di Desa Batupute Kecamatan Soppeng Riaja Kabupaten Barru dengan menggunakan peneltian deskriptif kualitatif, jenis data yang digunakan terdiri data primer dan data sekunder yang disertai dengan teknik pengumpula data yaitu observasi, wawancara dan dokumentasi. Sedangkan teknik analisis data melalui tahap pengumpulan data, reduksi data, penyajian data, dan penarikan kesimpulan.          Hasil kesimpulan penelitian pada laporan pengelolaan aset desa di Desa Batupute Kecamatan Soppeng Riaja Kabupaten Barru pada tahap perencanaan, pengadaan, dan pertanggungjawaban baik. Sedangkan tahap penatausahaan, pelaporan, dan pengawasan kurang baik dan Faktor-faktor yang menghambat pengelolaan aset desa yaitu, kompetensi SDM, kurangnya komunikasi, sikap pelaksana yang belum patuh pada aturan, keahlian pengelola kegiatan dalam menyikapi keadaan pasar yang berubah-ubah. \r\n','STIA AL-GAZALI BARRU',1,2022,1,953,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(953,'Jumrah . 20171158. Implementasi Standar Pelayanan Berbasis Lembaga Kesejahteraan Sosial Anak (LKSA) Yayasan At-Taufiq Padaelo Kelurahan Lalolang Kabupaten Barru.   \r\nPembimbing : Hafid Abdul Razak Dan Herlina Amrianah \r\nPenelitian ini bertujuan untuk mengetahui: Implementasi standar pelayanan berbasis Lembaga Kesejahteraan Sosial Anak (LKSA) Yayasan At-taufiq Padaelo Dan untuk mengetahui Faktor penghambat Lembaga Kesejahteraan Sosial Anak (LKSA) Yayasan At-taufiq dalam menerapkan standar pelayanan berbasis LKSA.  \r\nMetode penelitian yang digunakan adalah metode penelitian kualitatif,sumber data diperoleh dengan cara survey, wawancara, observasi, dan dokumentasi. Analisis data menggunakan pengumpuan data, reduksi data, penyajian data dan penarikan kesimpulan.  \r\nHasil penelitian ini menunjukkan bahwa implementasi dalam menerapkan standar pelayanan berbasis LKSA masih kurang efektif dalam hal SDM serta sarana, prasarana yang belum memenuhi standar. Dan untuk faktor yang menghambat penerapan standar pelayanan berbasis LKSA yaitu kurangnya dukungan pemerintah dimana dibuktikan dengan minimnya dana yang dikeluarkan, dan kurangnya sarana, prasarana serta tidak adanya tenaga profesional seperti tenaga medis dan psikologis. \r\n','STIA AL-GAZALI BARRU',1,2021,1,952,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(954,'Nur Alam. AS. 20171203. Upaya Pelaku Usaha Dalam Mengembangkan Usaha Mikro Kecil \r\nMenengah (UMKM) Di Desa Coppo Tompong Kecamatan Mandalle Kabupaten Pangkep, \r\nPembimbing A. Pananrangi dan Anshar A. Abidin \r\n \r\nPenelitian ini bertujuan untuk mengetahui upaya pelaku usaha dalam mengembangkan \r\nUsaha Mikro Kecil Menengah (UMKM) Di Desa Coppo Tompong Kecamatan Mandalle Kabupaten Pangkep. Untuk itu digunakan indikator penelitian menciptakan produk yang berkualitas, pengunaan media sosial, mengikuti perkembangan zaman, pemanfaatan e-commerce, dan peran pemerintah. Selain itu juga bertujuan untuk mengetahui  faktor-faktor  yang menghambat pelaku usaha dalam mengembangkan Usaha Mikro Kecil Menengah (UMKM) Di Desa Coppo Tompong Kecamatan Mandalle Kabupaten Pangkep. Tipe penelitian ini menggunakan tipe penelitian kualitatif, teknik pengumpulan data yaitu observasi, wawancara dan dokumentasi. Kemudian teknik analisis data yaitu reduksi data, penyajian data dan penarikan kesimpulan,. Sedangkan jenis data yang digunakan adalah data kualitatif dan sumber data yakni data primer dan sekunder. \r\n \r\nHasil penelitian menunjukkan bahwa Upaya pelaku usaha dalam mengembangkan Usaha Mikro Kecil Menengah (UMKM) di Desa Coppo Tompong Kecamatan Mandalle Kabupaten Pangkep dikategorikan sudah berjalan cukup baik. Kesimpulan ini didasarkan pada hasil analisis data melalui indikator penelitian yaitu Menciptakan Produk Berkualitas, Penggunaan Media Sosial, Mengikuti Perkembangan Zaman, Pemanfaatan E-Commerce dan Peran Pemerintah. \r\nKemudian faktor-faktor yang menghambat pelaku usaha dalam mengembangkan Usaha Mikro Kecil Menengah di Desa Coppo Tompong Kecamatan Mandalle Kabupaten Pangkep adalah kesulitan pemasaran, keterbatasan finansial, keterbatasan SDM, akses teknologi informasi dan dukungan akses keuangan atau permodalan. \r\n','STIA AL-GAZALI BARRU',1,2022,1,954,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(955,'Hasnah. 20181148. Analisis Program Desa Wisata Dalam Meningkatkan Pendapatan Masyarakat Di Desa Paccekke Kecamatan \r\nSoppeng Riaja Kabupaten Barru. Pembimbing : Hafid Abdul Razak dan \r\nFitrianti. \r\n  Penelitian ini bertujuan untuk mengetahui program Desa Wisata serta faktor-faktor yang mempengaruhi program Desa Wisata dalam meningkatkan pendapatan masyarakat di Desa Paccekke Kecamatan Soppeng Riaja Kabupaten Barru dengan menggunakan tipe penelitian kualitatif, jenis data yang di gunakan terdiri dari data primer dan sekunder, serta teknik pengumpulan data yaitu, observasi, wawancara dan dokumentasi. Adapun teknik analisis data yang digunakan yaitu, melalui tahap pengumpulan data, mereduksi data, menyajikan data dan penarikan kesimpulan.  \r\nHasil penelitian ini menunjukkan bahwa program Desa Wisata dalam meningkatkan pendapatan masyarakat di Desa Paccekke Kecamatan Soppeng Riaja Kabupaten Barru, sudah berjalan baik. Dapat dilihat dari indikator penelitian yaitu ekonomi, sosial dan budaya. Kemudian faktor-faktor yang mendukung program Desa wisata dalam meningkatkan pendapatan masyarakat di Desa Paccekke yaitu memiliki objek-objek menarik berupa alam, seni budaya, sedangkan adapun faktor penghambat yaitu aksebilitas jalan dan telekomunikasi yang belum memadai. \r\n','STIA AL-GAZALI BARRU',1,2023,1,955,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(956,'Mayang Ajeng Listio Rini. 20181136. Upaya Peningkatan Pendapatan Nelayan Pada Masa Pemulihan Ekonomi Oleh Dinas Perikanan Kabupaten Barru. Pembimbing : Dian Pratiwi dan Marsuki. \r\n Penelitian ini bertujuan untuk mengetahui upaya peningkatan pendapatan nelayan pada masa pemulihan ekonomi oleh Dinas Perikanan Kabupaten Barru dengan menggunakan tipe penelitian kualitatif, jenis data yang digunakan terdiri dari data primer dan sekunder, disertai teknik pengumpulan data yaitu, observasi, wawancara dan dokumentasi. Adapun teknik yang digunakan yaitu, melalui tahap pengumpulan data, penyajian data dan penarikan kesimpulan.  \r\nHasil penelitian ini menunjukkan bahwa upaya peningkatan pendapatan nelayan pada masa pemulihan ekonomi oleh Dinas Perikanan Kabupaten Barru sudah berjalan dengan cukup baik ini tergambar dari terpenuhinya beberapa indikator penelitian seperti Rata-Rata Pendapatan Perhari, Dengan Keuntungan Maksimal Kesejahteraan Akan Ikut Meningkat dan Pendapatan Akan Ikut Memenuhi Kebutuhan Keluarga. Sedangkan faktor yang menghambat upaya peningkatan pendapatan nelayan oleh Dinas Perikanan Kabupaten Barru, yaitu Dana anggaran untuk nelayan ditiadakan oleh pemerintah sejak pandemi Covid-19 berakhir dan kurangnya pemahaman teknologi nelayan dalam penggunaan aplikasi yang dapat memudahkan nelayan dalam mencari ikan dilaut seperti aplikasi nelayan nusantara dan nelayan pintar.\r\n','STIA AL-GAZALI BARRU',1,2023,1,956,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(957,'Ulan Sari. 20171005. Implementasi Kebijakan Pemenuhan Syarat Teknis Dalam Pelayanan Pengujian Kendaraan Bermotor (Pkb) Pada Dinas Perhubungan Kabupaten Pangkep. Dibimbing oleh : A.Pananrangi M dan Marsuki, \r\nPenelitian ini bertujuan untuk mengetahui Implementasi Kebijakan Pelayanan Pengujian Kendaraan Bermotor (PKB) Dalam Memenui Syarat Teknis Pada Dinas Perhubungan Kabupaten Pangkep. Untuk tujuan tersebut digunakan indikator penelitian yaitu : komunikasi, sumber daya, disposisi, dan struktur bitokrasi. Selain itu penelitian ini juga bertujuan untuk mengetahui faktor-faktor yang menghambat implementasi kebijakan pelayanan Pengujian Kendaraan Bermotor (PKB) dalam memenuhi syarat teknis pada dinas Perhubungan Kabupaten Pangkep.. digunakan indikator penelitian, yaitu : kompetensi petugas pengujian kendaraan, fasilitas pengujian kendaraan, kesesuaian persyaratan pengujian kendaraan dan tersedia sistem informasi yang terintegrasi secara nasional. Tipe penelitian yang digunakan deskriftif kualitatif. Teknik pengumpulan data adalah: observasi, wawancara dan dokumentasi. \r\nHasil penelitian menunjukan bahwa pernikahan Implementasi kebijakan pemenuhan syarat teknis dalam pelayanan Pengujian Kendaraan Bermotor (PKB) pada Dinas Perhubungan Kabupaten Pangkep sudah dijalankan tetapi hasilnya belum maksimal. Masih terdapat kelemahan yakni kurangnya SDM petugas PKB. Kesimpulan ini didasarkan pada hasil analsis data sesuai 4 indiktor penelitian dimana terdapat 1 indikator yang tidak terpenuhi sesuai teori yaitu sumber daya manusia petugas PKB. Sedangkan 3 indikator yang terpenuhi sesuai teori adalah komunikasi, disposisi dan struktur birokrasi. Oleh karena itu masih diperlukan upaya peningkatan SDM petugas PKB agar implementasi kebijakan pemenuhan syarat teknis dalam pelayanan PKB dapat berjalan secara efektif. Kemudian Faktor-faktor yang berpengaruh terhadap implementasi kebijakan pemenuhan syarat teknis dalam pelayanan Pengujian Kendaraan Bermotor (PKB) pada Dinas Perhubungan Kabupaten Pangkep adalah : fasilitas pengujian kendaraan, kesesuaian persyaratan pengujian kendaraan dan tersedia sistem informasi yang terintegrasi secara nasional\r\n','STIA AL-GAZALI BARRU',1,2022,1,958,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(958,'Feri Fadly. 20151236. Implementasi Program Keluarga Harapan (PKH) di Kelurahan Watang Bacukiki Kecamatan Bacukiki Kota Parepare. \r\nPembimbing Drs. M. Rasyidi Amran dan Drs. H. Arifin K. \r\nPenelitian ini bertujuan untuk mengetahui : Bagaimana Implementasi Program Keluarga Harapan (PKH) di Kelurahan Watang Bacukiki dan untuk mengetahui faktor penghambat yang dihadapi Program Keluarga Harapan (PKH) di Kelurahan Watang Bacukiki Kecamatan Bacukiki Kota Parepare. Sumber data diperoleh dengan cara Wawancara, Dokumen dan Observasi. Analisis Data menggunakan Miles dan Huberman. \r\nHasil penelitian menujukkan bahwa Implementasi Program Keluarga Harapan (PKH) di Kelurahan Watang Bacukiki Kecamatan Bacukiki Kota Parepare sudah dilakukan dengan baik. Mulai dari Tahap interprestasi, Tahap pengorganisasian dan Tahap aplikasi. Faktor-faktor yang menghambat implementasi di Kelurahan Watang Bacukiki Kecamatan Bacukiki yaitu faktor komunikasi dan sumberdaya. \r\n \r\n','STIA AL-GAZALI BARRU',1,2022,1,957,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(959,'Harianti. 20171010. Analisis Rencana Pembangunan Jangka Menengah Desa (RPJM Desa) Berdasarkan Peraturan Menteri Desa No. 21 Tahun 2020 Tentang Pedoman Umum Pembangunan \r\nDesa Dan Pemberdayaan Masyarakat Desa Di Desa Bulo - Bulo  Kecamatan pujananting kabupaten Barru. Pembimbing : H. Abd. Mannang Dan Muliati  \r\nPenelitian ini bertujuan untuk mengetahui : Rencana Pembangunan Jangka Menengah Desa (RPJM Desa) Berdasarkan Peraturan Menteri  No.21 Tahun 2020 Tentang Pedoman Umum Pembangunan Desa Dan Pemberdayaan Masyarakat Desa Dan Untuk Mengetahui Faktor-faktor yang mempengaruhi Rencana Pembangunan Jangka Menengah Desa (RPJM Desa)  beredasarkan peraturan menteri No.21 tahun 2020 Tentang Pedoman Umum Pembangunan Desa Dan Pemberdayaan Masyarakat Desa. Metode penelitian yang digunakan adalah metode kualitatif, sumber data diperoleh dengan cara wawancara, observasi, dan dokumentasi. Analisis data menggunakan pengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan \r\nHasil penelitian ini menunjukkan bahwa Rencana Pembangunan Jangka Menengah Desa (RPJM Desa) Berdasarkan Peraturan Menteri  No. 21 Tahun 2020 Tentang Pedoman Umum Pembangunan Desa Dan Pemberdayaan Masyarakat Desa sudah berjalan dengan cukup baik. untuk mengetahui faktor-faktor yang mempengaruhi Rencana  (RPJM Desa) No. 21 Tahun 2020 Tentang Pedoman Umum Pembangunan Desa Dan Pemberdayaan Masyarakat Desa Di Desa Bulo – Bulo Kecamatan pujananting kabupaten  Barru yaitu : pelibatan  masyarakat Desa, pengawasan, pelaksanaan, Adanya visi dan misi kepala Desa, adanya arah kebijakan perencanaan pembangunan Desa dan adanya rencana program kegiatan. \r\n','STIA AL-GAZALI BARRU',1,2022,1,959,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(960,'Nuralam, 20181004. Pengaruh Program Pelayanan Inovasi LaNCAR DIK’DUCAPIL KIAMISOL Terhadap Kepuasan Guru Di UPTD SDN 151 Barru Kecamatan Pujananting Kabupaten Barru. Pembimbing Kamaruddin Hasan dan Marsuki \r\n Penelitian ini bertujuan untuk mengetahui: Pengaruh Program Pelayanan Inovasi \r\nLaNCAR DIK’DUKCAPIL KIAMISOL Terhadap Kepuasan Guru Di UPTD SDN 151 Barru Kecamatan Pujananting Kabupaten Barru. Dari sumber data yang di peroleh yaitu dengan cara observasi, kuesioner dan dokumentasi serta analisis data menggunakan uji validitas dan reliabilitas, uji normalitas dan lenearitas, analisis regresi linear sederhana dan pengujian hipotesis uji F (Anova). tipe penelitian yang digunakan dalam penelitian ini adalah penelitian pendekatan kuantitatif. \r\n Hasil penelitian ini menunjukkan Pengaruh Program Pelayanan Inovasi LaNCAR \r\nDIK’DUKCAPIL KIAMISOL Terhadap Kepuasan Guru Di UPTD SDN 151 Barru Kecamatan Pujananting Kabupaten Barru adalah dihasilkan F hitung variabel Kartu Identitas Anak Mitra Sekolah Secara Online (X) adalah 0.761 dengan probabilitas signifikansi sebesar 0.043 yang dimana lebih kecil dari 0.05 (0.043 < 0.05). dengan demikian hal ini menunjukkan bahwa variabel independen yaitu Kartu Identitas Anak Mitra Sekolah Secara Online berpengaruh signifikan diterima terhadap kepuasan guru. Maka H0 di tolak dan H1 diterima. Jadi disimpulkan kartu identitas anak mitra sekolah secara online berpengaruh terhadap kepuasan guru. \r\n','STIA AL-GAZALI BARRU',1,2023,1,960,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(961,'Riska Handayani. 20161068. Analisis Kepuasan Masyarakat Terhadap Pelayanan Administrasi Kependudukan Di Mall Pelayanan Publik Kabupaten Barru. Pembimbing : H.Abd. Mannang dan M. Alwi A.Buraerah. \r\nPenelitian ini bertujuan untuk mengetahui : Kepuasan masyarakat terhadap pelayanan administrasi kependudukan di mall pelayanan publik Kabupaten Barru. Dan untuk mengetahui faktor yang menjadi kendala tentang kepuasan masyarakat terhadap pelayanan administrasi kependudukan di Mall Pelayanan Publik Kabupaten Barru. \r\nMetode penelitian yang digunakan adalah metode penelitian kualitatif, sumber data diperoleh dengan cara Observasi, Wawancara, dan Dokumentasi. Analisis data menggunakan pengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan. \r\nHasil penelitian ini menunjukkan bahwa analisis kepuasan masyarakat terhadap pelayanan administrasi kependudukan di Mall Pelayanan Kabupaten Barru sudah sesuai dengan harapan. Hal ini bisa dilihat dari indikator komunikasi, sikap pelaksana dan struktur organisasi sudah berjalan dengan baik. Dan faktor yang menjadi kendala dalam kepuasan masyarakat terhadap pelayanan administrasi kependudukan adalah kurangnya pemahaman masyarakat, jaringan, cuaca, dan kurangnya tenaga kerja. Kata kunci : Kepuasan Masyarakat, Administrasi, Mall Pelayanan Publik. \r\n','STIA AL-GAZALI BARRU',1,2022,1,963,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(962,'Andi Muh. Faizal Arfianda, 20161099, Implementasi Kebijakan Program Keluarga Harapan (PKH) Dalam Penanggulangan Kemiskinan Di Kelurahan Mangempang Kecamatan Barru Kabupaten Barru: Pembimbing A. Pananrangi Dan Hj Aidah \r\nPenelitian ini bertujuan untuk mengetahui Implementasi Kebijakan Program Keluarga Harapan (PKH) dan Faktor-Faktor Yang berpengaruh terhadap Implementasi Kebijakan Program Keluarga Harapan (PKH) Dalam Penanggulangan Kemiskinan Di Kelurahan Mangempang Kecamatan Barru. Penelitian ini menggunakan tipe penelitian kualitatif, jenis data yang digunakan terdiri dari data primer dan data sekunder yang disertai dengan teknik pengumpulan data yaitu observasi, wawancara, dan dokumentasi, sedangkan teknik analisis data melalui tahap pengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan. \r\nHasil penelitian ini menunjukkan bahwa implementasi kebijakan program keluarga harapan (PKH) dalam penanggulangan kemiskinan belum terlaksana dengan baik dikarenakan salah satu indikator tidak terpenuhi, adapun faktor yang berpengaruh yaitu Sumber dana pembiayaan, Sumber daya manusia aparatur, Sumber daya lingkungan dan Kejelasan kelompok sasaran, dan masih kurangnya pemahaman  tentang kewajiban dan komitmen Keluarga Penerima Mamfaat Program Keluarga Harapan (PKH). \r\n','STIA AL-GAZALI BARRU',1,2022,1,961,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(963,'Nurul Azisa.20171116. Implementasi Sistem Pendaftaran Ketenagakerjaan di Unit Pelaksanaan Teknis Pusat Balai Latihan Kerja (UPTP BLK) Kabupaten Pangkajene dan Kepulauan. Pembimbing : Saharuddin A. Tappu dan Masyitah. \r\n        Penelitian ini bertujuan untuk mengetahui Implementasi Sistem Pendaftaran \r\nKetenagakerjaan  di Unit Pelaksanaan Teknis Pusat Balai Latihan Kerja (UPTP BLK) Kabupaten Pangkajene Dan Kepulauan. Dan untuk mengetahui faktor penghambat sistem pendaftan ketenagakerjaan di Unit Pelaksanaan Teknis Pusat Balai Latihan Kerja (UPTP BLK) Kabupaten Pangkajene dan Kepulauan. Metode yang digunakan pada penelitian ini adalah kualitatif, teknik pengumpulan data terdiri dari observasi partisipan, wawancara mendalam, dan studi dokumentasi. Hasil penelitian ini menunjukan bahwa partisipasi masyarakat dalam implementasi sistem pendaftaran di Balai Latihan Kerja Kabupaten Pangkajene dan Kepulauan cukup tinggi, adapun faktor penghambat sistem pendaftaran ketenagakerjaan adalah kurangnya dukungan dari implementor bagi masyarakat yang memiliki NIK KTP tidak dapat terbaca sistem. \r\n','STIA AL-GAZALI BARRU',1,2022,1,964,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(964,'','STIA AL-GAZALI BARRU',1,2017,1,966,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(965,'\r\nRis mah.  20171087.  Implementas i  Undang-Undang   No.  16  Tahun  2019  Tentang  Perkawinan Dalam   Upaya   Pencegahan   Pernikahan   Anak   Us ia   Dini   Pada   Kantor   Urus an   Agama Kecamatan   Balus u Kabupaten  Barru. Pembimbing  : H. Kamarudd in Has an dan Marzuki. \r\n \r\nPene;itian  ini  bertujuan  untuk  mengetahui  :  Implementas i  Undang-Undang  No.16  Tahun \r\n2019 Tentang Upaya Pencegahan Pernikahan  Us ia Dini Pada Kantor Urus an Agama   Kecamatan Balus u Kabupaten  Barru. Dan   untuk mengetahi upaya -upaya pencegahan  pernikahan  us ia  dini pada Kantor Urus an Agama Kecamatan  Balus u Kabupaten  Barru. Sumber data diperoleh  dengan cara  Obs ervas i,  Wawancara,  Dokumentas i,  dan  Triangulas i.  Metode  penelitian   menggunakan Des kriptif Kualitatif. \r\n \r\nBerdas arkan  has il  penelitian     menunjukkan  bahwa,  Implementas i  Undang-Undang   No.16 Tahun 2019 Tentang Pernikahan Dalam Upaya Pencegahan Perkawinan Anak Us ia Dini   Pada Kantor Urus an Agama Kecamatan  Balus u   s udah di terapkan  dengan baik atau dengan kata lain s udah melakukan penyuluhan kepada mas yarakat terkait bahaya yang ditimbulkan  dari pernikahan anak us ia dini , dikarenakan s emua pihak yang bertanggung jawab  s eperti penyuluh  Perkawinan dan Pemerintah  Des a s etempat  s udah melakukan  beberapa upaya -upaya  dalam hal pencegahan pernikahan anak us ia dini di Kantor Urus an Agama Kecamatan  Balus u , s alah s atu upaya yang akan di laks anakan  untuk pencegahan  pernikahan  anak us ia  dini   yaitu mendangtangkan  pihak kes ehatan untuk mengs os ialis as ikan akibat pernikahan  dini agar mas yarkat s adar betul dan tidak akan terjadi pernikahan us ia dini \r\n \r\n \r\n','STIA AL-GAZALI BARRU',1,2022,1,967,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(966,'Ardilla, 20171047, Efektivitas Pelayanan Kartu tanda Penduduk (e-KTP) Mobile Door to Door bagi Penyandang Disabilitas Pada Dinas Kependudukan dan Pencatatn Sipil Kabupaten barru. Pembimbing Hafid Abdul Razak dan Ismail Hannanong. \r\n \r\nHasil penelitian ini bertujuan untuk mengetahui Efektivitas Pelayanan Kartu Tanda Penduduk (e-KTP) Mobile door to Door bagi penyandang disabilitas pada dinas Kependudukan dan Pencatatan Sipil Kabupaten Barru dan faktor-fakyor yang menghambat Efektivitas Pelayanan Kartu Tanda Penduduk (e-KTP) Mobile Door to Door bagi penyandang disabilitas. Tipe penelitian yang digunakan adalah tipe penilitian kualitatif, sumber data yang digunakan adalah sumber data primer dan sekunder. Teknik analisis datanya yaitu pengumpulan data,reduksi data,penyajian data dan penarikan kesimpulan. \r\n \r\nHasil penelitian ini menunjukkan bahwa Efektivitas Layanan Kartu Tanda Penduduk (eKTP) Mobile door to Door bagi penyandang disabilitas telah terlaksana dengan baik dan efektif karena adanya program tersebut masyarakat disabilitas telah memiliki dokumen kependudukan tanpa datang langsung ke Dinas Kependudukan dan Pencatatan Sipil untuk melakukan perekaman. Sedangkan faktor yang menghambat yaitu letak geografis,akses jalanan yang kurang baik serta jaringan yang kurang mendukung terutama didaerah pegunungan yang jauh dari jangkauan petugas Disdukcapil. \r\n','STIA AL-GAZALI BARRU',1,2022,1,965,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(967,'Rahmat Hidayat. 20151043. Analisis Kinerja Tim Pemadam Kebakaran Dalam Upaya Penanggulangan Kejadian Kebakaran Di Kabupaten Barru. Pembimbing : Dr. Hj. Andi Tenriningsih, M. Si., dan Muhammad Fadli, S. Pd. I., M. Pd. I. \r\n\r\nPenelitian ini dilaksanakan Untuk mengetahui  Bagaimana Kinerja Petugas Pemadam Kebakaran dalam upaya penanggulan kejadian kebakaran di Kabupaten Barru serta Untuk mengetahui Faktor yang mempengaruhi Kinerja Petugas Pemadam Kebakaran dalam upaya penanggulan kejadian kebakaran di Kabupaten Barru, dalam penelitian ini tentunya diperlukan sampel, sistem sampel menggunakan purposive sampel dimana sampel yang dipilih adalah sampel mereka yang bekerja sebagai Aparatur Sipil Negara dan pegawai non PNS, dan memilihnya menggunakan pendekatan Sampel pilihan dimana pilihan ini yang dipilih adalah ASN 9 orang, dan pegawai non PNS yang memiliki tanggung jawab untuk melakukan pemadaman sebanyak 49 orang dari 7 Kecamatan yang ada di Kabupaten Barru, sehingga total jumlah sampel pada penelitian ini sebanyak,  58 orang. menggunakan metode angket dan analisis data menggunakan SPSS versi 20.\r\n\r\nAdapun hasil penelitian sebagai berikut, Kinerja pemadam kebakaran yang dilaksanakan oleh Dinas Pemadam Kebakaran di Kabupaten Barru sudah terlaksana dengan baik dimana untuk mengukur hal tersbut dilakukan penilaian terhadap beberapa indikator yaitu kecakapan, keahlian, pengalaman dan ketepatan waktu, oleh karena itu seluruh indikator tersebut terpenuhi sehingga dengan demikian dapat disimpulkan bahwa pelayanan petugas pemadam kebakaran di Kabupaten Barru terlaksana dengan baik meskipun pada dasarnya masih membutuhkan pengembangan-pengembangan di masa yang akan datang guna untuk menunjang keberhasilan pelayanan publik khsusnya di Kabupaten Barru, dan berdasarkan hasil penelitian yang dilakukan maka didapatkan hasil penelitian bahwa faktor yang mempengaruhi kinerja pelayanan dalam pelayanan pemadam kebakaran di Kabupaten Barru adalah dari empat faktor yang menjadi pengaruh pelayanan maaka ditemukan 3 (tiga) faktor yang sangat berpengaruh dalam kinerja pelayanan yaitu otoritas atau wewenang, kedisiplinan serta inisiatif ketiga faktor tersebut sangat berpengaruh dalam kinerja pelayanan pemadam kebakaran di Kabupaten Barru.\r\n','STIA AL-GAZALI BARRU',1,2020,1,969,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(968,'Ilham. Analisis Tingkat Kepuasan Masyarakat Terhadap Pelayanan \r\nAdministrasi Kependudukan di Kantor Desa Anabanua Kecamatan Barru Kabupaten Barru. Pembimbing : H. Hafid Abdul Razak dan Hj. Aidah S \r\nPenelitian ini bertujuan untuk mengetahui tingkat kepuasan masyarakat terhadap pelayanan administrasi kependudukan di Kantor Desa Anabanua Kecamatan Barru Kabupaten Barru dan untuk mengetahui faktor-faktor yang menjadi penghambat pelayanan administrasi kependudukan di Kantor Desa Anabanua Kecamatan Barru Kabupaten Barru. Sumber data diperoleh dengan cara observasi, wawancara, dan dokumentasi. Metode yang digunakan dalam penelitian ini adalah penelitian kualitatif. \r\nHasil penelitian menunjukkan bahwa masyarakat puas terhadap pelayanan administrasi kependudukan di Kantor Desa Anabanua. Untuk melihat tingkat kepuasan masayarakat dilihat dari indikator yaitu kemudahan prosedur, kesesuaian persyaratan dengan jenis pelayanan, kejelasan dan kepastian petugas yang melayani, keadilan dalam mendapatkan pelayanan, dan kecepatan pelayanan yang diberikan oleh petugas. Faktor-faktor yang menjadi penghambat dalam pelayanan administrasi kependudukan di Kantor Desa Anabanua yaitu kurangnya fasilitas seperti komputer, akses internet atau wifi yang kurang bagus, masyarakat sering komplain karena diberakukan sistem antrian, dan masyarakat tidak membawa berkas-berkas persyaratan dalam pengurusan administrasi kependudukan. \r\n','STIA AL-GAZALI BARRU',1,2023,1,971,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(969,'ABSTRAK\r\nMuh. Fabian Candra Maulana. 20161044. Partisipasi Yayasan Masjid Modern Kurir Langit Dalam Upaya Peningkatan Kualitas Pelayanan Kepada Masyarakat Di Kabupaten Barru. Pembimbing : Mukmin Muhammad dan Kasmiah Ali.\r\n	Yayasan masjid modern kurir langit merupakan salah satu Yayasan yang berada dikabupaten Barru yang selalu konsisten dalam memberikan pelayanan kepada masyarakat di kabupaten Barru bahkan diluar kabupaten Barru bahkan dalam pelayanan tidak di pungkiri dalam memberikan pelayanan kepada masyarakat pasti menemukan kendalah maka Penelitian ini bertujuan untuk mengetahui : Partisipasi Yayasan Masjid Modern Kurir Langit Dalam Upaya Peningkatan Kualitas Pelayanan Kepada Masyarakat Di Kabupaten Barru. Dan untuk mengetahui  faktor-faktor yang mempengaruhi Partisipasi Yayasan Masjid Modern Kurir Langit dalam upaya peningkatan kualitas pelayanan kepada masyarakat di Kabupaten Barru. Metode penelitian yang digunakan adalah metode penelitian kualitatif,sumber data diperoleh dengan cara Survey, Wawancara, Observasi, dan Dokumen. Analisis data menggunakan Reduksi Data, Penyajian data dan Penarikan Kesimpulan. Hasil penelitian ini menunjukkan bahwa Partisipasi Yayasan Masjid Modern Kurir Langit Dalam Upaya Peningkatan Kualitas Pelayanan Kepada Masyarakat Di Kabupaten Barru yaitu sudah merasa puas akan pelayanan yang diberikan oleh Yayasan Masjid Modern Kurir Langit. Dan untuk Faktor- faktor yang mempengaruhi Partisipasi Yayasan Masjid Modern Kurir Langit dalam upaya peningkatan kualitas pelayanan kepada masyarakat di Kabupaten Barru yaitu faktor pendukungnya yaitu program yang diberikan sangat bermanfaat bagi masyarakat baik itu kegiatan sosial, kegiatan keagamaan,kegiatan program kesehatan maupun dalam kegiatan pendidikan dan seluruh kegiatan yang di programkan oleh yayasan masjid modern kurir langit dan adapun faktor penghambatnya masih kurangnya sosialisasi kepada masyarakat juga masih terbatasnya fasilitas yang terdapat di Yayasan Masjid Modern Kurir Langit sehingga belum bisa semaksimal mungkin memberikan pelayanan yang terbaik kepada masyarakat.\r\n','STIA AL-GAZALI BARRU',1,2022,1,962,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(970,'','STIA AL-GAZALI BARRU',1,2017,1,968,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(971,'Nurapisah 20181082. Pelaksanaan Pemeriksaan dan Pengawasan Post Market Produk Makanan Dan Minuman Industri Rumah Tangga Oleh Dinas Kesehatan Kabupaten Barru. Pembimbing: A. Aminah dan Herlina Amrianah \r\n \r\n Penelitian ini bertujuan untuk mengetahui pelaksanaan pemeriksaan dan faktor-faktor penghambat pengawasan post market pada produk makanan dan minuman industri rumah tangga oleh Dinas Kesehatan Kabupaten Barru. Dalam penelitian ini digunakan metode penelitian kualitatif, jenis data yang digunakan terdiri dari data primer dan data sekunder. Teknik pengumpulan data yang diterapkan yaitu observasi, wawancara, dokumentasi, dan triangulasi/gabungan. Teknik analisis data melalui tahap pengumpulan data, reduksi data, penyajian data, dan penarikan kesimpulan/ verifikasi. \r\n \r\nHasil penelitian menunjukkan bahwa pelaksanaan pemeriksaan dan pengawasan post market produk makanan dan minuman industri rumah tangga oleh Dinas Kesehatan Kabupaten Barru sudah cukup baik dari ke-5 indikator penelitian yaitu, inventarisasi sarana industri rumah tangga pangan (IRTP), pengawasan sarana industri rumah tangga pangan (IRTP), sampling dan pengujian pangan industri rumah tangga (PIRT), monitoring dan tindak lanjut pengawasan, KIE (komunikasi, informasi dan edukasi) keamanan pangan. Sedangkan faktor-faktor penghambat dalam pelaksanaan pemeriksaan dan pengawasan post market produk makanan dan minuman industri rumah tangga oleh Dinas Kesehatan Kabupaten Barru yaitu adanya sarana Industri Rumah Tangga Pangan (IRTP) yang memiliki izin edar namun sudah tidak berproduksi, serta adanya beberapa sarana yang pindah lokasi namun tidak mengkonfirmasi alamat barunya ke petugas pengawasan pangan dan belum adanya payung hukum bagi pengawas untuk memberikan sanksi kepada pelaku usaha yang melanggar. \r\n','STIA AL-GAZALI BARRU',1,2022,1,970,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(972,'Herawati. 20191101. Implementasi Kebijakan Pemanfaatan Ruang Terbuka\r\nHijau (RTH) di Kabupaten Barru. Dibimbing oleh Hafid Abd Razak dan Arifin\r\nKuruseng.  \r\nPenelitian ini bertujuan untuk mengetahui Bagaimana Implementasi\r\nKebijakan Pemanfaatan Ruang Terbuka Hijau (RTH) di Kabupaten Barru dan untuk\r\nmengetahui faktor-faktor apakah yang menghambat Implementasi Kebijakan\r\nPemanfaatan Ruang Terbuka Hijau (RTH) di Kabupaten Barru. Implementasi\r\nKebijakan Pemanfaatan Ruang Terbuka Hijau (RTH) di Kabupaten Barru dari 4\r\nindikator, Komunikasi, Sumber Daya, Disposisi dan Struktur Birokrasi sudah berjalan \r\nbaik. Faktor-faktor yang menghambat Implementasi Kebijakan Pemanfaatan Ruang\r\nTerbuka Hijau (RTH) di Kabupaten Barru yaitu kurangnnya kesadaran masyarakat\r\ndalam menjaga sarana dan prasarana dan keterbatasan dana. Adapun tehnik\r\npengumpulan data yaitu Observasi,Wawancara dan Dokumentasi. Teknik Analisis\r\nData meliputi Kondensasi Data, Penyajian Data dan Penarikan Kesimpulan dan\r\nVerifikasi.\r\nKata Kunci : Implementasi, Kebijakan, Ruang Terbuka Hijau (RTH) ','STIA AL-GAZALI BARRU',1,2023,1,972,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(973,'Arini Salsadila. 20181076. Implementasi Kebijakan Tentang Perilaku Hidup Bersih dan Sehat (PHBS) Dalam Tatanan Rumah Tangga di Desa Gura Kecamatan Buntu Batu Kabupaten Enrekang. Dibimbing oleh Drs.H. Surasno Taliki dan Wahyu Azikin. \r\n \r\nPenelitian ini bertujuan untuk mengetahui Implementasi Kebijakan Program Perilaku Hidup \r\nBersih dan Sehat (PHBS) Dalam Tatanan Rumah Tangga di Desa Gura Kecamatan Buntu Batu Kabupaten Enrekang. Selain itu penelitian ini juga bertujuan untuk mengetahui faktor yang berpengaruh dalam Implementasi Kebijakan Program Perilaku Hidup Bersih dan Sehat (PHBS) Dalam Tatanan Rumah Tangga di Desa Gura Kecamatan Buntu Batu Kabupaten Enrekang. Tipe penelitian yang digunakan adalah deskriptif kualitatif. Sumber data diperoleh melalui observasi,wawancara, dan dokumentasi. \r\n \r\nHasil penelitian ini menunjukan bahwa Implementasi Kebijakan Program Perilaku Hidup Bersih dan Sehat (PHBS) Dalam Tatanan Rumah Tangga di Desa Gura Kecamatan Buntu Batu Kabupaten Enrekang sudah berjalan dengan cukup baik. Kesimpulan ini didasarkan atas terpenuhinya teori indikator penelitian menurut Edward yaitu komunikasi, sumber daya, disposisi (sikap) dan struktur birokrasi. Sedangkan menurut Dr. Arifin Tahir, faktor yang berpengaruh dalam Implementasi Kebijakan Program Perilaku Hidup Bersih dan Sehat (PHBS) Dalam Tatanan Rumah Tangga di Desa Gura Kecamatan Buntu Batu Kabupaten Enrekang sudah berpengaruh dari sumber daya pembiyaan, sumber daya aparatur, sumber daya lingkungan dan kejelasan kelompok sasaran. Kesimpulan ini didasarkan pada hasil analisis data sesuai indikator penelitian tersebut sudah sesuai dengan teori yang digunakan. \r\n','STIA AL-GAZALI BARRU',1,2022,1,973,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(974,'Arfadila 20191090, Implementasi Aplikasi Sistem Informasi Pembangunan\r\nDaerah (SIPD) di Kelurahan Tanete Kecamatan Tanete Rilau Kabupaten\r\nBarru. Dibimbing oleh Nurlia dan A. M. Ishak Ismail. \r\n\r\nHasil dari penelitian ini bertujuan untuk mengetahui Implementasi \r\nAplikasi Sistem Informasi Pembangunan Daerah (SIPD) di Kelurahan Tanete\r\nKecamatan Tanete Rilau Kabupaten Barru dan untuk mengetahui faktor-faktor\r\nyang mempengaruhi penggunaan aplikasi Sistem Informasi Pembangunan Daerah\r\n(SIPD). Penelitian ini menggunakan tipe penelitian deskriptif kualitatif dengan\r\nsumber data diperoleh dengan cara observasi, wawancara dan dokumentasi.\r\nAnalisis data dengan cara pengumpulan data, kondensasi data, penyajian data dan\r\npenarikan kesimpulan.  \r\nHasil Penelitian ini menunjukkan Implementasi Aplikasi Sistem Informasi\r\nPembangunan Daerah (SIPD) di Kelurahan Tanete Kecamatan Tanete Rilau\r\nKabupaten Barru terdapat enam indikator yaitu ukuran dan tujuan kebijakan,\r\nsumber daya, karakteristik agen pelaksana, sikap atau kecenderungan para\r\npelaksana, komunikasi antar organisasi dan aktivitas pelaksana, lingkungan\r\nekonomi sosial dan politik sudah baik, akan tetapi masih terdapat satu indikator\r\nyang perlu dikembangkan kembali demi kelancaran implementasi aplikasi SIPD\r\nyaitu indikator sumber daya. Adapun faktor-faktor yang mempengaruhi\r\npenggunaan aplikasi sistem informasi pembangunan daerah (SIPD) yaitu faktor\r\nyang terletak pada rumusan kebijakan, faktor yang terletak pada personil\r\npelaksana dan faktor yang terletak pada sistem organisasi pelaksana. \r\nKata Kunci : Implementasi, Aplikasi, Informasi, Sistem.','STIA AL-GAZALI BARRU',1,2023,3,974,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(975,'','STIA AL-GAZALI BARRU',1,2017,1,975,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(976,'Muh. Imran Nur 20161285,  Dampak bantuan Dinas Perikanan terhadap kesejahteraan kelompok budidaya tambak di Tanjung Butung Desa Lasitae Kecamatan Tanete Rilau Kabupaten Barru, Pembimbing : Hj. A. \r\nTenriningsih dan Kasmiah Ali,   \r\n \r\nTujuan penelitian untuk mengetahui dampak bantuan Dinas Perikanan terhadap kesejahteraan kelompok budidaya tambak, serta faktor-faktor yang mempengaruhi pembudidayaan tambak tersebut di Tanjung Butung Desa Lasitae Kecamatan Tanete Rilau Kabupaten Barru. dengan menggunakan tipe penelitian deskriptif kualitatif, jenis data yang digunakan terdiri dari data  primer dan sekunder disertai teknik pengumpulan data yang di terapkan yaitu observasi, wawancara, dokumentasi. Sedangkan teknik analisis data melalui tahap pengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan \r\nHasil penelitian menunjukkan bantuan langsung Dinas Perikanan terhadap kesejahteraan kelompok budidaya tambak di Tanjung Butung Desa Lasitae berdampak cukup baik, namun belum optimal, sedangkan bantuan tidak langsung adalah cukup bermanfaat, terutama penyuluhan, pembinaan, perbaikan sarana dan prasarana produksi petani tambak. Faktor pendukung pengelolaan tambak adalah pembinaan pemerintah desa dan penyuluh perikanan madya, sedangkan faktor penghambat karena memberatkan kelompok budidaya tambak membayar biaya administrasi dan bantuan itu tidak merata. \r\n \r\n','STIA AL-GAZALI BARRU',1,2021,1,976,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(977,'','STIA AL-GAZALI BARRU',1,2017,1,977,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(978,'Vebyansyah. 20161349. Implementasi Kebijakan Pemerintah Dalam\r\nMeningkatkan Pendapatan Petani Padi di Kelurahan Lompo Riaja Kecamatan\r\nTanete Riaja Kabupaten Barru. Dibimbing oleh  A. Pananrangi M dan Wahyu\r\nAzikin\r\n   Penelitian ini bertujuan untuk mengetahui . implementasi kebijakan\r\npemerintah dalam meningkatkan pendapatan petani padi di Kelurahan Lompo\r\nRiaja Kecamatan Tanete Riaja Kabupaten Barru..Selain itu juga bertujuan untuk\r\nmengetahui faktor-faktor yang mempengaruhi implementasi kebijakan pemerintah\r\ndalam meningkatkan pendapatan petani padi di Kelurahan Lompo Riaja\r\nKecamatan Tanete Riaja Kabupaten Barru. Tipe penelitian yang digunakan adalah\r\ndeskriftif kualitatif. Sumber data diperoleh dengan cara  wawancara dan\r\ndokumentasi. Kemudian teknik analisis data adalah teknik Miles dan Heberman.\r\n    Hasil penelitian ini menunjukkan bahwa Implentasi kebijakan pemerintah\r\ndalam meningkatkan pendapatan petani padi di Kelurahan Lompo Riaja\r\nKecamatan Tanete Riaja Kabupaten Barru sudah dijalankan tetapi belum berjalan\r\nsecara maksimal. Untuk itu  masih diperlukan upaya perbaikan yang diarahkan\r\nuntuk peningkatan pendapatan petani padi..Sedangkan faktor-faktor yang\r\nmempengaruhi Implentasi kebijakan pemerintah dalam meningkatkan pendapatan\r\npetani padi di Kelurahan Lompo Riaja Kecamatan Tanete Riaja Kabupaten Barru\r\nadalah sumber daya pembiayaan,  sumber daya aparatur, sumber daya lingkungan\r\ndan kejelasan kelompok sasaran.\r\nKata kunci:  Implementasi Kebijakan, Peningkatan Pendapatan Petani Padi','STIA AL-GAZALI BARRU',1,2022,2,978,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(979,'MARLIANI,20171213, TINGKAT KEPUASAN MASYARAKAT TERHADAP PELAYANAN MASYARAKAT MISKIN MELALUI BASIS DATA TERPADU (BDT) DI DESA \r\nTAMARUPA KECAMATAN MANDALLE KABUPATEN PANGKEP  Pembimbing : Nurlia \r\ndan Marsuki. \r\n \r\nPenelitian ini bertujuan mengetahui tingkat kepuasan masyarakat dalam pelayanan melalui Basic data Terpadu di desa Tamarupa, sumber data melalui observasi, wawancara dan dokumentasi. \r\n  \r\nHasil penelitian ini menunjukkan bahwakepuasan masyarakat cukup tinggi terhadap pelayanan melalui BDT, terutama tentang pelayanan masyarakat melalui pendataan, respon terhadap pelayanan Tim, dan tingkat kepuasan melalui pelayanan Tim Pendataan.  \r\n \r\nFaktor yang mendukung terutama, tersedianya data awal warga miskin, kepemimpinan kepala desa cukup baik sebagai penasehat Tim. Sedangkan faktor penghambat terutama wilayah desa cukup luas, sarana prasarana masih sederhana, warga kurang mampu memberikan data valid, dan masih rendahnya dana operasional. \r\n \r\n','STIA AL-GAZALI BARRU',1,2021,1,984,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(980,'Dian. 20171021. Analisis Pelaksanaan Daerah Dalam Pengembangan Objek Wisata Hutan Pinus Sorombipi Di Desa Lalingato Kecamatan Lambandia Kabupaten Kolaka Timur. Pembimbing : M. Rasyidi Amran dan Masyitah. \r\n \r\n        Penelitian ini bertujuan untuk mengetahui bagaimana pelaksanaan daerah dalam pengembangan objek wisata hutan pinus Sorombipi di Desa Lalingato Kecamatan Tirawuta Kabupaten Kolaka Timur dan faktor-faktor apa yang mendukung dan menghambat pelaksanaan pengembangan objek wisata hutan pinus Sorombipi di Desa Lalingato Kecamatan Tirawuta Kabupaten Kolaka Timur. Penelitian ini menggunakan tipe penelitian kualitatif. Jenis yang digunakan adalah kualitatif. Sumber data primer dan sekunder dengan teknik pengumpulan data berupa observasi, wawancara dan dokumentasi. Analisis data melalui redukasi data, penyajian data dan pengambilan kesimpulan. \r\n \r\n        Hasil penelitian ini yang ditandai dengan indikator atraksi wisata, promosi dan pemasaran, pasar wisata dan masyarakat bahwa pelaksanaan pengembangan objek wisata Sorombipi tidak lagi berjalan. Faktor-faktor yang mendukung dan menghambat pelaksanaan pengembangan objek wisata Sorombipi yaitu: yang mendukung, dapat menikmati pemandangan yang indah serta fasilitas yang memadai sedangkan yang menghambat, tidak adanya dana untuk perbaikan dan perawatan. \r\n','STIA AL-GAZALI BARRU',1,2022,1,993,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(981,'Herwin. 20181097. Kinerja Aparatur Desa Dalam Meminimalisir Kemiskinan Melalui Program Kerja Ketahanan Pangan Dan Hewani Di Desa Tompo Kecamatan Barru Kabupaten Barru. Dibimbing oleh Mukmin Muhammad dan Anshar A. Abidin.\r\nPenelitian ini bertujuan untuk mengetahui Kinerja Aparatur Desa dalam meminimalisir kemiskinan melalui program kerja ketahanan pangan dan hewani di Desa Tompo Kecamatan Barru Kabupaten Barru. dan untuk mengetahui faktorfaktor yang mempengaruhi kinerja Aparatur Desa dalam meminimalisir kemiskinan melalui program kerja ketahanan pangan dan hewani di Desa Tompo. sumber data diperoleh dengan cara survei, Wawancara, Observasi, dan Dokumentasi.\r\nHasil penelitian ini menunjukkan bahwa Kinerja Aparatur Desa dalam meminimalisir kemiskinan di Desa Tompo sudah baik, penelitian ini didasarkan pada empat indikator yaitu, sarana dan prasarana, metode, kemampuan sumber daya manusia dan semangat kerja. Dan adapun faktor yang menghambat kinerja Aparatur Desa dalam meminimalisir kemiskinan di Desa Tompo yaitu terbatasnya anggaran, kemampuan masyarakat dalam mengelola ternak sapi dan kesulitan dalam mendapatkan indukan sapi.\r\n','STIA AL-GAZALI BARRU',1,2022,1,985,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(982,'Lika Hanifah Gunawan. 20171149. Tingkat Kepuasan Nasabah Tabungan Simpanan Pelajar (Simpel) Pada PT Bank Sulselbar Cabang Barru Di Kabupaten Barru, Pembimbing H. Kamaruddin Hasan, dan Muliati. \r\n  \r\nPenelitian ini bertujuan untuk mengetahui faktor-faktor yang mempengaruhi serta untuk mengetahui tingkat kepuasan tingkat kepuasan nasabah tabungan Simpanan Pelajar (SIMPEL) pada PT. Bank SulselBar cabang Kabupaten Barru. Tipe penelitian yang digunakan adalah tipe penelitian kuantitatif dengan teknik pengumpulan data yang digunakan adalah observasi, angket, dan dokumentasi. Teknis analisis datanya yaitu analisis statistik deskriptif dan analisis statistik inferensial. \r\n \r\nHasil penelitian menunjukkan faktor-faktor kualitas produk, kualitas pelayanan emosi, harga dan biaya berpengaruh signifikan terhadap kepuasan nasabah tabungan Simpanan Pelajar (SIMPEL) pada PT. Bank SulselBar cabang Kabupaten Barru. Adapun Tingkat kepuasan nasabah tabungan Simpanan Pelajar (SIMPEL) pada PT. Bank SulselBar berada pada persentase 90% yang berarti nasabah sangat puas terhadap produk tabungan Simpanan Pelajar (SIMPEL) yang ditawarkan. ','STIA AL-GAZALI BARRU',1,2021,1,986,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(983,'Awal Nur Arfan Liansyah, 20171130. Pengelolaan Sampah Oleh Pemerintah Desa Di Tempat Pengelolaan Sampah 3R Reduce, Reuse, Recycle Kelompok Swadaya Masyarakat Mapaccing \r\nDesa Pancana Kecamatan Tanete Rilau Kabupaten Barru, \r\nPembimbing : H. Abd. Mannang, dan Herlina Amrianah \r\n \r\n        Tujuan penelitian ini untuk mengetahui sistem pengelolaan sampah oleh pemerintah desa di tempat pengelolaan sampah 3R reduce, reuse, recycle kelompok swadaya masyarakat mapaccing desa pancana. Dan untuk mengetahui faktor-faktor yang menghambat pengelolaan sampah oleh pemerintah desa di tempat pengelolaan sampah 3R reduce, reuse, recycle kelompok swadaya masyarakat mapaccing desa pancana. Metode penelitian yang digunakan dalam penelitian ini bersifat deksriptif. Teknik pengumpulan data diperoleh dengan cara observasi, wawancara, dan dokumentasi. Adapun teknik analisis data yang digunakan yaitu pengumpulan data, reduksi data, penyajian data, dan penarikan kesimpulan. \r\n \r\n        Hasil penelitian ini menunjukkan bahwa pengelolaan sampah oleh pemerintah desa di tempat pengelolaan sampah 3R reduce, reuse, recycle kelompok swadaya masyarakat mapaccing desa pancana dengan menggunakan indikator yaitu : prinsip reduce (Mengurangi), prinsip reuse (Menggunakan kembali), dan prinsip recycle (Mendaur ulang) masih belum optimal serta faktorfaktor yang meliputi seperti, Kurangnya (SDM) sumber daya manusia/pengelola, Kurangnya penjagaan dilokasi tempat pengelolaan Sampah 3R, Kurangnya kesadaran membayar iuran/retribusi. belum berjalan dengan efektif seperti yang diharapkan. \r\n \r\n','STIA AL-GAZALI BARRU',1,2022,1,988,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(984,'Rahmat. 20161009 Analisis persepsi masyarakat terhadap kualitas pelayanan\r\nDi Unit Pelaksana Teknik Dinas (UPTD)Pusat Kesehatan Masyarakat\r\n(Puskesmas) Ralla Kab.Barru Pembimbing Hafid abdul razak dan Musdalifah.\r\n    Penelitian ini bertujuan untuk mengetahui : Kualitas Pelayanan UPTD\r\nKesehatan Puskesmas Ralla Kab. Barru . Jenis Data penelitian yang digunakan\r\nadalah tipe penelitian kualitatif, Lokasi dan waktu penelitian ,jenis dan sumber\r\ndata, data primer dan sekunder  tekhnik pengumpulan data diperoleh dengan cara\r\nSurvey, Wawancara, Observasi, dan Dokumentasi. Analisis data melalui tahap\r\nReduksi Data, Penyajian data dan Penarikan Kesimpulan. /verifikasi. \r\n      Hasil penelitian ini menunjukkan bahwa Kualitas Pelayanan UPTD Kesehatan\r\nPuskesmas Ralla Kab. Barru sudah berjalan dengan baik .berdasarkan hasil survey\r\nkepuasan pasien tersebut dapat di katakana bahwa setiap unsur pelayanan mulai\r\ndari loket kartu ,pemeriksaan dokter , apotek pengambilan obat,sedang berjalan\r\nsesuai dengan harapan masyarakat.\r\nKata Kunci : Analisis ,persepsi ,kualitas,dan pelayanan','STIA AL-GAZALI BARRU',1,2022,2,987,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(985,'Ashabul Kahfi, 20171173. Kontribusi TV Peduli dalam Memberikan Edukasi \r\nKepada Masyarakat di Kelurahan Lemoe Kecamatan Bacukiki Kota \r\nParepare. Pembimbing : H.A. Russeng dan H. Arifin K. \r\nPenelitian ini bertujuan untuk mengetahui bagaimana kontribusi TV Peduli dalam memberikan edukasi kepada masyarakat di Kelurahan Lemoe Kecamatan Bacukiki Kota Parepare, dan untuk mengetahui faktor-faktor yang menghambat \r\nTV Peduli dalam berkontribusi memberikan edukasi kepada masyarakat di Kelurahan Lemoe Kecamatan Bacukiki Kota Parepare. Dalam penelitian ini digunakan tipe penelitian kualitatif, jenis data terdiri dari data primer dan data sekunder. Teknik pengumpulan data dengan cara observasi, wawancara, dokumentasi, serta teknik analisis data melalui tahap reduksi data, penyajian data, dan penarikan kesimpulan/verifikasi.   \r\nHasil penelitian menunjukkan bahwa kontribusi TV Peduli dalam memberikan edukasi kepada masyarakat di Kelurahan Lemoe Kecamatan Bacukiki Kota Parepare sudah baik yaitu dengan memberikan kontribusikontribusi yang bersifat materi, tindakan, pemikiran, dan profesionalisme. Sedangkan faktor yang menghambat adalah Tuntutan perkembangan teknologi, materi program edukasi, kesadaran dan minat masyarakat terhadap siaran program edukasi,  akses, kondisi fisik, dan dukungan dari orangtua. \r\n','STIA AL-GAZALI BARRU',1,2022,1,979,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
