	(990,'Ana Selvia. 20151135. Sistem Penggunaan Anggaran dalam Pelaksanaan Program Kerja Pada Bidang Pengairan Dinas Pekerjaan Umum Kabupaten Barru. Pembimbing H. Andi Russeng dan Adam Malik.\r\n\r\nPenelitian ini bertujuan untuk mengetahui sistem penggunaan anggaran dan Faktor-faktor yang menghambat sistem penggunaan anggaran dalam pelaksanaan program kerja Pada Bidang Pengairan Dinas Pekerjaan Umum Kabupaten Barru. Penelitian ini merupakan penelitian deskriftif kualitatif dengan menggunakan teknik pengumpulan data melalui observasi, wawancara dan dokumentasi. Kemudian data yang diperoleh tersebut dianalisis dengan melalui tahapan berikut yaitu tahap reduksi data, tahap penyajian data dan penataan kesimpulan (verification).\r\n\r\nBerdasarkan data yang diperoleh penulis dalam penelitian dari proses analisis data diatas, bahwa sistem penggunaan anggaran pada Bidang Pengairan Dinas Pekerjaan Umum Kabupaten Barru dalam pelaksanaan program kerja Tahun anggaran 2018 dan Tahun 2019 sudah dibilang efektif sebagai wujud pertanggungjawaban dalam mencapai visi dan misi adapun Faktor-faktor yang menghambat sistem penggunaan anggaran yaitu kebijakan dan aturan yang kadang berubah, waktu bagi pegawai memahami perubahan mekanisme, kurangnya data informasi dan adanya campur tangan kepentingan politik.\r\n\r\nKata kunci: Sistem, Anggaran, Program dan Kerja','STIA AL-GAZALI BARRU',1,2020,1,983,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(991,'Yuni Avidah Syam, 20171143, Kebijakan Pemerintah Daerah dalam Penataan Zona dan Pemanfaatan Ruang Terbuka Hijau di Alun-alun Colliq Pujie Kabupaten Barru. Pembimbing : H. Kamaruddin Hasan dan Nurlia. \r\n \r\n  Tujuan penelitian ini mengetahui kebijakan pemerintah daerah dalam penataan zona dan pemanfaatan ruang terbuka hijau di Alun-Alun Colliq Pujie Kabupaten Barru. Dan untuk mengetahui faktor-faktor dalam kebijakan pemerintah daerah dalam penataan zona dan pemanfaatan ruang terbuka hijau di Alun-Alun Colliq Pujie Kabupaten Barru. Metode penelitian yang digunakan dalam penelitian ini adalah pendekatan kualitatif dimana penelitian yang dilakukan bersifat deskriptif. Teknik pengumpulan data diperoleh dengan cara Observasi, Wawancara, dokumentasi. Adapun teknik analisis data yang digunakan yaitu pengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan. \r\n \r\n  Hasil penelitian menunjukan bahwa kebijakan pemerintah daerah dalam penataan zona dan pemanfaatan ruang terbuka hijau dengan indikator meliputi komunikasi, sumber daya, disposisi, struktur birokrasi  belum berjalan optimal, serta faktor-faktor yang mempengaruhi penataan zona dan pemanfaatan ruang terbuka hijau yaitu kesadaran masyaraka dalam pemanfaatan ruang terbuka hijau, sampah masih tidak terkontrol, pedagang kaki lima yang sering melanggar, belum ada sesolisasi khusus untuk pentingya ruang terbuka hijau. Sehinggah kegiatan dalam penataan zona dan pemanfaatan ruang tebuka hijau belum berjalan dengan efektif seperti yang diharapkan. \r\n','STIA AL-GAZALI BARRU',1,2022,1,990,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(992,'','STIA AL-GAZALI BARRU',1,2016,1,980,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(993,'Mustaqimah. 20181078. Penerapan Aplikasi Sistem Informasi Pengawan Nikah (SIP\r\nNikah) di Kantor Urusan Agama Kecamatan Buntu Batu Kabupaten Enrekang.\r\nDibimbing oleh A. Pananrangi M dan Hj. Aidah. \r\n \r\nPenelitian ini bertujuan untuk mengetahui Penerapan Aplikasi Sistem Informasi Pengawasan\r\nNikah (SIP Nikah) di Kantor Urusan Agama Kecamatan Buntu Batu Kabupaten Enrekang.\r\nSelain itu penelitian ini juga bertujuan untuk mengetahui pemanfaatan Aplikasi Sistem\r\nInformasi Pengawasan Nikah (SIP Nikah) di Kantor Urusan Agama Kecamatan Buntu Batu\r\nKabupaten Enrekang. Tipe penelitian yang digunakan adalah deskriptif kualitatif. Sumber\r\ndata diperoleh melalui observasi, wawancara, dan dokumentasi. \r\n \r\nHasil penelitian ini menunjukkan bahwa penerapan aplikasi Sistem Informasi Pengawasan\r\nNikah (SIP Nikah) di Kantor Urusan Agama Kecamatan Buntu Batu sudah berjalan dengan\r\ncukup. Kesimpulan ini didasarkan atas terpenuhinya indikator yaitu komuniikasi, sumber\r\ndaya, disposisi (sikap) dan struktur birokrasi. Sedangkan pemanfaatan aplikasi Sistem\r\nInformasi Pengawasan Nikah (SIP) Nikah di Kantor Urusan Agama Kecamatan Buntu Batu\r\nKabupaten Enrekang sudah digunakan oleh penghulu untuk mempermudah proses\r\npengadministrasian pernikahan, memastikan kehadiran penghulu, dan memastikan tempat\r\ndilaksanakannya pernikahan.\r\n\r\nKesimpulan ini didasarkan pada hasil analisis data sesuai indikator penelitian dimana semua\r\nindikator penelitian tersebut sudah terpenuhi atau sesuai dengan teori yang digunakan.\r\n\r\nKata Kunci: Penerapan, Sistem Informasi, Pengawasan Pernikahan.','STIA AL-GAZALI BARRU',1,2022,2,982,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(994,'Fm Kabupaten Barru. Pembimbing: Hafid Abdul Razak dan Asriani. Penelitian ini bertujuan untuk mengetahui Analisis Pola Penyampaian Pesan \r\nKebijakan Publik  Kepada Masyarakat Melalui Radio Inovasi Gemilang Anak \r\nBangsa (Iga) 87,6 Fm Kabupaten Barru. Dengan Menggunakan tipe penelitian  Deskriftif Kualitatif jenis data  yang digunakan terdiri dari data primer dan data sekunder disertai termasuk pengumpulan data yang diterapkan yaitu observasi, wawancara dan dokumentasi , sedangkan teknik analisis data melalui tahap pengumpulan data , reduksi data, penyajian data dan penarikan kesimpulan atau verifikasi. \r\nPola penyampaian pesan kebijakan publik dikemas dalam 4 (Empat) format siaran yaitu format pesan kebijakan dialog interaktif, format pesan kebijakan musik islam, format kebijakan dalam bentuk motivasi dan format Komunikasi dengan menggunakan 4 format ini menunjukkan bahwa jika pesan kebijakan publik dilakukan melalui siaran radio  maka pesan kebijakan publik akan mampu mengjangkau komunikasi yang cukup jauh dan tersebar. Faktor yang menghambat dalam penyampaian pesan kebijakan publik yaitu terkendala jaringan, ada perangkat atau alat yang sering rusak dan lampu padam. \r\n','STIA AL-GAZALI BARRU',1,2021,1,994,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(995,'Mukmin.20161091.Analisis Tingkat Kepuasan Masyarakat Terhadap\r\nPelayanan Pemberian Bantuan Sosial di Desa Cilellang Kecamatan\r\nMallusetasi Kabupaten Barru. Pembimbing  H. Kamaruddin Hasan  dan Wahyu\r\nAzikin.  \r\n Penelitian ini bertujuan untuk mengetahui Tingkat kepuasan masyarakat\r\nterhadap pelayanan pemberian bantuan sosial di Desa Cilellang Kecamatan\r\nMallusetasi Kabupaten Barru Dan faktor-faktor yang mempengaruhi tingkat\r\nkepuasan dan ketidakpuasan masyarakat terhadap pelayanan pemberian bantuan\r\nsosial di Desa Cilellang Kecamatan Mallusetasi Kabupaten Barru. Dengan\r\nmenggunakan metode kuantitatif dan sumber data primer dan sekunder yang\r\ndiperoleh dengan teknik Observasi, Wawancara, Dokumentasi, dan Kuesioner.\r\nAnalisis data menggunakan SPSS 17.0.  \r\n Hasil penelitian menunjukkan bahwa Tingkat kepuasan masyarakat terhadap\r\npelayanan pemberian bantuan sosial di Desa Cilellang Kecamatan Mallusetasi\r\nKabupaten Barru dapat dilihat pada 5 indikator kepuasan masyarakat yaitu bukti\r\nlangsung mencapai skor 83% atau berada pada kategori tinggi, kehandalan mencapai\r\nskor 66% atau berada pada kategori sedang, daya tanggap mencapai skor 77% atau\r\nberada pada kategori sedang, jaminan mencapai skor 20% atau berada pada kategori\r\nsangat rendah dan empati mencapai skor 72% atau berada pada kategori sedang.\r\nSedangkan kepuasan masyarakat terhadap pelayanan pemberian bantuan sosial di\r\nDesa Cilellang mencapai skor 64% atau tergolong pada kategori sedang. Dan faktorfaktor\r\nyang\r\nmempengaruhi\r\ntingkat\r\nkepuasan\r\ndan\r\nketidakpuasan\r\nmasyarakat\r\nterhadap\r\n\r\npelayanan\r\n\r\npemberian bantuan sosial di Desa Cilellang yaitu: perencanan mencapai\r\nskor 80% atau berada pada kategori tinggi, koordinasi mencapai skor 80% atau\r\nberada pada kategori tinggi, pengawasan mencapai skor 68% atau berada pada\r\nkategori sedang dan kepemimpinan mencapai skor 65% atau berada pada kategori\r\nsedang. Sedangkan faktor-faktor yang mempengaruhi tingkat kepuasan dan\r\nketidakpuasan masyarakat mencapai skor 73,95% atau berada pada kategori sedang.  \r\nKata kunci : Analisis, Kepuasan Masyarakat, Pelayanan Pemberian Bantuan Sosial','STIA AL-GAZALI BARRU',1,2022,1,995,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(996,'P','STIA AL-GAZALI BARRU',1,2023,1,998,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(997,'Eka Sariana 20191071. Implementasi Penggunaan Aplikasi Pengaduan\r\nMasyarakat (ALPUKAT) di KORAMIL 1405-06/Barru. Dibimbing oleh\r\nMukmin Muhammad dan Alwi A. Buraerah.\r\n      Penelitian ini bertujuan untuk mengetahui Implementasi Penggunaan Aplikasi\r\nPengaduan Masyarakat (ALPUKAT) di KORAMIL 1405- 06/Barru, faktor–faktor\r\nyang mempengaruhi Implementasi Penggunaan Aplikasi Pengaduan Masyarakat\r\n(ALPUKAT) di KORAMIL 1405-06/Barru. Jenis penelitian ini adalah kualitatif\r\ndeskriptif, subjek penelitian yang diperoleh dengan cara: observasi, wawancara,\r\ndan dokumentasi. Pemeriksaan keabsahan datanya adalah uji kredibilitas, uji\r\nketeralihan, uji kebergantungan, dan uji kepastian. Teknik analisis datanya yaitu\r\npengumpulan data, reduksi data, penyajian data, dan penarikan kesimpulan atau\r\nverifikasi. \r\n      Hasil penelitian ini menunjukkan bahwa implementasi penggunaan aplikasi\r\npengaduan masyarakat (ALPUKAT) di KORAMIL 1405-06/Barru melalui \r\nindikator sudah terimplementasikan dengan baik, namun masih ada beberapa\r\nindikator yang belum optimal seperti sumber daya yang masih perlu ditinjau\r\nkembali demi kelancaran pengimpelemtasian penggunaan aplikasi ini, sedangkan\r\nfaktor-faktor yang mempengaruhi penggunaan aplikasi pengaduan masyarakat\r\n(ALPUKAT) di KORAMIL 1405-06/Barru yaitu faktor yang terletak pada\r\nrumusan kebijakan, faktor yang terletak pada personil pelaksana, dan faktor yang\r\nterletak pada sistem organisasi pelaksana. \r\n \r\nKata Kunci : Implementasi, Aplikasi Pengaduan Masyarakat (ALPUKAT)','STIA AL-GAZALI BARRU',1,2023,2,996,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(998,'IRMAWATI R 201910119. Implementasi Kebijakan Pemerintah Desa Dalam\r\nPemeliharaan Dan Penertiban Ternak Di Desa Bulo-Bulo Kecamatan\r\nPujananting  Kabupaten Barru. Dibimbing oleh Dian Pratiwi dan  Masyitah.\r\n \r\nPenelitian ini bertujuan untuk mengetahui:  Implementasi Kebijakan Pemerintah\r\nDesa dalam Pemeliharaan dan Penertiban Ternak di Desa Bulo-Bulo Kecamatan\r\nPujananting Kabupaten Barru dan Untuk mengetahui faktor-faktor yang\r\nmenghambat Implementasi Kebijakan Pemerintah Desa dalam Pemeliharaan dan\r\nPenertiban Ternak di Desa Bulo-bulo Kecamatan Pujananting Kabupaten Barru.\r\nMetode Penelitian yang digunakan adalah Metode Penelitian Kualitatif, Sumber\r\ndata diperoleh dengan cara Observasi, Wawancara, dan Dokumentasi. Teknik\r\nAnalisis data menggunakan pengumpulan data, Reduksi data, Penyajian data, dan\r\nPenarikan kesimpulan. Hasil penelitian menunjukan Implementasi Kebijakan\r\nPemerintah desa dalam Pemeliharaan dan penertiban Ternak di Desa Bulo-bulo\r\nKecamatan Pujananting Kabupaten Barru pada analisis data dengan baik melalui\r\nindikator penelitian kebijakan tersebut, telah terimplementasi namun masih\r\nterdapat beberapa indikator yang perlu diperhatikan terutama pada sumber daya\r\ndemi kelancaran Kebijakan Pemerintah desa dalam pemeliharaan dan penertiban\r\nternak di Desa Bulo-Bulo Kecamatan Pujananting Kabupaten Barru. Faktor-faktor\r\nyang menghambat dalam proses kebijakan ada 3 indikator perumusan kebijakan,\r\npersonil pelaksanan, Sistem Organisasi. Dalam hal yaitu faktor dari segi rumusan\r\nkebijakan tentang berbedanya pendapat penyelenggara mengenai sanksi\r\nkebijakan. Faktor dari segi personil sebagai yang terlibat dalam kebijakan,\r\nbanyaknya masyarakat yang tak mampu melaksanakan kebijakan atau hanya\r\nmembiarkan ternaknya berkeluyuran di hutan. Faktor sistem organisasi yaitu\r\nluasnya wilayah Desa Bulo-Bulo sehingga banyak ruang bagi masyarakat untuk\r\ntidak membuat kandang. Sedangkan kendala masyarakat yaitu kurangnya pakan\r\nuntuk ternak sehingga melepas ternak kehutan untuk bertahan hidup, dan\r\nmasyrakat mengelola perkebunan sehingga tidak sempat untuk memberi pakan\r\nternaknya. \r\n \r\n \r\n \r\nKata Kunci : Implementasi, Kebijakan, Pemeliharaan dan Penertiban \r\nTernak','STIA AL-GAZALI BARRU',1,2023,2,997,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(999,'Nurhalisah. 20171101. Transparansi Dan Akuntabilitas Pengelolaan Dana Desa\r\nDi Desa Pujananting Kecamatan Pujananting Kabupaten Barru :  Dr. Mukminin\r\nMuhammad  dan A Marsuki. \r\nPenelitian ini bertujuan untuk mengetahui : Transparansi dan Akuntabilitas\r\npengelolaan dana desa di Desa Pujananting Kecamatan Pujananting Kabupaten\r\nBarru. Sumber data dalam penelitian ini diperoleh dengan cara observasi,\r\nwawancara, dan dokumentasi. Metode penelitian dengan menggunakan deskripsi\r\nkualitatif. Berdasarkan hasil penelitian yang telah dilakukan menunjukan\r\nTransparansi pengelolaan dana desa di Desa Pujananting Kecamatan Pujananting\r\nKabupaten Barru sudah sesuai dengan peraturan yang ada, yakni adanya pelaporan\r\nsetiap awal tahun untuk mengapresiasi ide atau keluhan warga, selalu\r\nmenginformasikan secara tertulis jumlah dana yang didapat dari pemerintah, serta\r\ndanya papan-papan informasi mengenai kegiatan pembangunan yang sedang di\r\nkerjakan. Oleh sebab itu Desa Pujananting dapat dikatakan Transparan dalam\r\npengelolaan alokasi dana. Akuntabilitas pengelolaan dana desa di Desa Pujananting\r\nKecamatan Pujananting Kabupaten Barru yang terdiri dari penatausahaan, pelaporan\r\ndan pertanggungjawaban dapat di katakana telah berjalan sesuai dengan aturan dan\r\nUU No 06 Tahun 2014 tentang Desa. \r\nKata Kunci : Transparansi, Akuntabilas, Dana Desa','STIA AL-GAZALI BARRU',1,2022,2,999,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1000,'Irfin, 20161109, Analisis Kebijakan Pemerintah terhadap Pengembangan Masyarakat Pesisir (Budidaya Rumput Laut) di Kelurahan Tanete Kecamatan Tanete Rilau Kabupaten Barru, Pembimbing : Chaliddin dan Herlina Amriana. \r\nPenelitian ini bertujuan untuk mengetahui : kebijakan pemerintah Kab. Barru terhadap pengembangan masyarakat pesisir khususnya budidaya rumput laut di Kelurahan Tanete Kecamatan Tanete Rilau Kabupaten Barru serta Untuk mengetahui faktor-faktor yang menjadi penghambat kebijakan Pemerintah terhadap pengembangan masyarakat pesisir khususnya budidaya rumput laut di Kelurahan Tanete Kecamatan Tanete Rilau Kabupaten Barru. Menggunakan metode penelitian Kualitatif yang tekhnk pengumpulan datanya melalui Observasi , Wawancara, dan Dokumentasi. Tekhnik analisis data menggunakan Reduction (Reduksi Data), Display Data, Conclusion Drawing/Verification. \r\nKebijakan pemerintah Kabupaten Barru dalam pengembangan masyarakat pesisir khususnya Budi daya rumput laut di kelurahan tanene terlaksana dengan baik . keberhasilan tersebut karena pemerintah di sukung oleh kebijakan yang pro-rakyat sehingga menjadi pendukung dalam pengembangan masyarakat pesisir . Faktor penghambat pemerintah dalam pengembangan masyarakat pesisir khusunya budidaya rumput laut yaitu faktor iklim dan faktor kelembangan yang kami maksud disini yaitu kendala kewenangan pengelolaan wilayah pesisir berdasarkan Permendagri tahun 2014 UU No. 23 yang dimana kewenangan pesisir menjadi hak dinas provinsi. \r\n','STIA AL-GAZALI BARRU',1,2022,1,1001,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1001,'ABTRAK \r\nRasmawati, NIM: 20171011, Pengaruh jumlah penduduk terhadap angka kemiskinan di Desa Bulo-Bulo Kecamatan Pujananting Kabupaten Barru. Pembimbing H. A. Russeng dan H. Ismail Hannanong \r\n Penelitian ini bertujuan untuk mengetahui Pengaruh Jumlah Penduduk terhadap Angka Kemiskinan dan seberapa besar Pengaruh Jumlah Penduduk terhadap Angka Kemiskinan di Desa Bulo-Bulo Kecamatan Pujananting Kabupaten Barru. Penelitian ini mengunakan tipe penelitian kuantitatif, sumber teknik data adalah primer dan sekunder, teknik pengumpulan data dengan cara memberikan kuesioner dan observasi serta analisis data dengan mengunakan istrumen penelitian dari sampel penelitian. Adapun responden berjumlah 22 orang, untuk pengelolahan data mengunakan program SPSS versi 20 for windows.  \r\nHasil penelitian ini menunjukkan bahwa ada pengaruh terhadap angka kemiskinan di Desa Bulo-Bulo Kecamatan Pujananting Kabupaten Barru, dimana berdasarkan uji hipotesis dengan nilai F hitung adalah sebesar 32,634 dengan tingkat signifikan sebesar 0,000 < 0,05. Sedangkan besar pengaruh jumlah penduduk sebesar 62,0% dalam kategori kuat. Berdasarkan uji koefisien determinan model summary dengan nilai (R square) sebesar 0,620 atau 62,0%.  \r\n','STIA AL-GAZALI BARRU',1,2022,1,1000,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1002,'ABSTRAK \r\nFiki Amalia. 20181187. Analisis Kepuasan Masyarakat Dalam Memanfaatkan Aplikasi Digital Desa (DIGIDES) Pada Hp Android Untuk Mendapatkan Pelayanan Administrasi Berbasis Online Di Desa Pao-Pao Kecamatan Tanete Rilau Kabupaten Barru. Pembimbing : Chaliddin dan M. Alwi. A. Buraerah. \r\nPenelitian ini bertujuan untuk mengetahui kepuasan masyarakat dan faktor penghambat masyarakat dalam memanfaatkan Aplikasi Digital Desa (DIGIDES) pada Hp Android untuk mendapatkan pelayanan administrasi berbasis Online di desa Pao-Pao Kecamatan Tanete Rilau Kabupaten Barru dengan menggunakan tipe penelitian kualitatif jenis data yang digunakan terdiri dari data primer dan sekunder, disertai teknik pengumpulan data yaitu, observasi, wawancara dan dokumentasi. Sedangkan teknik analisis yang digunakan yaitu, melalui tahap pengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan. \r\nHasil penelitian ini menunjukkan bahwa kepuasan masyarakat dalam memanfaatkan aplikasi \r\nDigital Desa (DIGIDES) pada Hp Android untuk mendapatkan pelayanan administrasi berbasis Online di Desa Pao-Pao Kecamatan Tanete Rilau Kabupaten Barru, dalam kategori baik atau puas dengan indikator kemudahan penggunaan aplikasi Digital Desa (DIGIDES) memangkas prosedur dan waktu pelayanan menjadi beberapa menit, dan tidak ada lagi biaya dikeluarkan oleh masyarakat, sehingga pelayanan di kantor Desa Pao-Pao dapat berjalan efektif dan efesien. Sedangkan faktor penghambat masyarakat dalam menggunakan Aplikasi Digital Desa (DIGIDES) pada Hp Android yaitu kurangnya sosialisasi kepada masyarakat terhadap aplikasi Digital Desa (DIGIDES) dan gangguan jaringan yang disebabkan oleh cuaca buruk dan mati lampu, dan kurangnya pemahaman masyarakat tentang pemanfaatan gadget sehingga para orang tua lebih cenderung meminta bantuan anaknya untuk melakukan pelayanan tersebut. \r\n \r\n','STIA AL-GAZALI BARRU',1,2022,1,1004,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1003,'','STIA AL-GAZALI BARRU',1,2016,1,1002,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1004,'Nurmi.20171091. Implementasi kebijakan pemerintah desa terhadap kegiatan forum anak di Desa Ajakkang Kecamatan Soppeng Riaja Kabupaten Barru.  \r\nPembimbing :Nurlia dan Marsuki. \r\n Penelitian ini bertujuan untuk mengetahui : Implementasi Kebijakan Pemerintah Desa Terhadap Kegiatan Forum Anak Di Desa Ajakkang dan untuk mengetahui faktor-faktor yang menghambat kegiatan Forum Anak. Metode penelitian ini digunakan adalah metode penelitian kualitatif, sumber data diperoleh dengan cara pengawasan,wawancara, observasi, dan dokumentasi. Analisis data menggunakan pengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan. Hasil penelitian ini menunjukkan bahwa implementasi kebijakan pemerintah desa terhadap kegiatan Forum Anak, masih kurang efektif dalam pelaksanaan kebijakannya dilihat dari koordinasi dan komunikasi yang masih kurang juga proses pelaksanaan yang begitu lama. Dan untuk faktor yang menghambat kegiatan forum anak di desa ajakkang yaitu, kurangnya sosialisasi dan komunikasi yang baik, tidak diberikan izin mengadakan kegiatan yang menyebabkan kerumunan, dan kurangnya pemahaman juga kesadaran dari Forum Anak dan pemerintah sehingga dapat mempengaruhi kegiatan Forum Anak yang sesuai dengan yang ditentukan. \r\n','STIA AL-GAZALI BARRU',1,2022,1,1003,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1005,'Asrina. 20181032. Implementasi Sistem Informasi Penelusuran Perkara\r\nsebagai Sarana Pelayanan Berbasis E-Service di Pengadilan Agama Barru.\r\nPembimbing: H. M. Rasyidi Amran dan Fitrianti. \r\n \r\nPenelitian ini bertujuan untuk mengetahui implementasi sistem informasi\r\npenelusuran perkara (SIPP) sebagai sarana pelayanan berbasis e-service dan faktor yang\r\nmenjadi kendala implementasi sistem informasi penelusuran perkara (SIPP) sebagai\r\nsarana pelayanan berbasis e-service di Kantor Pengadilan Agama Barru. Penelitian ini\r\nmenggunakan metode penelitian kualitatif, teknik pengumpulan data melalui observasi,\r\nwawancara dan dokumentasi. Teknis analisis data menggunakan pengumpulan data,\r\nreduksi data, penyajian data, dan penarikan kesimpulan. Hasil penelitian ini menunjukkan\r\nbahwa implementasi sistem informasi penelusuran perkara (SIPP) di Pengadilan Agama\r\nBarru dilihat dari 4 (empat) indikator implementasi kebijakan menurut George C.\r\nEdward, dari indikator sumber daya, disposisi dan struktur birokrasi telah berjalan dengan\r\nbaik. Akan tetapi dari indikator komunikasi masih kurang dan harus ditingkatkan. Faktor\r\nyang menjadi kendala dalam implementasi sistem informasi penelusuran perkara (SIPP)\r\nsebagai sarana pelayanan peradilan berbasis e-service di Pengadilan Agama Barru yaitu\r\nkondisi jaringan tidak stabil dan minimnya pengetahuan masyarakat tentang SIPP. \r\n\r\nKata Kunci: Implementasi, SIPP, E-Service ','STIA AL-GAZALI BARRU',1,2023,2,1005,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1006,'','STIA AL-GAZALI BARRU',1,2016,1,1006,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1007,'Marliana. 20181016. Implementasi Sistem Informasi Manajemen Kepegawaian (SIMPEG)\r\ndalam Program Penataan Administrasi Kepegawaian di Kementerian Agama Kabupaten\r\nBarru. Pembimbing: Chaliddin dan Hj. Sukmiah.\r\n\r\n        Penelitian ini bertujuan untuk mengetahui implementasi Sistem Informasi Manajemen\r\nKepegawaian (SIMPEG) dan faktor kendala dalam program penataan administrasi kepegawaian di\r\nKementerian Agama Kabupaten Barru. Metode penelitian yang digunakan adalah metode\r\npenelitian kualitatif. Jenis data yang digunakan terdiri dari data primer dan data sekunder. Sumber\r\ndata diperoleh dengan cara observasi, wawancara, dan dokumentasi. Sedangkan teknik analisis\r\ndata melalui tahap pengumpulan data, reduksi data, penyajian data, dan penarikan kesimpulan.\r\n       Hasil penelitian ini menunjukkan bahwa implementasi Sistem Informasi Manajemen\r\nKepegawaian (SIMPEG) dalam program penataan administrasi kepegawaian di Kementerian\r\nAgama Kabupaten Barru sudah terlaksana dengan baik berdasarkan 4 (empat) indikator yaitu\r\nkomunikasi, sumber daya, disposisi, dan struktur birokrasi serta penerapan SIMPEG yang\r\nistiqamah. Adapun faktor yang menjadi kendala dalam pelaksanaan SIMPEG di Kementerian\r\nAgama Kabupaten Barru berdasarkan dua indikator. Pertama, aparat pelaksana yaitu kurangnya\r\nkesadaran pegawai untuk melakukan penginputan data kepegawaian secara mandiri dan\r\nmenyampaikan kepada pengelola SIMPEG setiap pembaharuan data, serta apabila ada kesalahan\r\ndalam penginputan data. Kedua, anggaran yaitu kondisi jaringan yang belum stabil menyebabkan\r\nproses penginputan data dan verifikasi data pegawai tidak diselesaikan dengan cepat.  \r\n\r\nKata Kunci: Implementasi, SIMPEG, dan administrasi kepegawaian','STIA AL-GAZALI BARRU',1,2023,2,1007,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1008,'P','STIA AL-GAZALI BARRU',1,2023,1,1009,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1009,'','STIA AL-GAZALI BARRU',1,2016,1,1008,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1010,'Nurhasanah. 20171152. Pengaruh Program Penyediaan Air Minum dan Sanitasi Berbasis Masyarakat (PAMSIMAS) Terhadap Kesehatam Masyarakat di Desa Kamiri Kecamatan Balusu Kabupaten Barru. Pembimbing : H. Hafid Abdul Razak dan Kasmiah. \r\nPenelitian ini bertujuan untuk mengetahui hubungan antara program penyediaan air minum dan sanitasi berbasis masyarakat (PAMSIMAS) dengan tingkat kesehatan masyarakat di Desa Kamiri Kecamatan Balusu Kabupaten Barru dan faktor-faktor yang menghambat dan mendukung terlaksananya program penyediaan air minum dans berbasis masyarakat. Sumber data diperoleh dengan cara angket, wawancara, observasi. Metode analisis data yang digunakan adalah regresi linear sederhana dan koefisien korelasi.  \r\nHasil penelitian menggunakan SPSS-20 menunjukkan bahwa program penyediaan air minum dan sanitasi berbasis masyarakat terhadap kesehatan masyarakat sangat berpengaruh signifikan karena masyarakat sangat memamfaatkan program pamsimas. Dan faktor-faktor yang mendukung terlaksananya program penyediaan air minum dan sanitasi berbasis masyarakat adalah factor internal dan factor eksternal, sementara factor penghambat yang sangat berpengaruh yakni kurangnya partisipasi masyarakat. ','STIA AL-GAZALI BARRU',1,2022,1,1010,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1011,'','STIA AL-GAZALI BARRU',1,2016,1,1011,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
