	(1013,'HASIL PENELITIAN INI MENUJUKKAN BAHWA ','STIA AL-GAZALI BARRU',1,2023,1,1013,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1014,'2023 MUS t','STIA AL-GAZALI BARRU',1,2023,2,1015,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1015,'Rezki Nanang. 20171109. Implementasi Pengelolaan Aset Desa Berbasis Aplikasi Sistem Pengelolaan Aset Desa (SIPADES) di Desa Corawali \r\nKecamatan Tanete Rilau Kabupaten Barru. Pembimbing : Mukmin Muhammad dan Muliati.  \r\n           Penelitian ini bertujuan untuk mengetahui: Bagaimana Implementasi pengelolaan aset desa berbasis aplikasi (SIPADES) dan untuk mengetahui faktorfaktor apa sajakah yang mempengaruhi pengelolaan aset desa berbasis aplikasi SIPADES. Metode penelitian yang digunakan adalah metode penelitian kualitatif, sumber data diperoleh dengan cara, wawancara, observasi, dan dokumentasi. Analisis data menggunakan pengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan. \r\n            Bimbingan teknik yang diberikan tidak bisa menjangkau seluruh perangkat desa yang terlibat langsung dalam menggunakan aplikasi SIPADES karena bimbingan teknis penggunaan aplikasi hanya diberikan kepada Operator khusus aplikasi SIPADES. Aplikasi masih dalam versi yang lama sehingga aplikasi masih sering mengalami error ketika digunakan serta aplikasi SIPADES belum online. \r\n','STIA AL-GAZALI BARRU',1,2022,1,1017,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1016,'','STIA AL-GAZALI BARRU',1,2016,1,1016,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1017,'Farid 20191096. Implementasi Program Penyaluran Pupuk Bersubsidi\r\nmelalui Kartu Tani di Desa Galung Kecamatan Barru Kabupaten Barru.\r\nDibimbing oleh Nurlia dan A. Ariyadi \r\nTujuan Penelitian ini Untuk mengetahui implementasi program penyaluran\r\npupuk bersubsidi melalui kartu tani di Desa Galung Kecamatan Barru Kabupaten\r\nBarru. Untuk mengetahui faktor pendukung dan penghambat dalam implementasi\r\npenyaluran pupuk bersubsidi melalui kartu tani di Desa Galung Kecamatan Barru\r\nKabupaten Barru. Penelitian ini dilakukan secara deskriptif kualitatif, sumber data\r\ndiperoleh dengan cara observasi, wawancara, dan dokumentasi. Analisis data\r\nmenggunakan reduksi data, penyajian data, verifikasi data dan penarikan\r\nkesimpulan. Hasil penelitian yang didapat tersebut kendala selama proses kartu\r\ntani ini berlangsung adalah berkaitan dengan waktu pembelian pupuk yang masih\r\nmenggunakan kebiasaan lama sehingga terjadi penumpukan pembeli dan\r\nmenyebabkan keterlambatan pengiriman. Kartu tani memfasilitasi masyarakat\r\npetani untuk bisa menabung tanpa ada biaya administrasi, yang bertujuan\r\nmasyarakat dapat menabung dan menggunakan uang tersebut untuk membeli\r\npupuk sehingga tidak bersamaan setelah musim panen dengan harapan tidak ada\r\npenumpukan pembeli dan keterlambatan pengiriman. Sejauh ini tujuan tersebut\r\nmasih perlu untuk diperbaiki untuk tercapainya tujuan program kartu tani. \r\nImplementasi program penyaluran pupuk bersubsidi melalui kartu tani di Desa\r\nGalung Kecamatan Barru Kabupaten Barru belum terimplementasi dengan baik\r\ndibuktikan dengan terpenuhnya indikator komnikasi yaitu kurangnya sosialisasi\r\nmengenai penggunaan kartu tani, meskipun pada dasarnya tiga indikator lain yaitu\r\nsumber daya, disposisi, dan struktur birokrasi telah terlaksana dengan baik.\r\nAdapun yang mendukung implementasi program kartu tani yaitu adanya tingkat\r\nantusiasme masyarakat untuk berpartisipasi dalam menggunakan kartu tani\r\nselanjutnya faktor yang menghambat kegiatan ini adalah kurangnya pemahaman\r\nmasyarakat mengenai metode penggunaan kartu tani sehingga menghambat\r\npenyaluran pupuk dan juga mengenai kualitas pupuk bersubsidi yang dianggap\r\nkurang baik bagi masyarakat dalam penggunanya.  \r\nKata Kunci : Implementasi, Pupuk Bersubsidi, Kartu Tani','STIA AL-GAZALI BARRU',1,2023,2,1014,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1018,'Mirnawati. 20171022. Pengaruh Kualitas  Pelayanan  terhadap Kepuasan Pemohon Informasi  pada Pejabat Pengelola Informasi dan Dokumentasi (PPID) Di Kantor Komisi Pemilihan Umum (Kpu) Kabupaten Barru. pembimbing : H.Abd. Mannang  A. Aminah  \r\nPenelitian ini bertujuan untuk mengetahui Pengaruh Kualitas  Pelayanan  terhadap Kepuasan Pemohon Informasi  pada Pejabat Pengelola Informasi dan Dokumentasi (PPID) Di Kantor Komisi Pemilihan Umum (KPU) Kabupaten Barru. Untuk tujuan tersebut digunakan indikator penelitian yaitu : 1. Pengaruh Kualitas Pelayanan (X) :Reability (kehandalan) Responsiveness (Daya Tanggap), Tangible  (Bukti Langsung),  Assurance (jaminan), dan (Empathy (Empati), 2. Kepuasan Pemohon Informasi (Y) : Kesesuaian kualitas pelayanan, Tingkat kepuasan, dan Tidak ada pengaduan.Tipe penelitian yang digunakan adalah kuantitatif. Teknik pengumpulan data adalah: kuisioner dan dokumentasi. \r\n           Hasil penelitian menunjukan bahwa Kualitas pelayanan berpengaruh secara signifikan sebesar 9.387% terhadap kepuasan pemohon informasi pada Pejabat Pengelola Informasi  dan Dokumentasi (PPID) di Kantor Komisi Pemilihan Umum (KPU) Kabupaten Barru. Kemudian jumlah pengaruh kualitas layanan terhadap kepuasan pemohon informasi pada Pejabat Pengelola Informasi  dan Dokumentasi (PPID) di Kantor Komisi Pemilihan Umum (KPU) Kabupaten Barru adalah sebesar : 0,572 atau (57,2%). \r\n','STIA AL-GAZALI BARRU',1,2022,1,1018,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1019,'','STIA AL-GAZALI BARRU',1,2016,1,1020,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1020,'Musfira, 20161096. Analisis peranan yayasan pendidikan Jabal Uhud Bottolai dalam pengembangan pendidikan gratis di Taman Kanak-kanak (Tk) Jabal Uhud Kabupaten Barru di bimbing: H. Hafid Abdul Razak dan Nurul Mukhlisa \r\n \r\nPenelitian ini bertujuan untuk mengetahui: Peranan yayasan pendidikan Jabal Uhud Bottolai dalam pengembangan pendidikan gratis di taman kanak-kanak (TK) Jabal Uhud, faktor yang mempengaruhi yayasan pendidikan Jabal Uhud Bottolai dalam pengembangan pendidikan gratis di Taman Kanak- kanak (TK) Jabal Uhud Kabupaten Barru. Penelitian ini menggunakan penelitian kualitatif, jenis dan sumber data diambil melalui data primer dan skunder. pengumpulan data dilakukan dengan tehnik observasi, wawancara dan dokumentasi. Analisis data dilakukan dengan tehnik pengumpulan data, kondensasi data, penyajian data dan penarik kesimpulan. \r\n \r\nHasil penelitian ini menunjukkan bahwa: Yayasan sangat berperan penting untuk mengembangkan pendidikan gratis sebagai pembina, penentu kebijakan, sebagai motor dan pemberi arahan dalam pelaksanaan pengembangan pendidikan gratis di taman kanak- kanak Jabal Uhud Bottolai, faktor pendukung seperti tenaga pendidik yang profesional, serta siswa yang mudah dijangkau, faktor penghambat yaitu dibatasi oleh zona. \r\n','STIA AL-GAZALI BARRU',1,2022,1,1019,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1021,'','STIA AL-GAZALI BARRU',1,2016,1,1021,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1022,'Penelitian ini bertujuan untuk mengetahui Bagaimana partisipasi masyarakat dalam\r\npenanggulangan sampah di Desa Siawung dan faktor-faktor apa yang menghambat\r\npartisipasi masyarakat dalam penanggulangan sampah di Desa Siawung Kecamatan Barru\r\nKabupaten Barru. Teknik pengumpulan data yaitu observasi, wawancara, dan\r\ndokumentasi.Adapun teknik analisis data yang digunakan yauitu pengumpulan data,\r\nreduksi data, penyajian data, dan penarikan kesimpulan. \r\nHasil penelitian menunjukkan bahwa analisis partisipasi masyarakat dalam\r\npenanggulangan sampah di Desa Siawung Kecamatan Barru Kabupaten Barru tidak\r\nterlaksana dengan baik karena melihat indikator yaitu tidak tersedianya tempat\r\npembuangan akhir sampah dan kurangnya kesadaran masyarakat serta faktor-faktor\r\npenghambat yang meliputi seperti lokasi dan partisipasi masyarakat.','STIA AL-GAZALI BARRU',1,2023,2,1023,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1023,'Salma. 20181131. Faktor-Faktor Yang Mempengaruhi Pengembangan Lembaga Pendidik \r\nAnak Usia Dini (PAUD)  Di Desa Bulo-Bulo Kecamatan Barru. Pembimbing : H. A. Russeng dan Muliati \r\nPenelitian ini bertujuan untuk mengetahui : Faktor-Faktor yang mempengaruhi Pengembangan Lembaga Pendidik Anak Usia Dini (PAUD) di Desa Bulo-bulo Kecamatan Pujananting Kabupaten Barru dan untuk mengetahui Pengembangan Lembaga Pendidik Anak Usia Dini (PAUD) di Desa Bulo-bulo Kecamatan Pujananting Kabupaten Barru. Tipe penelitian yang digunakan adalah tipe kualitatif, jenis data yang digunakan data kualitatif, diperoleh sumber data terdiri data primer dan data sekunder dengan cara wawancara, observasi, dan dokumentasi. teknik analisis data menggunakan pengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan. \r\nHasil penelitian ini menunjukkan bahwa Faktor-Faktor yang mempengaruhi pengembangan lembaga Pendidik Anak Usia Dini (PAUD) di Desa Bulo-bulo Kecamatan Pujananting Kabupaten Barruadalah ini didasarkan pada analisis data menggunakan indikator : model kerja, keterampilan kerja, kapasitas kerja, pengalaman kerja. untuk mengetahui untuk mengetahui Pengembangan Lembaga Pendidik Anak Usia Dini (PAUD) di Desa Bulo-bulo Kecamatan Pujananting Kabupaten barru, dilakukan melalui indikator: tersedianya kurikulum, adanya peserta didik/siswa/anak didik, ketersediaan tenaga kependidikan (guru dan staf), adanya sarana prasarana yang mencukupi ,  adanya pembiayaan pendidikan, adanya sistem evaluasi. \r\n \r\n','STIA AL-GAZALI BARRU',1,2022,1,1022,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1024,'Ilham. 20161281. Kinerja Dinas Pemadam Kebakaran Kabupaten Pangkep. Pembimbing: H.M. Rasyidi Amran dan Kasmiah Ali  \r\nPenelitian ini bertujuan Untuk mengetahui kinerja dan faktor-faktor penghambat Dinas Pemadam Kebakaran dalam pencegahan dan penanggulangan kebakaran Di Kabupaten Pangkep. Adapun tipe penelitian yang di gunakan yaitu deskriptif, kualitatif dengan jenis data yang digunakan terdiri dari data primer dan sekunder disertai teknik pengumpulan data yang diterapkan yaitu observasi, wawancara dan dokumentasi, sedangkan teknik analisis data melalui tahap pengumpulan data, reduksi data, penyajian data dan penalikan kesimpulan atau verifikasi.   \r\nHasil penelitian menunjukkan bahwa kinerja Dinas Pemadam Kebakaran Kabupaten Pangkep secara keseluruhan belum berjalan optimal. Hal ini dapat diketahui dari indikator efektivitas karena belum tercapainya target-target yang ditetapkan, kualitas layanan karena masih banyak keluhan masyarakat karena keterlambatan petugas tiba ke lokasi, responsivitas sudah berjalan baik karena adanya layanan untuk menanggapi keluhan dan aspirasi masyarakat, serta akuntabilitas karena keterbatasan informasi serta kegiatan yang dilakukan Dinas Pemadam Kebakaran Kabupaten Pangkep tidak diperbaharui diwebsite. Masih ditemukan banyak masalah yang menyebabkan tidak terwujudnya visi, misi, tujuan, dan target yang telah ditetapkan serta belum optimal dalam memberikan pelayanan pada masyarakat. Faktor-faktor yang menjadi penghambat Dinas Pemadam Kebakaran Kabupaten Pangkep adalah kurangnya armada dan sarana prasarana serta posko kesiagaan pemadam kebakaran di Kecamatan. \r\n','STIA AL-GAZALI BARRU',1,2021,1,1026,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1025,'ASMIDAR, 20181001, EFEKTIVITAS  PENGGUNAAN SISTEM INFORMASI\r\nMANAJEMEN OPERASIONAL (SIMOP) TERHADAP KEPUASAN KERJA\r\nKARYAWAN PADA KANTOR PT. PEGADAIAN (PERSERO) CABANG\r\nBARRU,  PEMBIMBING : MUKMIN MUHAMMAD, DAN FITRIANTI \r\n\r\nTujuan penelitian adalah untuk menganalisis penggunaan SIMOP serta \r\nmengetahui faktor penghambat dan pendukung efektifitas penggunaan SIMOP terhadap\r\nkepuasan kerja karyawan di Perusahaan PT. Pegadaian (Persero) Cabang Barru, penelitian\r\nmenggunakan tipe penelitian kualitatif, dengan teknik pengumpulan data melalui\r\nobservasi, wawancara dan dokumentasi.  \r\nHasil penlitian ini menunjukkan  bahwa efektivitas penggunaan Sistem Informasi\r\nManajemen Operasional  (SIMOP) terhadap kepuasan kerja karyawan sudah barjalan\r\ncukup baik walaupun belum optimal dan masih perlu ditingkatkan, yang meliputi SIMOP\r\ndalam pelaksanaan kegiatan manajemen operasional, dalam melaksanakan SOP (Standar\r\nOperation Prosedur) dan dalam meningkatkan kepuasan kerja. Terdapat faktor pendukung\r\npelaksnaan SIMOP secara efektif, terutama  perusahaan memiliki standar kerja yang\r\nsangat ketat, dan jika karyawan kurang disiplin melaksanakan SOP (Standar Operation\r\nProsedur) maka sewaktu-waktu bisa dikenakan sanksi sesuai aturan perusahaan. Selain itu\r\npimpinan bijaksana menerapkan aturan pengawasan pembinaan disiplin kerja. Sedangkan\r\nfaktor penghambat adalah  masih rendahnya komitmen kerja tentang jam kerja, masih ada\r\nkaryawan belum memahami standar-standar pekerjaan.\r\n \r\nKata Kunci : SIMOP terhadap kepuasan kerja karyawan','STIA AL-GAZALI BARRU',1,2023,2,1024,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1026,'Reski Yulianti. 20171060. Implcmcnta i\r\nProgram Pclayanun Surat lzln\r\nMcngcrnudi (Sll\\1) Kclillng pndn Satunn Latu Lintas Poire Barru di\r\nknbupntcn Ilnrru. Pcmbimbing : Kasmiah, S.Sos., M.A.P Lian Nurlia, S.Sos.,\r\nM.Si. \r\nPenclitian ini bertujuan untuk mengctahui : Implcmcntasi program pclayanan Surat\r\nlz.in Mengcmudi (SIM) kcliling pada satuan lalu lintas Polrcs Barru di Kabupatcn\r\nBarru dan Faktor-faktor yang rnempengaruhi dalarn implernentasi program\r\npelayanan Surat Izin Mcngemudi (SIM) keliling pada satuan lalu lintas Pol res Barru\r\ndi Kabupaten Barru. Sumber data diperoleh dengan cam observasi, wawancarn\r\nsecara mendalam dan dokumcntasi. Metode pcnclitian dengan rnenggunakan\r\nD skripsi Kualitatif. \r\nBerdasarkan basil penelitian menunjukan bahwa, Implcmentasi program pelayanan\r\nSIM keliling telah dijalankan sesuai dengan standar operasional prosedur dan dapat\r\nclikatakan telah berjalan dengan cukup baik sesuai dengan faktor komunikasi, faktor\r\nsumber daya, faktor disposisi, dan faktor struktur birokrasi. Faktor penghambat\r\ndalam proses pelayanan yaitu Adanya kebijakan yang terkadang tidak sesuai\r\ndengan keadaan sesungguhnya, infonnan dalam hal ini pemegang peran yang\r\nterlibat laogsung dalam proses pelaksanaan pelayanan justru tidak ada ataupun\r\nkurang, kendala sarana dan prasarana yang kurang memadai seperti kursi tunggu\r\nyang terbatas, keramahan dalarn pelayanan kurang dan adanya Covid-19. \r\nKata \r\nkuoci : lmplementasi, Pelayanan, SIM Keliling','STIA AL-GAZALI BARRU',1,2022,1,1027,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1027,'Muldayanti. 20171198. Analisis Efektifitas Nasabah Terhadap Produk Gadai Emas Dan Non Emas Di PT Pegadaian Cabang Dua Pitue Kabupaten Sidenreng Rappang, Pembimbing Zaid Zainal, dan Rosdiana \r\n \r\nPenelitian ini bertujuan untuk mengetahui Efektifitas Nasabah Terhadap Produk Gadai Emas Dan Non Emas Di PT Pegadaian Cabang Dua Pitue Kabupaten Sidenreng Rappang, dan untuk mengetahui faktor – faktor yang mempengaruhi Efektifitas Nasabah Terhadap Produk Gadai Emas Dan Non Emas Di PT Pegadaian Cabang Dua Pitue Kabupaten Sidenreng Rappang. Tipe penelitian ini menggunakan tipe penelitian deskriPTif kualitatif, jenis data yang digunakan adalah data kualitatif, sumber data meliputi data primer dan data sekunder, dan teknik pengumpulan data terdiri dari wawancara, observasi dan dokumentasi, dan teknik analisis data meliputi reduksi data, penyajian data dan penarikan kesimpulan. \r\nHasil penelitian yang dilakukan memperlihatkan bahwa seluruh indikator menunjukkan bahwa Efektifitas Nasabah Terhadap Produk Gadai Emas Dan Non Emas Di PT Pegadaian Cabang Dua Pitue Kabupaten Sidenreng Rappang sudah baik dan efektif, faktor-faktor yang mempengaruhi Efektifitas Nasabah Terhadap Produk Gadai Emas Dan Non Emas Di PT Pegadaian Cabang Dua Pitue Kabupaten Sidenreng Rappang dalam meningkatkan kesejahteraan masyarakat secara positif mempengaruhi terhadap Efektifitas Nasabah Terhadap Produk Gadai Emas Dan Non Emas Di PT Pegadaian Cabang Dua Pitue Kabupaten Sidenreng Rappang  \r\n','STIA AL-GAZALI BARRU',1,2022,1,1025,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1028,'ST.AISYA, 20151066, Analisis Terahadap Kompetensi Manajerial  Kepala Sekolah SMPN 4 Kecamatan Tanete Riaja Kabupaten Barru, pembimbing : Dr.H Kamaruddin Hasan,M.Pd dan Adam Malik \r\n       Penelitian ini bertujuan untuk mengetahui  faktor-faktor yang mempengaruhi terhadap kompetensi manajerial kepala sekolah dalam meningkatkan mutu pendidikan di SMPN 4 Tanete Riaja Kabupaten Barru.Sumber data diperoleh dengan cara menyebarkan angket, observasi, dan dokumentasi.Analisis data denga menggunakan rumus presentase dan uji hipotesis dengan menggunakan SPSS. \r\n        Setelah dilakasanakan pengujian hipotesis  yang telah ditentukan sebelumnya faktor- faktor yang mempengaruhi kompetensi manajerial kepala sekolah sangat mempengaruhi dalam meningkatkan mutu pendidikan di SMPN 4 Tanete Riaja Kabupaten Barru hal ini ditunjukkan dengan nilai Jika t-hitung > t-tabel dan sig < 0,05, maka H0 ditolak dan H1 diterima.Jika t-hitung < t-tabel, dan sig > 0,05 maka H0 diterima dan H1 ditolak.Taraf nyata = 5%, derajat kebebasan (df) = n-2 = 26-2 = 24.dengan demikian disimpulkan bawa variabel tersebur berpengaruh dalam meningkatkan mutu pendidikan di SMPN 4  Tanete Riaja Kabupaten Barru. \r\n','STIA AL-GAZALI BARRU',1,2020,1,1028,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1029,'Penelitian ini bertujuan untuk mengetahui Implementasi Undang-Undang\r\nNomor 8 Tahun 2016 tentang penyandang disabilitas dalam perlindungan dan\r\npemenuhan hak penyandang disabilitas dan faktor menghambat Undang-undang\r\nNomor 8 Tahun 2016 tentang penyandang disabilitas dalam perlindungan dan\r\npemenuhan hak penyandang disabilitas di Dinas Sosial Kabupaten Barru dengan\r\nmenggunakan tipe penelitian kualitatif jenis data yang digunakan terdiri dari data\r\nprimer dan sekunder, disertai teknik pengumpulan data yaitu, observasi,\r\nwawancara dan dokumentasi. Sedangkan teknik analisis yang digunakan yaitu,\r\nmelalui tahap pengumpulan data, reduksi data, penyajian data dan penarikan\r\nkesimpulan. \r\nHasil penelitian ini menunjukkan bahwa Implementasi Undang-Undang\r\nNomor 8 Tahun 2016 tentang penyandang disabilitas dalam perlindungan dan\r\npemenuhan hak penyandang disabilitas di Dinas Sosial Kabupaten Barru cukup\r\nbaik dengan indikator yaitu telah dilaksanakan implementasi Undang-Undang\r\nNomor 8 Tahun 2016, masalah yang ditemui penyandang disabilitas dalam\r\naksesibilitas, adanya peraturan daerah (PERDA) tentang pemenuhan hak dan\r\nperlindungan penyandang disabilitas, hak-hak yang diperoleh penyandang\r\ndisabilitas, tugas dan fungsi pemerintah bagi penyandang disabilitas, sedangkan\r\nFaktor yang mempengaruhi implementasi Undang-undang Nomor 8 Tahun 2016\r\ntentang penyandang disabilitas dalam perlindungan dan pemenuhan hak\r\npenyandang disabilitas di Dinas Sosial Kabupaten Barru yaitu faktor struktur\r\nhukum atau substansi hukum yang masih minim pertunjukan teknis yang khusus\r\nmengatur penyandang disabilitas dan sarana prasarana yang tertata serta kapasitas\r\naparat pemerintah yang masih kurang memahami tugas pokok, fungsi dan\r\nbersosialisasi pada disabilitas.','STIA AL-GAZALI BARRU',1,2023,1,1029,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1030,'Penelitian ini bertujuan untuk mengetahui pengaruh tingkat Pelayanan\r\nAdministrasi terhadap pelaksanaan Haji dan faktor-faktor yang mempengaruhi\r\nPelaksanaan Haji di Kantor Kementerian Agama Kabupaten Barru. \r\nSumber data diperoleh dengan cara angket, wawancara, observasi. \r\nMetode analisis data yang digunakan adalah teknik statistik inferensial \r\nparametrik (Analisis Regresi-SPSS). Hasil penelitian menggunakan SPSS \r\nmenunjukkan bahwa tingkat Pelayanan Administrasi terhadp Pelaksanaan Haji \r\ndi Kantor Kementerian Agama berpengaruh secara signifikan dimana hasil uji \r\nHipotesis (uji F) simultan dan uji T (parsial) menunjukkan signifikansi <0,05 \r\nyaitu sebesar 0,04 dan faktor-faktor yang mempengaruhi yaitu Kerjasma yang \r\nsolid antar masing masing pengurus dan Tenaga pemimpin yang kompeten.','STIA AL-GAZALI BARRU',1,2020,1,1030,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1031,'Penelitian ini bertujuan untuk mengetahui kinerja Dinas Koperasi, Usaha\r\nKecil Menengah dan Perdagangan dalam pelayanan penerimaan retribusi parkir dan\r\nuntuk mengetahui faktor-faktor yang menghambat kinerja Dinas Koperasi, Usaha\r\nKecil dan Menengah dan Perdagangan dalam pelayanan penerimaan retribusi parkir\r\ndi Pasar Sentral Mattirowalie . Penelitian ini menggunakan jenis  penelitian\r\ndeskriptif kualitatif. Teknik pengumpulan data meliputi observasi, wawancara, dan\r\ndokumentasi. Teknik analisis data yaitu reduksi data, penyajian data dan penarikan\r\nkesimpulan.\r\nHasil penelitian ini menunjukkan kinerja Dinas Koperasi, Usaha Kecil\r\nMenengah dan Perdagangan terlaksana dengan baik dengan terpenuhinya seluruh\r\nindikator kinerja yaitu kuantitas pekerjaan, kualitas pekerjaan, kemandirian,\r\ninisiatif, adaptabilitas dan kerjasama. Sedangkan faktor-faktor yang menghambat\r\nkinerja Dinas Koperasi Usaha Kecil Menengah dan Perdagangan dalam pelayanan\r\npenerimaan retribusi parkir di Pasar sentral Mattirowalie Barru ada tiga yaitu\r\nkualitas dan kemampuan pegawai, sarana pendukung dan supra sarana.','ITBA AL-GAZALI BARRU',1,2024,1,1031,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1032,'Yunita Sari. 20171027. Kinerja Badan Permusyawaratan Desa (BPD) Dalam \r\nPengawasan Pemanfaatan Anggaran Di Desa Sampaga Kecamatan Sampaga  \r\nKabupaten Mamuju. Pembimbing : Chaliddin  dan Rosdiana \r\nTujuan penelitian untuk mengetahui Kinerja Badan Permusyawaratan Desa (BPD) dan faktor-faktor yang menghambat Kinerja Badan Permusyawaratan Desa dalam melaksanakan pengawasan pemanfaatan anggaran di Desa Sampaga Kecamatan Sampaga Kabupaten Mamuju. Melalui indikator Produktivitas Kualitas Layanan, Akuntabilitas. Kualitas, kuantitas, manfaat waktu, kerja sama. Penelitian ini menggunakan tipe penelitian deskriptif kualitatif, jenis data yang digunakan terdiri dari data primer dan data sekunder yang disertai dengan teknik pengumpulan data yang diterapkan yaitu observasi, wawancara, dan dokumentasi, sedangkan teknik analisis data melalui  tahap pengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan verifikasi. \r\nHasil penelitian kinerja Badan Permusyawaratan Desa (BPD) dalam pengawasan pemanfaatan anggaran di Desa Sampaga Kecamatan Sampaga Kabupaten Mamuju. masih kurang baik dan belum berjalan secara maksimal. Sedangkan Faktor-Faktor yang menghambat kinerja Badan Permusyawaratan Desa (BPD) dalam pengawasan pemanfaatan anggaran di Desa Sampaga Kecamatan Sampaga Kabupaten Mamuju adalah Kuantitas Layanan, Kualitas Layanan, Manfaat Waktu dan Kerja Sama. \r\n','STIA AL-GAZALI BARRU',1,2022,1,1032,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1033,'Karmila .20181114. Pencegahan Dan Pengendalian Stunting Pada Ibu Hamil\r\nDi Puskesmas Pujananting Kecamatan Pujananting Kabupaten Barru.”.\r\nPembimbing: H. Haeruddin dan Marsuki.\r\nPenelitian ini bertujuan untuk mengetahui pencegahan dan pengendalian\r\nstunting pada ibu hamil di Puskesmas Pujananting Kecamatan Pujananting Kabupaten\r\nBarru. Dengan menggunakan tipe penelitian Deskriftif Kualitatif jenis data yang\r\ndigunakan terdiri dari data primer dan data sekunder disertai termasuk pengumpulan\r\ndata yang diterapkan yaitu observasi, wawancara dan dokumentasi , sedangkan teknik\r\nanalisis data melalui tahap pengumpulan data,reduksi data,penyajian data dan\r\npenarikan kesimpulan atau verifikasi.\r\nHasil penelitian tersebut menunjukan bahwa dalam pencegahan dan\r\npengendalian stunting menggunakan beberapa tahapan yaitu cara pencegahan melalui\r\npenyuluhan, penyuluhan, penuhi kebutuhan gizi sejak hamil , monitor pertumbuhan\r\nanak, dampingi ASI dengan MPASI sehat, selalu menjaga kebersihan lingkungan.\r\nSedangkan cara pengendalian stunting pada ibu  hamil di  Puskesmas\r\nPujananting antara lain stunting melakukan pemeriksaan kehamilan rutin, memastikan\r\nkecukupan nutrisi ibu dan bayi, deteksi dini penyakit, melahirkan di fasilitas kesehatan\r\nyang memadai, insiasi menyusui dini (IMD) dan pemberian ASI ekslusif.','STIA AL-GAZALI BARRU',1,2022,2,1033,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1034,'A. Ummiyah Anriah. 20171008. Implementasi Peraturan Pemerintah tentang Penyelenggaraan Badan Usaha Milik Desa Lasalama di Desa Binuang Kecamatan Balusu Kabupaten Barru. Pembimbing : Nurlia dan M. Alwi A. Buraerah.  \r\nPenelitian ini bertujuan untuk mengetahui Implementasi Peraturan Pemerintah tentang Penyelenggaraan Badan Usaha Milik Desa Lasalama. Dan untuk mengetahui faktor-faktor yang menghambat Implementasi Peraturan Pemerintah Tentang Badan Usaha Milik Desa dalam Penyelenggaraan Badan Usaha Milik Desa Lasalama di Desa Binuang Kecamatan Balusu Kabupaten Barru. Penelitian ini menggunakan tipe penelitian deskriptif kualitatif, sumber data terdiri dari data primer dan data sekunder, teknik pengumpulan data meliputi observasi, wawancara, dan dokumentasi.  \r\nHasil penelitian ini menunjukkan bahwa implementasi Badan Usaha Milik Desa sudah terimplementasi cukup baik yang sesuai indikator penelitian yaitu komunikasi, sumber daya, disposisi dan struktur birokrasi. Sedangkan faktor-faktor yang menghambat Implementasi Peraturan Pemerintah tentang Badan Usaha Milik Desa yaitu masih kurangnya pelatihan IT kepada pengelola BUMDes Lasalama sehingga mereka masih kurang mahir dalam pengelolaan administrasi serta masih kurangnya mitra kerja sama sehingga suplaiyer masih kurang.  \r\n','STIA AL-GAZALI BARRU',1,2022,1,1034,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1035,'','STIA AL-GAZALI BARRU',1,2016,1,1035,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1036,'','STIA AL-GAZALI BARRU',1,2016,1,1036,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1037,'Untuk mengetahui Bagaimana pengelolaan Administrasi Nikah di Kantor\r\nUrusan Agama Kecamatan Soppeng Riaja Kabupaten Barru, dan untuk mengetahui\r\nFaktor - faktor yang mendorong dan menghambat pengelolaan Administrasi Nikah di\r\nKantor Urusan Agama Kecamatan Soppeng Riaja Kabupaten Barru. Metode Penelitian\r\nyang digunakan dalam penelitian ini adalah metode kualitatif dengan menggunakan\r\nobservasi, pedoman wawancara dan studi dokumentasi. \r\nHasil penelitian disimpulkan sebagai berikut Dalam proses pengelolaan\r\nAdminstrasi Nikah yang dilaksanakan pada Kantor Urusan Agama Kecamatan\r\nSoppeng Riaja, telah dilaksanakan dengan baik sesuai dengan peraturan Perundangundang\r\n\r\nyang berlaku, yang didukung oleh seluruh stakeholder untuk pengelolaan\r\nadministrasi nikah ini dengan harapan masyarakat bisa memahami dengan baik, dan\r\njuga berdasarkan hasil wawancara yang dilakukan oleh Peneliti pada informan\r\nditemukan bahwa informan yang mendapatkan pelayanan administras nikah semuanya\r\nmenganggapbaik Faktor-faktor yang mempengaruhi pengelolaan Administrasi Nikah\r\nberdasarkan hasil penelitian yang dilakukan oleh peneliti yaitu mengenai data\r\nkependudukan yang biasanya tidak sinkron dengan data pada kantor urusan agama\r\nsehingga menghambat proses penyelenggaraan administrasi nikah tersebut.','STIA AL-GAZALI BARRU',1,2022,1,1038,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1038,'Penelitian ini bertujuan untuk mengetahui implementasi pemanfaatan\r\naplikasi EHDW (Electronic Human Development Worker) dalam memfasilitasi\r\nkonvergensi pencegahan Stunting terhadap Kader Pembangunan Manusia (KPM)\r\nDi Desa Galung Kecamatan Barru Kabupaten Barru dan faktor-faktor apa sajakah\r\nyang menghambat implementasi pemanfaatan aplikasi EHDW dalam\r\nmemfasilitasi konvergensi pencegahan Stunting terhadap Kader Pembangunan\r\nManusia (KPM) di Desa Galung Kecamatan Barru Kabupaten Barru. Metode\r\npenelitian yang digunakan adalah metode penelitian kualitatif, sumber data\r\ndiperoleh dengan cara survei, wawancara, observasi, dan dokumentasi. Analisis\r\ndata menggunakan pengumpuan data, reduksi data, penyajian data dan penarikan\r\nkesimpulan.\r\nHasil penelitian ini menunjukan bahwa implementasi pemanfaatan\r\nAplikasi EHDW dalam memfasilitasi konvergensi pencegahan Stunting terhadap\r\nKader Pembangunan Manusia (KPM) di Desa Galung Kecamatan Barru\r\nKabupaten Barru dengan menggunakan indikator : Standar Sasaran dan Tujuan\r\nKebijakan, Sumber Daya Implementasi, Komunikasi Antar Organisasi,\r\nKarakteristik Agen Pelaksana, Disposisi Implementor, dan Kondisi Lingkungan,\r\nsosial, politik, dan Ekonomi program tersebut Dilaksanakan bahwa seluruh\r\nindikator yang digunakan sudah berjalan dengan cukup baik. Sedangkan, untuk\r\nmengetahui faktor-faktor yang menghambat implementasi pemanfaatan aplikasi\r\nEHDW dalam memfasilitasi konvergensi pencegahan Stunting terhadap Kader\r\nPembangunan Manusia (KPM) di Desa Galung Kecamatan Barru Kabupaten\r\nBarru yaitu menggunakan indikator Komunikasi, Sumber Daya, Disposisi, dan\r\nStruktur Birokrasi.','STIA AL-GAZALI BARRU',1,2023,1,1037,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1039,'Ani Arnita. 20181033. Analisis Efektivitas Penggunaan Aplikasi M-Water\r\nTerhadap Monitoring Kondisi Akses Air dan Sanitasi di Kabupaten Barru.\r\nPembimbing: Nurlia dan H. Ismail Hannanong. \r\n \r\nPenelitian ini bertujuan untuk mengetahui efektivitas penggunaan aplikasi\r\nM-Water dan monitoring kondisi akses air dan sanitasi serta seberapa besar\r\nanalisis pengukuran efektivitas penggunaan aplikasi M-Water terhadap\r\nmonitoring kondisi akses air dan sanitasi di Kabupaten Barru. Penelitian ini\r\nmenggunakan metode penelitian kuantitatif dengan teknik pengumpulan data\r\nmelalui observasi dan kuesioner / angket serta teknik analisis data menggunakan\r\nuji asumsi klasik. Hasil penelitian ini menunjukkan bahwa efektivitas penggunaan\r\naplikasi M-Water di Kabupaten Barru masuk dalam kategori baik dengan tingkat\r\npersentasi sebesar 37,7% sedangkan untuk monitoring akses air dan sanitasi di\r\nKabupaten Barru masuk dalam kategori cukup dengan tingkat persentasi sebesar\r\n44,2%. Serta, besarnya analisis pengukuran efektivitas penggunaan aplikasi MWater\r\n\r\nterhadap monitoring kondisi akses air dan sanitasi di Kabupaten Barru\r\nsebesar 71,5%. \r\n\r\nKata Kunci: Analisis, Efektivitas, M-Water, Monitoring Kondisi Akses Air dan\r\nSanitasi','STIA AL-GAZALI BARRU',1,2023,2,1039,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1040,'Sri Utami hasir. 20171023. Implementasi Program Layanan Kesehatan Keliling pada Badan Amil Zakat Nasional (BAZNAS) Kabupaten Barru. Pembimbing: Hafid Abdul Razak dan Asriani. \r\n \r\nPenelitian ini bertujuan untuk mengetahui implementasi program layanan kesehatan keliling pada Badan Amil Zakat Nasional (BAZNAS) Kabupaten Barru dan untuk mengetahui faktor penghambat implementasi program layanan kesehatan keliling pada Badan Amil Zakat Nasional (BAZNAS) Kabupaten Barru. Metode penelitian yang digunakan adalah metode penelitian kualitatif, sumber data diperoleh dengan cara observasi, wawancara, dan dokumentasi. Analisis data menggunakan pengumpuan data, reduksi data, penyajian data dan penarikan kesimpulan/verifikasi. \r\nBerdasarkan hasil penelitian menunjukan bahwa implementasi program layanan kesehatan keliling pada Badan Amil Zakat Nasional (BAZNAS) Kabupaten Barru sudah berjalan dengan baik karna masyarakat terbantu dengan adanya program ini. Dan untuk faktor yang menghambat implementasi program layanan kesehatan keliling pada Badan Amil Zakat Nasional (BAZNAS) Kabupaten Barru yaitu dimana tenaga kerja yang digunakan masi bersifat bantuan (Relawan) yang terikat dengan puskesmas. \r\n \r\n','STIA AL-GAZALI BARRU',1,2022,1,1040,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1041,'Sri deviwulandari. 20181125. Persepsi Masyarakat Terhadap Pelayanan Pembuatan\r\nSurat Keterangan Catatan Kepolisian (SKCK) Secara Online Pada Mal Pelayanan\r\nPublik (MPP) di Kabupaten Barru. Dibimbing oleh Hafid Abdul Razak dan Kasmiah\r\nAli. \r\n \r\nPenelitian ini bertujuan untuk mengetahui Persepsi Masyarakat Terhadap Pelayanan \r\nPembuatan Surat Keterangan Catatan Kepolisian (SKCK) Secara Online Pada Mal\r\nPelayanan Publik (MPP) di Kabupaten Barru. dan untuk mengetahui faktor-faktor yang\r\nmenghambat Pelayanan Pembuatan Surat Keterangan Catatan Kepolisian (SKCK) Secara\r\nOnline Pada Mal Pelayanan Publik (MPP) di Kabupaten Barru. jenis data, sumber data,\r\ndata skunder dan data primer diperoleh dengan cara observasi, Wawancara, dan\r\nDokumentasi, analisis data, dan pengumpulan data \r\nHasil penelitian ini menunjukkan bahwa Persepsi masyarakat sudah cukup baik hal \r\nini dibuktikan dari indikator Reability (kehandalan), Assurance (jaminan), dan empaty\r\n(empati) hanya saja yang masih perlu ditingkatkan lagi adalah terdapat pada indikator\r\nTangible (berwujud), dan Responsivess (tanggapan) dan adapun Faktor-faktor penghambat\r\npelayanan SKCK online di Polres Barru yang ada pada Mal Pelayanan Publik(MPP) di\r\nKabupaten Barru yaitu Sarana dan prasarana belum memadai untuk digunakan, Anggaran\r\nmasih kurang, Daya listri kurang, SDM yang masih minim, dan kurang sosialisasi kepada\r\nmasyarakat. \r\nKata Kunci : persepsi, pelayanan, surat keterangan catatan kepolisian (SKCK) secara\r\nonline','STIA AL-GAZALI BARRU',1,2022,2,1041,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1042,'Maria Regina Hoar Deha . 20171015. Kebijakan Pemerintah Terhadap Pembinaan Masyarakat To Balo Dan To Garibo Di Desa Bulo-Bulo Kecamatan Pujananting Kabupaten Barru. Pembimbing : A.Pananrangi Dan M.Alwia. A. Burairah. \r\n penelitian ini bertujuan untuk mengetahui: Kebijakan Pemerintah Terhadap Pembinaan Masyarakat To Balo dan To Garibo dan untuk mengetahui Faktor-faktor yang Mempengaruhi Kebijakan Pemerintah Terhadap Pembinaan masyarakat To Balo Dan To Garibo. Melalui indikator sumber daya pembiayaan, sumber daya aparatur desa, sumber daya lingkungan, dan kejelasan kelompok sasaran. Metode penelitian yang digunakan adalah metode kualitatif, sumber data yaitu data primer dan data sekunder. Teknik pengumpulan data diperoleh dengan cara observasi, wawancara, dan dokumentasi. Serta teknik analisis data meliputi tahap-tahap reduksi, penyajian data, dan penarikan kesimpulan. \r\nHasil penelitian ini menunjukkan kebijakan pemerintah terhadap pembinaan masyarakat To Balo Dan To Garibo di Desa Bulo-Bulo Kecamatan Pujananting Kabupaten Barru. belum sepenuhnya berjalan sebagaimana mestinya. sedangkan FaktorFaktor yang berpengaruh terhadap kebijakan pemerintah dalam  pembinaan  masyarakat To Balo Dan To Garibo Di Desa Bulo-Bulo Kecamatan Pujananting Kabupaten Barru. adalah sumber daya pembiayaan, sumberdaya aparatur desa, sumber daya lingkungan dan kejelasan kelompok sasaran. \r\n','STIA AL-GAZALI BARRU',1,2022,1,1042,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1043,'Rahma Kasifah Riskya. 20171031. Implementasi Usaha Simpan Pinjam Pada Badan Usaha Milik Desa (BUMDes) Sinar Cinekko Tellumpanua Desa Tellumpanua Kecamatan Tanete Rilau Kabupaten Barru. \r\nPembimbing : M. Rasyidi Amran dan Wahyu Azikin. \r\nTujuan penelitian untuk mengetahui Implementasi Usaha Simpan Pinjam Pada Badan Usaha Milik Desa (BUMDes) Sinar Cinekko Tellumpanua Desa Tellumpanua Kecamatan Tanete Rilau Kabupaten Barru dan Untuk mengetahui faktor-faktor yang mempengaruhi Implementasi Usaha Simpan Pinjam Pada Badan Usaha Milik Desa (BUMDes) Sinar Cinekko Tellumpanua Desa Tellumpanua Kecamatan Tanete Rilau Kabupaten Barru. Penelitian ini menggunakan tipe penelitian kualitatif, sumber data diperoleh dengan cara survey, wawancara, observasi, dan dokumentasi. Analisis data menggunakan pengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan. \r\n \r\nHasil penelitian ini menunjukkan bahwa dalam mengetahui Implementasi Usaha Simpan Pinjam \r\nPada Badan Usaha Milik Desa (BUMDes) Sinar Cinekko Tellumpanua Desa Tellumpanua Kecamatan Tanete \r\nRilau Kabupaten Barru dengan menggunakan indikator : Sumber Daya Pembiayaan, Sumber Daya Aparatur, Sumber Daya Lingkungan Program tersebut Dilaksanakan, dan Membatasi Secara Jelas Kelompok Sasaran bahwa seluruh indikator yang digunakan sudah berjalan dengan cukup baik. Dan untuk mengetahui faktor- faktor yang mempengaruhi Implementasi Usaha Simpan Pinjam Pada Badan Usaha Milik Desa (BUMDes) Sinar Cinekko Tellumpanua Desa Tellumpanua Kecamatan Tanete Rilau Kabupaten Barru yaitu dengan Memberi Akses Terhadap Sumber Daya, Memberi Akses Terhadap Teknologi, Memberi Akses Terhadap Pasar dan Memberi Akses Terhadap Pembiayaan. \r\n','STIA AL-GAZALI BARRU',1,2022,1,1043,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1044,'','STIA AL-GAZALI BARRU',1,2016,1,1044,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1045,'Edwin Setiawan  20171056. Kepuasan Masyarakat Terhadap  Pelayanan Administrasi\r\nKependudukan Di Dinas  Kependudukan Dan Pencatatan  Sipil Kabupaten Barru.\r\nDibimbing oleh  Nurlia dan Marsuki.\r\n         Penelitian ini bertujuan untuk mengetahui kepuasan masyarakat terhadap \r\npelayanan administrasi kependudukan di Dinas  Kependudukan Dan Pencatatan  Sipil\r\nKabupaten Barru. Selain itu juga bertujuan untuk mengetahui faktor–faktor yang\r\nmendukung kepuasan masyarakat terhadap  pelayanan administrasi kependudukan di\r\nDinas Kependudukan Dan Pencatatan Sipil Kabupaten Barru. Jenis  penelitian yang\r\ndigunakan adalah deskriftif dengan pendekatan kualitatif. Subyek penelitian adalah\r\norang-orang yang memahami kepuasan masyarakat terhadap  pelayanan administrasi\r\nkependudukan di Dinas  Kependudukan Dan Pencatatan  Sipil Kabupaten Barru. \r\nSumber data adalah data primer dan data skunder. Teknik pengumpulan data\r\ndiperoleh dengan cara  observasi, wawancara dan dokumentasi. Pengabsahan data\r\nmelalui triangulasi. Kemudian teknik analisis data adalah pengumpulan data (data\r\ncollection), mereduksi data (data reduction), menyajikan data (data display), dan\r\npenarikan kesimpulan (conclution drawing/verification).  \r\n.   Hasil penelitian ini menunjukkan bahwa Kepuasan masyarakat terhadap \r\npelayanan administrasi kependudukan di Dinas Kependudukan Dan Pencatatan Sipil\r\nKabupaten Barru sudah terlaksana dengan baik. Kesimpulan ini didasarkan atas\r\nterpenuhinya seluruh indikator penelitian seperti: adanya kesesuaian kualitas\r\npelayanan dengan tingkat harapan, adanya kepuasan apabila dibandingkan dengan\r\nyang sejenis, dan tidak ada pengaduan masyarakat. Kemudian faktor-faktor yang\r\nmendukung  kepuasan masyarakat terhadap  pelayanan administrasi kependudukan di\r\nDinas Kependudukan Dan Pencatatan Sipil Kabupaten Barru  adalah kesadaran,\r\naturan, pendapatan, kemampuan dan sarana pelayanan.','STIA AL-GAZALI BARRU',1,2023,1,1045,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1046,'Tujuan penelitian ini untuk mengetahui pengelolaan aset tetap menurut\r\nPeraturan Menteri Dalam Negeri no 19 Tahun 2016 tentang aset tetap pada Badan\r\nPendapatan Daerah Kabupaten maros. dan untuk mengetahui faktor faktor yang\r\nmendukung dan menghambat dalam pengelolaan aset tetap menurut Peraturan\r\nMenteri Dalam Negeri nomor 19 tahun 2016 Tentang Aset Tetap pada Badan\r\nPendapatan Daerah Kabupaten Maros. Dalam penelitian ini digunakan tipe\r\npenelitian deskriptif-kualitatif, jenis data yang digunakan adalah data kualitatif,\r\ndan sumber data terdiri dari data primer dan data sekunder, dan tehnik\r\npengumpulan data terdiri atas observasi, wawancara, dan dokumentasi, dan\r\ntekhnik analisis data dilakukan dengan tahap reduksi data, penyajian data dan\r\nkesimpulan/verifikasi. \r\n Hasil penelitian ini menunjukkan bahwa pengelolaan aset tetap menurut\r\nPeraturan Menteri Dalam Negeri no 19 tahun 2016 Tentang Aset Tetap pada\r\nBadan Pendapatan Daerah Kabupaten Maros telah dilakukan dengan baik dan\r\nsesuai dengan sistem dan prosedur yang telah ditetapkan, meskipun secara\r\nkeseluruhan belum berjalan optimal. Faktor faktor yang mendukung dalam\r\nPengelolaan Aset Tetap pada Badan Pendapatan Daerah Kabupaten Maros adalah\r\nkepastian hukum dan transparansi sedangkan faktor faktor penghambat dalam\r\nPengelolaan Aset Tetap pada Badan Pendapatan Daerah Kabupaten Maros adalah\r\npelaksanaan siklus pendapatan daerah, SDM (pengawai Bapenda) dan anggaran\r\ndaerah.','STIA AL-GAZALI BARRU',1,2020,1,1046,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1047,'Jumriah. 20171056.Kebijakan pemerintah dalam mengendalikan ekonomi masyarakat pada masa pandemi covid 19 di Desa Harapan kecamatan Tanete Riaja Kabupaten Barru.pembimbing: H. Kamaruddin Hasan dan Dian Pratiwi. \r\n        Penelitian ini bertujuan untuk mengetahui bagaimana kebijakan pemerintah dalam mengendalikan ekonomi masyarakat pada masa pandemi covid-19. Dan untuk mengetahui dampak kebijakan pemerintah dalam mengendalikan ekonomi masyarakat pada masa pandemi covid-19 di Desa Harapan Kecamatan Tanete Riaja Kabupaten Barru. Penelitian ini menggunakan tipe penelitian deskriptif kualitatif, sumber data terdiri dari data primer dan data sekunder, teknik pengumpulan data meliputi observasi, wawancara, dan dokumentasi. \r\nHasil penelitian Kebijakan pemerintah dalam mengendalikan ekonomi masyarakat pada masa pandemi covid-19 di Desa Harapan dilihat dari indikatornya yaitu presepsi, agregasi, organisasi, agenda setting, formulasi. sudah terlaksana dengan baik.sedangkan Dampak Kebijakan Pemerintah dalam mengendalikan ekonomi pada masa pandemi Covid-19 di Desa Harapan Kecamatan Tanete Riaja Kabupaten Barru terbagi menjadi dua yaitu dampak positif dimana masyarakat di Desa Harapan Kecamatan Tanete Riaja Kabupaten Barru merasa sangat terbantu mengenai adanya kebijakan ini, sedangkan dampak negatifnya yaitu timbulnya perasaan iri dan dengki bagi masyarakat yang tidak mendaptkan bantuan dari pemerintah sehingga memicu timbulnya misscommunication bagi mereka. \r\n','STIA AL-GAZALI BARRU',1,2022,1,1047,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1048,'Penelitian ini bertujuan untuk mengetahui Pengaruh Iklim Kerja Terhadap\r\nKepuasan Masyarakat Pada Pelayanan Aparat Di Desa Galung Kecamatan Barru\r\nKabupaten Barru. untuk tujuan tersebut digunakan indikator penelitian \r\n1. Iklim Kerja (X) : Struktur Organisasi,  Kebijakan dan Praktik Manajerial Teknologi,\r\ndan Lingkungan Ekstrnal. 2.  Kepusan masyarakat terhadap pelayanan aparat desa (Y)\r\ndigunakan indiaktor penelitian: jenis pelayanan, persyaratan pelayanan, proses atau\r\nprosedur pelayanan, pejabat yang bertanggung jawab terhadap pelayanan, petugas\r\npelayanan,  waktu pelayanan yang dibutuhkan dan biaya pelayanan. Selain itu juga\r\nbertujuan untuk mengetahui jumlah pengaruh Pengaruh Iklim Kerja Terhadap Kepuasan\r\nMasyarakat Pada Pelayanan Aparat Di Desa Galung Kecamatan Barru Kabupaten Barru\r\nTipe penelitian yang digunakan adalah kuantitatif. Sumber data diperoleh dengan cara\r\nkuisioner dan dokumentasi dan wawancara. Kemudian teknik analisis data adalah\r\nmenggunakan aplikasi SPSS versi 17.0, \r\nHasil penelitian ini menunjukkan bahwa berdasarkan bahwa iklim kerja\r\nberpengaruh terhadap kepuasan masyarakat pada pelayanan aparat di Desa  Galung\r\nKecamatan Barru Kabupaten. Sedangkan jumlah pengaruh iklim kerja terhadap kepuasan\r\nmasyarakat pada  pelayanan aparat di Desa Galung Kecamatan Barru Kabupaten Barru\r\nadalah sebesar : 64,6 %.','STIA AL-GAZALI BARRU',1,2021,1,1049,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1049,'','STIA AL-GAZALI BARRU',1,2016,1,1051,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1050,'Penelitian ini bertujuan untuk mengetahui implementasi instruksi presiden \r\n(INPRES) No. 1 Tahun 2017 Tentang Gerakan Masyarakat Hidup Sehat\r\n(GERMAS) di wilayah kerja Puskesmas Lisu Kecamatan Tanete Riaja Kabupaten\r\nBarru, dan untuk mengetahui faktor-faktor yang menghambat dalam\r\nimplementasi Instruktur Presiden No. 1 Tahun 2017 tentang Germas di\r\nPuskesmas Lisu Kecamatan Tanete Riaja Kabupaten Barru.\r\nPenelitian ini mengunakan tipe penelitian deskriptif kualitatif, jenis data\r\nkualitatif, sumber data data premier dan sekunder. Pengumpulan dilakukan dengan\r\ncara observasi, wawancara, dan dokumentasi. Teknis analisis data dilakukan\r\nmelalui tahap reduksi data, penyajian data dan penarikan kesimpulan/verivikasi.\r\nHasil penelitian ini menunjukan bahwa implementasi Instruksi Presiden\r\nTentang Gerakan Masyarakat Hidup Sehat di Wilayah Kerja Puskesmas Lisu\r\ncukup baik, faktor-faktor penghambat adalah dampak pandemi covid-19 yang\r\nsangat mempengaruhi setiap kegiatan GERMAS di wilayah kerja puskesmas lisu.','STIA AL-GAZALI BARRU',1,2022,1,1048,'2025-06-05 15:02:14','2025-06-05 15:02:14');
