VALUES
	(1051,'Penelitian ini bertujuan untuk mengetahui: pengelolaan administrasi Pajak Bumi dan\r\nBangunan (PBB) di Desa Libureng Kecamatan Tanete Riaja Kabupaten Barru, dan untuk\r\nmengetahui faktor-faktor yang menghambat pengelolahan administrasi Pajak Bumi dan\r\nBangunan (PBB) di Desa Libureng Kecamatan Tanete Riaja Kabupaten Barru. Tipe\r\npenelitian yang digunakan dalam penelitian ini adalah tiep penelitian kualiatif,  Jenis data\r\nyang digunakan dalah data kualitatif dan sumber data terdiri atas data primer dan data\r\nsekunder. Sedangkan teknik pengumpulan datanya adalah wawancara, observasi, dan\r\ndokumentasi. Teknik analisis data yang digunakan adalah melalui tahap reduksi data,\r\npenyajian data, dan penarikan kesimpulan serta verifikasi.\r\nHasil penelitian menunjukan bahwa pengelolaan Administrasi Pajak Pajak Bumi dan\r\nBangunan (PBB) di desa Libureng Kecamatan Tanete Riaja sudah cukup baik namun belum\r\noptimal. Karena faktor-faktor  penghambat adalah sarana dan prasaran yang sudah cukup\r\nbaik namun belum optimal, kinerja kolektor yang bertugas dalam melakukan penagihan\r\npajak bumi dan bangunan masih rendah, serta faktor masih rendahnya kemauan wajib pajak\r\ndalam membayar pajak bumi dan bangunan.','STIA AL-GAZALI BARRU',1,2022,1,1050,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1052,'Penelitian ini bertujuan untuk mengetahui pengaruh sistem\r\npengendalian internal terhadap nilai informasi pelaporan keuangan\r\ndaerah dan untuk mengetahui nilai informasi pelaporan keuangan\r\ndaerah sudah signifikan \r\nterhadap sistem pengendalian \r\ninternal.Penelitian ini adalah penelitian kuantitatif metode survey yang\r\nbersifat korelasional. Variabel bebas dalam penelitian ini adalah \r\nsistem pengendalian internal ,sedangkan variabel terikatnya adalah\r\nnilai informasi pelaporan keuangan Daerah. Populasi dalam penelitian\r\nini adalah seluruh pegawai pada Kantor BPKAD Kab. Barru yang\r\nberjumlah 40 pegawai, sedangkan sampelnya juga sebanyak 40\r\npegawai.Hasil penelitian menunjukkan bahwa hasil yang di peroleh\r\nsistem pengendalian internal tergolong cukup dengan perensentasi\r\n53,7% memberikan pengaruh positif terhadap nilai informasi\r\npelaporan keuangan Daerah dalam kategori baik dilihat dari t hitung\r\nsebesar 3,897 lebih besar  disbanding nilai t tabel sebesar 2,021 dan pvalue\r\n0,000<0,05\r\nyang\r\nberarti\r\nH0\r\nditolak\r\ndan\r\nH1\r\nditerima\r\n\r\n.dan Nilai\r\nInformasi Pelaporan Keuangan Daerah signifikan terhadap Sistem\r\nPengendalian Internal tergolong baik  dilihat dari koefesien korelasi\r\n0,534 dan F hitung = 15,183 dengan p-value 0,000<0,05 yang berarti\r\nH0 ditolak dan H1 diterima.','STIA AL-GAZALI BARRU',1,2023,1,1053,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1053,'','STIA AL-GAZALI BARRU',1,2016,1,1054,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1054,'Penelitian ini bertujuan untuk mengetahui tingkat kepuasan masyarakat terhadap pendataan \r\nmasyarakat miskin penerima Bantuan Langsung Tunai (BLT) di Kelurahan Sumpang Binangae\r\nKabupaten Barru. Dan untuk mengetahui faktor-faktor yang menghambat pendataan masyarakat miskin\r\npenerima Bantuan Langsung Tunai (BLT) di Kelurahan Sumpang Binangae Kabupaten Barru. Dengan\r\nmenggunakan tipe penelitian kualitatif, jenis data yang digunakan terdiri dari data primer dan data\r\nsekunder, disertai teknik pengumpulan data yaitu, observasi, wawancara, dan dokumentasi. Sedangkan\r\nteknik analisis data yang digunakan yaitu, melalui tahap pengumpulan data, reduksi data, penyajian\r\ndata, dan penarikan kesimpulan.\r\n \r\nHasil penelitian ini menunjukkan bahwa tingkat kepuasan masyarakat terhadap pendataan \r\nmasyarakat miskin penerima Bantuan Langsung Tunai (BLT) di Kelurahan Sumpang Binangae\r\nKabupaten Barru sudah cukup puas. Kesimpulan ini didasarkan atas terpenuhinya 11 indikator\r\npenelitian yaitu prosedur pelayanan, persyaratan pelayanan, kejelasan petugas pelayanan, kedisiplinan\r\npetugas pelayanan, tanggung jawab petugas pelayanan, kemampuan petugas pelayanan, kecepatan\r\npelayanan, keadilan mendapatkan pelayanan, kesopanan dan keramahan petugas, kenyamanan\r\nlingkungan, dan keamanan pelayanan. Adapun 3 indikator yang tidak terpenuhi yaitu kewajaran biaya\r\npelayanan, biaya pelayanan, kepastian jadwal pelayanan. Faktor-faktor yang menghambat pendataan\r\nmasyarakat miskin penerima Bantuan Langsung Tunai (BLT) di Kelurahan Sumpang Binangae\r\nKabupaten Barru yaitu adanya masyarakat yang tidak berada di rumah pada saat petugas akan\r\nmelakukan pendataan terhadap masyarakat calon penerima Bantuan Langsung Tunai (BLT). ','STIA AL-GAZALI BARRU',1,2023,1,1052,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1055,'Penelitian ini bertujuan untuk mengetahui implementasi kebijakan pelayanan\r\nposyandu  terhadap kesehatan masyarakat lanjut usia di desa pao-pao kecamatan\r\ntanete rilau kabupaten barru dan untuk mengetahui faktor-faktor yang menghambat\r\nimplementasi kebijakan pelayanan posyandu lanjut usia di desa pao-pao kecamatan\r\ntanete rilau kabupaten barru. Tipe penelitian yang digunakan adalah penelitian\r\nkualitatif, jenis data kualitatif, sumber data primer dan sekunder. Teknik analisis data\r\nmelalui, pengumpulan data, reduksi data, penyajian data, dan penarikan\r\nkesimpulan/verifikasi. \r\nHasil penelitian ini menunjukan bahwa implementasi kebijakan pelayanan\r\nposyandu terhadap kesehatan masyarakat lanjut usia (lansia) di desa pao-pao\r\nkecamatan tanete rilau kabupaten barru sudah cukup baik. Kesimpulan ini didasarkan\r\natas terpenuhinya seluruh indikator penelitian yaitu Komunikasi, Sumber daya,\r\nDisposisi, dan Birokrasi. Sedangkan faktor-faktor yang menghambat implementasi\r\nkebijakan pelayanan posyandu lanjut usia di desa pao-pao kecamatan tanete rilau\r\nkabupaten barru meliputi, Sumber daya manusia (SDM) sarana dan prasarana\r\nkurangnya kursi meja, belum terbangunanya gedung khusus lanjut usia, alat-alat\r\npemeriksaan lanjut usia, kurangnya kesadaran para lanjut usia, obat-obatan tidak\r\ngratis.','STIA AL-GAZALI BARRU',1,2023,1,1057,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1056,'Arifah Syahnidar. 20171016. Analisis Kepuasan Masyarakat Pada Pelaksanaan Tugas  Pokok Dan Fungsi Kepala Lingkungan Di Kelurahan Lompo Riaja Kabupaten Barru. Pembimbing : Surasno Taliki dan Wahyul AZ \r\n Penelitian ini bertujuan untuk mengetahui bagaimana kepuasan masyarakat terhadap pelaksanaan tugas pokok dan fungsi kepala lingkungan dan untuk mengetahui faktor-faktor apa yang menghambat kepuasan masyarakat pada pelaksanaan tugas pokok dan fungsi kepala lingkungan di Kelurahan Lompo Riaja Kabupaten Barru. Tipe penelitian yang digunakan adalah deskriptif kualitatif, teknik pengumpulan data berdasarkan observasi, wawancara dan dokumentasi. Teknik analisis data yaitu pengumpulan data, penyajian data dan penarikan kesimpulan. \r\n Hasil penelitian menunjukkan kepuasan masyarakat pada pelaksanaan tugas pokok dan fungsi kepala lingkungan di Kelurahan Lompo Riaja cukup bagus dengan indikator prosedur pelayanan, persyaratan pelayanan, kejelasan tugas pelayanan, tanggung jawab pelayanan serta kenyamanan dan keamanan. Sedangkan faktor-faktor yang menghambat kepuasan masyarakat pada pelaksanaan tugas pokok dan fungsi kepala lingkungan adalah tidak terpenuhinya keinginan masyarakat dan rendahnya teknologi informasi yang dimiliki. \r\n','STIA AL-GAZALI BARRU',1,2022,1,1055,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1057,'Penelitian ini bertujuan untuk mengetahui: Kebijakan pemerintah desa\r\ndalam pemberian bantuan dana duka bagi masyarakat di Desa Panrenreng\r\nKecamatan Segeri Kabupaten Pangkep. Untuk mengetahui faktor penghambat\r\ndalam pemberian bantuan dana duka bagi masyarakat di Desa Parenreng\r\nKecamatan Segeri Kabupaten Pangkep. Metode yang digunakan pada penelitian\r\nini adalah kualitatif, teknik pengumpulan data terdiri dari observasi, wawancara\r\ndan dokumentasi.\r\nHasil dari penelitian ini menunjukkan bahwa kebijakan pemerintah desa\r\ndalam pemberian bantuan dana duka bagi masyarakat di Desa Parenreng\r\nKecamatan Segeri Kabupaten Pangkep cukup baik dalam pelaksanaannya.\r\nKesimpulan ini didasarkan atas terpenuhinya seluruh indikator penelitian yaitu\r\nkomunikasi, sumber daya, disposisi, dan birokrasi. Faktor penghambat dalam\r\npemberian bantuan dana duka bagi masyarakat di Desa Parenreng adalah proses\r\npencairan dana duka yang lambat dan jumlah dana yang diberikan kepada\r\npenerima masih kurang.','STIA AL-GAZALI BARRU',1,2023,1,1058,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1058,'   Penelitian ini bertujuan untuk mengetahui . implementasi kebijakan\r\npemerintah dalam meningkatkan pendapatan petani padi di Kelurahan Lompo\r\nRiaja Kecamatan Tanete Riaja Kabupaten Barru..Selain itu juga bertujuan untuk\r\nmengetahui faktor-faktor yang mempengaruhi implementasi kebijakan pemerintah\r\ndalam meningkatkan pendapatan petani padi di Kelurahan Lompo Riaja\r\nKecamatan Tanete Riaja Kabupaten Barru. Tipe penelitian yang digunakan adalah\r\ndeskriftif kualitatif. Sumber data diperoleh dengan cara  wawancara dan\r\ndokumentasi. Kemudian teknik analisis data adalah teknik Miles dan Heberman.\r\n    Hasil penelitian ini menunjukkan bahwa Implentasi kebijakan pemerintah\r\ndalam meningkatkan pendapatan petani padi di Kelurahan Lompo Riaja\r\nKecamatan Tanete Riaja Kabupaten Barru sudah dijalankan tetapi belum berjalan\r\nsecara maksimal. Untuk itu  masih diperlukan upaya perbaikan yang diarahkan\r\nuntuk peningkatan pendapatan petani padi..Sedangkan faktor-faktor yang\r\nmempengaruhi Implentasi kebijakan pemerintah dalam meningkatkan pendapatan\r\npetani padi di Kelurahan Lompo Riaja Kecamatan Tanete Riaja Kabupaten Barru\r\nadalah sumber daya pembiayaan,  sumber daya aparatur, sumber daya lingkungan\r\ndan kejelasan kelompok sasaran.\r\n','STIA AL-GAZALI BARRU',1,2022,2,1056,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1059,'Penelitian ini bertujuan untuk mengetahui pencegahan dan pengendalian\r\nstunting pada ibu hamil di Puskesmas Pujananting Kecamatan Pujananting Kabupaten\r\nBarru. Dengan menggunakan tipe penelitian Deskriftif Kualitatif jenis data yang\r\ndigunakan terdiri dari data primer dan data sekunder disertai termasuk pengumpulan\r\ndata yang diterapkan yaitu observasi, wawancara dan dokumentasi , sedangkan teknik\r\nanalisis data melalui tahap pengumpulan data,reduksi data,penyajian data dan\r\npenarikan kesimpulan atau verifikasi.\r\nHasil penelitian tersebut menunjukan bahwa dalam pencegahan dan\r\npengendalian stunting menggunakan beberapa tahapan yaitu cara pencegahan melalui\r\npenyuluhan, penyuluhan, penuhi kebutuhan gizi sejak hamil , monitor pertumbuhan\r\nanak, dampingi ASI dengan MPASI sehat, selalu menjaga kebersihan lingkungan.\r\nSedangkan cara pengendalian stunting pada ibu  hamil di  Puskesmas\r\nPujananting antara lain stunting melakukan pemeriksaan kehamilan rutin, memastikan\r\nkecukupan nutrisi ibu dan bayi, deteksi dini penyakit, melahirkan di fasilitas kesehatan\r\nyang memadai, insiasi menyusui dini (IMD) dan pemberian ASI ekslusif. ','STIA AL-GAZALI BARRU',1,2022,1,1059,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1060,'Penelitian ini bertujuan untuk mengetahui Bagaimana Implementasi\r\nKebijakan Pemanfaatan Ruang Terbuka Hijau (RTH) di Kabupaten Barru dan untuk\r\nmengetahui faktor-faktor apakah yang menghambat Implementasi Kebijakan\r\nPemanfaatan Ruang Terbuka Hijau (RTH) di Kabupaten Barru. Implementasi\r\nKebijakan Pemanfaatan Ruang Terbuka Hijau (RTH) di Kabupaten Barru dari 4\r\nindikator, Komunikasi, Sumber Daya, Disposisi dan Struktur Birokrasi sudah berjalan \r\nbaik. Faktor-faktor yang menghambat Implementasi Kebijakan Pemanfaatan Ruang\r\nTerbuka Hijau (RTH) di Kabupaten Barru yaitu kurangnnya kesadaran masyarakat\r\ndalam menjaga sarana dan prasarana dan keterbatasan dana. Adapun tehnik\r\npengumpulan data yaitu Observasi,Wawancara dan Dokumentasi. Teknik Analisis\r\nData meliputi Kondensasi Data, Penyajian Data dan Penarikan Kesimpulan dan\r\nVerifikasi.','STIA AL-GAZALI BARRU',1,2023,1,1060,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1061,'       Penelitian ini bertujuan untuk mengetahui peran pemerintah desa pujananting\r\ndalam melestarikan kearifan lokal musik tradisional genrang riwakkang, selain itu\r\npenelitian ini juga bertujuan untuk mengetahui faktor pendukung dan penghambat\r\nyang dialami pemerintah dalam melestarikan kearifan lokal genrang riwakkang.\r\nTipe penelitian yang digunakan adalah Kualitatif. Teknik Pengumpulan Data\r\ndiperoleh melalui wawancara, observasi dan dokumentasi. Teknik analisis data\r\nyaitu kondensasi data, penyajian data, dan Penarikan Kesimpulan/Verifikasi. \r\nHasil Penelitian ini menunjukkan bahwa peran pemerintah dalam melestarikan\r\nmusik tradisional terbagi menjadi tiga yaitu peran pemerintah sebagai\r\ndinamistator, regulator dan fasilitator. Adapun faktor pendukung dalam\r\nmelestarikan musik tradisional genrang riwakkang adalah pemerintah membuat\r\nevent yang diselanggarakan setiap tahun dan akan selalu menghadirkan\r\npertunjukan musik tradisional genrang riwakkang, adapun faktor pengahambat\r\ndalam melestarikan musik tradisional genrang riwakkang ini adalah kurangnya\r\nsinergitas pemerintah daerah dan pemerintah pusat dalam memperhatikan\r\npelestarian kearifan lokal khususnya musik tardisonal yang ada di desa.','STIA AL-GAZALI BARRU',1,2023,1,1061,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1062,'enelitian ini bertujuan untuk mengetahui Implementasi Pelayanan \r\nPembayaran Pajak Kendaraan Bermotor Berbasis Digital E-Samsat Pada Kantor\r\nUPT Pendapatan Samsat Wilayah Barru dan faktor-faktor yang mempengaruhi\r\npelayanan pembayaran pajak kendaraan bermotor berbasis digital E-Samsat.\r\nPenelitian ini menggunakan jenis penelitian deskriptif kualitatif dengan sumber\r\ndata diperoleh dengan cara observasi, wawancara dan dokumentasi. Hasil\r\npenelitian ini menunjukkan bahwa Implementasi Pelayanan Pembayaran Pajak\r\nKendaraan Bermotor Berbasis Digital E-Samsat Pada Kantor UPT Pendapatan\r\nSamsat Wilayah Barru telah terlaksana dengan baik karena dari ke enam indikator\r\nVan Meter dan Van Horn telah memenuhi semua indikator dalam kesuksesan\r\npelayanan dan faktor yang mempengaruhi aplikasi E-Samsat dalam pelayanan\r\npembayaran pajak kendaraan bermotor berbasis digital pada Kantor Pendapatan\r\nSamsat Wilayah Barru telah efektif dalam membantu pemerintahan dan\r\nmemudahkan masyarakat dalam penerimaan pajak di dukung dengan personil\r\npelaksana yang telah melakukan tugasnya dengan baik namun akses jaringan\r\nsangat berpengaruh dalam penggunaan aplikasi ini, jika jaringan buruk maka\r\npenggunaan aplikasi E-Samsat ini akan terganggu.','STIA AL-GAZALI BARRU',1,2023,2,1062,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1063,'Penelitian ini bertujuan untuk mengetahui: kualitas pelayanan parkir pintar \r\n(smart parking) di Rumah Sakit Umum Daerah (RSUD) La Patarai Kabupaten\r\nBarru. Dan untuk mengetahui faktor-faktor yang mempengaruhi peningkatan\r\nkualitas pelayanan parkir pintar (smart parking) di Rumah Sakit Umum Daerah\r\n(RSUD) La Patarai Kabupaten Barru. Sumber data diperoleh dengan cara:\r\nObservasi, Wawancara, Dokumentasi. Analisis data menggunakan: 1.\r\nPengumpulan data 2. Reduksi data 3. Penyajian data 4. Penarikan kesimpulan /\r\nVerifikasi.\r\n \r\nHasil penelitian ini menunjukkan bahwa kualitas pelayanan parkir pintar \r\n(smart parking) di Rumah Sakit Umum Daerah (RSUD) La Patarai Kabupaten\r\nBarru sudah baik. Adapun yang mempengaruhi peningkatan kualitas pelayanan\r\nparkir pintar (smart parking) di Rumah Sakit Umum Daerah (RSUD) La Patarai\r\nKabupaten Barru. Adalah dukungan dari pihak luar, sumber Daya Manusia\r\n(SDM), sarana penunjang lain.','STIA AL-GAZALI BARRU',1,2022,1,1066,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1064,'Gusnani. 20181273. Implementasi Kebijakan Pelayanan Posyandu terhadap\r\nKesehatan Masyarakat Lanjut usia (Lansia) Di Desa Pao-pao Kecamatan Tanete\r\nRilau Kabupaten Barru. Pembimbing  H.Rasyidi Amran, dan M. Alwi A. Buraera. \r\nPenelitian ini bertujuan untuk mengetahui implementasi kebijakan pelayanan\r\nposyandu  terhadap kesehatan masyarakat lanjut usia di desa pao-pao kecamatan\r\ntanete rilau kabupaten barru dan untuk mengetahui faktor-faktor yang menghambat\r\nimplementasi kebijakan pelayanan posyandu lanjut usia di desa pao-pao kecamatan\r\ntanete rilau kabupaten barru. Tipe penelitian yang digunakan adalah penelitian\r\nkualitatif, jenis data kualitatif, sumber data primer dan sekunder. Teknik analisis data\r\nmelalui, pengumpulan data, reduksi data, penyajian data, dan penarikan\r\nkesimpulan/verifikasi. \r\nHasil penelitian ini menunjukan bahwa implementasi kebijakan pelayanan\r\nposyandu terhadap kesehatan masyarakat lanjut usia (lansia) di desa pao-pao\r\nkecamatan tanete rilau kabupaten barru sudah cukup baik. Kesimpulan ini didasarkan\r\natas terpenuhinya seluruh indikator penelitian yaitu Komunikasi, Sumber daya,\r\nDisposisi, dan Birokrasi. Sedangkan faktor-faktor yang menghambat implementasi\r\nkebijakan pelayanan posyandu lanjut usia di desa pao-pao kecamatan tanete rilau\r\nkabupaten barru meliputi, Sumber daya manusia (SDM) sarana dan prasarana\r\nkurangnya kursi meja, belum terbangunanya gedung khusus lanjut usia, alat-alat\r\npemeriksaan lanjut usia, kurangnya kesadaran para lanjut usia, obat-obatan tidak\r\ngratis. \r\nKata Kunci: Implementasi, Kebijakan, pelayanan, kesehatan, posyandu, lanjut usia.','STIA AL-GAZALI BARRU',1,2023,2,1063,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1065,'A. Muh. Fiqih A. Darwis. 20161034. Implementasi Tugas Pokok Dan Fungsi Badan Permusyawaratan Desa (BPD) Di Desa Pongkeru Kec. Malili Kab.  Luwu Timur, Pembimbing H. Hafid Abdul Razak dan Kasmiah Ali. \r\n \r\nPenelitian ini bertujuan untuk mengetahui implementasi tugas pokok dan fungsi Badan Permusyawaratan  Desa (BPD) di Desa Pongkeru Kecamatan Malili Kabupaten Luwu Timur dan untuk mengetahui faktor-faktor yang menghambat implementasi tugas pokok dan fungsi Badan Permusyawaratan Desa (BPD) di Desa Pongkeru Kecamatan Malili Kabupaten Luwu Timur. Tipe penelitian yang digunakan adalah tipe penelitian kualitatif, sumber data yang digunakan adalah sumber data primer dan sekunder. Pengumpulan data yang dilakukan dengan cara observasi, wawancara, dan dokumentasi. Teknik analisis datanya yaitu pengumpulan data, reduksi data, penyanjian data, dan penarikan kesimpulan/ verivikasi. \r\nHasil penelitian ini menunjukkan tugas pokok BPD dalam penyelenggaraan pemerintah di Desa Pongkeru Kec. Malili Kab. Luwu Timur ditinjau dari indikator penelitian menampung dan menyalurkan aspirasi masyarakat, pengawasan terhadap kinerja kepala desa, serta pelaporan dan evaluasi penyelenggaraan pemerintahan desa telah terlaksana dengan cukup baik. Sedangkan fungsi BPD yakni perumusan dan penetapan rancangan peraturan desa dibahas bersama kepala desa serta pemberian dana operasional yang memadai telah terlaksana dengan baik. Adapun faktor-faktor yang menghambat implementasi tugas pokok dan fungsi BPD yaitu ketersediaan sumber daya manusia, pemberian tunjangan anggota BPD serta sarana dan prasarana. \r\n','STIA AL-GAZALI BARRU',1,2022,1,1064,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1066,' Penelitian ini bertujuan untuk mengetahui pengaruh pemberian Kredit Usaha \r\nRakyat (KUR) terhadap peningkatan keuntungan usaha mikro di kecamatan barru\r\nkabupaten barru. dan untuk mengetahui seberapa besar pengaruh KUR terhadap\r\npeningkatan keuntungan usaha mikro di kecamatan barru kabupaten barru. jenis data\r\nyang digunakan adalah data kuantitatif, tipe penelitian kuantitatif, sumber data primer dan\r\nsekunder, teknik pengumpulan data observasi, kuesioner, dan dokumentasi, teknik\r\nanalisis data melalui pengolahan data SPSS yang telah di uji. \r\nHasil penelitian ini menunjukkan bahwa ada pengaruh pemberian KUR \r\nterhadap keuntungan usaha kecil di kecamatan barru kabupaten barru dan\r\npengaruhnya kuat hal ini dibuktikan dari hasil penelitian berdasarkan uji validasi\r\ndan reliabilitas semua instrumen dikatakan valid dan reliabel. Perlu bagi para\r\npelaku usaha kecil agar memanfaatkan kredit usaha rakyat yang diterima lebih\r\nbaik agar mampu mendatangkan manfaat bagi usaha yang dikelolah. ','STIA AL-GAZALI BARRU',1,2023,2,1067,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1067,'Penelitian ini adalah penelitian kuantitatif   metode survey yang bersifat\r\nkorelasional yang bertujuan untuk mengetahui seberapa besarkah pengaruh kebijakan\r\ntataniaga pupuk terhadap distributor PT. Karya Libureng di Kabupaten Barru, dan\r\nuntuk mengetahui Faktor-faktor apakah yang mempengaruhi petani dalam\r\npelaksanaan tataniaga pupuk. Variabel bebas dalam penelitian ini adalah kebijakan\r\ntataniaga pupuk, sedangkan variabel terikatnya adalah peran distributor PT. Karya\r\nLibureng. \r\nPopulasi dalam penelitian ini adalah masayarakat dan karyawan PT. Karya\r\nLibureng, dengan responden yang di peroleh 40. Teknik pengumpulan data penelitian\r\nini menggunakan angket. Teknik analisis data yang di gunakan yaitu analisis regresi\r\nlinear sederhana dan uji signifikansi. \r\nBerdasarkan hasil analisis inferensial Kebijakan tataniga pupuk terhadap\r\nperan distributor PT. Karya Libureng di Kabupaten Barru berpengaruh positif dengan\r\nregresi linear sederhana 0,076 < 0,05, dan berdasarkan sampel yang di peroleh\r\ndengan menggunakan angket, hal yang mempengaruhi petani dalam pelaksanaan \r\ntataniaga pupuk, adalah harga pupuk, harga gabah, modal, petugas penyuluh,\r\npendapatan usaha tani, pengetahuan petani terhadap informasi pupuk.','STIA AL-GAZALI BARRU',1,2023,1,1065,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1068,'Penelitian ini bertujuan untuk mengetahui Implementasi Peraturan Menteri \r\nAgraria dan Tata Ruang/Kepala Badan Pertanahan Nasional Nomor 19 Tahun 2020\r\ntentang Layanan Informasi Pertanahan Secara Elektronik Pada Kantor Pertanahan\r\nKabupaten Barru dan faktor-faktor  penghambat penerapan layanan informasi\r\npertanahan secara elekronik. Penelitian ini menggunakan jenis penelitian deskriptif\r\nkualitatif dengan sumber data diperoleh dengan cara observasi, wawancara, dan\r\ndokumentasi serta teknik analisis data melalui pengumpulan data, kondensasi data,\r\npenyajian data, dan penarikan kesimpulan/verifikasi. Hasil penelitian ini\r\nmenunjukkan bahwa Implementasi Peraturan Menteri Agraria dan Tata\r\nRuang/Kepala Badan Pertanahan Nasional Nomor 19 Tahun 2020 tentang Layanan\r\nInformasi Pertanahan Secara Elektronik pada Kantor Pertanahan Kabupaten Barru\r\nmelalui indikator Ukuran dan tujuan kebijakan, sumber daya, karakteristik agen\r\npelaksana, sikap para pelaksana, komunikasi antar organisasi dan aktivitas\r\npelaksana, dan lingkungan ekonomi, sosial dan budaya sudah cukup baik dan\r\nfaktor-faktor yang menghambat pelayanan informasi pertanahan secara elektronik\r\npada kantor pertanahan Kabupaten Barru adalah sarana dan prasarana serta sumber\r\ndaya manusia (SDM).','STIA AL-GAZALI BARRU',1,2023,1,1075,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1069,'Program CSR merupakan program yang mempunyai kepentingan yang merujuk\r\npada kewajiban-kewajiban sebuah organisasi untuk melindungi dan memberi kontribusi\r\nkepada masyarakat dimana ia berasal. CSR dapat digunakan perusahaan sebagai strategi\r\npencitraan bagi perusahaan. Tanggung jawab sosial perusahaan dilakukan bagi\r\nmasyarakat khususnya masyarakat di sekitar area perusahaan. Tujuan penelitian ini untuk\r\nmengetahui bagaimana pelaksanaan Corporate Social Responsibility (CSR) oleh PT PLN\r\nIndonesia Power Barru Dalam Meningkatkan kesejahteraan Masyarakat melalui program\r\nCSR. Berdasarkan hasil pengamatan penulis bahwa indikator dengan Tercapainya tujuan\r\nCSR ( Corporate Social Responsibility ), Adanya Pemberdayaan Ekonomi Masyarakat,\r\nAdanya Kepedulian Sosial Terhadap Lingkugan, Adanya Perhatian Terhadap\r\nLingkungan, Adanya Manfaat Dari CSR Bagi Masyarakat Sasaran, Terjadinya\r\nKomunikasi CSR Yang Baik Antara Perusahaan Dengan Masyarakat dengan kagiatan\r\nCSR (Corporate Social Responsibility ) ini, pihak perusahaan PT. PLN Indonesia Power\r\nmelibatkan masyarakat setempat serta ikut serta dalam suatu kegiatan CSR (Corporate\r\nSocial Responsibility ) perusahaan. Upaya yang dilakukan oleh perusahaan dalam\r\npelestarian lingkungan misalnya dengan cara penanaman mangrove di pinggir pantai  dan\r\npenanaman pohon, dengan adanya kegiatan CSR ini yang dilakukan perusahaan maka\r\nmasyarakat merasa diberdayakan. Jenis penelitian ini adalah kualitatif, dengan\r\npendekatan deskriptif Sumber data penelitian ini didapatkan melalui data primer dan data\r\nsekunder Penelitian ini menggunakan teknik analisa data kualitatif, terhadap konsep\r\npenelitian yakni Implementasi CSR yang diturunkan dalam beberapa kategori yakni\r\ntercapainya tujuan CSR, Adanya pemberdayaan ekonomi dan masyarakat, Adanya\r\nkepedulian sosial terhadap lingkungan, Adanya perhatian terhadap lingkungan, Adanya\r\nmanfaat dari CSR bagi Masyarakat sasaran, dan terjadinya komunikasi CSR yang baik\r\nantara Perusahaan dengan Masyarakat dan antar Perusahaan. Hasil penelitian\r\nPelaksanaan program CSR yang dilakukan oleh PT PLN Indonesia Power Barru adalah\r\nperusahaan memberikan bantuan berupa bantuan bencana banjir, bantuan pembangunan\r\nmasjid Nurul Jannah Bulu Lampoko, bantuan perbaikan lampu jalan, bantuan pembuatan\r\nusaha roti, bantuan pemeriksaan kesehatan, bantuan pemberian beasiswa berprestasi\r\nkepada anak sd, atau bantuan pemberian beberapa ekor sapi saat idul adha.\r\n','STIA AL-GAZALI BARRU',1,2023,1,1070,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1070,'Penelitian ini bertujuan untuk mengetahui Implementasi Penggunaan Aplikasi\r\nPengaduan Masyarakat (ALPUKAT) di KORAMIL 1405- 06/Barru, faktor–faktor\r\nyang mempengaruhi Implementasi Penggunaan Aplikasi Pengaduan Masyarakat\r\n(ALPUKAT) di KORAMIL 1405-06/Barru. Jenis penelitian ini adalah kualitatif\r\ndeskriptif, subjek penelitian yang diperoleh dengan cara: observasi, wawancara,\r\ndan dokumentasi. Pemeriksaan keabsahan datanya adalah uji kredibilitas, uji\r\nketeralihan, uji kebergantungan, dan uji kepastian. Teknik analisis datanya yaitu\r\npengumpulan data, reduksi data, penyajian data, dan penarikan kesimpulan atau\r\nverifikasi. \r\n      Hasil penelitian ini menunjukkan bahwa implementasi penggunaan aplikasi\r\npengaduan masyarakat (ALPUKAT) di KORAMIL 1405-06/Barru melalui \r\nindikator sudah terimplementasikan dengan baik, namun masih ada beberapa\r\nindikator yang belum optimal seperti sumber daya yang masih perlu ditinjau\r\nkembali demi kelancaran pengimpelemtasian penggunaan aplikasi ini, sedangkan\r\nfaktor-faktor yang mempengaruhi penggunaan aplikasi pengaduan masyarakat\r\n(ALPUKAT) di KORAMIL 1405-06/Barru yaitu faktor yang terletak pada\r\nrumusan kebijakan, faktor yang terletak pada personil pelaksana, dan faktor yang\r\nterletak pada sistem organisasi pelaksana.','STIA AL-GAZALI BARRU',1,2023,2,1069,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1071,'Penelitian ini bertujuan untuk mengetahui implementasi dan faktor\r\npenghambat program inovasi LANCAR D‟DUKCAPIL 7311 dalam pelayanan\r\nadministrasi kependudukan pada Dinas Kependudukan dan Pencatatan Sipil\r\nKabupaten Barru. Jenis penelitian ini adalah kualitatif deskriptif, lokasi penelitian\r\npada kantor Dinas Kependudukan dan Pencatatan Sipil. Teknik pengumpulan data\r\ndiperoleh dengan observasi, wawancara, dan dokumentasi. Teknik Analisis data\r\ndilakukan dengan pengumpulan data, reduksi data, penyajian data dan penarikan\r\nkesimpulan atau verifikasi. \r\n      Hasil penelitian ini menunjukkan bahwa implementasi program inovasi\r\nLANCAR D‟DUKCAPIL dalam pelayanan administrasi kependudukan pada\r\nDinas Kependudukan dan Pencatatan Sipil Kabupaten Barru sudah berjalan\r\ndengan baik dengan terpenuhinya indikator penelitian yaitu komunikasi, sumber\r\ndaya, disposisi dan struktur birokrasi, sedangkan faktor penghambat dalam\r\nprogram inovasi LANCAR D‟DUKCAPIL 7311 yaitu isi kebijakan, informasi,\r\ndukungan masyarakat dan pembagian potensi.','STIA AL-GAZALI BARRU',1,2023,2,1068,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1072,'Penelitian ini bertujuan untuk mengetahui: Tingkat partisipasi masyarakat dalam\r\npembangunan di Desa Kading Kecamatan Tanete Riaja Kabupaten Barru. Dan untuk\r\nmengetahui faktor-faktor yang mempengaruhi tingkat partisipasi masyarakat dalam\r\npembangunan di Desa Kading Kecamatan Tanete Riaja Kabupaten Barru. Sumber data\r\ndiperoleh dengan cara Survey, Wawancara, Kuisioner. Dukumentasi Analisis Data\r\nMenggunakan Skala Likert. \r\nHasil penelitian ini menunjukkan bahwa Tingkat partisipasi masyarakat dalam\r\npembangunan desa di desa Kading  yaitu dilihat keempat bidang partisipasi yaitu\r\nperencanan mencapai skor 58.6 persen atau berada pada kategori sedang, pelaksanaan\r\nmencapai skor 75.3 persen atau berada pada kategori tinggi, evaluasi/monitoring 77.4\r\npersen berada pada kategori tinggi, dan pemanfaatan hasil 81.8 persen berada pada\r\nkategori sangat tinggi. Skor partisipasi masyarakat dalam pembangunan desa di desa\r\nkading tergolong pada kategori tinggi yang dibuktikan oleh skor gabungan bidang-bidang\r\npartisipasi rata-rata 77.3 persen, hal ini membuktikan bahwa partisipasi masyarakat dalam\r\npembangunan desa di desa kading tergolong tinggi. Adapun yang mempengaruhi\r\npartisipasi masyarakat dalam pembangunan desa di desa kading  adalah: faktor interen\r\nyang meliputi (kesadaran/kemauan, pendidikan, pendapatan/penghasilan). Faktor\r\neksternal yang meliputi (pemerintah dan fasilitas yang tersedia).','STIA AL-GAZALI BARRU',1,2019,1,1071,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1073,'Penelitian ini bertujuan untuk mengetahui Persepsi Masyarakat Terhadap Pelayanan \r\nPembuatan Surat Keterangan Catatan Kepolisian (SKCK) Secara Online Pada Mal\r\nPelayanan Publik (MPP) di Kabupaten Barru. dan untuk mengetahui faktor-faktor yang\r\nmenghambat Pelayanan Pembuatan Surat Keterangan Catatan Kepolisian (SKCK) Secara\r\nOnline Pada Mal Pelayanan Publik (MPP) di Kabupaten Barru. jenis data, sumber data,\r\ndata skunder dan data primer diperoleh dengan cara observasi, Wawancara, dan\r\nDokumentasi, analisis data, dan pengumpulan data \r\nHasil penelitian ini menunjukkan bahwa Persepsi masyarakat sudah cukup baik hal \r\nini dibuktikan dari indikator Reability (kehandalan), Assurance (jaminan), dan empaty\r\n(empati) hanya saja yang masih perlu ditingkatkan lagi adalah terdapat pada indikator\r\nTangible (berwujud), dan Responsivess (tanggapan) dan adapun Faktor-faktor penghambat\r\npelayanan SKCK online di Polres Barru yang ada pada Mal Pelayanan Publik(MPP) di\r\nKabupaten Barru yaitu Sarana dan prasarana belum memadai untuk digunakan, Anggaran\r\nmasih kurang, Daya listri kurang, SDM yang masih minim, dan kurang sosialisasi kepada\r\nmasyarakat.','STIA AL-GAZALI BARRU',1,2022,2,1072,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1074,'Marsani, 20171169, Tingkat Capaian Sasaran Kinerja Pegawai Di Lingkup \r\nSekretariat Dewan Perwakilan Rakyat Daerah Kota Parepare, Pembimbing: Rasidin Calundu,  dan Fitrianti. \r\n        Penelitian ini bertujuan untuk mengetahui tingkat capaian sasaran kinerja pegawai di lingkup Sekretariat Dewan Perwakilan Rakyat Daerah Kota Parepare, bagaimana pengaruhnya terhadap peningkatan kinerja serta faktor-faktor penghambat apa saja yang ditemukan dalam upaya meningkatkan kinerja pegawai. Sumber data diperoleh dengan cara survey, observasi dan wawancara.  \r\n        Dari penelitian ini diperoleh kesimpulan bahwa tingkat capaian kinerja pegawai Sekretariat Dewan Perwakilan Rakyat Daerah Kota Parepare, masuk dalam kategori baik. Akan tetapi capaian tersebut tidak berpengaruh signifikan terhadap meningkatnya kinerja pegawai. Hal tersebut terjadi karena adanya sejumlah faktor penghambat, antara lain; pola komunikasi yang tidak efektif, hubungan antar pegawai yang kurang harmonis serta ketidakjelasan reward atau penghargaan yang diberikan atas kinerja para pegawai.  \r\n','STIA AL-GAZALI BARRU',1,2022,1,1073,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1075,'Penelitian ini bertujuan untuk mengetahui:  Implementasi Kebijakan Pemerintah\r\nDesa dalam Pemeliharaan dan Penertiban Ternak di Desa Bulo-Bulo Kecamatan\r\nPujananting Kabupaten Barru dan Untuk mengetahui faktor-faktor yang\r\nmenghambat Implementasi Kebijakan Pemerintah Desa dalam Pemeliharaan dan\r\nPenertiban Ternak di Desa Bulo-bulo Kecamatan Pujananting Kabupaten Barru.\r\nMetode Penelitian yang digunakan adalah Metode Penelitian Kualitatif, Sumber\r\ndata diperoleh dengan cara Observasi, Wawancara, dan Dokumentasi. Teknik\r\nAnalisis data menggunakan pengumpulan data, Reduksi data, Penyajian data, dan\r\nPenarikan kesimpulan. Hasil penelitian menunjukan Implementasi Kebijakan\r\nPemerintah desa dalam Pemeliharaan dan penertiban Ternak di Desa Bulo-bulo\r\nKecamatan Pujananting Kabupaten Barru pada analisis data dengan baik melalui\r\nindikator penelitian kebijakan tersebut, telah terimplementasi namun masih\r\nterdapat beberapa indikator yang perlu diperhatikan terutama pada sumber daya\r\ndemi kelancaran Kebijakan Pemerintah desa dalam pemeliharaan dan penertiban\r\nternak di Desa Bulo-Bulo Kecamatan Pujananting Kabupaten Barru. Faktor-faktor\r\nyang menghambat dalam proses kebijakan ada 3 indikator perumusan kebijakan,\r\npersonil pelaksanan, Sistem Organisasi. Dalam hal yaitu faktor dari segi rumusan\r\nkebijakan tentang berbedanya pendapat penyelenggara mengenai sanksi\r\nkebijakan. Faktor dari segi personil sebagai yang terlibat dalam kebijakan,\r\nbanyaknya masyarakat yang tak mampu melaksanakan kebijakan atau hanya\r\nmembiarkan ternaknya berkeluyuran di hutan. Faktor sistem organisasi yaitu\r\nluasnya wilayah Desa Bulo-Bulo sehingga banyak ruang bagi masyarakat untuk\r\ntidak membuat kandang. Sedangkan kendala masyarakat yaitu kurangnya pakan\r\nuntuk ternak sehingga melepas ternak kehutan untuk bertahan hidup, dan\r\nmasyrakat mengelola perkebunan sehingga tidak sempat untuk memberi pakan\r\nternaknya.','STIA AL-GAZALI BARRU',1,2023,2,1074,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1076,'Penelitian ini bertujuan untuk mengetahui analisis tingkat kepuasan\r\nnasabah dalam penetapan tarif jasa agen brilink dalam layanan nasabah di desa\r\nmattirowalie kecamatan tanete riaja kabupaten barru. Jenis data yang digunakan\r\nadalah deskriptif kuantitatif, sumber data yaitu data primer dan data sekunder.\r\nteknik pengumpulan data dengan cara observasi, kuesioner dan dokumentasi.\r\nTeknis analisis data dengan cara uji validitas, reliabilitas dan analisis deskriptif \r\nserta penarikan kesimpulan.\r\nHasil penelitian ini menunjukkan bahwa Ada pengaruh besar terhadap\r\nkepuasan nasabah BRILink berdasarkan persepsi harga yang ditetapkan oleh agen\r\nBRILink dan kualitas pelayanan di Desa Mattirowalie Kecamatan Tanete Riaja\r\nKabupaten Barru. Dimana Hasil ini didapatkan dari perhitungan SPSS,\r\ndibandingkan dengan r tabel dicari pada signifikansi 0,01 dan jumlah data (n)=50,\r\nmaka r tabel sebesar 0,3542 (tabel r product moment). Maka nilai R hitung lebih\r\nbesar dari R tabel untuk semua item yang diteliti.','STIA AL-GAZALI BARRU',1,2023,1,1077,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1077,'Penelitian ini bertujuan Untuk mengetahui bagaimana Implementasi Sustainable\r\nDevelopment Goals (SDGs ) dalam bidang kesehatan pencegahan Stunting di\r\nDesa Sadar Kecamatan Tellu Limpoe Kabupaten Bone dan juga Untuk\r\nmengetahui faktor yang menghambat Implementasi Sustainable Development\r\nGoals (SDGs ) dalam Bidang Kesehatan Pencegahan Stunting di Desa Sadar\r\nKecamatan Tellu Limpoe Kabupaten Bone. Penelitian ini menggunakan tipe\r\npenelitian deskriptif kualitatif dengan sumber data yang di peroleh dengan cara\r\nObservasi, Wawancara, dan Dokumentasi. Analisis data menggunakan Model\r\nImplementasi G. Edward III. Hasil penelitian menunjukan bahwa Implementasi\r\nSustainable Devolepment Goals (SDGs) dalam pencegahan Stunting di Desa\r\nSadar Kecamatan Tellu Limpoe Kabupaten Bone cukup efektif dalam\r\nmenjalankan program SDGs yang di implementasikan untuk melakukan\r\npencegahan Stunting. Dengan Indikator Komunikasi, Sumber daya, disposisi dan\r\nStruktur Birokrasi, Implementasi Sustainable Development Goals (SDGs)  Dalam\r\nBidang Kesehatan Pencegahan Stunting Di Desa Sadar Kecamatan Tellu Limpoe\r\nKabupaten Bone sudah berjalan dengan baik namun pelaksanaanya belum efesien\r\nkarena terkendala pada sumber daya pendanaan, karena hal tersebutlah yang\r\nmenjadi penunjang dalam pengimplementasian program. ada dua faktor yang\r\nmenjadi penghambat implementasi Sustainable Development Goals (SDGs) \r\nDalam Bidang Kesehatan Pencegahan Stunting yaitu faktor kurangnya pendidikan\r\ndan edukasi yang disebabkan oleh tidak adanya pendidikan secara personal dan\r\nfaktor kedua yaitu faktor pendanaan dimana dana Desa saja tidak cukup untuk\r\nmenunjang pelaksanaan program Sustainable Development Goals (SDGs)  Dalam\r\nBidang Kesehatan Pencegahan Stunting.','STIA AL-GAZALI BARRU',1,2023,2,1076,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1078,'Penelitian ini bertujuan untuk mengetahui implementasi sistem informasi\r\npenelusuran perkara (SIPP) sebagai sarana pelayanan berbasis e-service dan faktor yang\r\nmenjadi kendala implementasi sistem informasi penelusuran perkara (SIPP) sebagai\r\nsarana pelayanan berbasis e-service di Kantor Pengadilan Agama Barru. Penelitian ini\r\nmenggunakan metode penelitian kualitatif, teknik pengumpulan data melalui observasi,\r\nwawancara dan dokumentasi. Teknis analisis data menggunakan pengumpulan data,\r\nreduksi data, penyajian data, dan penarikan kesimpulan. Hasil penelitian ini menunjukkan\r\nbahwa implementasi sistem informasi penelusuran perkara (SIPP) di Pengadilan Agama\r\nBarru dilihat dari 4 (empat) indikator implementasi kebijakan menurut George C.\r\nEdward, dari indikator sumber daya, disposisi dan struktur birokrasi telah berjalan dengan\r\nbaik. Akan tetapi dari indikator komunikasi masih kurang dan harus ditingkatkan. Faktor\r\nyang menjadi kendala dalam implementasi sistem informasi penelusuran perkara (SIPP)\r\nsebagai sarana pelayanan peradilan berbasis e-service di Pengadilan Agama Barru yaitu\r\nkondisi jaringan tidak stabil dan minimnya pengetahuan masyarakat tentang SIPP.','STIA AL-GAZALI BARRU',1,2023,2,1078,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1079,'Penelitian ini bertujuan untuk mengetahui: Implementasi kebijakan izin keramaian \r\ndalam upaya penertiban kegiatan masyrakat di kecamatan Tanete Riaja kabupaten Barru. Dan\r\nuntuk mengetahui faktor-faktor yang menghambat dalam Implementasi kebijakan izin\r\nkeramaian dalam upaya penertiban kegiatan masyrakat di kecamatan Tanete Riaja kabupaten\r\nBarru.\r\nPenelitian ini menggunakan tipe penelitian deskriptif kualitatif. Jenis data yang \r\ndigunakan adalah data kualitatif. Sumber data primer dan sekunder dengan teknik\r\npengumpulan data berupa observasi, wawancara dan dokumentasi. Analisis data melalui tahap\r\nreduksi data.\r\n Hasil penelitian ini menunjukkan bahwa implementasi kebijakan izin keramaian dalam\r\nupaya penertiban kegiatan masyarakat di polsek Tanete Riaja Kabupaten Barru berjalan sesuai\r\nPP RI No. 60 Tahun 2017, Namun belum maksimal dapat dilihat berdasasrkan indikatorindikator\r\n\r\n yaitu komunikasi,sumberdaya,disposisi,dan struktur organisasi. Adapun faktorfaktor\r\n\r\nyang menghambat implementasi kebijakan izin keramaian dalam upaya penertiban\r\nkegiatan masyarakat di Polsek Kecamatan Tanete Riaja Kabupaten Barru yaitu: pengurusan\r\nsurat izin keramaian melalui perantara, mengurus surat izin keramaian pada hari libur kerja,\r\nmengurus surat izin keramaian tepat pada acara atau kegiatan di selenggarakan.','STIA AL-GAZALI BARRU',1,2021,2,1079,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1080,'Penelitian ini bertujuan untuk mengetahui strategi pengelolaan aset desa berbasis\r\naplikasi sistem pengelolaan aset desa (SIPADES) di kantor Desa Harapan\r\nKecamatan Tanete Riaja Kabupaten Barru dan juga mengetahui faktor apa saja\r\nyang menghambat strategi pengelolaan aset desa berbasis aplikasi sistem \r\npengelolaan aset desa (SIPADES) di kantor Desa Harapan Kecamatan Tanete \r\nRiaja Kabupaten Barru. Penelitian ini menggunakan tipe  penelitian deskriftif\r\nkualitatif  dengan sumber data yang di peroleh dengan cara Observasi,\r\nWawancara, dan Dokumentasi. Analisis data menggunakan model Nurdinawati.\r\nHasil penelitian ini menunjukkan bahwa pelaksanaan Strategi Pengelolaan Aset\r\nDesa Berbasis Aplikasi Sistem Pengelolaan Aset Desa (SIPADES) Di Kantor\r\nDesa Harapan Kecamatan Tanete Riaja Kabupaten Barru melalui indikator\r\npenelitian Asas Fungsional, Kepastian Hukum, Efisiensi, Asas Akuntabilitas,\r\nAsas Kepastian Hukum, belum terlaksana dengan baik sehingga di perlukan\r\npeninjauan kembali terutama pada upgrade aplikasi yang bisa diakses tanpa\r\njaringan atau Offline demi terwujudnya asas serta maksud dan tujuan dari\r\npeluncuran Aplikasi pengelolaan Aset Desa Berbasis Aplikasi Sistem Pengelolaan\r\nAset Desa Di kantor Desa Harapan Kecamatan Tanete Riaja Kabupaten Barru. ','STIA AL-GAZALI BARRU',1,2023,2,1081,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1081,'Penelitian ini bertujuan untuk mengetahui, Kualitas Pelayanan Vaksinasi \r\nCovod-19 Di Desa Lasitae Kecamatan Tanete Rilau Kabupaten Barru. Sedangkan\r\nfaktor-faktor yang menghambat Kualitas Pelayanan Vaksinasi Covid-19 Di Desa\r\nLasitae Kecamatan Tanete Rilau Kabupaten Barru. Tipe penelitian yang digunakan\r\nyaitu tipe penelitian kualitatif dan sumber data yang di peroleh dengan cara Observasi,\r\nwawancara, dan dokumentasi. Adapun teknik yang digunakan dalam menganaisis data\r\nseperti, tahap pengumpulan data, reduksi data, penyajian data, penarikan kesimpulan\r\ndan klarifikasi.\r\n\r\nHasil penelitian ini menunjukkan bahwa Kuaitas Pelayanan Vaksinasi Covid-\r\n19 Di Desa Lasitae Kecamatan Tanete Rilau Kabupaten Barru sudah berjalan cukup\r\nbaik dengan menggunkan indikator penelitian seperti, Bukti fisik, Keandalan, Daya\r\ntanggap, Jaminan, dan Empati. Sedangkan faktor-faktor yang menghambat yaitu,\r\nkecemasan masyarakat terhadap efek samping vaksin, kurangnya sosialisasi, sistem\r\nkerja yang tidak memadai, keraguguan masyarakat terkait kehalalan vaksin.','STIA AL-GAZALI BARRU',1,2022,2,1082,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1082,'Kabupaten Pangkep. Pembimbing : Kamaruddin Hasan dan M. Alwi A.\r\nBuraerah.\r\nPenelitian ini bertujuan untuk mengetahui: Kebijakan pemerintah desa\r\ndalam pemberian bantuan dana duka bagi masyarakat di Desa Panrenreng\r\nKecamatan Segeri Kabupaten Pangkep. Untuk mengetahui faktor penghambat\r\ndalam pemberian bantuan dana duka bagi masyarakat di Desa Parenreng\r\nKecamatan Segeri Kabupaten Pangkep. Metode yang digunakan pada penelitian\r\nini adalah kualitatif, teknik pengumpulan data terdiri dari observasi, wawancara\r\ndan dokumentasi.\r\nHasil dari penelitian ini menunjukkan bahwa kebijakan pemerintah desa\r\ndalam pemberian bantuan dana duka bagi masyarakat di Desa Parenreng\r\nKecamatan Segeri Kabupaten Pangkep cukup baik dalam pelaksanaannya.\r\nKesimpulan ini didasarkan atas terpenuhinya seluruh indikator penelitian yaitu\r\nkomunikasi, sumber daya, disposisi, dan birokrasi. Faktor penghambat dalam\r\npemberian bantuan dana duka bagi masyarakat di Desa Parenreng adalah proses\r\npencairan dana duka yang lambat dan jumlah dana yang diberikan kepada\r\npenerima masih kurang. \r\nKata kunci: Kebijakan, Program Bantuan Dana Duka, Masyarakat.','STIA AL-GAZALI BARRU',1,2023,2,1083,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1083,'Fadilah. 20171046. Implementasi Sistem Pengelolaan Pengaduan Pelayanan Publik (SP4N) Layanan Aspirasi dan Pengaduan Online Rakyat (LAPOR) pada Inspektorat Pemerintah Kabupaten Barru. Pembimbing : H. Kamaruddin Hasan dan Masyitah. \r\nPenelitian ini bertujuan untuk mengetahui Implementasi Sistem Pengelolaan Pengaduan Pelayanan Publik (SP4N) Layanan Aspirasi dan Pengaduan Online Rakyat (LAPOR). Dan untuk mengetahui faktor-faktor yang mempengaruhi Implementasi Sistem Pengelolaan Pengaduan Pelayanan Publik (SP4N) Layanan Aspirasi dan Pengaduan Online Rakyat (LAPOR) pada Inspektorat Pemerintah Kabupaten Barru. Penelitian ini menggunakan tipe penelitian deskriptif kualitatif, sumber data terdiri dari data primer dan data sekunder, teknik pengumpulan data meliputi observasi, wawancara, dan dokumentasi. \r\nHasil penelitian ini menunjukkan bahwa implementasi aplikasai SP4N-LAPOR sudah terimplementasi guna meningkatkan kualitas pelayanan publik yang lebih baik dengan indikator penelitian menurut Edwards yaitu komunikasi, sumber daya, disposisi dan struktur birokrasi. Sedangkan faktor-faktor yang mempengaruhi implementasi SP4NLAPOR terbagi menjadi dua yaitu faktor penghambat yang meliputi sarana dan prasarana, data dan informasi, komunikasi serta anggaran dan faktor pendorong meliputi sumber daya manusia, komitmen kerja dan sosialisasi. \r\n','STIA AL-GAZALI BARRU',1,2021,1,1084,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1084,'Penelitian ini bertujuan untuk mengetahui : Transparansi dan Akuntabilitaspengelolaan dana desa di Desa Pujananting Kecamatan Pujananting KabupatenBarru. Sumber data dalam penelitian ini diperoleh dengan cara observasi,wawancara, dan dokumentasi. Metode penelitian dengan menggunakan deskripsikualitatif. Berdasarkan hasil penelitian yang telah dilakukan menunjukanTransparansi pengelolaan dana desa di Desa Pujananting Kecamatan PujanantingKabupaten Barru sudah sesuai dengan peraturan yang ada, yakni adanya pelaporansetiap awal tahun untuk mengapresiasi ide atau keluhan warga, selalu\r\nmenginformasikan secara tertulis jumlah dana yang didapat dari pemerintah, sertadanya papan-papan informasi mengenai kegiatan pembangunan yang sedang di\r\nkerjakan. Oleh sebab itu Desa Pujananting dapat dikatakan Transparan dalampengelolaan alokasi dana. Akuntabilitas pengelolaan dana desa di Desa PujanantingKecamatan Pujananting Kabupaten Barru yang terdiri dari penatausahaan, pelaporandan pertanggungjawaban dapat di katakana telah berjalan sesuai dengan aturan danUU No 06 Tahun 2014 tentang Desa.','STIA AL-GAZALI BARRU',1,2022,2,1086,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1085,'Penelitian ini bertujuan untuk mengetahui bahwa  Implementasi Kajian\r\nPemanfaatan Ruang Kawasan Pesisir Yang Berwawasan Lingkungan Di Dinas\r\nPerikanan Kabupaten Pangkep. Penelitian ini menggunakan metode data primer\r\ndan sekunder yang selanjutnya diolah secara analisis deskriptif dengan\r\npendekatan kualitatif. Adapun hasil yang diperoleh dari penelitian ini yaitu\r\nperencanaan yang cukup baik untuk masyarakat pesisir Kabupaten Pangkep yaitu\r\nterwujudnya kesejahteraan masyarakat pesisir. Adapun kesimpulannya yaitu\r\nkurangnya kerja sama antara masyarakat dengan pihak pemerintah sehingga\r\ntujuan yang ingin dicapai, tidak tercapai dengan baik. Sehingga berdampak pada\r\nekonomi masyarakat pesisir. Adapun upaya yang dilakukan Dinas Perikanan\r\nKabupaten Pangkep dalam mengimplementasikan Pemanfaatan Ruang Kawasan\r\nPesisir di Kabupaten Pangkep yaitu melalui perencanaan yang baik kemudian\r\ndilaksanakan dengan baik, dan tetap diawasi dan dievaluasi oleh pihak Pemerintah\r\nKabupaten Pangkep, apakah sudah sesuai dengan Kebutuhan Masyarakat Pesisir.  ','STIA AL-GAZALI BARRU',1,2023,2,1085,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1086,'Penelitian ini bertujuan untuk mengetahui: Implementasi program pelayanan Surat Izin Mengemudi (SIM) keliling pada satuan lalu lintas Polres Barru di Kabupaten Barru dan Faktor-faktor yang mempengaruhi dalam implementasi program pelayanan Surat Izin Mengemudi (SIM) keliling pada satuan lalu lintas Polres Barru di Kabupaten Barru. Sumber data diperoleh dengan cara observasi, wawancara secara mendalam, dan dokumentasi. Metode penelitian dengan menggunakan Deskripsi Kualitatif.\r\n\r\nBerdasarkan hasil penelitian menunjukan bahwa, Implementasi program pelayanan SIM keliling telah dijalankan sesuai dengan standar operasional prosedur dan dapat dikatakan telah berjalan dengan cukup baik sesuai dengan faktor komunikasi, faktor sumber daya, faktor disposisi, dan faktor struktur birokrasi. Faktor penghambat dalam proses pelayanan yaitu Adanya kebijakan yang terkadang tidak sesuai dengan keadaan sesungguhnya, informan dalam hal ini pemegang peran yang terlibat langsung dalam proses pelaksanaan pelayanan justru tidak ada ataupun kurang, kendala sarana dan prasana yang kurang memadai seperti kursi tunggu terbatas, keramahan dalam pelayanan kurang dan adanya Covid-19.','STIA AL-GAZALI BARRU',1,2022,2,1089,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1087,'Andi Firdawiyah. 20181119. Pengaruh Disiplin Kerja Terhadap Kinerja \r\nPegawai Subbagian Rumah Tangga Dan Perlengkapan Pada Sekretariat  Daerah\r\nKabupaten Barru. Dibimbing oleh A. Pananrangi M dan H. Ismail Hannanong.\r\nPenelitian ini bertujuan untuk mengetahui pengaruh disiplin kerja terhadap\r\nkinerja pegawai Subbagian Rumah Tangga dan Perlengkapan pada Sekretariat \r\nDaerah Kabupaten Barru. Selain itu juga bertujuan untuk mengetahui seberapa\r\nbesar pengaruh disiplin kerja terhadap kinerja pegawai Subbagian Rumah Tangga\r\ndan Perlengkapan pada Sekretariat  Daerah Kabupaten Barru. Tipe penelitian yang\r\ndigunakan adalah kuantitatif. Jenis data yaitu data kuantitatif. Sumber data adalah\r\ndata primer dan data sekunder, Sumber data diperoleh dengan cara kuesioner dan\r\ndokumentasi. Untuk memudahkan analisis data menggunakan aplikasi SPSS Versi\r\n22.0.\r\nHasil penelitian ini menunjukkan bahwa Disiplin kerja berpengaruh secara\r\nsignifikan terhadap kinerja pegawai subbagian rumah tangga dan perlengkapan di\r\nSekretariat Daerah Kabupaten Barru kemudian Jumlah pengaruh disiplin kerja\r\nterhadap kinerja pegawai subbagian rumah tangga dan perlengkapan di Sekretariat\r\nDaerah Kabupaten Barru adalah sebsesar 61,7%.','STIA AL-GAZALI BARRU',1,2023,1,1080,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1088,' Penelitian ini bertujuan untuk mengetahui implementasi program pencegahan kematian ibu\r\ndan bayi di Puskesmas  Segeri Kecamatan Segeri Kabupaten Pangkep.  Selain itu juga bertujuan\r\nuntuk mengetahui faktor-faktor yang berpengaruh terhadap implementasi program pencegahan\r\nkematian ibu dan bayi di Puskesmas  Segeri Kecamatan Segeri Kabupaten Pangkep Tipe penelitian\r\nyang digunakan adalah kualitatif. Jenis data adalah kualitatif dan sumber data adalah data primer\r\ndan data skunder. Teknik pengumpulan data diperoleh dengan cara  observasi, wawancara dan\r\ndokumentasi. Kemudian teknik analisis data adalah a. Pengumpulan Data (Data Collection), b.\r\nReduksi Data (Data Reduction), c. Penyajian Data (Data Display), dan d. Penarikan\r\nKesimpulan/Verifikasi (Conclution Drawing/Verification). \r\n         Hasil penelitian menunjukan bahwa Implementasi program pencegahan kematian ibu dan bayi\r\ndi Puskesmas Segeri Kecamatan Segeri Kabupaten Pangkep  sudah berjalan dengan baik.\r\nKesimpulan ini didasarkan atas terpenuhinya seluruh indikator penelitian seperti: pencegahan\r\nkomplikasi kehamilan ibu hamil, perencanaan persalinan ibu hamil, pelayanan kesehatan ibu nifas,\r\ndan perawatan bayi. Kemudian faktor-faktor yang mempengaruhi program pencegahan kematian\r\nibu dan bayi di Puskesmas Segeri Kecamatan Segeri Kabupaten Pangkep  adalah faktor internal\r\nyang meliputi pengetahuan, sikap, dukungan keluarga dan nilai atau norma yang berlaku pada ibu\r\nhamil.  Kemudian faktor eksternal yang meliputi sikap dan prilaku dan kemampuan suber daya\r\nmanusia petugas kesehatan dan ketersediaan fasilitas kesehatan.','STIA AL-GAZALI BARRU',1,2023,2,1088,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1089,'Penelitian ini bertujuan untuk mengetahui Implementasi Sistem Rujukan\r\nOnline Badan Penyelenggara Jaminan Sosial (BPJS) Kesehatan Di Puskesmas\r\nPalakka Kecamatan Barru Kabupaten Barru dan faktor-faktor yang menjadi\r\npenghambat Implementasi Sistem Rujukan Online Badan Penyelenggara Jaminan\r\nSosial (BPJS) Kesehatan Di Puskesmas Palakka Kecamatan Barru Kabupaten\r\nBarru. Penelitian ini menggunakan metode penelitiandeskriptif kualitatif, teknik\r\npengumpulan data melalui observasi, wawancara dan dokumentasi.Teknis analisis\r\ndata menggunakan pengumpulan data, reduksi data, penyajian data, dan penarikan\r\nkesimpulan.\r\nHasil penelitian ini menunjukkan bahwa Implementasi Sistem Rujukan\r\nOnine Badan Penyelenggara Jaminan Sosial (BPJS) Kesehatan Di Puskesmas\r\nPalakka Kecamatan Barru Kabupaten Barru dilihat dari 4 (empat) aspek atau\r\nindikator Implementasi Kebijakan menurut George C. Edward III diantaranya\r\nkomunikasi, sumber daya, disposisi dan struktur birokrasi telah berjalan dengan\r\nbaik. Faktor-faktor yang menjadi penghambat dalam Implementasi Sistem\r\nRujukan Online Badan Penyelenggara Jaminan Sosial (BPJS) Kesehatan Di\r\nPuskesmas Palakka Kecamatan Barru Kabupaten Barru adalah faktor informasi\r\ndan faktor dukungan.','STIA AL-GAZALI BARRU',1,2023,1,1087,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1090,'Penelitian ini bertujuan untuk mengetahui kepuasan Pasien Terhadap Pelayanan\r\nIGD di Rumah Sakit Universitas Hasanuddin, dan untuk mengetahui faktor-faktor\r\nyang mempengaruhi kepuasan masyarakat terhadap pelayanan IGD rumah sakit\r\nUniversitas Hasanuddin. Jenis penelitian yang digunakan dalam penelitian ini adalah\r\npenelitian deskriptif kualitatif. Subjek dalam penelitian ini adalah pasien peserta\r\nBadan Penyelenggara Jaminan Sosial (BPJS) dan Non-BPJS. Teknik pengumpulan\r\ndata dilakukan dengan 3 metode yaitu wawancara, observasi, dan dokumentasi.\r\nKemudian untuk analisis data dilakukan dengan 3 tahap, yaitu kondensasi data,\r\npenyajian data dan penarikan kesimpulan/verifikasi. Selanjutnya untuk pemeriksaan\r\nkeabsahan data dilakukan dengan Uji kredibilitas, Uji ketergantungan, Uji\r\ntransferabilitas, Uji Konfirmabilitas. Hasil penelitian ini menunjukkan bahwa\r\nkepuasan masyarakat dalam mendapatkan pelayanan di Instalasi Gawat Darurat\r\n(IGD) pada pasien peserta Badan Penyelenggara Jaminan Sosial (BPJS) dan NonBPJS\r\ndilihat\r\ndari\r\n5\r\ndimensi\r\nyaitu\r\nKeandalan,\r\nDaya\r\nTanggap,\r\nJaminan,\r\nEmpati,\r\ndan\r\n\r\nBukti\r\n\r\nFisik dapat dikatakan cukup memuaskan. Adapun faktor-faktor yang\r\nmempengaruhi kepuasan masyarakat terhadap pelayanan IGD RSUH meliputi\r\nkenyamanan, hubungan pasien dengan petugas rumah sakit, kompetensi teknis\r\npetugas, dan biaya.','STIA AL-GAZALI BARRU',1,2020,1,1090,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1091,'Penelitian ini bertujuan untuk mengetahui Tingkat kepuasan masyarakat\r\nterhadap pelayanan pemberian bantuan sosial di Desa Cilellang Kecamatan\r\nMallusetasi Kabupaten Barru Dan faktor-faktor yang mempengaruhi tingkat\r\nkepuasan dan ketidakpuasan masyarakat terhadap pelayanan pemberian bantuan\r\nsosial di Desa Cilellang Kecamatan Mallusetasi Kabupaten Barru. Dengan\r\nmenggunakan metode kuantitatif dan sumber data primer dan sekunder yang\r\ndiperoleh dengan teknik Observasi, Wawancara, Dokumentasi, dan Kuesioner.\r\nAnalisis data menggunakan SPSS 17.0.  \r\n Hasil penelitian menunjukkan bahwa Tingkat kepuasan masyarakat terhadap\r\npelayanan pemberian bantuan sosial di Desa Cilellang Kecamatan Mallusetasi\r\nKabupaten Barru dapat dilihat pada 5 indikator kepuasan masyarakat yaitu bukti\r\nlangsung mencapai skor 83% atau berada pada kategori tinggi, kehandalan mencapai\r\nskor 66% atau berada pada kategori sedang, daya tanggap mencapai skor 77% atau\r\nberada pada kategori sedang, jaminan mencapai skor 20% atau berada pada kategori\r\nsangat rendah dan empati mencapai skor 72% atau berada pada kategori sedang.\r\nSedangkan kepuasan masyarakat terhadap pelayanan pemberian bantuan sosial di\r\nDesa Cilellang mencapai skor 64% atau tergolong pada kategori sedang. Dan faktorfaktor\r\nyang\r\nmempengaruhi\r\ntingkat\r\nkepuasan\r\ndan\r\nketidakpuasan\r\nmasyarakat\r\nterhadap\r\n\r\npelayanan\r\n\r\npemberian bantuan sosial di Desa Cilellang yaitu: perencanan mencapai\r\nskor 80% atau berada pada kategori tinggi, koordinasi mencapai skor 80% atau\r\nberada pada kategori tinggi, pengawasan mencapai skor 68% atau berada pada\r\nkategori sedang dan kepemimpinan mencapai skor 65% atau berada pada kategori\r\nsedang. Sedangkan faktor-faktor yang mempengaruhi tingkat kepuasan dan\r\nketidakpuasan masyarakat mencapai skor 73,95% atau berada pada kategori sedang.','STIA AL-GAZALI BARRU',1,2022,2,1091,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1092,'Penelitian ini bertujuan untuk mengetahui Penerapan Aplikasi Sistem Informasi Pengawasan\r\nNikah (SIP Nikah) di Kantor Urusan Agama Kecamatan Buntu Batu Kabupaten Enrekang.\r\nSelain itu penelitian ini juga bertujuan untuk mengetahui pemanfaatan Aplikasi Sistem\r\nInformasi Pengawasan Nikah (SIP Nikah) di Kantor Urusan Agama Kecamatan Buntu Batu\r\nKabupaten Enrekang. Tipe penelitian yang digunakan adalah deskriptif kualitatif. Sumber\r\ndata diperoleh melalui observasi, wawancara, dan dokumentasi. \r\nHasil penelitian ini menunjukkan bahwa penerapan aplikasi Sistem Informasi Pengawasan\r\nNikah (SIP Nikah) di Kantor Urusan Agama Kecamatan Buntu Batu sudah berjalan dengan\r\ncukup. Kesimpulan ini didasarkan atas terpenuhinya indikator yaitu komuniikasi, sumber\r\ndaya, disposisi (sikap) dan struktur birokrasi. Sedangkan pemanfaatan aplikasi Sistem\r\nInformasi Pengawasan Nikah (SIP) Nikah di Kantor Urusan Agama Kecamatan Buntu Batu\r\nKabupaten Enrekang sudah digunakan oleh penghulu untuk mempermudah proses\r\npengadministrasian pernikahan, memastikan kehadiran penghulu, dan memastikan tempat\r\ndilaksanakannya pernikahan.\r\nKesimpulan ini didasarkan pada hasil analisis data sesuai indikator penelitian dimana semua\r\nindikator penelitian tersebut sudah terpenuhi atau sesuai dengan teori yang digunakan.','STIA AL-GAZALI BARRU',1,2022,2,1092,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1093,'Penelitian ini bertujuan untuk mengetahui dampak kebijakan layanan pojok\r\nbaca digital (POCADI) terhadap minat baca masyarakat di Kabupaten Barru. Dan\r\nuntuk mengetahui faktor-faktor yang mempengaruhi layanan pojok baca digital\r\n(POCADI) terhadap minat baca masyarakat di Kabupaten Barru. Penelitian ini\r\nmenggunakan penelitian deskriptif kualitatif, data diperoleh dari dengan cara\r\nobservasi, wawancara, dan dokumentasi. Teori yang digunakan dalam penelitian ini\r\nyaitu teori oleh Rokim, 2016. Subjek penelitian ini meliputi Kepala Kantor Dinas\r\nPerpustakaan dan Kearsipan Kabupaten Barru, Kepala Bidang Perpustakaan,\r\nPustakawan dan pengunjung Pojok Baca Digital. Serta pemeriksaan keabsahan data\r\nmeliputi uji kredibiltas, uji tranferabilitas, uji defendabilitas, dan uji\r\nkomfirmabilitas. Teknik analisis data meliputi pengumpulan data, reduksi data,\r\npenyajian data, dan penarikan kesimpulan/verifikasi. Hasil penelitian ini\r\nmenunjukkan bahwa Dampak kebijakan layanan pojok baca digital (POCADI)\r\nterhadap minat baca masyarakat di Kabupaten Barru cukup baik dengan\r\nterpenuhinya beberapa indikator kriteria evaluasi kebijakan yaitu efektivitas,\r\nefesiensi, kecukupan, kesamaan, responsivitas, dan ketepatan. Faktor-faktor yang\r\nmempengaruhi layanan Pojok Baca Digital terhadap minat baca masyarakat di\r\nKabupaten Barru dibagi menjadi dua yaitu faktor pendorong dan faktor\r\npenghambat. Adapun faktor pendorong layanan Pojok Baca Digital terhadap Minat\r\nbaca masyarakat di Kabupaten Barru yaitu, Berbasis digital sehingga mudah di\r\nakses, jumlah buku yang bervariasi dan pelayanan yang bagus oleh pustakawan /\r\npengelola Pojok Baca Digital. Dan adapun faktor penghambat layanan Pojok Baca\r\nDigital yaitu, infrastruktur teknologi yang terbatas, keterbatasan aksesibilitas dan\r\nperangkap, kurangnya literasi digital, ketidakpahaman dan kurangnya kesadaran\r\nmasyarakat, konten yang tidak menarik atau yang kurang relevan, ketidaktersediaan\r\nkonten dalam bahasa lokal, tingkat ekonomi dan ketersediaan dana, kebijakan dan\r\nregulasi yang tidak mendukung, kurangnya dukungan pemerintah dan lembaga\r\nterkait.','STIA AL-GAZALI BARRU',1,2023,2,1093,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1094,'Penelitian ini bertujuan untuk mengetahui Kebijakan Pemerintah Dalam\r\nPengembangan Desa Wisata Dalam Upaya Meningkatkan Pendapatan Asli Desa Kamiri \r\nKecamatan Balusu Kabupaten Barru dan faktor-faktor penghambatnya. Dalam penelitian\r\nini digunakan metode penelitian kualitatif. Subjek penelitian yang terdiri dari tiga level\r\nyaitu mikro, meso, makro. Deskripsi fokus penelitian Teknik pengumpulan data yang\r\nditerapkan yaitu observasi, wawancara, dokumentasi. Pemeriksaan keabsahan data.\r\nTeknik analisis data melalui tahap pengumpulan data, reduksi data, penyajian data, dan\r\npenarikan kesimpulan/ verifikasi. Hasil penelitian menunjukkan bahwa Kebijakan\r\npemerintah dalam pengembangan desa wisata dalam upaya meningkatkan pendapatan asli\r\nDesa Kamiri Kecamatan Balusu Kabupaten Barru terdiri dari 5 indikator yaitu,\r\npengembangan sumber daya manusia (SDM), kebijakan pemerintah, promosi desa wisata,\r\npembinaan organisasi masyarakat, Kerjasama dengan universitas. Faktor-faktor yang\r\nmenghambat dalam pengembangan desa wisata dalam upaya meningkatkan pendapatan\r\nasli Desa Kamiri Kecamatan Balusu Kabupaten Barru yaitu faktor pendorong yang terdiri\r\ndari factor internal dan eksternal, dan faktor penghambat yang terdiri dari keterbatasan\r\nSDM dan keterbatasan anggaran.','STIA AL-GAZALI BARRU',1,2023,1,1099,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1095,'FATMAWATI.20151198. ANALISIS PENGELOLAAN ASET TETAP\r\nMENURUT  PERATURAN MENTERI DALAM NEGERI NO 19 TAHUN\r\n2016 TENTANG ASET TETAP PADA BADAN PENDAPATAN DAERAH\r\nKABUPATEN MAROS PEMBIMBING : H.A.Russeng, SH.MH dan Drs.\r\nH.Arifin K, M.Pd \r\nTujuan penelitian ini untuk mengetahui pengelolaan aset tetap menurut\r\nPeraturan Menteri Dalam Negeri no 19 Tahun 2016 tentang aset tetap pada Badan\r\nPendapatan Daerah Kabupaten maros. dan untuk mengetahui faktor faktor yang\r\nmendukung dan menghambat dalam pengelolaan aset tetap menurut Peraturan\r\nMenteri Dalam Negeri nomor 19 tahun 2016 Tentang Aset Tetap pada Badan\r\nPendapatan Daerah Kabupaten Maros. Dalam penelitian ini digunakan tipe\r\npenelitian deskriptif-kualitatif, jenis data yang digunakan adalah data kualitatif,\r\ndan sumber data terdiri dari data primer dan data sekunder, dan tehnik\r\npengumpulan data terdiri atas observasi, wawancara, dan dokumentasi, dan\r\ntekhnik analisis data dilakukan dengan tahap reduksi data, penyajian data dan\r\nkesimpulan/verifikasi. \r\n Hasil penelitian ini menunjukkan bahwa pengelolaan aset tetap menurut\r\nPeraturan Menteri Dalam Negeri no 19 tahun 2016 Tentang Aset Tetap pada\r\nBadan Pendapatan Daerah Kabupaten Maros telah dilakukan dengan baik dan\r\nsesuai dengan sistem dan prosedur yang telah ditetapkan, meskipun secara\r\nkeseluruhan belum berjalan optimal. Faktor faktor yang mendukung dalam\r\nPengelolaan Aset Tetap pada Badan Pendapatan Daerah Kabupaten Maros adalah\r\nkepastian hukum dan transparansi sedangkan faktor faktor penghambat dalam\r\nPengelolaan Aset Tetap pada Badan Pendapatan Daerah Kabupaten Maros adalah\r\npelaksanaan siklus pendapatan daerah, SDM (pengawai Bapenda) dan anggaran\r\ndaerah. \r\n Kata Kunci : Pengelolaan. Aset, Tetap, Peraturan','STIA AL-GAZALI BARRU',1,2020,2,1094,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1096,'AMELIANA, 20171072. Upaya Kemitraan Badan Permusyawaratan Desa dalam mendukung Pembangunan di Desa Pao-pao Kecamatan Tanete Rilau \r\nKabupaten Barru, Pembimbing: Nurlia dan Herlina Amriana \r\n \r\n        Hasil penelitian ini bertujuan untuk mengetahui: Bagaimana upaya kemitraan badan permusyawaratan desa dalam mendukung pembangunan di Desa pao-pao dan untuk mengetahui faktor yang mendukung dan menghambat upaya kemitraan badan permusyawaratan Desa dalam mendukung pembangunan di Desa Pao-pao Kecamatan Tanete Rilau Kabupaten Barru. Sumber data diperoleh dengan cara observasi, wawancara, dan dokumentasi. \r\n       Hasil penelitian menunjukkan upaya kemitraan badan permusyawaratan Desa dalam mendukung pembangunan meningkatkan partisipasi masyarakat yang aktif. Faktor pendukung adanya dukungan dari bawah mulai keterlibatan masyarakat dan diwujudkan dalam bentuk dana desa. Sedangkan faktor penghambat adalah rendahnya aspirasi masyarakat dikarenakan minimnya pengetahuan masyarakat untuk berpartisipasi meskipun pemerintah desa sudah berupaya memberikan pelayanan terbaik kepada masyarakat dalam bentuk sosialisasi. Adapun saran saya pertama yaitu menyediakan forum bagi masyarakat kemudian yang kedua bertindak secara transparansi terhadap masyarakat. \r\n','STIA AL-GAZALI BARRU',1,2022,1,1096,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1097,'Penelitian ini bertujuan untuk mengetahui implementasi kredit cepat aman\r\n(KCA) kepada nasabah dan untuk mengetahui faktor-faktor yang menghambat\r\nimplemetasi kredit cepat aman (KCA) kepada nasabah di kantor PT. Pegadaian\r\nPersero cabang barru. Penelitian ini menggunakan metode penelitian kualitatif,\r\nteknik pengumpulan data melalaui, observasi, wawancara, dan dokumentasi,\r\ndengan teknik analisi data menggunakan, reduksi data, penyajian data, dan\r\npenarikan kesimpulan.  \r\nHasil penelitian ini menunjukan bahwa Implementasi Kredit Cepat  Aman\r\nKepada Nasabah Di Kantor PT. Pegadaian Persero Cabang Barru telah berjalan\r\ndengan baik berdasarkan empat indikator menurut Geore C. Edward yang\r\ndigunakan. Pertama komunikasi, informasi yang diberikan oleh pemberi Kredit\r\nCepat Aman (KCA) dapat tersampaikan dengan baik. Hal ini ditinjau dari 15\r\nnasabah menyatakan memahami penggunaan atau implementasi Kredit Cepat\r\nAman. Kedua, sumber daya pada implementasi Kredit Cepat Aman di Kantor PT.\r\nPegadaian Persero Cabang Barru memiliki sarana dan prasarana yang sangat\r\nmemadai sehingga memudahkan pelayanan. Ketiga, disposisi seluruh pelaksanaan\r\nKredit Cepat Aman (KCA) di Kantor PT. Pegadaian Persero Cabang Barru\r\ndilakukan oleh pihak-pihak yang memeiliki wewenang atau jobdesc dan tanggung\r\njawab. Keempat birokrasi, seluruh proses implementasi Kredit Cepat  Aman\r\n(KCA) di Kantor PT. Pegadaian Persero Cabang Barru diawasi oleh OJK dan\r\nmemiliki SOP. Hal ini menjadi acuan dalam pelaksanaan kebijakan yang sesuai\r\ndengan tujuan dan saran. Faktor-faktor yang menjadi penghambat Implementasi\r\nKredit Cepat  Aman Di Kantor PT. Pegadaian Persero Cabang Barru yaitu\r\nhambatan dalam memberikan informasi kepada nasabah usia lanjut, dan\r\nkurangnya dukungan yang disebabkan karakter nasabah yang kurang disiplin\r\ndalam membayar pinjaman sesuai dengan tenggak waktu.','STIA AL-GAZALI BARRU',1,2023,1,1098,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1098,'Tujuan Penelitian ini Untuk mengetahui implementasi program penyaluran\r\npupuk bersubsidi melalui kartu tani di Desa Galung Kecamatan Barru Kabupaten\r\nBarru. Untuk mengetahui faktor pendukung dan penghambat dalam implementasi\r\npenyaluran pupuk bersubsidi melalui kartu tani di Desa Galung Kecamatan Barru\r\nKabupaten Barru. Penelitian ini dilakukan secara deskriptif kualitatif, sumber data\r\ndiperoleh dengan cara observasi, wawancara, dan dokumentasi. Analisis data\r\nmenggunakan reduksi data, penyajian data, verifikasi data dan penarikan\r\nkesimpulan. Hasil penelitian yang didapat tersebut kendala selama proses kartu\r\ntani ini berlangsung adalah berkaitan dengan waktu pembelian pupuk yang masih\r\nmenggunakan kebiasaan lama sehingga terjadi penumpukan pembeli dan\r\nmenyebabkan keterlambatan pengiriman. Kartu tani memfasilitasi masyarakat\r\npetani untuk bisa menabung tanpa ada biaya administrasi, yang bertujuan\r\nmasyarakat dapat menabung dan menggunakan uang tersebut untuk membeli\r\npupuk sehingga tidak bersamaan setelah musim panen dengan harapan tidak ada\r\npenumpukan pembeli dan keterlambatan pengiriman. Sejauh ini tujuan tersebut\r\nmasih perlu untuk diperbaiki untuk tercapainya tujuan program kartu tani. \r\nImplementasi program penyaluran pupuk bersubsidi melalui kartu tani di Desa\r\nGalung Kecamatan Barru Kabupaten Barru belum terimplementasi dengan baik\r\ndibuktikan dengan terpenuhnya indikator komnikasi yaitu kurangnya sosialisasi\r\nmengenai penggunaan kartu tani, meskipun pada dasarnya tiga indikator lain yaitu\r\nsumber daya, disposisi, dan struktur birokrasi telah terlaksana dengan baik.\r\nAdapun yang mendukung implementasi program kartu tani yaitu adanya tingkat\r\nantusiasme masyarakat untuk berpartisipasi dalam menggunakan kartu tani\r\nselanjutnya faktor yang menghambat kegiatan ini adalah kurangnya pemahaman\r\nmasyarakat mengenai metode penggunaan kartu tani sehingga menghambat\r\npenyaluran pupuk dan juga mengenai kualitas pupuk bersubsidi yang dianggap\r\nkurang baik bagi masyarakat dalam penggunanya.  ','STIA AL-GAZALI BARRU',1,2023,2,1097,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1099,'Penelitian ini bertujuan untuk mengetahui sistem penggunaan anggaran\r\ndan Faktor-faktor yang menghambat sistem penggunaan anggaran dalam\r\npelaksanaan program kerja Pada Bidang Pengairan Dinas Pekerjaan Umum\r\nKabupaten Barru. Penelitian ini merupakan penelitian deskriftif kualitatif dengan\r\nmenggunakan teknik pengumpulan data melalui observasi, wawancara dan\r\ndokumentasi. Kemudian data yang diperoleh tersebut dianalisis dengan melalui\r\ntahapan berikut yaitu tahap reduksi data, tahap penyajian data dan penataan\r\nkesimpulan (verification).\r\nBerdasarkan data yang diperoleh penulis dalam penelitian dari proses \r\nanalisis data diatas, bahwa sistem penggunaan anggaran pada Bidang Pengairan\r\nDinas Pekerjaan Umum Kabupaten Barru dalam pelaksanaan program kerja\r\nTahun anggaran 2018 dan Tahun 2019 sudah dibilang efektif sebagai wujud\r\npertanggungjawaban dalam mencapai visi dan misi adapun Faktor-faktor yang\r\nmenghambat sistem penggunaan anggaran yaitu kebijakan dan aturan yang\r\nkadang berubah, waktu bagi pegawai memahami perubahan mekanisme,\r\nkurangnya data informasi dan adanya campur tangan kepentingan politik.\r\nKata kunci: Sistem, Anggaran, Program dan Kerja ','STIA AL-GAZALI BARRU',1,2020,2,1095,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1100,'Penelitian ini bertujuan untuk mengetahui kebijakan Pemerintah Desa\r\nBinuang dalam melestarikan budaya massure’ sebagai warisan budaya takbenda.\r\nUntuk mengetahui dampak kebijakan pemerintah Desa Binuang terhadap\r\npelestarian budaya massure’ sebagai warisan budaya takbenda. Sumber data\r\ndiperoleh melalui observasi, wawancara dan dokumentasi, analisis data\r\nmenggunakan analisis deskriptif kualitatif. Hasil penelitian ini menunjukkan\r\nbahwa Kebijakan pemerintah Desa Binuang dalam melestarikan Budaya Massure’\r\nsebagai Warisan Budaya Takbenda terdapat empat hal pokok, yaitu: menjadikan\r\nkegiatan massure’ sebagai kegiatan budaya rutin tahunan, memadukan budaya\r\nlokal massure’ dangan budaya islam mabbarazanji, melibatkan pemuda desa\r\ndalam kegiatan budaya massure’, dan d) mengalokasikan dana desa untuk\r\nkegiatan budaya massure’. Adapun dampak yang ditimbulkan dari kebijakan\r\nPemerintah Desa Binuang terhadap pelestarian budaya massure’ terdapat empat\r\nunsur yaitu: silaturahin dan gotong-royong warga dapat di pertahankan,\r\npendidikan karakter terus meningkat, tumbuhnya budaya hidup hemat, dan\r\npelestarian dan eksistensi Bahasa Bugis.','STIA AL-GAZALI BARRU',1,2023,2,1100,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1101,'Penelitian ini bertujuan untuk mengetahui implementasi Sistem Informasi Manajemen\r\nKepegawaian (SIMPEG) dan faktor kendala dalam program penataan administrasi kepegawaian di\r\nKementerian Agama Kabupaten Barru. Metode penelitian yang digunakan adalah metode\r\npenelitian kualitatif. Jenis data yang digunakan terdiri dari data primer dan data sekunder. Sumber\r\ndata diperoleh dengan cara observasi, wawancara, dan dokumentasi. Sedangkan teknik analisis\r\ndata melalui tahap pengumpulan data, reduksi data, penyajian data, dan penarikan kesimpulan.\r\n       Hasil penelitian ini menunjukkan bahwa implementasi Sistem Informasi Manajemen\r\nKepegawaian (SIMPEG) dalam program penataan administrasi kepegawaian di Kementerian\r\nAgama Kabupaten Barru sudah terlaksana dengan baik berdasarkan 4 (empat) indikator yaitu\r\nkomunikasi, sumber daya, disposisi, dan struktur birokrasi serta penerapan SIMPEG yang\r\nistiqamah. Adapun faktor yang menjadi kendala dalam pelaksanaan SIMPEG di Kementerian\r\nAgama Kabupaten Barru berdasarkan dua indikator. Pertama, aparat pelaksana yaitu kurangnya\r\nkesadaran pegawai untuk melakukan penginputan data kepegawaian secara mandiri dan\r\nmenyampaikan kepada pengelola SIMPEG setiap pembaharuan data, serta apabila ada kesalahan\r\ndalam penginputan data. Kedua, anggaran yaitu kondisi jaringan yang belum stabil menyebabkan\r\nproses penginputan data dan verifikasi data pegawai tidak diselesaikan dengan cepat.','STIA AL-GAZALI BARRU',1,2023,1,1101,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1102,'Penelitian ini bertujuan untuk mengetahui pengaruh pelaksanaan sistem pengolahan\r\ndata dengan tingkat akurat data dan kemutakhiran data kependudukan di kantor BPS Kabupaten\r\nBarru. Sumber data diperoleh dengan cara angket dan observasi. Analisa data menggunakan\r\nrumus regressi linier dengan SPSS.\r\nHasil penelitian menunjukkan bahwa pelaksanaan sistem pengolahan data di kantor\r\nBPS Kabupaten Barru sudah berjalan dengan baik, yang meliputi kegiatan pengumpulan data,\r\npengubahan data, penyimpanan data dan pembuatan dokumen kependudukan. Hasil analisis\r\nregressi linier dengan menggunakan SPSS, diketahui : nilai 0,005 \r\n( 0,001  <  0,005 ),\r\n dan t.hit : 3678   >  2771 t.tab atau t.hitung lebih besar dari t.tabel, sehingga hipotesis \r\n(H.1)\r\n diterima, yakni pelaksanaan pengolahan data kependudukan berpengaruh secara signifikan\r\nterhadap tingkat akurat dan mutakhir data kependudukan yang dihasilkan BPS Kabupaten Barru\r\nTerdapat beberapa faktor yang menghambat pelaksanaan sistem pengolahan data\r\nkependudukan, anatara lain yang menonjol adalah : tingkat SDM aparat BPS masih rendah\r\n(Pendidikan, Latihan dan pengalaman serta keterampilan kerja), peralatan yang digunakan masih\r\nsederhana, dan dana pembinaan maish kurang dalam pelaksanaan seluruh kegiatan pengelolaan\r\ndata.','STIA AL-GAZALI BARRU',1,2021,2,1102,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1103,'Penelitian ini bertujuan untuk mengetahui: Peran badan usaha milik desa\r\n(BUMDes) dalam meningkatkan kesejahteraan masyarakat di Desa Lempang Kecamatan\r\nTanete Riaja Kabupaten Barru. Dan untuk mengetahui faktor-faktor yang menghambat\r\nperan badan usaha milik desa (BUMDes) di Desa Lempang Kecamatan Tanete Riaja\r\nKabupaten Barru. Peneliian ini menggunakan Sumber data Primer dan Sekunder. Teknik\r\npengumpulan data  observasi, wawancara, dan dokumentasi. Serta teknik analisis data\r\nmelalui pengumpulan data, reduksi data, penyajian data, dan penarikan\r\nkesimpulan/verifikasi.\r\nHasil penelitian ini menunjukkan bahwa peran BUMDes dalam meningkatkan\r\nkesejahteraan masyarakat di Desa Lempang belum berperan secara maksimal. Ada tiga\r\nindikator yang sudah berjalan dengan baik dan ada lima indikator yang masih belum\r\nberjalan dengan baik contohnya belum sesuai dengan harapan, seperti pendapatan yang\r\nmasih tergolong rendah. Selain itu peran BUMDes Siamasei belum dirasakan secara merata\r\noleh masyarakat, hanya masyarakat yang terlibat saja yang merasakan dampak adanya\r\nBUMDes. Sedangkan faktor yang menghambat, teknik pengelolaan yang kurang\r\ndiperhatikan, terbatasnya anggaran, kurangnya sumber daya manusia dalam rangka\r\nmengelola unit-unit usaha.','STIA AL-GAZALI BARRU',1,2023,2,1103,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1104,'Penelitian ini bertujuan untuk mengetahui pelayanan administrasi\r\npersidangan kasus perceraian di Pengadilan Agama Barru dan faktor-faktor yang\r\nmenghambat pelayanan administrasi persidangan kasus perceraian di Pengadilan\r\nAgama Barru. Dalam penelitian ini digunakan metode penelitian deskriptif\r\nkualitatif. Teknik pengumpulan data yang diterapkan yaitu observasi, wawancara,\r\ndokumentasi. Teknik analisis data melalui tahap pengumpulan data, reduksi data,\r\npenyajian data, penarikan kesimpulan/verifikasi. Hasil penelitian menunjukkan\r\nbahwa sudah berjalan cukup baik dan terpenuhinya indikator penelitian yaitu\r\nketepatan waktu, pelayanan perceraian, kepuasan masyarakat dan indikator belum\r\nerpenuhi yaitu Kedisplinan dan responsive sedangkan faktor-faktor penghambat\r\ndari beberapa indikator penelitian seperti kurangnya sumber daya manusia,\r\nmotivasi dari atasan, lingkungan internal mengalami kendala dari segi kebahasaan\r\ndan segi eksternal tidak mengalami kendala, sarana dan prasarana,manajemen\r\nadministrasi dan kepatuhan peraturan serta segi pengawasan.','STIA AL-GAZALI BARRU',1,2023,2,1106,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1105,'Penelitian ini bertujuan untuk mengetahui kebijakan pemerintah dalam mencegah \r\nterjadinya bencana alam di desa Lempang Kecamatan Tanete Riaja Kabupaten Barru dan\r\nuntuk mengetahui dampak kebijakan pemerintah dalam mencegah terjadinya bencana\r\nalam di desa Lempang  Kecamatan Tanete Riaja Kabupaten Barru. Metode penelitian\r\nyang digunakaan adalah metode penelitian kualitatif, sumber data diperoleh dengan cara\r\nobservasi, wawancara, dokumentasi dan teknik analisis data dengan cara pengumpulan\r\ndata, reduksi data, penyajian data dan kesimpulan. \r\n \r\nHasil penelitian ini menunjukan bahwa kebijakan pemerintah dalam mencegah \r\nterjadinya bencana alam di desa Lempang dilihat dari lima indikator, permasalahan\r\npenangulangan bencana alam disebabkan faktor alam dan manusia. langkah pemerintah\r\nsudah baik kebijakan pemerintah sudah cukup baik,begitupun  tanggapan masyarakat\r\nsudah baik serta efektifitas dampak kebijakan sudah baik serta memperlancar aktifitas\r\nmasyarakat demi mencapai kesejateraan masyarakat, dan untuk dampak kebijakan\r\npemerintah dalam mencegah terjadinya bencana alam di desa Lempang  yaitu dampak\r\nkebijakan terhadap situasi kelompok target  dampak pada kelompok lain, kondisi\r\nsekarang serta masa depan dan Kondisi insfrastruktur yang merupakan dampak dari\r\nkebijakan pemerintah dalam mencegah terjadinya bencana alam. ','STIA AL-GAZALI BARRU',1,2023,2,1107,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1106,'Penelitian ini bertujuan untuk mengetahui: Bagaimana kesadaran dan kepedulian\r\nmasyarakat dan faktor-faktor penghambat dalam pelunasan Pajak Bumi dan Bangunan di\r\nDesa Harapan Kecamatan Tanete Riaja Kabupaten Barru. Penelitian ini menggunakan tipe\r\npenelitian deskriptif kualitatif. Jenis data yang digunakan adalah data kualitatif. Sumber\r\ndata primer dan sekunder dengan teknik pengumpulan data berupa observasi, wawancara\r\ndan dokumentasi. Teknik analisis data melalui pengumpulan data, reduksi data, penyajian\r\ndata dan penarikan kesimpulan.\r\nHasil penelitian ini menunjukkan bahwa Kesadaran dan Kepedulian Masyarakat\r\ndalam Pelunasan Pajak Bumi dan Bangunan (PBB) di Desa Harapan Kecamatan Tanete\r\nRiaja Kabupaten Barru, masih kurang baik. Kesimpulan ini didasarkan atas terpenuhinya\r\nindikator yaitu kurangnya informasi dari pihak pemerintah kepada masyarakat, adanya\r\nkebocoran pada penarikan pajak, suasana individu (belum memiliki uang, malas serta tidak\r\nadanya imbalan langsung dari pemerintah). Sedangkan faktor-faktor yang menghambat\r\nKesadaran dan Kepedulian Masyarakat dalam Pelunasan Pajak Bumi dan Bangunan (PBB)\r\ndi Desa Harapan Kecamatan Tanete Riaja Kabupaten Barru meliputi kurangnya dalam\r\nmelakukan penyuluhan, kurangnya dalam meningkatkan pelayanan dan kurangnya dalam\r\npemberian penghargaan.','STIA AL-GAZALI BARRU',1,2023,2,1105,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1107,'Siti Rahmi Intan. 20171135. Kebijakan Pemerintah Terhadap Limbah Tiram Di Kelurahan Coppo Kecamatan Barru Kabupaten Barru. Pembimbing : H. Abd. Mannang dan Adam Malik \r\n Penelitian ini bertujuan untuk mengetahui: dampak limbah tiram terhadap lingkungan sosial masyarakat dan untuk mengetahui kebijakan pemerintah kelurahan terhadap limbah tiram. Metode yang digunakan adalah metode penelitian kualitatif, sumber data yang diperoleh dengan cara wawancara, observasi, dan dokumentasi. Analisis data menggunakan pengumpulan data, reduksi data, penyajian data dan penariak kesimpulan. \r\nHasil penelitian ini menunjukkan bahwa dampak negatif limbah tiram di Deae terhadap penjual tiram yaitu dampak terhadap lingkungan terumbu karang dan dampak terhadap manusia seperti terkena goresan kulit cangkang tiram jika tidak memakai alas kaki, dan dampak positif limbah tiram dapat dimanfaatkan sebagai bahan timbun, bahan campuran semen, dan dapat dijadikan pupuk.. Dan kebijakan pengendalian limbah tiram di Deae belum buatnya aturan spesifik dalam pengendalian limbah tiram, dan hasil penelitian ini menunjukkan bahwa limbah tiram ini dapat di manfaatkan dengan mengelolanya kembali. \r\n','STIA AL-GAZALI BARRU',1,2022,1,1104,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1108,'Tujuan penelitian adalah untuk menganalisis penggunaan SIMOP serta \r\nmengetahui faktor penghambat dan pendukung efektifitas penggunaan SIMOP terhadap\r\nkepuasan kerja karyawan di Perusahaan PT. Pegadaian (Persero) Cabang Barru, penelitian\r\nmenggunakan tipe penelitian kualitatif, dengan teknik pengumpulan data melalui\r\nobservasi, wawancara dan dokumentasi.  \r\nHasil penlitian ini menunjukkan  bahwa efektivitas penggunaan Sistem Informasi\r\nManajemen Operasional  (SIMOP) terhadap kepuasan kerja karyawan sudah barjalan\r\ncukup baik walaupun belum optimal dan masih perlu ditingkatkan, yang meliputi SIMOP\r\ndalam pelaksanaan kegiatan manajemen operasional, dalam melaksanakan SOP (Standar\r\nOperation Prosedur) dan dalam meningkatkan kepuasan kerja. Terdapat faktor pendukung\r\npelaksnaan SIMOP secara efektif, terutama  perusahaan memiliki standar kerja yang\r\nsangat ketat, dan jika karyawan kurang disiplin melaksanakan SOP (Standar Operation\r\nProsedur) maka sewaktu-waktu bisa dikenakan sanksi sesuai aturan perusahaan. Selain itu\r\npimpinan bijaksana menerapkan aturan pengawasan pembinaan disiplin kerja. Sedangkan\r\nfaktor penghambat adalah  masih rendahnya komitmen kerja tentang jam kerja, masih ada\r\nkaryawan belum memahami standar-standar pekerjaan.','STIA AL-GAZALI BARRU',1,2023,1,1109,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1109,'Irnawati Tahir. 20161018. Implementasi Kebijakan Izin Keramaian Dalam Upaya\r\nPenertiban Kegiatan Masyarakat di Polsek Kecamatan Tanete Riaja Kabupaten Barru.\r\nPembimbing  H. M. Rasyidi Amran dan Kasmiah Ali.\r\n \r\nPenelitian ini bertujuan untuk mengetahui: Implementasi kebijakan izin keramaian \r\ndalam upaya penertiban kegiatan masyrakat di kecamatan Tanete Riaja kabupaten Barru. Dan\r\nuntuk mengetahui faktor-faktor yang menghambat dalam Implementasi kebijakan izin\r\nkeramaian dalam upaya penertiban kegiatan masyrakat di kecamatan Tanete Riaja kabupaten\r\nBarru.\r\n \r\nPenelitian ini menggunakan tipe penelitian deskriptif kualitatif. Jenis data yang \r\ndigunakan adalah data kualitatif. Sumber data primer dan sekunder dengan teknik\r\npengumpulan data berupa observasi, wawancara dan dokumentasi. Analisis data melalui tahap\r\nreduksi data.\r\n Hasil penelitian ini menunjukkan bahwa implementasi kebijakan izin keramaian dalam\r\nupaya penertiban kegiatan masyarakat di polsek Tanete Riaja Kabupaten Barru berjalan sesuai\r\nPP RI No. 60 Tahun 2017, Namun belum maksimal dapat dilihat berdasasrkan indikatorindikator\r\n\r\n yaitu komunikasi,sumberdaya,disposisi,dan struktur organisasi. Adapun faktorfaktor\r\n\r\nyang menghambat implementasi kebijakan izin keramaian dalam upaya penertiban\r\nkegiatan masyarakat di Polsek Kecamatan Tanete Riaja Kabupaten Barru yaitu: pengurusan\r\nsurat izin keramaian melalui perantara, mengurus surat izin keramaian pada hari libur kerja,\r\nmengurus surat izin keramaian tepat pada acara atau kegiatan di selenggarakan.\r\n \r\n \r\nKata Kunci: Implemetasi, Kebijakan, Izin keramaian','STIA AL-GAZALI BARRU',1,2021,2,1108,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1110,'Tujuan penelitian ini untuk mendeskripsikan dan menganalisis peran pelaksanaan\r\npengawasan oleh BPD di Desa Tellumpanua Kecamatan Tanete Rilau Kabupaten Barru. Dan\r\nuntuk mendeskripsikan dan menganalisis faktor yang menjadi kendala pembangunan di Desa\r\nTellumpanua Kecamatan Tanete Rilau Kabupaten Barru. Metode penelitian yang digunakan dalam\r\npenelitian adalah tipe penelitian deskriptif kualitatif, jenis data yang digunakan terdiri dari data\r\nprimer dan sekunder, disertai teknik pengumpulan data yaitu, observasi, wawancara dan\r\ndokumentasi.  \r\nHasil penelitian ini menunjukkan bahwa peran pelaksanaan pengawasan oleh BPD di\r\nDesa Tellumpanua Kecamatan Tanete Rilau Kabupaten Barru adalah; Legitimasi dan\r\nRepresentasi, Keterlibatan aktif, Kemampuan analisis, Kemitraan dengan pemerintah desa, dan\r\nPartisipasi masyarakat. Adapun Faktor yang Menjadi Kendala Pembangunan di Desa Tellumpanua\r\nKecamatan Tanete Rilau Kabupaten Barru adalah Keterbatasan sumber daya, kendala hukum dan\r\nminimnya pengetahuan dan keterampilan anggota BPD.','STIA AL-GAZALI BARRU',1,2023,1,1112,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1111,'Andrini. 20181179. Pengaruh Pemberian Kredit Usaha Rakyat (KUR) Bank Mandiri\r\nTerhadap Peningkatan Keuntungan Usaha Mikro di Kecamatan Barru Kabupaten\r\nBarru. Dibimbing oleh H. A. Russeng  dan  M. Alwi A. Buraerah.\r\n \r\nPenelitian ini bertujuan untuk mengetahui pengaruh pemberian Kredit Usaha \r\nRakyat (KUR) terhadap peningkatan keuntungan usaha mikro di kecamatan barru\r\nkabupaten barru. dan untuk mengetahui seberapa besar pengaruh KUR terhadap\r\npeningkatan keuntungan usaha mikro di kecamatan barru kabupaten barru. jenis data\r\nyang digunakan adalah data kuantitatif, tipe penelitian kuantitatif, sumber data primer dan\r\nsekunder, teknik pengumpulan data observasi, kuesioner, dan dokumentasi, teknik\r\nanalisis data melalui pengolahan data SPSS yang telah di uji. \r\nHasil penelitian ini menunjukkan bahwa ada pengaruh pemberian KUR \r\nterhadap keuntungan usaha kecil di kecamatan barru kabupaten barru dan\r\npengaruhnya kuat hal ini dibuktikan dari hasil penelitian berdasarkan uji validasi\r\ndan reliabilitas semua instrumen dikatakan valid dan reliabel. Perlu bagi para\r\npelaku usaha kecil agar memanfaatkan kredit usaha rakyat yang diterima lebih\r\nbaik agar mampu mendatangkan manfaat bagi usaha yang dikelolah.  \r\nKata Kunci : pengaruh, kredit usaha rakyat (KUR), keuntungan usaha mikro','STIA AL-GAZALI BARRU',1,2023,2,1116,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1112,'Penelitian ini bertujuan untuk menganalisis tata raung di Kelurahan Mangempang Kecamatan Barru Kabupaten Barru yang meliputi letak perumahan dan pemukiman, letak area perdagangan dan jasa, letak area industri, letak area Pendidikan, letak area perkantoran dan gedung pemerintahan, letak area terminal dan stasiun, letak area wisata dan taman rekreasi, letak area pertanian dan\r\nperkebunan, letak area pemakaman umum, letak tempat pembuangan sampah. Tipe\r\npenelitian yang digunakan adalah kualitatif. Teknik pengumpulan data adalah:\r\nobservasi, wawancara dan dokumentasi.\r\nHasil penelitian ini menunjukkan letak pembangunan perumahan dan\r\npemukiman, terdapat 1 perumahan yang cukup besar serta pemukiman yang\r\ntersebar di beberapa lokasi yang cenderung berada di pinggir jalan, dan terdapat\r\ntemuan pemukiman yang masuk area industri hal itu disebabkan belum adanya\r\nperencanaan titik titik atau daerah pemukiman dan perumahan yang yang diatur\r\nberdasarkan tata ruang. Letak area perdagangan dan jasa didapatkan bahwa tidak\r\nada pasar, oleh karena itu banyak berdiri toko maupun warung kecil yang\r\nmenyediakan barang maupun jasa, akan tetapi belum tertata dengan baik\r\ndikarenakan belum ada perencanaan tata ruang untuk area perdagangan dan jasa.\r\nLetak area industri berada di sekitaran jalan menuju Pelabuhan Garongkong,\r\ndan sudah ada perencanaan ke depanya terkait lokasi yang akan dijadikan area\r\nindustri maupun pergudangan, akan tetapi masih ditemukan pemukiman yang\r\nmasuk di area tersebut. Letak area Pendidikan atau sekolah yang lokasinya tidak\r\nterpusat di satu area saja, melainkan terbagi di beberapa lokasi yang terdiri dari 5\r\nsekolah dasar dan 1 sekolah menengah pertama, area Pendidikan atau sekolah yang\r\ntetapkan pemerintah memang belum ada sehingga belum diketahui rencana ke\r\ndepan oleh masyarakat umum. Letak area perkantoran atau gedung pemerintahan\r\nterdapat 6 kantor yang terdiri dari 4 milik pemerintah daerah dan 2 milik swasta\r\nyang tidak terpusat di satu lokasi saja disebabkan belum adanya rencana ke depan\r\nterkait tata ruang area tersebut.\r\nLetak area terminal atau stasiun menunjukkan belum adanya terminal, hanya\r\nada stasiun kereta api, yang sudah diketahui masyarakat umum bahkan sudah\r\nberoperasi, menunjukkan berhasilnya sosialisasi dari pemerintah. Letak area wisata\r\ndan taman rekreasi ada di lingkungan Padongko berupa pantai dan taman wisata\r\npola pitue yang cukup bagus yang langsung dikelola oleh dinas pariwisata, dan\r\nbelum ada rencana kedepan untuk penambahan jumlah tempat wisata. Letak daerah\r\npertanian dan perkebunan dikarenakan mayoritas warga Kelurahan Mangempang\r\nmata pencahariannya adalah petani, tak heran jika daerah pertanian sangat luas, baik\r\nitu berupa sawah ataupun tambak/empang, akan tetapi belum ada aturan dari\r\npemerintah terkait rencana tata ruang kedepannya hingga menimbulkan\r\nberkurangnya jumlah lahan pertanian dan perkebunan. \r\nLetak tempat pemakaman umum terdapat 4 pemakaman yang lahannya masih\r\ncukup luas dan masih bisa digunakan hingga puluhan tahun bahkan ratusan tahun, akan tetapi pemerintah belum membuat rencana ke depanya terkait dimana saja titik\r\natau lokasi yang akan dijadikan tempat pemakaman bilamana pemakaman yang ada sudah penuh. Tempat pembuangan sampah atau limbah terkait tempat pembuangan\r\nsampah di Kelurahan Mangempang tidak ada, sampahnya diangkut ke TPA yang\r\nada di wilayah lain, akibat kurangnya kesadaran dari masyarakat mengakibatkan\r\nmasih ada yang membuang sampah sembarangan, meskipun sudah sering dilakukan\r\nimbauan maupun sosialisasi dari pemerintah.','STIA AL-GAZALI BARRU',1,2023,1,1114,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1113,'Penelitian ini bertujuan untuk mengetahui proses implementasi program\r\nposyandu lansia di desa Galung dan untuk mengetahui apa yang menjadi\r\npenghambat dalam proses implementasi program posyandu lansia. Hasil dari\r\npenelitian ini menunjukkan Implementasi kebijakan Posyandu Lansia di Desa\r\nGalung Kecamatan Barru Kabupaten Barru dari lima indikator yaitu, sasaran dan\r\ntujuan kebijakan, sumber daya, karakteristik organisasi, sikap para pelaksana,\r\nkomunikasi antar organisasi pelaksana, dari empat unsur tersebut telah\r\nterimplementasi dengan baik dan satu unsur yang tidak terlaksana dengan baik\r\nyaitu sumber daya, faktor yang menghambat dari implementasi Program\r\nPosyandu Lansia yaitu pertama pemahaman masyarakat mengenai pentinya\r\nlayanan kesehatan tidak terlalu di pahami secara baik, yang kedua adalah\r\nmasyarakat yang lebih mementingakan pekerjaan dari pada memeriksakan\r\nkesehatannya di posyandu atau puskesmas setempat, ketiga yaitu pemahaman\r\ntradisional masyarakat yang mendahulukan pemahaman mistis dari pada\r\npamahaman medis. ','STIA AL-GAZALI BARRU',1,2023,1,1110,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1114,'Penelitian ini bertujuan untuk mengetahui Traffic Accedent Claim System  sebagai sarana penanganan kecelakaan lalu lintas di Polres Kabupaten Barru, dan mengetahui faktor-faktor apa yang menghambat Traffic Accident Claim System\r\n(TACS) sebagai sarana penanganan kecelakaan lalu lintas di Polres Barru. Tipe penelitian yang digunakan adalah deskriptif kualitatif. Jenis data yaitu data kualitatif teori dan sumber data primer dan data sekunder. Teknik pengumpulan data melalui observasi, wawancara, dan dokumentasi. Teknik analisis data yaitu pengumpulan data, reduksi data, penyajian data, dan penarikan kesimpulan. Hasil penelitian ini menunjukkan bahwa Trafic Accedent Claim System sebagai sarana penanganan kecelakaan lalu lintas di Polres Barru, sudah berjalan dengan baik. Hal ini menjadi bagian dari indikator penelitian yaitu Transparan, Akuntabel, Efektif dan\r\nEfisien, dan Terpadu. Sedangkan untuk faktor yang penghambat kepolisian yaitu ketakutan korban atau masyarakat dalam memberikan informasi kepada orang yang terkait.','STIA AL-GAZALI BARRU',1,2023,2,1113,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1115,'Haslinda Sappe. 20181129. Kebijakan Pemerintah Desa Terhadap Pemberdayaan Forum Anak Sebagai Pelopor dan Pelapor di Desa Galung Kecamatan Barru Kabupaten Barru. Pembimbing : Chaliddin dan M. Alwi. A. Buraerah. \r\n Penelitian ini bertujuan untuk mengetahui kebijakan pemerintah desa terhadap pemberdayaan forum anak sebagai pelopor dan pelapor serta faktor penghambat pemerintah Desa di Desa Galung Kecamatan Barru Kabupaten Barru dengan menggunakan tipe penelitian kualitatif, jenis data yang digunakan terdiri dari data primer dan sekunder, disertai teknik pengumpulan data yaitu, observasi, wawancara dan dokumentasi. Adapun teknik yang digunakan yaitu, melalui tahap pengumpulan data, penyajian data dan penarikan kesimpulan. \r\nHasil penelitian ini menunjukkan bahwa Kebijakan pemerintah Desa terhadap pemberdayaan forum anak sebagai pelopor dan pelapor di Desa Galung Kecamatan Barru Kabupaten Barru sudah baik, dengan indikator Hak Sipil Anak, Lingkungan Kerja Anak, Kesehatan Dasar Anak, Pendidikan dan Perlindungan Khusus terhadap Anak. Sedangkan faktor-faktor yang menghambat kegiatan forum anak di Desa Galung, yaitu sebagian besar tidak terlaksana karena terkendala Covid-19, dalam hal ini sebagian besar kegiatan forum anak yang sudah diprogram kurang memungkinkan untuk dilaksanakan secara virtual melainkan harus tatap muka secara langsung, dan juga terkendala pendanaan karena sebagian besar dana untuk forum anak dialihkan ke dana Covid-19. \r\n','STIA AL-GAZALI BARRU',1,2022,1,1111,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1116,'Peneliti ini bertujuan untuk mengetahui Implementasi dan faktor yang menghambat Sistem Informasi Pembangunan Daerah (SIPD) dalam penyusunan program dan pelaporan di Kantor Kelurahan Tuwung Kecamatan Barru Kabupaten Barru. Metode penelitian yang digunakan adalah metode penelitian kualitatif, sumber data diperoleh dengan cara observasi, wawancara dan dokumentasi. Tehnik analisis data melalui pengumpulan data, reduksi data, penyajian data dan kesimpulan/verifikasi. Hasil penelitian ini dilihat dari empat indikator komunikasi, sumber daya, disposisi pelaksana kebijakan dan struktur birokrasi sebagai faktor penentu\r\nkeberhasilan implementasi. Untuk faktor penghambat yaitu data kurang valid dan jaringan tidak stabil, maka perlu adanya peningkatan agar mendukung keberhasilan pelaksana kebijakan.','STIA AL-GAZALI BARRU',1,2023,2,1115,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1117,'Penelitian ini bertujuan untuk mengetahui implementasi pengawasan \r\npemungutan retribusi parkir di pasar Mattirowalie Kabupaten Barru, dan juga\r\nuntuk mengetahui faktor-faktor yang mempengaruhi implementasi pengawasan\r\npemungutan retribusi parkir di pasar mattirowalie Kabupaten Barru. Penelitian ini\r\nmenggunakan jenis penelitian deskriptif kualitatif, data diperoleh dengan cara\r\nobservasi, wawancara, dan dokumentasi. Teknik analis data melalui tahap\r\npengelohan data, reduksi data, penyajian data, dan penarikan\r\nkesimpulan/verifikasi. Hasil penelitian ini menunjukkan bahwa pengawasan\r\npemungutan retribusi parkir di Pasar Mattirowalie Kabupaten Barru sudah\r\nterlaksana dengan baik berdasarkan indikator pengawasan yaitu pengawasan\r\nlangsung, pengawasan tidak langsung, pengawasan formal, pengawasan informal,\r\npengawasan administratif dan pengawasan teknis. Sedangkan faktor-faktor yang\r\nmempengaruhi pengawasan pemungutan retribusi parkir di Pasar Mattirowalie\r\nKabupaten Barru yang terbagi atas faktor penghambat yaitu kurangnya kesadaran\r\nmasyarakat, rendahnya sumber daya manusia, pengawasan belum optimal dan\r\nfaktor pendukung yaitu letak geografis yang strategis, sarana transportasi dan\r\nbanyaknya pengunjung yang datang di Pasar. ','STIA AL-GAZALI BARRU',1,2023,2,1117,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1118,'Penelitian ini bertujuan mengetahui implementasi \r\n','STIA AL-GAZALI BARRU',1,2023,2,1118,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1119,'Muhammad Alif. 20171160. Upaya Dinas Komunikasi Informatika Dan Statistik\r\n(DISKOMINSTA) Untuk Mendukung Pengawasan Anak Dan Remaja Dalam Penggunaan \r\nMedia Sosisial di Kabupaten Barru. Pembimbing Hafid Abdul Razak dan A.Aminah.\r\nPenelitian ini bertujuan untuk mengetahui Upaya Dinas Komunikasi Informatika \r\nDan Statistik (DISKOMINSTA) untuk Mendukung Pengawasan Anak Dan Remaja Dalam \r\nPenggunaan Media Sosial Di Kabupaten Barru. Dan Tanggapan Orang Tua Tentang Upaya Dinas \r\nKomunikasi Informatika Dan Statistik (DISKOMINSTA) untuk Mendukung Pengawasan Anak \r\nDan Remaja Dalam Penggunaan Media Sosial Di Kabupaten Barru. Penelitian ini menggunakan \r\ntipe penelitian deskriptif dengan pendekatan kualitatif, jenis data yang digunakan adalah \r\ndata kualitatif, sedangkan sumber data terdiri dari data primer dan sekunder, teknik \r\npengumpulan data melalui observasi, wawancara, dan dokumentasi serta Teknik analisis \r\ndata melalui tahap pengumpulan data,reduksi data, penyajian data, dan penarikan \r\nkesimpulan/verifikasi.\r\nHasil penelitian ini menunjukan bahwa pengawasan anak dan remaja dalam penggunaan \r\nmedia sosial di kabupaten barru yaitu. Membentuk KIM (klompok informan masyarakat) yang \r\nterjun langsung ke lapagan untuk mlakukan pengawasan, salah satunya memonitoring aspirasi \r\nopini yang di alirkan ke pemuda dan remaja, karena tidak semua masyarakat memahami teknik \r\nkomunikasi yang baik di publik terkadang apa yang dia lihat berbeda dengan apa yang dia \r\nsampaikan,selanjutya masalah yang di temukan lalu di proses kemudian di teruskan ke dinas-dinas \r\nterkait.dan Tanggapan Orang Tua Untuk Mendukung Pengawasan Anak Dan Remaja Dalam \r\nPenggunaan Media Sosial Di Kabupaten Barru yaitu : orang tua lebih merasa tenang dengan \r\nadanya upaya seperti ini karena ada yang membantu mengawasi anak-anaknya dalam bermedia \r\nsosial, karena di dalam media sosial banyak sisi positif tetapi banyak pula sisi negatifnya.\r\nKata Kunci : Upaya,pengawasan, media sosial,media online anak,remaja.','STIA AL-GAZALI BARRU',1,2022,1,1119,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1120,'Penelitian ini bertujuan untuk mengetahui efektivitas penggunaan aplikasi M-Water dan monitoring kondisi akses air dan sanitasi serta seberapa besar analisis pengukuran efektivitas penggunaan aplikasi M-Water terhadap monitoring kondisi akses air dan sanitasi di Kabupaten Barru. Penelitian ini menggunakan metode penelitian kuantitatif dengan teknik pengumpulan data melalui observasi dan kuesioner / angket serta teknik analisis data menggunakan uji asumsi klasik. Hasil penelitian ini menunjukkan bahwa efektivitas penggunaan aplikasi M-Water di Kabupaten Barru masuk dalam kategori baik dengan tingkat persentasi sebesar 37,7% sedangkan untuk monitoring akses air dan sanitasi di Kabupaten Barru masuk dalam kategori cukup dengan tingkat persentasi sebesar 44,2%. Serta, besarnya analisis pengukuran efektivitas penggunaan aplikasi MWater terhadap monitoring kondisi akses air dan sanitasi di Kabupaten Barru sebesar 71,5%.','STIA AL-GAZALI BARRU',1,2023,1,1120,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1121,'Karmila BT. Baharuddin. 20201133. Optimalisasi Kayu Gaharu Dalam \r\nKebijakan Penerapan Sustainable Development Kabupaten Barru. Dibimbing \r\noleh Kasmiah dan H. Usamah Mahmud.\r\nPenelitian ini membahas efektivitas kebijakan pengelolaan kayu gaharu di \r\nDesa Lasitae, Kabupaten Barru, serta faktor-faktor yang memengaruhinya. Kayu \r\ngaharu memiliki nilai ekonomi tinggi, namun pengelolaannya menghadapi \r\ntantangan dalam hal pengetahuan teknis, akses pasar, dan dukungan kelembagaan. \r\nMeskipun kebijakan desa telah melibatkan masyarakat dalam budidaya kayu \r\ngaharu, efektivitasnya belum sepenuhnya tercapai karena masih terbatasnya \r\npendampingan teknis dan akses pasar yang optimal. Penelitian ini menemukan \r\nbahwa siklus panjang panen gaharu dan ketergantungan pada penjualan mentah \r\nmenjadi hambatan utama dalam peningkatan kesejahteraan masyarakat. \r\nRekomendasi yang diusulkan meliputi peningkatan pelatihan teknis secara \r\nberkelanjutan, pembentukan koperasi untuk memperkuat akses pasar, diversifikasi \r\ntanaman jangka pendek sebagai sumber pendapatan tambahan, serta inovasi dalam \r\npengolahan produk gaharu. Kebijakan yang lebih terintegrasi antara aspek \r\nekonomi dan lingkungan diharapkan dapat mendukung pengelolaan kayu gaharu \r\nsecara berkelanjutan, meningkatkan kesejahteraan masyarakat, dan menjaga \r\nkelestarian ekosistem lokal.\r\nKata kunci : Kayu gaharu, efektivitas kebijakan, keberlanjutan, partisipasi \r\nmasyarakat, akses pasar.','ITBA AL-GAZALI BARRU',1,2024,1,1121,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1122,'Rustina Ramadani. 20201128 Partisipasi Kelompok Wanita Tani “Embun \r\nPagi” Dalam Peningkatan Ekonomi Masyarakat Dusun Watan Nepo, Desa \r\nNepo, Kecamatan Mallusetasi, Kabupaten Barru. Pembimbing : A. pananrangi\r\ndan Rosdiana.\r\nPenelitian ini bertujuan untuk mengetahui partisipasi kelompok wanita tani \r\n“embun pagi” dalam peningkatan ekonomi masyarakat Dusun Watan Nepo, Desa \r\nNepo, Kecamatan Mallusetasi, Kabupaten Barru, dan untuk mengetahui faktor￾faktor yang mempengaruhi partisipasi kelompok wanita tani Dusun Watan Nepo, \r\nDesa Nepo, Kecamatan Mallusetasi, Kabupaten Barru. Penelitian ini \r\nmenggunakan pendekatan kualitatif, dengan jenis data yang digunakan yaitu data \r\nkualitatif yang bersumber dari data primer dan data sekunder. Teknik \r\npengumpulan data meliputi observasi, wawancara, dan dokumentasi. Analisis data \r\ndilakukan melalui tahapan pengumpulan data, reduksi data, penyajian data, dan \r\npenarikan kesimpulan.\r\nHasil penelitian menyatakan bahwa partisipasi kelompok wanita tani embun \r\npagi dalam peningkatan ekonomi masyarakat Dusun Watan Nepo sudah \r\ndikategorikan tinggi, ini didasarkan atas terpenuhinya seluruh indikator penelitian\r\nyang digunakan yaitu partisipasi pada tahap perencanaan, pelaksanaan, \r\npengambilan manfaat, dan evaluasi. Beberapa faktor yang menjadi penghambat \r\ndalam partisipasi kelompok wanita tani Dusun Watan Nepo yaitu jenis kelamin \r\nserta pekerjaan dan penghasilan. Faktor pendukungnya yaitu usia, pendidikan, dan \r\nlamanya tinggal. \r\nKata Kunci : Partisipasi, Kelompok Wanita Tani, Peningkatan Ekonomi\r\n Masyarakat','ITBA AL-GAZALI BARRU',1,2024,1,1123,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1123,'Penelitian ini bertujuan untuk mengetahui implementasi Inovasi Pelayanan Pendidikan Program SPP gratis bagi mahasiswa, dan faktor penghambat dalam implementasi Inovasi Pelayanan Pendidikan Program SPP gratis bagi mahasiswa di Kabupaten Pangkep. Metode penelitian menggunakan penelitian kualitatif, jenis data yang digunakam teridiri dari Data Primer dan Data Sekunder, dengan teknik pengumpulan data berupa observasi, wawancara, dan dokumentasi, sedangkan teknik analisis data dilakukan melalui tahap Pengumpulan Data, Reduksi data, Penyajian Data, dan Penarikan Kesimpulan.\r\nHasil penelitian ini menunjukkan bahwa Implementasi Inovasi Pelayanan Pendidikan Program Sumbangan Pembinaan Pendidikan (SPP) Gratis Bagi Mahasiswa Pada Dinas Pendidikan Kabupaten Pangkep secara umum sudah cukup baik. Kesimpulan ini didasarkan atas terpenuhinya indikator penelitian yaitu komunikasi, Sumber Daya, Disposisi, dan Struktur Birokrasi. Sedangkan faktor penghambat dalam implementasi program tersebut seperti lambatnya proses verifikasi data, proses penyampaian dan kejelasan informasi yang kurang serta lambatnya proses pencairan dana.\r\n','STIA AL-GAZALI BARRU',1,2023,3,1126,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1124,'Mariani, 20191025, Implementasi Peraturan Menteri dalam Negeri Nomor 20 \r\nTahun 2018 tentang Pengelolaan Keuangan Desa dalam Tahapan \r\nPerencanaan, Realisasi dan Pertanggungjawaban di Desa Jangan-Jangan, \r\nKecamatan Pujananting, Kabupaten Barru, Dibimbing oleh A. Aminah dan\r\nWahyu Azikin\r\nPenelitian ini bertujuan untuk mengetahui proses Implementasi Peraturan \r\nMenteri dalam Negeri Nomor 20 Tahun 2018 tentang Pengelolaan Keuangan Desa \r\ndalam Tahapan Perencanaan, Realisasi dan Pertanggungjawaban di Desa Jangan￾Jangan, Kecamatan Pujananting, Kabupaten Barru dan untuk mengetahui apa yang \r\nmenjadi penghambat dalam proses implementasi tersebut. Hasil dari penelitian ini \r\nmenunjukkan Implementasi kebijakan Peraturan Menteri dalam Negeri Nomor 20 \r\nTahun 2018 tentang Pengelolaan Keuangan Desa dalam Tahapan Perencanaan, \r\nRealisasi dan Pertanggungjawaban di Desa Jangan-Jangan, Kecamatan \r\nPujananting, Kabupaten Barru dari enam indikator yaitu, sasaran dan tujuan \r\nkebijakan, sumber daya, karakteristik organisasi, sikap para pelaksana, komunikasi \r\nantar organisasi pelaksana, lingkungan sosial, ekonomi dan politik. Dari lima unsur \r\ntersebut telah terimplementasi dengan baik dan satu unsur yang tidak terlaksana \r\ndengan baik yaitu sumber daya, faktor yang menghambat dari implementasi \r\nperaturan menteri dalam negeri nomor 20 tahun 2018 tentang pengelolaan \r\nkeuangan desa yaitu pertama kurangnya sumber daya manusia yang mampu \r\nmenganalisa rencana kegiatan pembangunan fisik, yang kedua adalah lokasi \r\nkegiatan pembangunan fisik yang terlalu jauh, waktu pelaksanaan kegiatan yang \r\nterlalu singkat.\r\nKata Kunci : Kebijakan, Implementasi, Pengelolaan, Keuangan Desa,\r\nPerencanaan, Realisasi, Pertanggungjawaban','ITBA AL-GAZALI BARRU',1,2024,1,1124,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1125,'Penelitian ini bertujuan untuk mengetahui proses Impelementasi Kebijakan Kartu  Keluarga Sejahtera (KKS) Dalam Penurunan Kemiskinan Kelurahan Bontomatenne Kecamatan Segeri Kabupaten Pangkajenne Kepulauan. Selain itu juga bertujuan untuk mengetahui hambatan – hambatan yang terjadi saat pelaksanaan Kartu Keluarga Sejahtera di kelurahan Bontomatene. Tipe penelitian yang  digunakan  adalah  kualitatif.  Sumber  data  diperoleh  dengan  cara     observasi, wawancara dan dokumentasi. Kemudian teknik analisis data adalah Reduksi data, Penyajian Data, dan Pengambilan Kesimpulan.  Hasil dari penelitian  ini  menunjukkan  bahwa  Impelementasi Kebijakan Kartu Keluarga  Sejahtera (KKS) Dalam Penurunan Kemiskinan Kelurahan Bontomatenne Kecamatan Segeri Kabupaten Pangkajenne Kepulauan.sudah cukup baik. Kesimpulan ini didasarkan atas terpenuhinya  seluruh  indikator  penelitian  yaitu komunikasi, Sumber Daya, Disposisi, dan Birokrasi sehingga bantuan KKS bisa tepat sasaran. Namun bantuan tersebut belum bisa untuk menurungkan kemiskinan. Kemudian hambatan yang terjadi saat pengimplementasian Kartu Keluarga Sejahtera di kelurahan Bontomatene adalah masalah jaringan ,dan tingkat valid tidaknya data penerima. Serta hambatan lain yang di alami oleh kelurahan adaalah pengakuan masyarakat yang mengaku tidak mampu.','STIA AL-GAZALI BARRU',1,2022,2,1127,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1126,'Endang Sukmawati 20191011. Implementasi Kebijakan Pemerintah Desa dalam meningkatkan Indeks Desa Membangun (IDM) Di Desa Galung Kecamatan Barru Kabupaten Barru. Dibimbing oleh Andi Aminah dan Hj. Sukmiah.\r\nPenelitian ini bertujuan untuk mengetahui Implementasi Kebijakan Pemerintah Desa dalam meningkatkan Indeks Desa Membangun (IDM) Di Desa Galung Kecamatan Barru Kabupaten Barru dan Faktor-faktor yang menghambat Implementasi Kebijakan Pemerintah Desa dalam meningkatkan Indeks Desa Membangun (IDM) Di Desa Galung Kecamatan Barru Kabupaten Barru. Jenis penelitian yang digunakan adalah kualitatif. Teknik pengumpulan data diperoleh dengan cara observasi, wawancara, dan dokumentasi.\r\nHasil penelitian ini menunjekkan bahwa Implementasi Kebijakan Pemerintah Desa dalam meningkatkan Indeks Desa Membangun (IDM) Di Desa Galung Kecamatan Barru Kabupaten Barru sudah sesuai dengan prosedur yang berlaku yaitu Dasar hukum, Tujuan dan Standar Operasional Prosedur (SOP) sesuai tolak ukur menurut Van meter dan Van horn (Standar sasaran dan tujuan kebijakan, Sumber daya implementasi, Komunikasi antar organisasi, Karakteristik agen pelaksana, Sikap atau disposisi implementor, Kondisi lingkungan sosial,politik, dan ekonomi). Sedangkan Faktor Yang Menghambat Implementasi Kebijakan Pemerintah Desa dalam meningkatkan Indeks Desa Membangun (IDM) Di Desa Galung Kecamatan Barru Kabupaten Barru, belum maksimal terimplementasikan, disebabkan masih ada beberapa kendala diantaranya: Isi kebijakan, Informasi, Dukungan, Pembagian potensi.\r\nKata Kunci : Kebijakan, Indeks Desa Membangun (IDM) ','ITBA AL-GAZALI BARRU',1,2024,3,1129,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1127,'Hasil dari penelitian ini bertujuan untuk mengetahui Implementasi \r\nAplikasi Sistem Informasi Pembangunan Daerah (SIPD) di Kelurahan Tanete\r\nKecamatan Tanete Rilau Kabupaten Barru dan untuk mengetahui faktor-faktor\r\nyang mempengaruhi penggunaan aplikasi Sistem Informasi Pembangunan Daerah\r\n(SIPD). Penelitian ini menggunakan tipe penelitian deskriptif kualitatif dengan\r\nsumber data diperoleh dengan cara observasi, wawancara dan dokumentasi.\r\nAnalisis data dengan cara pengumpulan data, kondensasi data, penyajian data dan\r\npenarikan kesimpulan.  \r\nHasil Penelitian ini menunjukkan Implementasi Aplikasi Sistem Informasi\r\nPembangunan Daerah (SIPD) di Kelurahan Tanete Kecamatan Tanete Rilau\r\nKabupaten Barru terdapat enam indikator yaitu ukuran dan tujuan kebijakan,\r\nsumber daya, karakteristik agen pelaksana, sikap atau kecenderungan para\r\npelaksana, komunikasi antar organisasi dan aktivitas pelaksana, lingkungan\r\nekonomi sosial dan politik sudah baik, akan tetapi masih terdapat satu indikator\r\nyang perlu dikembangkan kembali demi kelancaran implementasi aplikasi SIPD\r\nyaitu indikator sumber daya. Adapun faktor-faktor yang mempengaruhi\r\npenggunaan aplikasi sistem informasi pembangunan daerah (SIPD) yaitu faktor\r\nyang terletak pada rumusan kebijakan, faktor yang terletak pada personil\r\npelaksana dan faktor yang terletak pada sistem organisasi pelaksana. ','STIA AL-GAZALI BARRU',1,2023,1,1125,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1128,'Arfiana Akbar Syam. 20161306. Evaluasi Dampak Program Bantuan\r\nLangsung Tunai (BLT) di Kelurahan Bone Kecamatan Segeri Kabupaten\r\nPangkep, Pembimbing Nurlia dan Fitriani\r\nPenelitian ini bertujuan untuk mengetahui evaluasi dampak program Batuan\r\nLangsung Tunai (BLT) dan untuk mengetahui faktor-faktor yang menghambat\r\nevaluasi dampak Program Batuan Langsung Tunai (BLT) di Kelurahan Bone\r\nKecamatan Segeri Kabupaten Pangkep. Tipe penelitian ini menggunakan tipe\r\npenelitian kualitatif, teknik pengumpulan data yaitu observasi, wawancara dan\r\ndokumentasi. Teknik analisis data yaitu pengumpulan data, reduksi data,\r\npenyajian data dan penarikan kesimpulan.\r\nHasil penelitian ini menunjukkan bahwa evaluasi dampak program Bantuan\r\nLangsung Tunai (BLT) berdampak positif bagi masyarakat, dan faktor-faktor\r\nyang mempengaruhi evaluasi dampak program Bantuan Langsung Tunai (BLT)\r\nadalah keterampilan pelaksana dan koordinasi antar pelaksana program.\r\nKata Kunci : Evaluasi, Program Bantuan Langsung Tunai (BLT)\r\nABSTRACT\r\nArfiana Akbar Syam. 20161306. Evaluation of the Impact of the Direct Cash\r\nAssistance Program (BLT) in Bone Village, Segeri District, Pangkep Regency,\r\nAdvisor Nurlia and Fitriani\r\nThis study aims to determine the evaluation of the impact of the Cash\r\nDirect Rock (BLT) program and to determine the factors that hinder the\r\nevaluation of the impact of the Cash Direct Rock Program (BLT) in Bone Village,\r\nSegeri District, Pangkep Regency. This type of research uses a qualitative\r\nresearch type, data collection techniques are observation, interviews and\r\ndocumentation. Data analysis techniques are data collection, data reduction, data\r\npresentation and conclusion drawing.\r\nThe results of this study indicate that the evaluation of the impact of the\r\nDirect Cash Assistance (BLT) program has a good (positive) impact on the\r\ncommunity, and the factors that influence the evaluation of the impact of the\r\nDirect Cash Assistance (BLT) program are the skills of implementers and\r\ncoordination between program implementers.\r\nKeywords: Evaluation, Direct Cash Assistance Program (BLT','STIA AL-GAZALI BARRU',1,2022,1,1128,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1129,'Penelitian ini bertujuan untuk mengetahui Efektivitas Program Inovasi Desa (Pid) dalam Mewujudkan Kemandirian Desa Tellumpanua Kecamatan Tanete Rilau Kabupaten Barru dan mengetahui Faktor-faktor yang menghambat pelaksanaan Program Inovasi Desa di Desa Tellumpanua Kecamatan Tanete Rilau Kabupaten Barru. Tipe penelitian yang digunakan adalah deskriptif kualitatif. Jenis data dan sumber data diperoleh data kualitatif primer dan sekunder. Teknik pengumpulan data melalui observasi, wawancara, dan dokumentasi. Teknik analisis data yaitu pengumpulan data, reduksi data, penyajian data, dan penarikan kesimpulan.\r\nHasil peneltian ini menunjukkan Efektivitas Program Inovasi Desa (PID) Dalam Mewujudkan Kemandirian Desa Tellumpanua Kecamatan Tanete Rilau Kabupaten Barru belum efektif ditinjau dari indikator pencapaian tujuan dan\r\nintegrasi. Dan sudah efektif ditinjau dari indikator adaptasi. Kesimpulan ini didasari dari hasil analisis data yang dilakukan dilapangan dimana bertumpu pada 3 bidang kegiatan utama yaitu pengembangan kewirausahaan, peningkatan kualitas Sumber Daya Manusia, serta pemenuhan dan peningkatan infrastruktur pedesaan. Sedangkan untuk faktor penghambat program inovasi desa ditinjau dari 2 indikator yaitu Faktor Internal berupa kurangnya pemahaman dan pengetahuan pelaksana program terkait mekanisme program, dan Faktor Eksternal berupa kurangnya partisipasi Masyarakat serta kurangnya dana yang diterima.','STIA AL-GAZALI BARRU',1,2022,2,1122,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1130,'Penelitian ini bertujuan untuk mengetahui kebijakan pemerintah dalam upaya\r\npencegahan stunting pada balita di Puskesmas Pekkae Kecamatan tanete rilau \r\nKabupaten Barru, serta mengetahui factor-faktor yang dapat mempengaruhi kebijakan\r\npemeritah dalam pencegahan stunting pada balita di Puskesmas Pekkae Kecamatan\r\ntanete rilau Kabupaten Barru. Penelitian ini dilakukan dengan menggunakan tipe\r\npenelitian secara kualitatif, serta jenis data yang digunakan yaitu data kualitatif dengan\r\nsumber data yang terdiri dari data primer dan data sekunder. Adapun Teknik\r\npengumpulan data berupa observasi, wawancara dan dokumentasi. Teknik analisis data\r\ndalam penelitian ini dilakukan melalui tahap pengumpulan data, reduksi data,\r\npenyajian data, dan penarikan kesimpulan. \r\nHasil penelitian ini menunjukkan bahwa kebijakan pemerintah dalam melakukan\r\npencegahan stunting pada balita sudah cukup baik yaitu dengan melakukan kunjungan\r\nkerumah balita serta dengan pemberian makanan tambahan yang mengandung Fe (Zat\r\nBesi) yang baik untuk pertumbuhan dan perkembangan pada balita. Beberapa faktor\r\nyang dapat mempengaruhi kebijakan pemerintah dalam pencegahan stunting dapat\r\nberupa faktor lingkungan dan social ekonomi.','STIA AL-GAZALI BARRU',1,2023,1,1130,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1131,'MUSLIANI. 20201134. Implementasi Pemanfaatan Teknologi Informasi dan \r\nKomunikasi (TIK) dalam Meningkatkan Pertumbuhan Ekonomi Desa \r\nMerata Berbasis SDGs di Desa Lasitae Kecamatan Tanete Rilau Kabupaten \r\nBarru. Pembimbing: A. Russeng dan Andi Muhammad Ishak Ismail \r\nPenelitian ini bertujuan untuk mengetahui implementasi dan faktor-faktor \r\nyang menghambat implementasi Pemanfaatan Teknologi Informasi dan \r\nKomuniksi (TIK) dalam meningkatkan Pertumbuhan Ekonomi Desa Merata \r\nBerbasis SDGs di Desa Lasitae Kecamatan Tanete Rilau Kabupaten Barru . \r\nPenelitian ini menggunakan jenis penelitian deskriptif kualitatif. Teknik \r\npengumpulan data, Pemeriksaan keabsahan data menyangkut kepercayaan, \r\nketeralihan, kebergantungan, dan kepastian, Teknik analisis data meliputi \r\nKondensasi data, Penyajian data dan penarikan kesimpulan/Verifikasi. Hasil \r\npenelitian ini menunjukkan bahwa implementasi pemanfaatan Teknologi \r\nInformasi dan Komunikasi (TIK) dalam meningkatkan pertumbuhan ekonomi \r\ndesa merata berbasis SDGs di Desa Lasitae Kecamatan Tanete Rilau Kabupaten \r\nBarru telah terlaksana dengan baik berdasarkan dengan terpenuhinya indikator \r\nkomunikasi, sumber daya, disposisi dan struktur birokrasi, sedangkan faktor￾faktor yang menghambat implementasi pemanfaatan Teknologi Komunikasi dan \r\nInformasi (TIK) dalam meningkatkan pertumbuhan ekonomi desa merata berbasis \r\nSDGs di Desa Lasitae Kecamatan Tanete Rilau Kabupaten Barru yaitu akses \r\njaringan internet yang terbatas, pada umumnya masih ada masyarakat yang tidak \r\ntahu menggunakan handphone serta masih adanya masyarakat yang tidak \r\nmemiliki handphone.\r\nKata Kunci: Implementasi, TIK, Ekonomi Desa, SDGs','ITBA AL-GAZALI BARRU',1,2024,1,1132,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1132,'Nur Asisa, 20201126. Penerapan Sistem Aplikasi Pegadaian Digital Service \r\nDalam Transaksi Nasabah Pada PT. Pegadaian (persero) UPC. Mangkoso \r\nKabupaten Barru. Dibimbing oleh Chaliddin dan Musdalifa.\r\n Penelitian ini bertujuan untuk mengetahui Penerapan sistem aplikasi \r\npegadaian digital service dalam transaksi nasabah dan faktor kendalanya pada PT. \r\nPegadaian (persero) UPC. Mangkoso Kabupaten Barru. Penelitian ini \r\nmenggunakan jenis penelitian deskriptif kualitatif subjek penelitian yaitu pimpinan,\r\npengelola unit/penaksir, kasir, security dan nasabah pada PT. Pegadaian UPC. \r\nMangkoso sumber data diperoleh dengan cara observasi, wawancara, dan \r\ndokumentasi pemeriksaan keabsahan data, dengan cara uji kredibilitas, pengujian \r\ntransferability pengujian dependability dan pengujian konfirmability, teknik\r\nanalisis data, menggunakan pengumpulan data, reduksi data, penyajian data dan \r\npenarikan kesimpulan. \r\n Hasil penelitian menunjukkan bahwa penerapan sistem aplikasi pegadaian \r\ndigital service pada PT. Pegadaian (persero) UPC. Mangkoso Kabupaten Barru, \r\nmasih kurang baik dengan kurang terpenuhinya komunikasi, sumberdaya, disposisi \r\natau sikap pelaksana, meskipun struktur birokrasi sudah cukup baik. Sedangkan \r\nfaktor-faktor kendala pada PT. Pegadaian (persero) UPC. Mangkoso Kabupaten \r\nBarru yaitu kendala jaringan, aplikasi tidak stabil/error pada sistem dan masih \r\nbanyaknya nasabah yang kurang terampil dalam teknologi. \r\nKata Kunci: Aplikasi Pegadaian Digital Service, Transaksi, Nasabah','ITBA AL-GAZALI BARRU',1,2024,1,1131,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1133,'Penelitian ini berfokus kepada bagaimana implementasi analisis jabatan \r\ndalam penentuan petugas teknis pemadam kebakaran dan penyelamatan, serta\r\nfaktor yang mempengaruhi implementasi analisis jabatan pada kantor Dinas\r\nPemadam Kebakaran dan Penyelamatan Kota Parepare. \r\nPenelitian ini menggunakan tipe penelitian deskriptif kualitatif, teknik \r\nPengumpulan data diperoleh dengan cara observasi, dokementasi, wawancara, dan\r\nteknik Analisis data menggunakan analisis model pengumpulan data, reduksi data,\r\npenyajian data dan penarikan kesimpulan. \r\nHasil Penelitian ini menunjukkan bahwa: (1) implemetasi analisis jabatan \r\n(ANJAB) dalam penentuan petugas teknis yakni analisis jabatan memberikan\r\ntingkat keberhasilan yang baik dalam anjab, dipengaruhi oleh komunikasi, sumber\r\ndaya, disposisi dan struktur birokrasi. (2) Faktor-faktor yang mempengaruhi\r\nanalisis jabatan dalam menentukan petugas teknis yaitu Rekrutmen Pegawai/\r\nPetugas Teknis, skill atau keterampilan kemudian rotasi atau pergesaran pegawai.','STIA AL-GAZALI BARRU',1,2022,2,1135,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1134,'St. Nuraeni Fatirah, 20201100. Optimalisasi Dana Desa Melalui \r\nPengembangan BUMDES Menuju Desa Mandiri Di Desa Kamiri \r\nKecamatan Balusu Kabupaten Barru. Dibimbing oleh Safaruddin dan Herlina \r\nAmrianah.\r\nPenelitian ini bertujuan untuk mengetahui Optimalisasi dana Desa \r\nmelalui pengembangan BUMDES menuju Desa mandiri di Desa Kamiri \r\nKecamatan Balusu Kabupaten Barru.Untuk mengetahui faktor – faktor yang \r\nmenghambat optimalisasi dana Desa melalui pengembangan BUMDES menuju \r\nDesa mandiri di Desa kamiri Kecamatan Balusu Kabupaten Barru. Metode \r\npenelitian ini menggunakan Metode kualitatif dan menggunakan sumber data \r\nPrimer dan Sekunder. Teknik pengumpulan data observasi, wawancara, dan \r\ndokumentasi. Serta teknik analisis data melalui pengumpulan data, reduksi data, \r\npenyajian data, dan penarikan kesimpulan / verifikasi. Hasil penelitian ini \r\nmenunjukkan bahwa peran BUMDES dalam optimalisasi dana Desa belum \r\nberperan secara maksimal ada dua indikator yang sudah berjalan dengan baik \r\ndan ada satu indikator yang belum berjalan dengan baik, contohnya belum sesuai \r\ndengan harapan yang bisa membantu masyarakat yang berpenghasilan rendah \r\nuntuk mengembangkan potensinya. Sedangkan faktor yang menghambat, \r\nketerbatasan sumber daya alam, terbatasnya anggaran. \r\nKata Kunci : Optimalisasi, Dana Desa, Pengembangan BUMDES','ITBA AL-GAZALI BARRU',1,2024,1,1134,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1135,'Penelitian ini bertujuan untuk mengetahui implementasi Inovasi Pelayanan\r\nPendidikan Program SPP gratis bagi mahasiswa, dan faktor penghambat dalam\r\nimplementasi Inovasi Pelayanan Pendidikan Program SPP gratis bagi mahasiswa di\r\nKabupaten Pangkep. Metode penelitian menggunakan penelitian kualitatif, jenis data\r\nyang digunakam teridiri dari Data Primer dan Data Sekunder, dengan teknik\r\npengumpulan data berupa observasi, wawancara, dan dokumentasi, sedangkan teknik\r\nanalisis data dilakukan melalui tahap Pengumpulan Data, Reduksi data, Penyajian Data,\r\ndan Penarikan Kesimpulan. \r\nHasil penelitian ini menunjukkan bahwa Implementasi Inovasi Pelayanan\r\nPendidikan Program Sumbangan Pembinaan Pendidikan (SPP) Gratis Bagi Mahasiswa\r\nPada Dinas Pendidikan Kabupaten Pangkep secara umum sudah cukup baik. Kesimpulan\r\nini didasarkan atas terpenuhinya indikator penelitian yaitu komunikasi, Sumber Daya,\r\nDisposisi, dan Struktur Birokrasi. Sedangkan faktor penghambat dalam implementasi\r\nprogram tersebut seperti lambatnya proses verifikasi data, proses penyampaian dan\r\nkejelasan informasi yang kurang serta lambatnya proses pencairan dana.','STIA AL-GAZALI BARRU',1,2023,1,1133,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1136,'Kasriadi 20201089. Implementasi Permendikbudristek Republik Indonesia \r\nNomor 46 Tahun 2023 Tentang Pencegahan Dan Penanganan Kekerasan Di \r\nLingkungan Satuan Pendidikan Di Kecamatan Pujananting. Dibimbing oleh \r\nH. Kamaruddin Hasan dan A. Ariyadi. \r\nPenelitian ini bertujuan untuk Mengetahui Implementasi dan dampak\r\nPERMENDIKBUDRISTEK Republik Indonesia Nomor 46 Tahun 2023 tentang \r\nPencegahan dan Penanganan Kekerasan di Lingkungan Satuan Pendidikan di \r\nKecamatan Pujananting Penelitian ini menggunakan jenis penelitian kualitatif \r\ndengan pendekatan deskriptif, dengan teknik pengumpulan data, observasi, \r\nwawancara dan dokumentasi. Hasil penelitian ini menunjukka Implementasi \r\nPERMENDIKBUDRISTEK Nomor 46 Tahun 2023 tentang Pencegahan dan \r\nPenanganan Kekerasan di Satuan Pendidikan bergantung pada kompetensi \r\npelaksana, dukungan sumber daya, dan kolaborasi antara pemerintah, sekolah, dan \r\nmasyarakat. Kesuksesan kebijakan ini dapat berdampak positif bagi pengembangan \r\nkarakter siswa dan penanggulangan kekerasan di sekolah Implementasi \r\nPermendikbudristek Nomor 46 Tahun 2023 tentang Pencegahan dan Penanganan \r\nKekerasan di Lingkungan Satuan Pendidikan telah berhasil menciptakan perubahan \r\npositif dengan menurunkan angka kekerasan dan menciptakan suasana yang aman. \r\nKolaborasi antara guru, orang tua, dan masyarakat, serta pelatihan yang memadai \r\nbagi pelaksana kebijakan, menjadi kunci keberhasilan dalam mencapai tujuan \r\nkebijakan ini. Pemerintah Kabupaten melakukan pelatihan rutin bagi pelaksana \r\nprogram, termasuk guru dan kepala sekolah, untuk meningkatkan pemahaman dan \r\nketerampilan mereka dalam menerapkan kebijakan Permendikbudristek Nomor 46 \r\nTahun 2023, sehingga implementasi pencegahan kekerasan di lingkungan \r\npendidikan dapat berjalan lebih efektif dan diperlukan upaya berkelanjutan untuk \r\nmeningkatkan partisipasi orang tua dan masyarakat dalam mendukung kebijakan \r\nini, serta penyediaan sumber daya yang memadai agar implementasi kebijakan \r\ndapat berjalan optimal di semua institusi pendidikan\r\n.\r\nKata Kunci : Implementasi, Penanganan, Kekerasan, Satuan Pendidikan','ITBA AL-GAZALI BARRU',1,2024,3,1136,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1137,'Nurul Arianti Jusman, 20201062. Strategi Peningkatan Pelayanan Publik \r\nMelalu Traffic Accident Claim System (TACS) dalam Penanganan Kecelakaan \r\nLalu Lintas di Polres Barru. Dibimbing oleh Chaliddin dan Rahmi Rais.\r\nPenelitian ini bertujuan untuk mengetahui strategi peningkatan pelayanan \r\npublik melalui traffic accident claim system dalam penanganan kecelakaan dan \r\nfaktor penghambatnya di Polres Barru. Penelitian ini menggunakan jenis penelitian \r\ndeskriptif kualitatif dengan sumber data diperoleh dengan cara observasi, \r\nwawancara dan dokumentasi. Subjek penelitian yaitu Ketua Gakkum Unit Lalu \r\nLintas, Bintara Unit Lalu Lintas dan Masyarakat. Adapun pemeriksaan keabsahan \r\ndata dengan cara uji kredibilitas, uji dependebility, dan uji konfirmability, teknik \r\nanalisis data menggunakan pengumpulan data, redukasi data, penyajian data, dan \r\npenarikan kesimpulan. Hasil penelitian menunjukkan bahwa strategi peningkatan \r\npelayanan publik melalui Traffic Accident Claim System dalam penanganan \r\nkecelakaan lalu lintas di Polres Barru sudah terlaksana dengan cukup baik, dengan \r\ncukup terpenuhinya keempat indikator yaitu strategi pengembangan struktur (cukup \r\nbaik), strategi pengembangan penyederhanaan prosedur (baik), strategi \r\npengembangan infrastruktur (kurang baik), dan strategi pengembangan \r\nbudaya/kultur (baik). Sedangkan faktor-faktor yang menjadi penghambat strategi \r\npeningkatan pelayanan publik melalui Traffic Accident Claim System dalam \r\npenanganan kecelakaan lalu lintas di Polres Barru yaitu kurangnya informasi yang \r\ndidapatkan, gangguan jaringan dan sistem yang sering eror atau aplikasi yang tidak \r\nstabil.\r\nKata Kunci: Kecelakaan Lalu Lintas, Traffic Accident Claim System','ITBA AL-GAZALI BARRU',1,2024,1,1137,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1138,'NUR HALISA 20201111 Transparansi Pengelolaan Kewenangan Kepala \r\nDesa Dalam Pengisian Jabatan Perangkat Desa di Desa Jangan-jangan \r\nKecamatan Pujananting Kabupaten Barru. Dibimbing oleh: Mukmin \r\nMuhammad dan Masyitah.\r\nPenelitian ini bertujuan untuk mengetahui transparansi pengelolaan \r\nkewenangan kepala desa dalam pengisian jabatan perangkat desa dan untuk \r\nmengetahui faktor penghambat transparansi pengelolaan kewenangan kepala desa \r\ndalam pengisian jabatan perangkat desa di Desa Jangan-jangan Kecamatan \r\nPujananting Kabupaten Barru. Jenis penelitian ini adalah deskriptif kualitatif, \r\ndengan teknik pengumpulan data yang diperoleh melalui observasi, wawancara, \r\ndan dokumentasi. Pemeriksaan keabsahan data dilakukan dengan uji kredibilitas, \r\nuji transferabilitas, uji dependabilitas, dan uji konfirmabilitas. Teknik analisis data \r\nmeliputi kondensasi data, penyajian data, dan penarikan kesimpulan/verifikasi. \r\nHasil penelitian ini menunjukkan bahwa transparansi pengelolaan kewenangan \r\nkepala desa dalam pengisian jabatan perangkat desa di Desa Jangan-jangan \r\nKecamatan Pujananting Kabupaten Barru cukup transparan. Hal ini ditunjukkan \r\noleh keempat indikator penelitian, yaitu penyediaan informasi yang jelas, \r\nkemudahan akses informasi, penyusunan mekanisme jika ada peraturan yang \r\ndilanggar, serta peningkatan arus informasi melalui kerja sama dengan media \r\nmassa dan lembaga non-pemerintah. Salah satu indikator yang tidak terpenuhi \r\nadalah peningkatan arus informasi melalui kerja sama dengan media massa dan \r\nlembaga non-pemerintah. Adapun faktor-faktor yang menghambat transparansi \r\npengelolaan kewenangan kepala desa dalam pengisian jabatan perangkat desa di \r\nDesa Jangan-jangan Kecamatan Pujananting Kabupaten Barru antara lain \r\nkurangnya sosialisasi kepada masyarakat, rendahnya kesadaran masyarakat, serta \r\nsarana dan prasarana yang kurang memadai untuk proses pengisian jabatan \r\nperangkat desa.\r\nKata kunci : Kepala Desa, Transparansi, Kewenangan, Pengelolaan.','ITBA AL-GAZALI BARRU',1,2024,1,1138,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1139,'Penelitian ini bertujuan untuk mengetahui Implementasi\r\nPelayanan Tera dan Tera Ulang secara digital di Dinas Koperasi UMKM dan Perdagangan Kabupaten Barru dan Faktor-faktor yang menghambat Pelayanan Tera dan Tera  Ulang Secara Digital Di Dinas Koperasi UMKM dan Perdagangan Kabupaten Barru dalam pelaksanaanya, menggunakan metode penelitian  Deskriptif  Kualitatif yang Teknik Pengumpulan datanya melalui Observasi,Wawancara, dan Dokumentasi, Teknik Analisis data menggunakanPengumpulan Data,Reduksi data, Penyajian Data dan Penaberikan Kesimpulan. Hasil Penelitian menunjukkan Bahwa Implementasi PelayananTera dan Tera Ulang memiliki beberapa penghambat tapi dapat ditangani dengan baik dimana Pegawai terus melakukan upaya-upaya demi mewujudkan kabupaten Barru sebagai Tertib ukur agar guna meminimalisir terjadinya Tindak kecurangan dalam bertransaksi jual beli. Sedangkan untuk faktor penghambat implementasi pelayanan tera dan tera ulang ditinjau dari 2 indikator yaitu Faktor Internal berupa kurangnya pengetahuan para pelaku usaha dan masyarakat mengenaIpentingnya tera dan tera ulang dan Faktor Eksternal Kurangnya keterlibatan dan partisipasi aktif dalam meningkatkan pelayanan tera dan tera ulang.','STIA AL-GAZALI BARRU',1,2023,2,1139,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1140,'Ernasari 20201103. Pengaruh Penerapan Layanan Digital Bank BRI \r\nMobile (BRImo) dalam Meningkatkan Aksesibilitas Keuangan Masyarakat\r\nDi Kabupaten Barru. Pembimbing : H. Kamaruddin Hasan dan Andi Aminah.\r\nPenelitian ini bertujuan untuk mengetahui Pengaruh Penerapan Layanan \r\nDigital Bank BRI Mobile (BRImo) dalam Meningkatkan Aksesibilitas Keuangan \r\nMasyarakat Di Kabupaten Barru. Penelitian ini adalah penelitian kuantitatif, \r\nsumber data adalah semua pegawai di Kantor Cabang (Kanca) BRI dengan \r\nmenggunakan kuesioner sebagai instrument pengumpulan data. Untuk pengolahan \r\ndata menggunakan program SPSS versi 29.0 for windows. Hasil penelitian ini \r\nmenunjukkan bahwa pada hasil uji F signifikansinya sebesar 0,009 > 0,05 \r\nmaka H0 ditolak dan H1 diterima hal ini berarti bahwa variabel layanan \r\ndigital BRImo berpengaruh tehadap aksesibilitas keuangan masyarakat. \r\nPada hasil uji regresi linear menunjukkan bahwa nilai X sebesar 0,309 dan \r\nnilai Y sebesar 2.884 yang artinya bahwa besarnya pengaruh variabel \r\nlayanan digital BRImo dalam meningkatkan aksesibilitas keuangan \r\nmasyarakat kuat sesuai dengan tingkat hubungan nilai koefisien korelasi. \r\nKata Kunci: BRImo, Keuangan Masyarakat, Aksesibilitas.','ITBA AL-GAZALI BARRU',1,2024,1,1142,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1141,'Bahrasari Bt Adi. 20201037. Pengaruh Penerapan Standar Operasional \r\nProsedur Terhadap Kualitas Pelayanan Kesehatan Di Puskesmas Palakka \r\nKecamatan Barru Kabupaten Barru. . Dibimbing oleh A. Pananrangi M dan \r\nAdam Malik\r\n Penelitian ini bertujuan untuk mengetahui pengaruh penerapan standar \r\noperasional prosedur terhadap kualitas pelayanan kesehatan di Puskesmas Palakka \r\nKecamatan Barru Kabupaten Barru, dan untuk mengetahui besaran jumlah \r\npengaruh penerapan Standar Operasional Prosedur terhadap kualitas pelayanan \r\nkesehatan di Puskesmas Palakka Kecamatan Barru Kabupaten Barru. Jenis \r\npenelitian yang digunakan adalah kuantitatif. Teknik pengambilan sampel \r\nmenggunakan sampel jenuh atau total sampling Teknik pengumpulan data \r\ndiperoleh dengan cara observasi, kuisioner, dan dokumentasi. Kemudian teknik \r\nanalisis data adalah Analisis Statistik Deskriptif, Uji validitas dan Reabilitas, uji \r\nnormalitas, uji linearitas dan uji regresi linear sederhana. Hasil penelitian \r\nmenunjukan bahwa Terdapat pengaruh yang signifikan penerapan standar \r\noperasional prosedur terhadap kualitas pelayanan di Puskesmas Palakka\r\nKecamatan Barru Kabupaten Barru. atau dengan kata lain hipotesis : H0 ditolak\r\ndan H1 diterima. Kemudian jumlah pengaruh penerapan standar operasional \r\nprosedur terhadap kualitas pelayanan di Puskesmas Palakka Kecamatan Barru \r\nKabupaten Barru. adalah sebesar 85%. Sisanya 15 % dipengaruhi oleh faktor lain \r\nyang tidak dibahas dalam penelitian ini.\r\nKata Kunci: Penerapan, SOP, Kualitas, Pelayanan.','ITBA AL-GAZALI BARRU',1,2024,1,1143,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1142,'Penelitian ini bertujuan adalah untuk mengetahui implementasi dari pelaksa-naan inovasi perahu sehat pulau bahagia di Puskesmas Sabutung Kecamatan Liukang      Tupabiring Utara Kabupaten Pangkajene Kepulauan, serta tingkat keberhasilan program Inovasi Layanan Publik Perahu Sehat Pulau Bahagia Di Pulau SabutungKecamatan Liukang Tupabiring Utara Kabupaten Pangkajene Kepulauan. penelitian menggunakan penelitian kualitatif dengan teknik pengumpulan data beru-pa observasi, wawancara, dan dokumentasi, adapun teknik analisis data dilakukan dengan Pengumpulan Data, Reduksi data, Penyajian Data, dan Pengambilan Kes-impulan.\r\nHasil dari penelitian ini menunjukkan bahwa Inovasi layanan publik perahu sehat pulau bahagia di Puskesmas Sabutung Kecamatan Tupabiring Utara Kabupaten Pangkajene Kepulauan secara umum cukup baik. Hal  ini didasarkan atas ter-penuhinya seluruh indikator penelitian  yaitu komunikasi, Sumber Daya, Disposisi, dan Struktur Birokrasi. Dan Tingkat keberhasilan program Inovasi layanan publik perahu sehat pulau bahagia Di Pulau Sabutung Kecamatan Liukang tupabiring utara kabupaten pangkajene terbilang berhasil hal ini didasarkan beberapa faktor dari un-sur kepemimpinan, manejemen resiko, sumberdaya, teknologi ,dan dilihat dari keberhasilan program yang melibatkan banyak orang, mengubah polah pikir masyarakat dan jaringan yang kuat.\r\nKata Kunci: Implementasi, inovasi perahu sehat pulau bahagia (PSPB)\r\n','STIA AL-GAZALI BARRU',1,2023,1,1140,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1143,'Meliana , 20201093. Upaya Pengelola “Wisata Pekkae Ecolodge” Dalam \r\nMeningkatkan Minat Pengunjung Di Salo Rumpiae Desa Kading Kecamatan \r\nTanete Riaja Kabupaten Barru. Dibimbing oleh Dian Pratiwi dan Rahmi Rais.\r\nPenelitian ini bertujuan untuk menegtahui Upaya pengelola wisata Pekkae \r\nEcolodge dalam meningkatkan minat pengunjung Salo Rumpiae Desa Kading \r\nKecamatan Tanete Riaja Kabupaten Barru. Untuk mengetahui faktor-faktor yang \r\nmenghambat upaya pengelola wisata Pekkae Ecolodge di Salo Rumpiae Desa \r\nKading. Metode penelitian ini menggunakan metode kualitatif dan mengunakan \r\nsumber data primer dan sekunder. Teknik pengumpulan data observasi, \r\nwawancara, dan dokumentasi. Serta teknik analisis data melalui tahap \r\npengumpulan data, reduksi data, penyajian data, dan penarikan kesimpulan/ \r\nverifikasi. Hasil penelitian ini menunjukkan Upaya pengelola wisata pekkae \r\nEcolodge dalam meningkatkan minat pengunjung di Salo Rumpiae Desa Kading \r\nbelum berjalan dengan baik hal ini dibuktikan dengan tidak terpenuhinya 2 \r\nIndikator Penelitian yaitu Perencanaan dan Pengawasan, meskipun terdapat 2 \r\nindikator yang terpenuhi yaitu pengorganisasi dan pengarahan. Serta adanya \r\nfaktor-faktor Penghambat yaitu Faktor Internal berupa kurangnya Pemahaman \r\nSDM dan Sarana dan prasarana. Sedangkan Faktor Eksetrnal yang menjadi \r\npenghambat adalah beredarnya Informasi yang tidak akurat dan bersifat mistis \r\nyang berdampak pada kurangnya minat pengunjung yang pada gilirannya \r\nmengurangi pendapatan Pengelola.\r\nKata Kunci : pengelola,wisata, pekkae Ecolodge, pengunjung','ITBA AL-GAZALI BARRU',1,2024,1,1141,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1144,'Penelitian ini bertujuan adalah untuk mengetahui implementasi dari pelaksanaan\r\ninovasi perahu sehat pulau bahagia di Puskesmas Sabutung Kecamatan Liukang     \r\nTupabiring Utara Kabupaten Pangkajene Kepulauan, serta tingkat keberhasilan program\r\nInovasi Layanan Publik Perahu Sehat Pulau Bahagia Di Pulau SabutungKecamatan\r\nLiukang Tupabiring Utara Kabupaten Pangkajene Kepulauan. penelitian menggunakan\r\npenelitian kualitatif dengan teknik pengumpulan data berupa observasi, wawancara, dan\r\ndokumentasi, adapun teknik analisis data dilakukan dengan Pengumpulan Data, Reduksi\r\ndata, Penyajian Data, dan Pengambilan Kesimpulan.\r\nHasil dari penelitian ini menunjukkan bahwa Inovasi layanan publik perahu sehat\r\npulau bahagia di Puskesmas Sabutung Kecamatan Tupabiring Utara Kabupaten\r\nPangkajene Kepulauan secara umum cukup baik. Hal  ini didasarkan atas terpenuhinya\r\nseluruh indikator penelitian  yaitu komunikasi, Sumber Daya, Disposisi, dan Struktur\r\nBirokrasi. Dan Tingkat keberhasilan program Inovasi layanan publik perahu sehat pulau\r\nbahagia Di Pulau Sabutung Kecamatan Liukang tupabiring utara kabupaten pangkajene\r\nterbilang berhasil hal ini didasarkan beberapa faktor dari unsur kepemimpinan,\r\nmanejemen resiko, sumberdaya, teknologi ,dan dilihat dari keberhasilan program yang\r\nmelibatkan banyak orang, mengubah polah pikir masyarakat dan jaringan yang kuat. ','STIA AL-GAZALI BARRU',1,2023,1,1144,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1145,'A.Muh. Rezky Pratama, 20201021, Upaya Pemerintah Desa untuk Mendorong Partisipasi Masyarakat Dalam Pembangunan Desa di desa Siawung Kecamatan Barru Kabupaten Barru,dibimbing oleh H. A. Russeng dan Adam Malik.\r\nPenelitian ini bertujuan untuk mengetahui upaya pemerintah desa untuk mendorong partisipasi masyarakat dalam pembangunan desa di Desa Siawung Kecamatan Barru Kabupaten Barru, dan Untuk mengetahui faktor-faktor yang menghambat pembangunan desa di Desa Siawung Kecamatan Barru Kabupaten Barru. Jenis penelitian yang digunakan dalam penelitian ini adalah jenis penelitian deskriptif dengan pendekatan kualitatif, subjek penelitian terdiri Sekretaris Desa, Kepala Seksi Kesejahteraan Kantor Desa Siawung, dan Sekretaris BPD, serta warga masyaraka Desa Siawung Kecamatan Barru Kabupaten Barru, teknik pengumpulan data terdiri observasi, wawancara, dan dokumentasi, pemeriksaan keabsahan data melalui triangulasi yang meliputi triangulasi sumber, triangulasi teknik, dan triangulasi waktu, serta teknik analisis data melalui tahap kondensasi data, penyajian data, dan penarikan kesimpulan/verifikasi. Hasil penelitian menunjukkan bahwa upaya pemerintah desa untuk mendorong partisipasi masyarakat dalam pembangunan desa di Desa Siawung Kecamatan Barru Kabupaten Barru sudah berjalan dengan baik berdasarkan telah terpenuhinya dengan baik semua indikator penelitian yang meliputi indikator sosialisasi dan edukasi, penyusunan rencana pembangunan, transparansi dan akuntabilitas, pelibatan dalam pengambilan keputusan, penguatan kapasitas, insentif dan penghargaan, fasilitasi kelompok masyarakat, serta feedback dan evaluasi; sedangkan faktor-faktor yang menghambat upaya pemerintah desa untuk mendorong partisipasi masyarakat dalam pembangunan desa di Desa Siawung Kecamatan Barru Kabupaten Barru yang terdiri faktor internal yaitu rendahnya kualitas SDM, terbatasnya anggaran yang tersedia, dan kurangnya sarana dan prasarana; serta faktor eksternal yaitu rendahnya kesadaran masyarakat.\r\nKata Kunci : Upaya, Peemerintah Desa, Partisipasi Masyarakat, Pembangunan.','ITBA AL-GAZALI BARRU',1,2024,1,1145,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1146,'Penelitian ini bertujuan untuk mengetahui Implementasi Peraturan Pemerintah tentang Penyelenggaraan Badan Usaha Milik Desa Lasalama. Dan untuk mengetahui faktor-faktor yang menghambat Implementasi Peraturan Pemerintah Tentang Badan Usaha Milik Desa dalam Penyelenggaraan Badan Usaha Milik Desa Lasalama di Desa Binuang Kecamatan Balusu Kabupaten Barru. Penelitian ini menggunakan tipe penelitian deskriptif kualitatif, sumber data terdiri dari data primer dan data sekunder, teknik pengumpulan data meliputi observasi, wawancara, dan dokumentasi. Hasil penelitian ini menunjukkan bahwa implementasi Badan Usaha Milik Desa sudah terimplementasi cukup baik yang sesuai indikator penelitian yaitu komunikasi, sumber daya, disposisi dan struktur birokrasi. Sedangkan faktor-faktor yang menghambat Implementasi Peraturan Pemerintah tentang Badan Usaha Milik Desa yaitu masih kurangnya pelatihan IT kepada pengelola BUMDes Lasalama sehingga mereka masih kurang mahir dalam pengelolaan administrasi serta masih kurangnya mitra kerja sama sehingga suplaiyer masih kurang. ','STIA AL-GAZALI BARRU',1,2022,2,1146,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1147,'Hasmira. (20191057) Analisis Penanganan Keluhan Masyarakat Terhadap \r\nPelayanan Penerangan Jalan Umum Di Dinas Perhubungan Kabupaten \r\nBarru. Dibimbing oleh Hafid Abd Razak dan Alwi A.Buraerah.\r\nPenelitian ini bertujuan untuk mengetahui: penanganan Keluhan Masyarakat \r\nterhadap Pelayanan Penerangan Jalan Umum di Dinas Perhubungan Kabupaten \r\nBarru.Apa faktor-faktor yang menghambat penanganan Keluhan Masyarakat \r\nterhadap Pelayanan Penerangan Jalan Umum di Dinas Perhubungan Kabupaten \r\nBarru Metode Penelitian yang digunakan adalah Metode Penelitian Kualitatif, \r\nSumber data diperoleh dengan cara Observasi, Wawancara, dan Dokumentasi. \r\nTeknik Analisis data menggunakan pengumpulan data, Reduksi data, Penyajian \r\ndata, dan Penarikan kesimpulan. Hasil penelitian menunjukan Analisis \r\nPenanganan Keluhan Masyarakat Terhadap Pelayanan Penerangan Jalan Umum \r\nDi Dinas Perhubungan Kabupaten sudah terlaksana dengan cukup baik melalui \r\nmelalui terpenuhinya bebrapa indicator penelitian ini seperti Empati terhadap \r\npelanggan yang marah, Kecepatan dalam penanganan keluhan, Kewajaran atau \r\nkeadilan dalam memecahkan permasalahan atau keluhan, Kemudahan bagi \r\npelanggan untuk menghubungi perusahaan.Penanganan Keluhan Masyarakat \r\nTerhadap Pelayanan Penerangan Jalan Umum Di Dinas Perhubungan Kabupaten \r\nBarru telah mengambil langkah proaktif dengan memperkuat Empati terhadap \r\npelanggan yang marah, Kecepatan dalam penanganan keluhan, Kewajaran atau \r\nkeadilan dalam memecahkan permasalahan atau keluhan, Kemudahan bagi \r\npelanggan untuk menghubungi perusahaan. Tetapi tentunya tidak berjalan dengan \r\nbegitu mulus karena berbaga hambatan yang telah terjadi tentunya terkhusunya di \r\nindikator Faktor Sumber Daya Manusia (SDM), Faktor sarana, Faktor masyarakat.\r\nKata Kunci: Analisis, Pelayanan, Penerangan Jalan Umum','ITBA AL-GAZALI BARRU',1,2024,1,1149,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1148,'Penelitian ini bertujuan untuk mengetahui Akuntabilitas Pengelolaan Dana Desa Di Desa Siawung Kecamatan Barru Kabupaten Barru dan factor-factor dengan pendekatan kualitatif. Subyek penelitian adalah orang-orang yang memahami akuntabilitas pengelolaan dana desa di Desa Siawung Kecamatan Barru Kabupaten Barru. Teknik pengumpulan data diperoleh dengan cara observasi, wawancara dan dokumentasi. Pemeriksaan keabsahan data melalui triangulasi, kemudian teknik analisis data adalah pengumpulan data (data collection), reduksi data (data reduction), penyajian data (data display, dan penarikan kesimpulan (conclution drawing/verification). Hasil penelitian ini menunjukkan bahwa Akuntabilitas pengelolaan dana desa di Desa Siawung Kecamatan Barru Kabupaten Barru, adalah sudah baik. Kesimpulan ini didasarkan atas terpenuhinya seluruh tahapan pengelolaan dana desa seperti: perencanaan, pelaksanaan, penatausahaan, pelaporan dan pertanggunjawaban Faktor-faktor yang mempengaruhi akuntabilitas pengelolaan dana desa di Desa Siawung Kecamatan Barru adalah komptensi perangkat desa, kepemimpinan kepala desa, dan partsispasi masyarakat','STIA AL-GAZALI BARRU',1,2023,1,1147,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1149,'Penelitian ini bertujuan untuk mengetahui Implementasi Program Generasi\r\nBerencana (Genre) dalam persiapan hidup berkeluarga bagi Generasi muda di\r\nDesa Tompo Kecamatan Barru Kabupaten Barru, dan untuk mengetahui faktorfaktor\r\n\r\nyang mendukung dan menghambat Implementasi Program Generasi\r\nBerencana (Genre) dalam persiapan hidup berkeluarga bagi Generasi muda di\r\nDesa Tompo Kecamatan Barru Kabupaten Barru. Sumber data yang diperoleh\r\nmelalui cara observasi, wawancara dan dokumentasi. Analisis data menggunakan\r\nreduksi data, penyajian data, verifikasi data dan penarikan kesimpulan. Hasil\r\npenelitian sudah terlaksana dengan baik yang menunjukkan Implementasi Program\r\nGenerasi Berencana (Genre) dalam persiapan hidup berkeluarga bagi Generasi muda di\r\nDesa Tompo Kecamatan Barru Kabupaten Barru. Dapat disimpulkan bahwa\r\nImplementasi Program Generasi Berencana (Genre) dalam persiapan hidup berkeluarga\r\nbagi Generasi muda di Desa Tompo Kecamatan Barru Kabupaten Barru sudah berjalan\r\ndengan cukup baik dibuktikan dengan terpenuhinya indikator yaitu Sumber daya,\r\nDisposisi dan Struktur, hanya saja indikator yang tidak terpenuhi yaitu Indikator\r\nKomunikasi karena sebagian Remaja belum mengetahui apa itu Generasi Berencana\r\n(Genre) sedangkan telah disiapkan wadah sebagai kolaborasi dan koordinasi di Desa yaitu\r\nPusat informasi konseling remaja (PIK R) Maraung. Faktor-faktor yang mendukung dan\r\nmenghambat Implementasi Program Generasi Berencana (Genre) dalam persiapan hidup\r\nberkeluarga bagi Generasi muda di Desa Tompo Kecamatan Barru Kabupaten Barru\r\nadalah Sumber daya pembiayaan, Sumber daya Manusia dan Kejelasan Sasaran Program\r\nGenerasi Berencana (Genre) yang menjadi faktor pendukung, dan yang menjadi Faktor\r\npenghambat adalah Kurangnya dukungan dari Masyarakat dan Partisipasi dari Remaja itu\r\nsendiri.','STIA AL-GAZALI BARRU',1,2023,1,1148,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1150,'Muh. Agung 20191087. Implementasi Kebijakan Pemerintah Daerah Dalam \r\nPenanganan Orang Dengan Gangguan Jiwa (ODGJ) Di Kabupaten Barru. Di \r\nbimbing oleh Drs. H. Hafid Abd. Razak, M.Si.dan Fitrianti SP, M.Si \r\nTujuan penelitian ini adalah untuk mengetahui implementasi kebijakan pemerintah \r\ndalam penanganan ODGJ di Dinas Sosial Kabupaten Barru dan untuk mengetahui \r\nfaktor yang mempengaruhi implementasi kebijakan pemerintah dalam penaganan \r\nODGJ. Metode penelitian ini menggunakan analisis kualitatif, teknik pengumpulan \r\ndata melalui observasi, wawancara dan dokumentasi kemudian data dianailis dengan \r\ncara kondensasi data, penyajian data dan penarikan kesimpulan. Hasil penelitian\r\nmenunjukkan bahwa implementasi kebijakan pemerintah daerah dalam penanganan \r\nODGJ di Kabupaten Barru, belum terlaksana dengan baik hal tersebut dapat dilihat \r\ndari sumber daya dan disposisi yang belum memenuhi. Adapun faktor yang \r\nmenghambat dalam implementasi kebijakan tersebut adalah, sumber daya manusia, \r\npengawasan yang tidak memadai serta Sarana dan prasarana.\r\nKata Kunci : Implementasi, Kebijakan, ODGJ','ITBA AL-GAZALI BARRU',1,2024,1,1150,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1151,'silvana lindra 20201046. Implemtasi Kebijakan Dispensasi Penghapusan Denda\r\nPajak tahunan Kendaraan Bermotor Tahun 2023 di UPTD Sistem Administrasi\r\nManunggal Satu Atap (Samsat) Barru. Dibimbing oleh A. Pananrangi M dan Siti\r\nHardiyanti Bahnar. Penelitian ini bertujuan untuk mengetahui implementasi\r\nkebijakan dispensasi penghapusan denda pajak tahunan kendaraan bermotor tahun\r\n2023 di UPTD sistem administrasi manunggal satu atap (Samsat) Barru dan\r\ndampak implementasi kebijakan dispensasi penghapusan denda pajak tahunan\r\nkendaraan bermotor tahun 2023 di Samsat Barru. Penelitian ini menggunakan tipe\r\npenelitian desktiftif kualitatitif dengan sumber data yang diperoleh dengan cara\r\nobservasi, wawancara dan dokumentasi. Analisis analisis data menggunakan\r\npengumpulan data, mereduksi data, menyajikan data dan penarikan\r\nkesimpulan.Hasil penelitian ini menunjukkan bahwa Implementasi kebijakan\r\ndispensasi penghapusan denda pajak tahunan kendaraan bermotor tahun 2023 di\r\nUPTD sistem administrasi manunggal satu atap (Samsat) Barru telah berjalan\r\ndengan cukup baik. Sedangkan dampak Implementasi kebijakan dispensasi\r\npenghapusan denda pajak tahunan kendaraan bermotor tahun 2023 di UPTD\r\nSamsat Barru adalah peningkatan kesadaran membayar pajak, penurunann tingkat\r\nketerlambatan pajak dan meningkatkan kepatuhan wajib. Kata Kunci: Implementasi, Dispensasi Penghapusan Denda Pajak','ITBA AL-GAZALI BARRU',1,2024,3,1157,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1152,'P','STIA AL-GAZALI BARRU',1,2022,1,1156,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1153,'Syairah Aulia Amir 20201006. Kebijakan Pemerintah Desa Siawung Pada \r\nImplementasi Program Sustainable Development Goals (SDGs) Desa Layak Air \r\nBersih. Dibimbing oleh Nurlia dan A. Ariyadi\r\nPenelitian ini bertujuan untuk mengetahui kebijakan Pemerintah Desa \r\nSiawung mengenai program Sustainable Development Goals (SDGs) desa layak \r\nair bersih dan dampak yang dirasakan mengenai kebijakan Pemerintah Desa \r\nSiawung mengenai program Sustainable Development Goals (SDGs) desa layak \r\nair bersih. Dalam penelitian ini digunakan tipe penelitian kualitatif dan teknik \r\npengunpulan data yaitu observasi, wawancara dan dokumentasi. Teknik analisis \r\ndatanya yaitu pengumpulan data, reduksi data, penyajian data dan penarikan \r\nkesimpulan/verifikasi. Hasil penelitian menunjukkan bahwa implementasi \r\nprogram Sustainable Development Goals (SDGs) desa layak air bersih telah \r\nberjalan sudah cukup baik yang dibuktikan dengan terpenuhinya 3 indikator yaitu \r\ndari segi komunikasi, sumber daya, dan struktur birokrasi, akan tetapi tidak \r\nditemukan adanya kebijakan yang di buat pemerintah desa dalam menindaklanjuti \r\nprogram Sustainable Development Goals (SDGs) air bersih tersebut. Adapun \r\nfaktor-faktor yang mendukung program Sustainable Development Goals (SDGs)\r\ndesa layak air bersih dalam pemenuhan akses air bersih bagi masyarakat di Desa \r\nSiawung yaitu sumber daya manusia, sumber daya pembiayaan, dan sumber daya \r\nfasilitas.\r\nKata Kunci: Kebijakan, Sustainable Development Goals, Desa, Air bersih','ITBA AL-GAZALI BARRU',1,2024,3,1151,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1154,'SRI NURPAIDA. 20201060. Implementasi Program Penyediaan Layanan \r\nKesehatan Untuk Upaya Kesehatan Masyarakat (UKM) dan Upaya \r\nKesehatan Perorangan (UKP) Terhadap Penyakit Malaria di Dinas \r\nKesehatan Kabupaten Barru. Dibimbing oleh A. Pananrangi M dan Hj. Aidah.\r\n Penelitian ini bertujuan untuk mengetahui implementasi program \r\npenyediaan layanan kesehatan untuk Upaya Kesehatan Masyarakat (UKM) \r\nDan Upaya Kesehatan Perorangan (UKP) terhadap penyakit malaria di Dinas \r\nKesehatan Kabupaten Barru dan faktor-faktor yang mempengaruhi. Jenis \r\npenelitian yang digunakan adalah deskriptif dengan pendekatan kualitatif. Subjek \r\npenelitian adalah orang-orang yang memahami implementasi program penyediaan \r\nlayanan kesehatan untuk Upaya Kesehatan Masyarakat (UKM) dan Upaya \r\nKesehatan Perorangan (UKP) terhadap penyakit malaria di Dinas Kesehatan \r\nKabupaten Barru. Teknik pengumpulan data diperoleh dengan cara observasi, \r\nwawancara dan dokumentasi. Pemeriksaan pengabsahan data melalui triangulasi. \r\nKemudian teknik analisis data adalah pengumpulan data (data collection), reduksi \r\ndata (data reduction), penyajian data (data display), dan penarikan kesimpulan \r\n(conclution drawing/verification). Hasil penelitian ini menunjukkan bahwa \r\nimplementasi program penyediaan layanan kesehatan untuk Upaya Kesehatan \r\nMasyarakat (UKM) dan Upaya Kesehatan Perorangan (UKP) terhadap penyakit \r\nmalaria di Dinas Kesehatan Kabupaten Barru sudah dijalankan dengan baik. \r\nTemuan hasil penelitian ini didasarkan terpenuhinya seluruh indikator penelitian \r\nyaitu: komunikasi, sumber daya, disposisi (sikap) dan struktur birokrasi.\r\nSedangkan faktor-faktor yang mempengaruhi implementasi program penyediaan \r\nlayanan kesehatan untuk Upaya Kesehatan Masyarakat (UKM) dan Upaya \r\nKesehatan Perorangan (UKP) terhadap penyakit malaria di Dinas Kesehatan \r\nKabupaten Barru, yaitu fakor penghambat adalah sumber daya aparatur kader \r\nPuskesmas dan faktor pendukung adalah sumber daya pembiayaan, sumber daya \r\nlingkungan dan kejelasan kelompok sasaran.\r\nKata kunci: Implementasi Kebijakan, UKM dan UKP','ITBA AL-GAZALI BARRU',1,2024,1,1152,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1155,'Harni 20191056. Penerapan Prinsip Partisipasi dalam Penyelenggaraan \r\nPembangunan di Desa Bacu-Bacu Kecamatan Pujananting Kabupaten \r\nBarru. Pembimbing: Surasno Taliki dan Arifin K.\r\nPenelitian ini bertujuan untuk mengetahui Penerapan Prinsip Partisipasi \r\ndan faktor-faktor penghambat Penyelenggaraan Pembangunan di Desa Bacu-Bacu \r\nKecamatan Pujananting Kabupaten Barru. Dalam penelitian ini menggunakan \r\njenis deskriptif kualitatif, teknik pengumpulan data yang diterapkan yaitu \r\nobservasi, wawancara, dokumentasi. Teknik analisis data menggunakan \r\nkondensasi data, penyajian data, penarikan kesimpulan. \r\nHasil penelitian menunjukkan bahwa Penerapan Prinsip Partisipasi dalam \r\nPenyelenggaraan Pembangunan di Desa Bacu-Bacu Kecamatan Pujananting \r\nKabupaten Barru sudah terlaksana dengan baik dari ke-4 indikator penelitian \r\nyaitu, sosialisasi, perencanaan, pelaksanaan, dan pelestarian kegiatan. Sedangkan \r\nfaktor-faktor penghambat dalam Penerapan Prinsip Partisipasi dalam \r\nPenyelenggaraan Pembangunan di Desa Bacu-Bacu Kecamatan Pujananting \r\nKabupaten Barru yaitu Kesadaran, pendidikan, sumber daya aparatur desa, sarana \r\ndan prasarana yang masih kurang efektif.\r\nKata Kunci: Partisipasi Masyarakat, Pembangunan Desa','ITBA AL-GAZALI BARRU',1,2024,1,1159,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1156,'Sartika 20201102. Implementasi Kebijakan Penertiban Sertifikat Peralihan \r\nHak Milik Atas Tanah Jual Beli di Badan Pertanahan Nasional Kabupaten \r\nBarru. Pembimbing Marsuki dan M.Alwi A.Buraerah.\r\nPenelitian ini bertujuan untuk mengetahui Implementasi kebijakan \r\nPenertiban Sertifikat Peralihan Hak Milik Atas Tanah Jual Beli di Badan \r\nPertanahan Nasional Kabupaten Barru.Dalam penelitian ini digunakan metode \r\npenelitian kualitatif,adapun subjek dalam penelitian ini yaitu staf badan \r\npertanahan nasional dan masyarakat yang telah melakukan permohonan sertifikat,\r\nperalihan jenis data yang digunakan terdiri dari data primer dan data sekunder. \r\nTeknik pengumpulan data yang diterapkan yaitu observasi, wawancara, \r\ndokumentasi. Teknik analisis data melalui tahap pengumpulan data, reduksi data, \r\npenyajian data, dan penarikan kesimpulan/verifikasi. Penelitian ini menggunakan \r\nempat dimensi implementasi kebijakan dari Edward III. Hasil penelitian ini \r\nmenunjukkan Implementasi kebijakan penertiban sertifikat peralihan hak milik \r\natas tanah jual beli di badan pertanahan nasional kabupaten barru sudah Berjalan \r\nCukup baik yang didasarkan Atas tidak terpenuhinya satu indikator penelitian \r\nyaitu Disposisi (Sikap) mesikupun 3 indikator sudah terpenuhi yaitu komunikasi, \r\nsumber daya dan struktur birokrasi. Faktor-Faktor Penghambat Implementasi \r\nKebijakan Penertiban Sertifikat Peralihan Hak Milik Atas Tanah Jual Beli di Badan \r\nPertanahan Nasional Kabupaten Barru adalah Kurangnya kesadaran masyarakat \r\ntentang pentingnya sertifikat, kurangnya pemahaman masyarakat tentang syarat \r\nadministratif permohonan sertifikat, dan keterbatasan kemampuan masyarakat \r\ndalam membayar sertifikat.\r\nKata kunci : Implementasi kebijakan, penertiban sertifikat peralihan, hak milik \r\natas tanah jual beli.','ITBA AL-GAZALI BARRU',1,2024,1,1158,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1157,'Widiya Astuti 20201066. Implementasi Undang-Undang Nomor 27 Tahun \r\n2022 Tentang Perlindungan Data Pribadi Pada Aplikasi Identitas \r\nKependudukan Digital (IKD) Di Dinas Kependudukan Dan Pencatatan Sipil \r\n(Disdukcapil) Kabupaten Barru. Di bimbing oleh Hafid Abdul Razak dan Nurul \r\nMukhlisa.\r\nTujuan penelitian ini adalah untuk mengetahui Implementasi Undang￾Undang Nomor 27 Tahun 2022 Tentang Perlindungan Data Pribadi Pada Aplikasi \r\nIdentitas Kependudukan Digital (IKD) Di Dinas Kependudukan Dan Pencatatan \r\nSipil (Disdukcapil) Kabupaten Barru dan mengetahui faktor-faktor yang menjadi \r\npenghambat dalam implementasi kebijakan dalam perlindungan data pribadi pada \r\naplikasi Identitas kependudukan Digital (IKD). Metode penelitian ini \r\nmenggunakan deskriptif dengan pendekatan kualitatif. Sumber data diperoleh \r\ndengan observasi, wawancara, dan dokumentasi. Analisis data menggunakan \r\nkondensasi data, penyajian data, dan penarikan kesimpulan. Hasil penelitian ini \r\nmenunjukkan bahwa implementasi kebijakan pemerintah dalam perlindungan data \r\npada aplikasi Identitas kependudukan Digital (IKD) pada Dinas Kependudukan \r\ndan Pencatatn Sipil belum sepenuhnya berjalan sesuai dengan harapan. \r\nBerdasarkan 4 (empat) indikator penelitian menunjukkan komunikasi, struktur \r\nbirokrasi kurang berjalan dengan baik karena masih ada masyarakat yang belum \r\nikut serta sosialisasi dan tidak adanya SOP khusus yang diterbitkan sedangkan \r\nsumberdaya dan disposisi sudah berjalan dengan cukup baik. Adapun faktor￾faktor yang menjadi penghambat dalam implementasi kebijakan tersebut adalah \r\nsumberdaya lingkungan, dan partisipasi masyarakat.\r\nKata Kunci: Implementasi, Perlindungan Data pribadi, Apikasi Identitas \r\nkependudukan Digital','ITBA AL-GAZALI BARRU',1,2024,1,1160,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1158,'Penelitian ini bertujuan : 1) Untuk mengetahui implementasi rencana tata \r\nruang dan wilayah dalam  melakukan pembangunan di Kabupaten Barru 2) Untuk\r\nmengetahui kendala kendala yang dihadapi dalam realisasi rencana pembangunan\r\ntata ruang dan wilayah, dan usaha usaha yang dilakukan untuk mengatasinya di\r\nKabupaten Barru\r\nPenelitian ini menggunakan desain penelitian deskriptif kualitatif (qualitative\r\ndescriptive research), yang bertujuan untuk menggambarkan, meringkaskan\r\nberbagai kondisi, berbagai situasi, atau berbagai fenomena realitas sosial yang ada\r\ndi masyarakat yang menjadi objek penelitian. \r\nPemerintah Kabupaten Barru diharapkan mampu mengembangkan hunian\r\nyang layak untuk masyarakat melihat semakin meningkatnya permintaan  hunian\r\nyang layak oleh masyarakat, serta dapat mempercepat proses pembangunan, serta\r\ndapat mengatasi kendala-kendala yang dihadapi dalam memaksimalkan rencana\r\ntata ruang, dan menindak lanjuti Undang-Undang Nomor 1 Tahun 2011.','STIA AL-GAZALI BARRU',1,2021,1,1154,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1159,'Sry Wahyuni Hamzah 20201036. Kebijakan Lintas Sektor Dalam Penanganan \r\nStunting Di Desa Corawali Kecamatan Tanete Rilau, Kabupaten Barru. \r\nDibimbing oleh Andi Muh. Ishak Ismail dan Fitrianti.\r\nPenelitian ini bertujuan untuk mengetahui kebijakan lintas sektor dan faktor-faktor \r\npenghambat dalam penanganan stunting di Desa Corawali, Kecamatan Tanete \r\nRilau, Kabupaten Barru. Penelitian ini menggunakan tipe penelitian deskriptif \r\nkualitatif dengan sumber data diperoleh dengan cara observasi, wawancara, dan \r\ndokumentasi. Analisis data menggunakan teknik reduksi data, penyajian data, dan \r\npenarikan kesimpulan. Subjek penelitian ini adalah sekretaris desa, Staf desa, kader \r\nposyandu, dan bidan desa. Pemeriksaan keabsahan data menggunakan triangulasi \r\nsumber, triangulasi teknik, dan triangulasi waktu. Hasil penelitian ini menunjukkan \r\nbahwa kebijakan lintas sektor dalam penanganan stunting di Desa Corawali, \r\nKecamatan Tanete Rilau, Kabupaten Barru sudah terlaksana dengan baik, karena \r\nbeberapa indikator telah terpenuhi seperti penyusunan agenda, formulasi kebijakan, \r\nadopsi kebijakan, implementasi kebijakan, dan evaluasi kebijakan. Adapun faktor \r\nyang menjadi penghambat dari Kebijakan tersebut adalah SDM, Gizi, Peran \r\nPemerintah dan Edukasi Kesehatan.\r\nKata Kunci : Kebijakan, Lintas Sektor, Stunting, Gizi.','ITBA AL-GAZALI BARRU',1,2024,1,1153,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1160,'Muh. Firdaus. 20191207. Kebijakan Revitalisasi Sarana Olahraga Dalam \r\nPembangunan Berkelanjutan Di Kecamatan Segeri Kabupaten Pangkep. \r\nDibimbing oleh A. Russeng dan Andi Muhammad Ishak Ismail.\r\nPenelitian ini bertujuan untuk mengetahui kebijakan revitalisasi sarana \r\nolahraga dalam pembagunan berkelanjutan di Kecamatan Segeri Kabupaten \r\nPangkep dan untuk mengetahui faktor-faktor yang mempengaruhi kebijakan \r\nrevitalisasi sarana olahraga dalam pembagunan berkelanjutan di Kecamatan Segeri \r\nKabupaten Pangkep. Penelitian ini menggunakan jenis penelitian deskriptif \r\nkualitatif dengan sumber data diperoleh dengan cara observasi, wawancara, dan \r\ndokumentasi. Analisis data menggunakan pengumpulan data, reduksi data, \r\npenyajian data dan penarikan kesimpulan. Hasil penelitian menunjukkan bahwa \r\nKebijakan Revitalisasi Sarana Olahraga dalam Pembangunan Berkelanjutan di \r\nKecamatan Segeri Kabupaten Pangkep sudah terlaksana dengan baik ini dibuktikan \r\ndengan terpenuhinya seluruh indikator dalam pembangunan berkelanjutan yaitu \r\ntujuan atau rencana, aktor yang berperan, sistem program yang terkoordinasi dan \r\nmasalah atau hambatan dalam lingkungan dan Faktor-faktor yang mempengaruhi \r\nKebijakan Revitalisasi Sarana Olahraga dalam Pembangunan Berkelanjutan di \r\nKecamatan Segeri, Kabupaten Pangkep, adalah ketersediaan sumber daya finansial \r\nyang memadai, keberlanjutan lingkungan, regulasi dan kebijakan yang mendukung, \r\npartisipasi masyarakat dan pihak terkait, dan penerapan teknologi yang efisien dan \r\ninovatif.\r\n \r\nKata Kunci: Kebijakan, revitalisasi, pembangunan berkelanjutan','ITBA AL-GAZALI BARRU',1,2024,1,1155,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1161,'Penelitian ini bertujuan Untuk mengetahui kinerja dan faktor-faktor penghambat Dinas Pemadam Kebakaran dalam pencegahan dan penanggulangan kebakaran Di Kabupaten Pangkep. Adapun tipe penelitian yang di gunakan yaitu\r\ndeskriptif, kualitatif dengan jenis data yang digunakan terdiri dari data primer dan sekunder disertai teknik pengumpulan data yang diterapkan yaitu observasi, wawancara dan dokumentasi, sedangkan teknik analisis data melalui tahap\r\npengumpulan data, reduksi data, penyajian data dan penalikan kesimpulan atau verifikasi. Hasil penelitian menunjukkan bahwa kinerja Dinas Pemadam Kebakaran\r\nKabupaten Pangkep secara keseluruhan belum berjalan optimal. Hal ini dapat diketahui dari indikator efektivitas karena belum tercapainya target-target yang ditetapkan, kualitas layanan karena masih banyak keluhan masyarakat karena keterlambatan petugas tiba ke lokasi, responsivitas sudah berjalan baik karena adanya layanan untuk menanggapi keluhan dan aspirasi masyarakat, serta\r\nakuntabilitas karena keterbatasan informasi serta kegiatan yang dilakukan Dinas Pemadam Kebakaran Kabupaten Pangkep tidak diperbaharui diwebsite. Masih ditemukan banyak masalah yang menyebabkan tidak terwujudnya visi, misi, tujuan, dan target yang telah ditetapkan serta belum optimal dalam memberikan pelayanan pada masyarakat. Faktor-faktor yang menjadi penghambat Dinas Pemadam Kebakaran Kabupaten Pangkep adalah kurangnya armada dan sarana prasarana serta posko kesiagaan pemadam kebakaran di Kecamatan.','STIA AL-GAZALI BARRU',1,2021,2,1161,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1162,'Andi Asna Irawati. 20201014. Diskresi dalam Penyelenggaraan Pelayanan \r\nPublik di Mal Pelayanan Publik Kabupaten Barru. Dibimbing oleh A. Ariyadi \r\ndan A. Muh. Ishak Ismail.\r\nPenelitian ini bertujuan untuk mengetahui diskresi dalam penyelenggaraan \r\npelayanan publik di Mal Pelayanan Publik dan untuk mengetahui dampak diskresi \r\ndalam penyelenggaraan Pelayanan Publik di Mal Pelayanan Publik Kabupaten \r\nBarru. Sumber data diperoleh dengan cara observasi, wawancara, dokumentasi. \r\nAnalisis data menggunakan pengumpulan data, reduksi data, penyajian data dan \r\npenarikan kesimpulan. Diskresi dalam penyelenggaraan pelayanan publik di Mal \r\nPelayanan Publik Kabupaten Barru, sebagaimana diatur dalam UU Nomor 30 \r\nTahun 2014 tentang Administrasi Pemerintahan, merupakan alat penting untuk \r\nmengatasi situasi kekosongan hukum dan situasi mendesak. Tujuan diskresi \r\nmeliputi memperlancar pemerintahan, mengisi kekosongan hukum, memberikan \r\nkepastian hukum, dan mengatasi stagnasi administrasi. Penggunaannya harus \r\nsesuai prinsip hukum dan etika, termasuk tujuan yang jelas, kepatuhan pada \r\nperaturan, tata kelola yang baik, dan menghindari benturan kepentingan. Pejabat \r\npemerintah diharapkan menggunakan diskresi secara hati-hati dan transparan untuk\r\nmeningkatkan efisiensi dan kepercayaan publik. Diskresi dalam pelayanan publik \r\ndi Mal Pelayanan Publik Kabupaten Barru memiliki manfaat dan tantangan yang \r\nharus dikelola dengan hati-hati. Penerapan diskresi perlu selaras dengan peraturan \r\nhukum untuk meningkatkan efisiensi, kepuasan, dan transparansi layanan publik. \r\nSementara diskresi dapat membantu dalam situasi yang tidak diatur hukum, \r\nkepatuhan ketat terhadap hukum dan prinsip tata kelola yang baik tetap penting. \r\nPendekatan yang melibatkan teknologi, pelatihan, umpan balik, dan koordinasi \r\nantar lembaga dapat meningkatkan kualitas layanan. Meskipun diskresi dapat \r\nberpotensi menimbulkan persepsi ketidakadilan, jika dilakukan dengan transparan \r\ndan adil, diskresi dapat memperbaiki proses pelayanan dan kepuasan masyarakat.\r\nKata kunci: Diskresi, penyelenggaraan, pelayanan publik','ITBA AL-GAZALI BARRU',1,2024,1,1162,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1163,'Milna Ummi Kumala. 20181144. Pelayanan SIM Keliling Dalam Rangka \r\nTertib Administrasi Mengendara Di Wilayah Polres Barru. Dibimbing oleh \r\nHaeruddin dan Marsuki.\r\nPenelitian ini adalah penelitian kuantitatif metode survey yang bersifat \r\nkorelasional yang bertujuan untuk mengetahui hubungan prosedur pengambilan \r\nSIM, kepastian waktu penerbitan SIM, keramahan petugas pelayanan SIM, \r\nkenyamanan ruang pengambilan SIM terhadap tertib administrasi pengambilan \r\nSIM. Variabel bebas dalam penelitian ini adalah pelayanan SIM, sedangkan \r\nvariabel terikatnya adalah tertib administrasi. Populasi dalam penelitian ini adalah \r\nmasyarakat barru yang hendak memperpanjang SIM sedangkan sampelnya 40 \r\norang. Teknik pengumpulan data penelitian ini menggunakan angket. Teknik \r\nanalisis data yang digunakan yaitu analisis univariat dan analisis bivariat dengan \r\nmelakukan uji chi square. Berdasarkan hasil uji chi square antara prosedur \r\npengambilan SIM dengan tertib administrasi diperoleh nilai p-value 0,000 < 0,05 \r\natau H0 ditolak dan H1 diterima, antara kepastian waktu penerbitan SIM dengan \r\ntertib administrasi diperoleh nilai p-value 0,008 < 0,05 atau H0 ditolak dan H1 \r\nditerima, antara keramahan petugas dengan tertib administrasi diperoleh nilai p￾value 0,008 < 0,05 atau H0 ditolak dan H1 diterima, antara kenyamanan ruang \r\ndengan tertib administrasi diperoleh nilai p-value 0,000 < 0,05 atau H0 ditolak \r\ndan H1 diterima, yang berarti bahwa prosedur pengambilan SIM, kepastian waktu \r\npenerbitan SIM, keramahan petugas, dan kenyamanan ruang pengambilan SIM \r\nmemiliki hubungan yang positif dan signifikan terhadap tertib administrasi. Kata \r\nKunci : Pelayanan, SIM Keliling, Tertib Administrasi','ITBA AL-GAZALI BARRU',1,2024,3,1163,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1164,'Ani, 20201124. Peran Kelompok Sadar Stunting (MPOK DARTI) Dalam \r\nPenurunan Stunting Di Dinas Sosial Kabupaten Barru. Dibimbing oleh Zaid \r\nzainal dan Rosdiana.\r\n Penelitian ini bertujuan untuk mengetahui Peran kelompok sadar Stunting\r\nMPOK DARTI dalam penurunan Stunting di Dinas Sosial Kabupaten Barru. Dan \r\nuntuk mengetahui faktor-faktor yang menghambat Peran kelompok sadar Stunting\r\nMPOK DARTI dalam penurunan Stunting di Dinas Sosial Kabupaten Barru.\r\nPenelitian ini menggunakan Jenis penelitian deskriptif kualitatif, subjek penelitian \r\nyaitu Kepala Dinas Sosial, Bidang Perlindungan dan Jaminan Sosial, Ketua \r\nMPOK DARTI, Orang tua dari anak yang mengalami Stunting. Sumber data \r\ndiperoleh dengan cara observasi, wawancara dan dokumentasi. Pemeriksaan \r\nkeabsahan data dengan cara perpanjang pengamatan, meningkatkan ketekunan, \r\ndan triangulasi. Teknik analisis data menggunakan reduksi data, penyajian data, \r\ndan penarikan kesimpulan. Hasil penelitian menunjukkan bahwa Peran Kelompok \r\nSadar Stunting MPOK DARTI dalam penurunan Stunting di Dinas Sosial \r\nKabupaten Barru, sudah berjalan dengan efektif atas terpenuhinya 3 indikator\r\npenelitian yang di gunakan yaitu: peran fasilitatif, peran edukasi, peran teknis, dan \r\ntidak terpenuhinya 1 indikator yaitu peran representasional. Sedangkan faktor￾faktor yang menghambat Peran Kelompok Sadar Stunting MPOK DARTI dalam \r\npenurunan Stunting di Dinas Sosial Kabupaten Barru yaitu gangguan jaringan, \r\norang tua tidak ingin anaknya dikatakan Stunting, anak yang tidak menyukai \r\nmakanan yang berprotein. \r\nKata Kunci: Peran, MPOK DARTI, Stunting, Dinas Sosial.','ITBA AL-GAZALI BARRU',1,2024,1,1164,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1165,'Penelitian ini bertujuan untuk mengetahui implementasi kebijakan gerakan membangun\r\npemeliharaan operasional saluran irigasi di Desa Palakka Kabupaten Barru. Dan untuk mengetahui\r\nfaktor-faktor yang berpengaruh dalam implementasi kebijakan Gerakan membangun pemeliharaan\r\noperasional saluran irigasi di Desa Palakka Kabupaten Barru. Metode penelitian yang digunakan\r\nadalah metode penelitian kualitatif, sumber data yang diperoleh dengan cara survey, wawancara,\r\nobservasi, dan dokumentasi \r\nHasil penelitian ini menunjukkan bahwa Implementasi Kebijakan Gerakan Membagun\r\nPemeliharaan Operasional Saluran Irigasi di Desa Palakka Kabupaten Barru belum dijalankan\r\nsesuai dengan ketentuan. kesimpulan ini didasarkan atas tidak terpenuhinya 1 indikator penelitian\r\nseperti sumber daya meskipun 3 indikator lainnya sudah terpenuhi seperti komunikasi, disposisi,\r\ndan struktur birokrasi. Adapun faktor-faktor yang berpengaruh dalam Implementasi Kebijakan\r\nGerakan Membagun Pemeliharaan Operasional Saluran Irigasi Di Desa Palakka Kabupaten Barru,\r\nfaktor penghambat yaitu sumber daya dan faktor pendukung yaitu sumber daya aparatur, sumber\r\ndaya lingkungan dan kejelasan kelompok sasaran.\r\n','STIA AL-GAZALI BARRU',1,2023,1,1166,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1166,'Rahmawati. H . 20181156. Implementasi Peraturan Daerah Nomor 11 Tahun \r\n2016 Tentang Pengangkatan Dan Pemberhentian Perangkat Desa Di Desa Kading \r\nKecamatan Tanete Riaja Kabupaten Barru. Dibimbing oleh A. Pananrangi M dan \r\nWahyu Azikin \r\nPenelitian ini bertujuan untuk mengetahui implementasi Peraturan Daerah \r\nNomor 11 Tahun 2016 Tentang Pengangkatan Dan Pemberhentian Perangkat \r\nDesa Di Desa Kading Kecamatan Tanete Riaja Kabupaten Barru dan faktor-faktor \r\nyang mendukungnya. Jenis penelitian adalah deskriftif dengan pendekatan \r\nkualitatif. Subyek penelitian adalah orang-orang yang memahami implementasi \r\nPeraturan Daerah Nomor 11 Tahun 2016 Tentang Pengangkatan Dan \r\nPemberhentian Perangkat Desa Di Desa Kading Kecamatan Tanete Riaja \r\nKabupaten Barru. Teknik pengumpulan dengan cara observasi, wawancara dan \r\ndokumentasi. Pemeriksaan pengabsahan data melalui triangulasi. Kemudian \r\nteknik analisis data adalah pengumpulan data (data collection), mereduksi data \r\n(data reduction), menyajikan data (data display), dan penarikan kesimpulan \r\n(conclution drawing/verification).\r\nHasil penelitian ini menunjukkan bahwa implementsi Peraturan Daerah \r\nNomor 11 Tahun 2016 tentang Pengangkatan dan Pemberhentian Perangkat Desa \r\ndi Desa Kading Kecamatan Tanete Riaja Kabupaten Barru sudah berjalan dengan \r\nbaik. Temuan hasil penelitian ini didasarkan atas terpenuhinya seluruh indikator \r\npenelitian, yaitu untuk pengangkatan perangkat desa adalah: pembentukan tim \r\noleh kepala desa, persyaratan perangkat desa dan penjaringan dan penyaringan \r\nbakal calon. Kemudian untuk pemberhentian perangkat desa adalah: berhenti;\r\ndiberhentikan dan pemberhentian sementara Faktor-faktor yang mendukung \r\nimplementasi Peraturan Daerah Nomor 11 Tahun 2016 tentang Pengangkatan dan \r\nPemberhentian Perangkat Desa di Desa Kading Kecamatan Tanete Riaja \r\nKabupaten Barru adalah: komunikasi, sumber daya, disposisi (sikap) dan struktur \r\nbirokrasi.\r\n.Kata kunci: Implementasi Peraturan Daerah, pengangkatan dan pemberhentian \r\nperangkat desa','ITBA AL-GAZALI BARRU',1,2024,1,1167,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1167,'Daud Aslan 20191093, Analisis Pengelolahan Pasar Tradisional Tompo \r\nLemo-lemo di Desa Harapan Kecamatan Tanete Riaja Kabupaten Barru \r\nDibimbing oleh Chaliddin dan Musdalifa.\r\nPenelitin ini bertujuan untuk mengetahui Analisis pengelolaan pasar \r\ntradisional tompo lemo-lemo dan faktor penghambatnya di Desa Harapan \r\nKecamatan Tanete Riaja Kabupaten Barru. Penelitian ini menggunakan jenis \r\npenelitian deskriktif kualitatif subjek penelitian yaitu pengelola pasar dan penjual \r\ndan pembeli pada pasar tradisional tompo lemo-lemo Desa Harapan sumber data \r\ndiperoleh dengan cara observasi, wawancara dan dokumentasi pemeriksaan \r\nkeabsahan data, dengan cara uji kredibilitas,pengujian transferability pengujian \r\ndependability dan pengujian konfirmability, teknik analisis data, menggunakan \r\npegumpulan data, reduksi data, penyajian data dan penarikan kesimpulan, dan \r\npengujian konfirmability.\r\nHasil penelitian menunjukkan bahwa pengelolaan pasar tradisional tompo \r\nlemo-lemo Desa Harapan Kecamatan Tanete Riaja Kabupaten Barru, masih \r\nkurang baik dengan kurang terpenuhinya indikator, perencanaan pasar \r\npengorganisasian pasar, penggerakan pasar dan pengawasan pasar.sedangkan \r\nfaktor-faktor penghambat pengelolaan pasar tradisional tompo lemo-lemo di desa \r\nharapan Kecamatan Tanete Riaja Kabupaten Barru. Yaitu kondisi pasar tidak \r\ndilaksanakan setiap hari, hanya hari sabtu, kurangnya pembeli, dan banyaknya \r\npasar lain disekitarnya. \r\nKata Kunci: Pengelolaan, Pasar Tradisional','ITBA AL-GAZALI BARRU',1,2024,1,1165,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1168,'Penelitian  ini  bertujuan  untuk  mengetahui  :  Implementas i  Undang -Undang  No.16  Tahun\r\n2019 Tentang Upaya Pencegahan Pernikahan  Us ia Dini Pada Kantor Urus an A gama   Kecamatan\r\nBalus u Kabupaten  Barru. Dan   untuk mengetahi upaya -upaya pencegahan  pernikahan  us ia  dini\r\npada Kantor Urus an A gama Kecamatan  Balus u Kabupaten  Barru. Sumber data diperoleh  dengan\r\ncara  Obs ervas i,  W awancara,  Dokumentas i,  dan  Triangulas i.  Metode  penelitian   menggunakan\r\nDes kriptif Kualitatif.\r\nBerdasarkan  hasil  penelitian menunjukkan  bahwa,  Implementas i  Undang -Undang   No.16\r\nTahun 2019 Tentang Pernikahan Dalam Upaya Pencegahan Perkawinan A nak Us ia Dini   Pada\r\nKantor Urus an A gama Kecamatan  Balus u   s udah di terapkan  dengan baik atau dengan kata lain\r\ns udah melakukan penyuluhan kepada mas yarakat terkait bahaya yang ditimbulkan  dari pernikahan\r\nanak us ia dini , dikarenakan s emua pihak yang bertanggung jawab  s eperti penyuluh  Perkawinan\r\ndan Pemerintah  Des a s etempat  s udah melakukan  beberapa upaya -upaya  dalam hal pencegahan\r\npernikahan anak us ia dini di Kantor Urus an A gama Kecamatan  Balus u , s alah s atu upaya yang\r\nakan di laks anakan  untuk pencegahan  pernikahan  anak us ia  dini   yaitu mendangtangkan  pihak\r\nkes ehatan untuk mengs os ialis as ikan akibat pernikahan  dini agar mas yarkat s adar betul dan tidak\r\nakan terjadi pernikahan us ia dini','STIA AL-GAZALI BARRU',1,2022,2,1168,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1169,'Yusriani 20201069. Implementasi Smart city Dalam Meningkatkan Layanan \r\nInfrastruktur Berwawasan Lingkungan Di Dinas Lingkungan Hidup\r\nKabupaten Barru. Dibimbing oleh Nurlia dan Asriani\r\nPenelitian ini bertujuan untuk mengetahui implementasi smart city dan faktor \r\npenghambat dalam meningkatkan layanan infrastruktur berwawasan lingkungan di \r\nDinas Lingkungan Hidup Kabupaten Barru. Penelitian ini menggunakan jenis\r\npenelitian deskriptif dengan pendekatan kualitatif dengan teknik pengumpulan data \r\ndengan cara observasi, wawancara, dan dokumentasi. Analisis data menggunakan \r\nteknik reduksi data, penyajian data, dan penarikan kesimpulan. Dengan subjek \r\npenelitian yaitu kepala dinas lingkungan hidup, staf dinas lingkungan hidup serta \r\nmasyarakat umum kabupaten barru. Pemeriksaan dan keabsahan data dengan \r\nmenggunakan uji kreadibilitas, transferabilitas, dependabilitas, dan konfirmabilitas.\r\nHasil penelitian ini menunjukkan bahwa implementasi smart city dalam \r\nmeningkatkan layanan infrastruktur berwawasan lingkungan di Dinas Lingkungan \r\nHidup Kabupaten Barru melalui indikator penelitian, komunikasi, sumber daya, \r\ndisposisi, dan struktur birokrasi sudah cukup baik, namun masih terdapat indikator \r\nyang belum berjalan dengan baik yaitu sumber daya dan struktur birokrasi. Adapun \r\nfaktor yang menjadi penghambat yaitu kurangnya sumber daya, dan keterbatasan \r\nsarana dan prasarana.\r\nKata Kunci: implementasi, smart city, layanan infrastruktur','ITBA AL-GAZALI BARRU',1,2024,1,1169,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1170,'KISMAWATI AHMAD 20201102. Pengelolaan Aplikasi Sistem Keuangan \r\nDesa (SISKEUDES) dalam Rangka Mewujudkan Akuntabilitas dan \r\nTransparansi Laporan Keuangan Di Desa Watu Toa Kecamatan \r\nMarioriwawo Kabupaten Soppeng. Pembimbing A.Pananrangi dan Adam \r\nMalik. \r\nPenelitian ini bertujuan untuk mengetahui Pengelolaan Aplikasi Sistem \r\nKeuangan Desa (SISKEUDES) dan Akuntabilitas Pengelolaan SISKEUDES\r\ndalam Pelaporan Keuangan di Desa Watu Toa Kecamatan Marioriwawo \r\nKabupaten Soppeng. Dalam penelitian ini digunakana metode penelitian \r\nkualitatif, jenis data yang digunakan terdiri dari data primer dan data sekunder. \r\nTeknik pengumpulan data yang diterapkan yaitu observasi, wawancara, \r\ndokumentasi. Teknik analisis data melalui tahap pengumpulan data, reduksi data, \r\npenyajian data, dan penarikan kesimpulan/verifikasi. Hasil penelitian ini \r\nmenunjukkan Pengelolaan Aplikasi Sistem Keuangan Desa (SISKEUDES) di \r\nDesa Watu Toa Telah Berjalan dengan baik hal ini dibuktikan dengan \r\nterpenuhinya semua indikator penelitian. Yang meliputi Perencanaan, \r\nPenganggaran, Penatausahaan,Pembukuan/Pelaporan dan pertanggungjawaban. \r\nAkuntabilitas Pengelolaan Aplikasi Sistem Keuangan Desa (SISKEUDES) Dalam \r\nPelaporan Keuangan telah berjalan dengan lancar sesuai indikator penelitian yang \r\nmencakup perencanaan, pelaksanaan, pengawasan dan pertanggungjawaban. \r\nMelalui Kerjasama dengan Badan Permusyawaratn Desa (BPD).\r\nKata Kunci : Pengelolaan, Aplikasi SISKEUDES, Akuntabilitas, Transparansi','ITBA AL-GAZALI BARRU',1,2024,1,1170,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1171,'Intan Dwira. 20201034. Analisis Pemanfaatan Website E-Bugalu (Elektronik\r\nBuletin Warga Luwu) Sebagai Media Informasi Masyarakat Pada Dinas\r\nKomunikasi Informatika Statistik Dan Persandia Kabupaten Luwu. Dibimbing oleh Kamaruddin Hasan dan M. Alwi A. Buraerah\r\nPenelitian ini bertujuan untuk mengetahui pemanfaatan website E-Bugalu dan\r\nfaktor-faktor yang mendukung dan menghambat penggunaan website E-Bugalu\r\nsebagai media informasi masyarakat di Kantor Dinas Komunikasi Informatika\r\nStatistik dan Persandian Kabupaten Luwu. Penelitian ini menggunakan tipe\r\npenelitian deskriptif kualitatif dengan sumber data diperoleh dengan cara observasi, wawancara, dan dokumentasi. Analisis data menggunakan teknik reduksi data, penyajian data, dan penarikan kesimpulan. Hasil penelitian ini menunjukkan bahwa\r\nanalisis pemanfaatan Website E-Bugalu (elektronik buletin warga luwu) sebagai\r\nmedia informasi masyarakat pada dinas komunikasi informatika statistik dan\r\npersandian Kabupaten Luwu melalui aspek pemanfaatan, efektivitas, efisiensi dan\r\nekonomis sudah terlaksana dengan cukup maksimal. Adapun faktor pendukungnya\r\nyaitu teknologi informasi dan desain website, dan faktor penghambatnya yaitu\r\njaringan internet dan sumber daya manusia (SDM). Kata kunci: Pemanfaatan, Website, Media, Komunik','ITBA AL-GAZALI BARRU',1,2024,1,1171,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1172,'Serlianti. 20191172. Kinerja Kelompok Sadar Wisata (Pokdarwis) Wanua \r\nMassiringpulu dalam Pengembangan Pariwisata Di Desa Palakka \r\nKecamatan Barru Kabupaten Barru. Dibimbing oleh Safaruddin dan Rosdiana.\r\nPenelitian ini bertujuan untuk mengetahui Kinerja Kelompok Sadar Wisata \r\n(Pokdarwis) Wanua Massiringpulu dalam mengembangkan pariwisata yang ada di \r\nDesa Palakka Kecamatan Barru Kabupaten Barru, dan Untuk mengetahui faktor￾faktor yang menghambat Kinerja dari (Pokdarwis) Wanua Massiringpulu dalam \r\nmengembangkan pariwisata yang ada di Desa Palakka Kecamatan Barru \r\nKabupaten Barru. Penelitian ini menggunakan jenis penelitiaan deskriptif \r\nKualitatif dengan pengumpulan data diperoleh dengan cara observasi, wawancara \r\ndan dokumentasi. Teknik Analisis data menggunakan kondensasi data, penyajian \r\ndata dan penarikan kesimpulan. Hasil penelitian ini menujukan bahwa kinerja \r\nPokdarwis Wanua Massiringpulu mengalami penurunan kinerja dibuktikan dari \r\nindikator kuantitas yaitu kegiatan yang dihasilkan menjadi sedikit dari tahun \r\nsebelumnya, serta penggunaan waktu dalam kerja yaitu beberapa pengurus tidak \r\nhadir dalam kegiatan-kegiatan yang dilakukan, dan dari indikator kerjasama yaitu \r\nkerjasama antar pengurus kurang, sedangkan kerjasama dengan beberapa \r\norganisasi sudah dilakukaan dan untuk indikator kualitas sudah cukup baik. \r\nAdapun faktor yang menghambat kinerja dari Pokdarwis Wanua Massiringpulu\r\nyaitu Sumber daya manusia (SDM), sarana dan prasarana, kedisiplinan, \r\nkomunikasi, belum tersosialisasi secara luas, kurangnya biaya atau anggaran, \r\nkurangnya dukungan dari pemerintah setempat.\r\nKata Kunci : Kinerja, Pokdarwis, Pengembangan Pariwisata','ITBA AL-GAZALI BARRU',1,2024,1,1173,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1173,'Rusmin, 20201018. Kebijakan Pemerintah Desa Madello Terhadap \r\nPengembangan Ekowisata Mangrove Dalam Meningkatkan Ekonomi Wisata \r\nDi Pulau Pannikiang Desa Madello Kecamatan Balusus Kabupaten Barru. \r\nDibimbing oleh A.Ariyadi dan Andi Muhammad Ishak Ismail\r\nPenelitian ini bertujuan untuk mengetahui Kebijakan Pemerintah Desa \r\nMadello Terhadap Pengembangan Ekowisata Mangrove Dalam Meningkatkan \r\nEkonomi Wisata Di Pulau Pannikiang Desa Madello Kecamatan Balusu Kabupaten \r\nBarru. Sumber data yang diperoleh dengan cara observasi, wawancara dan \r\ndokumentasi. Analis data menggunakan pengumpulan data, mereduksi data, \r\nmenyajikan data dan penarikan kesimpulan. Hasil penelitian ini menunjukkan \r\nbahwa kebijakan yang dilakukan pemerintah desa madello hanya membentuk \r\nKelompok Sadar Wisata (Pokdarwis) tanpa adanya dorongan dan dukungan dari \r\npemerintah Desa Madello. Sehingga fasilitas-fasilitas di hutan mangrove \r\nkhususnya jembatan kurangnya perhatian dan akhirnya terbengkalai dan \r\nmengalami rusak berat. Yang mengakibatkan kurangnya kunjungan wisatawan \r\ndihutan mangrove sehingga pengembangan ekowisata mangrove tidak \r\nmeningkatkan perekonomian bagi masyarakat. Adapun faktor penghambat dalam \r\nmelakukan pengembangan dalam pengelolaan hutan mangrove yang ada di Pulau \r\nPannikiang adalah pengembangan hutan mangrove yang belum merata, \r\nketersediaan dana dan dan fasilitas umum yang belum memadai, terbatasnya \r\nkemampuan dan keterampilan sumber daya manusia disekitar hutan mangrove\r\ndalam memanfaatkan potensi yang ada\r\nKata Kunci : Kebijakan Pemerintah, Pengembangan Ekowisata Mangrove dan \r\nPeningkatan Ekonomi Masyarakat.','ITBA AL-GAZALI BARRU',1,2024,1,1174,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1174,'Nama:Suharni. Nim:20191148. Implementasi Pengolaan Sampah Medis Padat\r\nDi UPT Puskesmas Palakka Kecamatan Barru Kabupaten Barru. Pembimbing\r\n: Dian Pratiwi dan Adam Malik.\r\nPenelitian ini bertujuan untuk mengetahui: Implementasi pengolaan limbah\r\nmedis padat di UPT Puskesmas Palakka Kecamatan Barru Kabuapeten Barru dan\r\nbagaimana implementasi pengeolaan limbah medis padat di UPT Puskesmas\r\nPalakka Kecamatan Barru Kabupaten Barru dan apakah faktor pendukung dan\r\npenghambat implementasi pengolaan limbah medis padat di UPT Puskesmas\r\nPalakka Kecamatan Barru Kabupaten Barru. Sumber data diperoleh dengan cara\r\nobservasi partisipan, wawancara mendalam, dan studi dokumentasi.\r\nMetode penelitian : tipe penelitian, lokasi dan waktu penelitian, jenis dan\r\nsumber data, teknik pengumpulan data dan teknik analisis data. Penelitian ini adalah\r\npenelitian yang menggunakan pendekatan deskriptif kualitatif.\r\nHasil penelitiannya masalah lingkungan sangat berkaitan dengan dunia\r\nkesehatan. Lingkungan yang sehat dibutuhkan untuk mencapai masyarakat dengan\r\nkondisi yang sehat.\r\nKata Kunci : Implementasi, Pengelolaan dan Sampah Medis','ITBA AL-GAZALI BARRU',1,2024,1,1172,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1175,'Penelitian ini bertujuan untuk mengetahui pengelolaan produk pegadaian  dalam meningkatkan  jumlah nasabah  di Unit Pelayanan Syariah Cempae Kecamatan Segeri\r\nKabupaten Pangkep. Selain itu juga bertujuan untuk mengetahui upaya  apa saja yang dilakukan untuk meningkatkan jumlah nasabah dalam pengelolaan produk pegadaian di Unit Pelayanan Syariah Cempae Kecamatan Segeri Kabupaten Pangkep. Tipe penelitian yang digunakan adalah kualitatif. Jenis data adalah kualitatif dan sumber data adalah data primer dan data skunder. Teknik pengumpulan data diperoleh dengan cara  observasi, wawancara dan dokumentasi. Kemudian teknik analisis data adalah a. Pengumpulan Data (Data Collection), b. Mereduksi Data (Data Reduction), c. Menyajikan Data (Data Display), dan d. Penarikan Kesimpulan (Conclusion Drawing/Verification). Hasil penelitian ini menunjukkan bahwa Pengelolaan produk pegadaian dalam meningkatkan  jumlah nasabah di Unit Pelayanan Syariah Cempae  Kecamatan Segeri Kabupaten Pangkep sudah berjalan dengan baik. Kesimpulan ini didasarkan atas terpenuhinya seluruh indikator penelitian mengenai fungsi-fungsi manajemen, yaitu: perencanaan  (planning), pengorganisasian (organizing), penggerakan (actuating), dan pengawasan (controlling). Kemudian upaya meningkatkan jumlah nasabah dalam pengelolaan produk pegadaian di Unit Pelayanan Syariah Cempae Kecamatan Segeri Kabupaten Pangkep, seperti menawarkan produk pegadaian yang menarik, kemudahan persyaratan, menawarkan jasa yang terjangkau, menawarkan berbagai hadiah, dan meningkatkan kualitas pelayanan belum sepenuhnya mampu meningkatkan jumlah nasabah.','STIA AL-GAZALI BARRU',1,2022,2,1175,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1176,'Reski Aulia, 20191002. Upaya Pemenuhan Hak Kesehatan Narapidana di Rumah\r\nTahanan Kelas II B Kabupaten Barru.\r\nPembimbing : H. Kamaruddin Hasan dan M. Alwi A. Buraerah\r\nTujuan penelitian ini adalah Untuk mengetahui upaya pemenuhan hak mendapatkan\r\npelayanan kesehatan bagi narapidana di Rumah Tahanan kelas II B Kabupaten Barru\r\ndan Untuk mengetahui faktor-faktor apakah yang menghambat upaya pemenuhan hak\r\nmendapatkan pelayanan kesehatan bagi narapidana di Rumah Tahanan kelas II B\r\nKabupaten Barru. Metode penelitian yang digunakan pada penelitian ini yaitu tipe\r\ndeskriptif kualitatif. Teknik pengumpulan data diperoleh dengan cara observasi,\r\nwawancara, dokumentasi. Adapun teknik analisis data yang digunakan yaitu,\r\npengumpulan data, mereduksi data, menyajikan data dan penarikan kesimpulan. Hasil\r\npenelitian ini menujukkan bahwa Upaya Pemenuhan Hak Kesehatan Narapidana di\r\nRumah Tahanan Kelas II B Kabupaten Barru yaitu : Pemenuhan hak untuk\r\nmendapatakan kesehatan di Rumah Tahanan Kelas II B Kabupaten Barru sudah\r\nterpenuhi meskipun belum maksimal karna tenaga kesehatan yang terbatas dan fasilitas\r\nyang belum maksimal untuk rumah tahanan yang ful kapasitas, dan kendala yang di\r\nhadapi terkait upaya pemenuhan hak mendapatkan pelayanan kesehatan bagi narapidana\r\ndi Rumah Tahanan kelas II B Kabupaten Barru juga menyangkut jumlah tenaga medis\r\ndan beberapa kendala teknis seperti identitas yang kurang lengkap.\r\nKata Kunci : Upaya Pemenuhan, Hak, Kesehatan Narapidana.','ITBA AL-GAZALI BARRU',1,2024,3,1176,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1177,'Siti Miladia Istianah 20201003. Kebijakan Zakat Community Development\r\n(ZCD) Dalam Pemberdayaan Ekonomi Masyarakat di Badan Amil Zakat \r\nNasional (BAZNAS) Kabupaten Barru. Dibimbing oleh Rasidin Calundu dan \r\nAsriani.\r\nKemiskinan yang masih tinggi di Kabupaten Barru menjadi tantangan \r\nsignifikan yang memerlukan intervensi berbasis kebijakan yang efektif. Salah satu \r\nupaya yang dilakukan adalah melalui kebijakan Zakat Community Development \r\n(ZCD) yang diterapkan oleh Badan Amil Zakat Nasional (BAZNAS) untuk \r\npemberdayaan ekonomi masyarakat. Penelitian ini bertujuan untuk mengetahui\r\nkebijakan Zakat Community Development (ZCD) dalam pemberdayaan ekonomi \r\nmasyarakat di Badan Amil Zakat Nasional (BAZNAS) Kabupaten Barru dan \r\nuntuk mengetahui faktor-faktor yang mempengaruhi kebijakan Zakat Community \r\nDevelopment (ZCD) dalam pemberdayaan ekonomi masyarakat di Badan Amil \r\nZakat Nasional (BAZNAS) Kabupaten Barru. Penelitian ini menggunakan \r\npendekatan kualitatif deskriptif dengan analisis data yang dilakukan melalui \r\nresduksi data, penyajian data, dan verifikasi atau penarikan kesimpulan \r\nberdasarkan wawancara mendalam dan observasi pastisipatif, serta lokasi \r\npenelitian pada Kantor Badan Amil Zakat Nasional (BAZNAS) Kabupaten \r\nBarru.\r\nHasil penelitian menunjukkan bahwa kebijakan Zakat Community \r\nDevelopment (ZCD) dalam pemberdayaan ekonomi masyarakat di Badan Amil \r\nZakat Nasional (BAZNAS) Kabupaten Barru efektif dalam meningkatkan \r\npemberdayaan ekonomi masyarakat, dengan indikator keberhasilan meliputi \r\nkomunikasi, sumber daya, disposisi, dan struktur birokrasi yang memadai,\r\nimplikasi dari temuan ini menunjukkan perlunya penguatan komunikasi dan \r\nalokasi sumber daya yang berkelanjutan untuk mendukung inisiatif serupa di \r\nwilayah lain. Terdapat pula faktor yang mempengaruhi kebijakan Zakat \r\nCommunity Development (ZCD) dalam pemberdayaan ekonomi masyarakat \r\ndengan beberapa faktor yaitu manfaat (benefit), peluang (opportunity), biaya \r\n(cost), dan resiko (risk), implikasi dari temuan ini menunjukkan perlunya \r\nmemanfaatkan peluang yang ada, mengelola biaya secara efisien, dan \r\nmeminimalkan resiko yang semuanya berkontribusi pada keberlanjutan dan \r\nkesuksesan program pemberdayaan ekonomi masyarakat.\r\nKata Kunci: Kebijakan, Zakat Community Development, Pemberdayaan\r\nEkonomi ','ITBA AL-GAZALI BARRU',1,2024,1,1177,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1178,'Muh. Lutfi Alfian, 20201025,Tingkat Partisipasi Masyarakat Pemilih Dalam \r\nPenyelenggaraan Pemilihan Umum (Pemilu) 2024 Di Desa Pujananting \r\nKecamatan Pujananting Kabupaten Barru, dibimbing oleh Kamaruddin Hasan \r\ndan A.Ariyadi\r\nPenelitian ini bertujuan untuk mengetahui tingkat partisipasi masyarakat \r\npemilih dalam penyelenggaraan Pemilihan Umum (PEMILU) 2024 di Desa \r\nPujananting Kecamatan Pujananting Kabupaten Barru, Serta Faktor yang \r\nmempengaruhi tingkat partisipasi pemilih dalam penyelenggaraan Pemilihan \r\nUmum (PEMILU) 2024 di Desa Pujananting Kecamatan Pujananting Kabupaten\r\nBarru, menggunakan metode penelitian kualitatif dengan pendekatan deskriptif, \r\nadapun teknik pengumpulan data, dengan observasi, wawancara dan dokumentasi, \r\nHasil dari penelitian ini menunjukkan tingkat partisipasi masyarakat dalam \r\npelaksanaan Pemilihan Umum (PEMILU) 2024 di Desa Pujananting, Kecamatan \r\nPujananting Kabupaten Barru, memiliki tingkat keaktifan, dimana masyarakat \r\naktif dalam proses pemungutan suara dan juga aktif dalam berbagai tahapan baik \r\ndalam bentuk sosialisasi, pencocokan data pemilih serta memastikan informasi \r\nyang tepat dan akurat terkait dengan kandidat yang akan dipilih dalam proses \r\npemilihan tersebut. Faktor yang mendorong tingkat partisipasi pemilih yaitu \r\nadanya kesadaran masyarakat akan kewajiban sebagai warga negara, dengan \r\nharapan adanya perubahan dan peningkatan kondisi di lingkungan mereka, serta \r\nsosialisasi yang intensif dari penyelenggara pemilu, dimana upaya ini menjadi \r\nbentuk edukasi serta memastikan akses informasi mudah dijangkau oleh seluruh \r\nlapisan masyarakat.\r\nKata Kunci : Partisipasi, Masyarakat,Pemilu.','ITBA AL-GAZALI BARRU',1,2024,1,1178,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1179,'Aan Ade Kusuma Wardana. 20201038. Implementasi Pengelolaan Anggaran \r\nRencana Kerja Pemerintah Desa (RKPDES) Tahun 2023 Di Desa Lipukasi \r\nKecamatan Tanete Rilau Kabupaten Barru. Dibimbing oleh A. Ariyadi dan \r\nMuliati.\r\nPenelitian ini bertujuan untuk mengetahui Implementasi Pengelolaan \r\nAnggaran Rencana Kerja Pemerintah Desa (RKPDES) Tahun 2023 Di Desa \r\nLipukasi Kecamatan Tanete Rilau Kabupaten Barru dan untuk mengetahui faktor￾faktor yang menghambat Implementasi Pengelolaan Anggaran Rencana Kerja \r\nPemerintah Desa (RKPDES) Tahun 2023 Di Desa Lipukasi Kecamatan Tanete \r\nRilau Kabupaten Barru. Jenis data, sumber data, data sekunder dan data primer \r\ndiperoleh dengan cara observasi, wawancara, dan dokumentasi, analisis data, dan \r\npengumpulan data. Hasil penelitian ini menunjukkan bahwa implementasi \r\npengelolaan anggaran secara umum berjalan dengan baik, namun anggaran yang \r\nbersumber dari APBN dan APBD belum mencukupi untuk merealisasikan semua \r\nkegiatan yang direncanakan. Hambatan utama dalam implementasi ini adalah \r\nketerbatasan dana desa dari APBN dan APBD, yang menyebabkan beberapa \r\nprogram atau proyek tidak dapat direalisasikan. Selain itu, keterbatasan fasilitas \r\ndan tenaga kerja turut mempengaruhi efisiensi administrasi dan \r\npelaksanaan kegiatan.\r\nKata Kunci : implementasi, anggaran, Rencana Kerja Pemerintah Desa \r\n(RKPDES)','ITBA AL-GAZALI BARRU',1,2024,1,1179,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1180,'Achmad Rifai. 20191157. Implementasi Sistem Database Pemasyarakatan \r\n(SDP) fitur kunjungan dalam upaya meningkatkan kualitas pelayanan \r\nterhadap pengunjung di Rumah Tahanan Negara Kelas IIB Kabupaten \r\nBarru. Dibimbing oleh Kamaruddin Hasan dan Sri Hardiyanti Lukman\r\nPenelitian ini bertujuan untuk mengevaluasi implementasi Sistem Database \r\nPemasyarakatan (SDP) fitur kunjungan dalam upaya meningkatkan kualitas \r\npelayanan terhadap pengunjung di Rumah Tahanan Negara Kelas IIB Kabupaten \r\nBarru. SDP merupakan sistem berbasis teknologi informasi yang dirancang untuk \r\nmemfasilitasi manajemen data tahanan serta pengelolaan kunjungan secara \r\nterintegrasi, bertujuan untuk meningkatkan efisiensi dan transparansi dalam \r\npelayanan. Penelitian ini menggunakan metode kualitatif dengan pendekatan \r\ndeskriptif, menggabungkan teknik pengumpulan data melalui observasi, \r\nwawancara, dan studi dokumentasi. Hasil penelitian menunjukkan bahwa \r\npenggunaan SDP fitur kunjungan telah berkontribusi signifikan dalam \r\nmeningkatkan efektivitas pelayanan, terutama dalam hal pengelolaan waktu \r\nkunjungan dan pengurangan antrian manual. SDP juga mempermudah proses \r\nregistrasi dan pemantauan kunjungan, sehingga menciptakan pengalaman yang \r\nlebih terstruktur bagi pengunjung. Dalam hal ini, indikator implementasi yang \r\ndievaluasi meliputi: komunikasi, yang menunjukkan pentingnya alur informasi \r\nyang jelas dan transparan antara petugas dan pengunjung, serta antara petugas satu \r\ndengan lainnya; sumber daya, yang mencakup ketersediaan dan kualitas sumber \r\ndaya manusia serta infrastruktur teknologi yang mendukung sistem; dan disposisi, \r\nyang mencerminkan sikap dan komitmen dari pihak yang terlibat dalam \r\nimplementasi sistem untuk mendukung keberhasilan operasional SDP. Namun \r\ndemikian, penelitian ini juga menemukan beberapa hambatan dalam implementasi, \r\nseperti keterbatasan sumber daya manusia, infrastruktur teknologi yang belum \r\noptimal, dan kurangnya stabilitas jaringan internet. Oleh karena itu, penelitian ini \r\nmerekomendasikan peningkatan kapasitas sumber daya manusia, perbaikan \r\ninfrastruktur teknologi, serta perbaikan stabilitas jaringan internet untuk \r\nmemastikan peningkatan pelayanan yang berkelanjutan. Dengan demikian, \r\nimplementasi SDP fitur kunjungan diharapkan dapat menjadi model dalam \r\npengembangan sistem pelayanan berbasis teknologi di lembaga pemasyarakatan \r\nlainnya, guna mencapai pelayanan yang lebih efisien, transparan, dan responsif \r\nterhadap kebutuhan masyarakat.\r\nKata kunci: Sistem Database Pemasyarakatan, layanan publik, Rumah Tahanan','ITBA AL-GAZALI BARRU',1,2024,1,1180,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1181,'Nadya Salzabila. 20201001. Implementasi Aplikasi Identitas Kependudukan \r\nDigital (IKD) dalam Menunjang Akurasi Data Kependudukan dan Pencatatan \r\nSipil Kabupaten Barru. Dibimbing oleh Andi Muhammad Ishak Ismail dan Sri \r\nHardiyanti Lukman\r\nPenelitian ini bertujuan untuk mengetahui implementasi aplikasi Identitas \r\nKependudukan Digital (IKD) dalam menunjang akurasi data kependudukan di \r\nDinas Kependudukan dan Pencatatan Sipil kabupaten Barru dan untuk mengetahui \r\nfaktor-faktor yang menghambat implementasi aplikasi Identitas Kependudukan \r\nDigital (IKD) dalam menunjang akurasi data kependudukan di Dinas \r\nKependudukan dan Pencatatan Sipil kabupaten Barru. Sumber data diperoleh \r\ndengan cara Observasi, Wawancara, dan Dokumentasi. Analisis data menggunakan \r\nreduksi data, penyajian data dan penarikan kesimpulan. Hasil penelitian ini \r\nmenunjukkan bahwa implementasi Aplikasi Identitas Kependudukan Digital \r\nberjalan baik namun perlu untuk lebih dimaksimalkan. Adapun beberapa faktor \r\nyang menjadi penghambat implementasi Aplikasi Identitas Kependudukan Digital \r\n(IKD) yaitu kurangnya partisipasi atau dukungan dari masyarakat juga sumber daya \r\nyang belum maksimal yakni jumlah pegawai ASN berjumlah 28 orang dan pegawai \r\nhonorer berjumlah 30 orang. kemudian jaringan internet yang terbatas di daerah￾daerah tertentu seperti daerah pegunungan sehingga sulit untuk mengakses aplikasi \r\nIdentitas Kependudukan Digital (IKD).\r\nKata Kunci : Aplikasi, Identitas Kependudukan Digital (IKD), Data \r\nKependudukan.','ITBA AL-GAZALI BARRU',1,2024,1,1181,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1182,'Penelitian ini bertujuan untuk mengetahui Penerapan transparansi dan akuntabilitas serta faktor-faktor yang mempengaruhi pengelolaan dana bantuan operasional sekolah (BOS) di Madrasah Tsanawiyah  DDI Bonto-Bonto Kelurahan Bonto-Bonto Kecamatan Ma’rang Kabupaten Pangkep, Adapun tipe penelitian yang digunakan yaitu pendekatan deskriptif kualitatif, jenis data yang digunakan yaitu data primer dan skunder disertai dengan teknik pengumpulan data yang diterapkan yaitu  observasi, wawancara, dan dokumentasi, sedangkan teknik analisis data melalui tahap pengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan atau verifikasi. Hasil penelitian menunjukkan bahwa penerapan prinsip transparansi dan akuntabilitas pengelolaan dana bantuan operasional sekolah (BOS) Madrasah Tsanawiyah DDI Bonto-Bonto cukup baik, karena sudah sesuai dengan indikator transparansi serta indikator akuntabilitas dengan keterlibatan semua pihak yang berkepentingan, serta faktor-faktor yang mempengaruhi Transparansi dan Akuntabilitas Pengelolaan Dana Bantuan Oprasional Sekolah (BOS) Di Madrasah Tsanawiyah DDI Bonto-Bonto yaitu kurangnya media informasi, sumber daya manusia, jumlah siswa yang dimiliki, sarana dan prasarana terbatas serta sumber dana yang dimiliki belum cukup untuk memenuhi kebutuhan madrasah.','STIA AL-GAZALI BARRU',1,2021,2,1182,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1183,'Hafifah. 20191204. Implementasi Kebijakan Pemerintah dalam Penerbitan \r\nKartu Usaha Kelautan dan Perikanan di Kelurahan Bawasalo Kecamatan \r\nSegeri Kabupaten Pangkep. Dibimbing oleh Andi Aminah dan Fitrianti\r\nPenelitian ini bertujuan untuk mengetahui implementasi kebijakan Kartu \r\nUsaha Kelautan dan Perikanan (KUSUKA) dan untuk mengetahui faktor yang \r\nmempengaruhi kebijakan Kartu Usaha Kelautan dan Perikanan (KUSUKA) di \r\nKelurahan Bawasalo Kecamatan Segeri Kabupaten Pangkep. Metode yang \r\ndigunakan dalam penelitian ini adalah kualitatif deskriptif dengan teknik \r\npengumpulan data berupa observasi, wawancara, dan dokumentasi. Adapun teknik \r\nanalisis data yang digunakan yaitu pengumpulan data, kondensasi data, penyajian \r\ndata dan penarikan kesimpulan. Hasil penelitian ini menunjukkan bahwa \r\nimplementasi kebijakan pemerintah dalam penerbitan Kartu Usaha Kelautan dan \r\nPerikanan (KUSUKA) dalam pelaksanaannya sudah sesuai dengan standar \r\noperasional prosedur (SOP) di tandai dengan adanya 270 orang pemegang kartu \r\nusaha kelautan dan perikanan (KUSUKA). Adapun faktor yang mempengaruhi \r\nimplementasi kebijakan Kartu Usaha Kelautan dan Perikanan (KUSUKA) yaitu, \r\nfaktor pendukung disposisi dan struktur birokrasi. Selain itu faktor penghambat \r\nyaitu komunikasi antara pelaksana dan masyarakat belum berjalan dengan baik,\r\ndimana masih adanya masyarakat yang belum memiliki kartu usaha kelautan dan \r\nperikanan (KUSUKA), selain itu sumber daya berupa sarana dan prasarana yang\r\nmasih kurang seperti jaringan internet yang belum memadai.\r\nKata Kunci: Implementasi dan kebijakan KUSUKA','ITBA AL-GAZALI BARRU',1,2024,1,1183,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1184,'Indah Saputri. 20201112.Kebijakan Pemerintah Desa dalam Membangun \r\nInfrastruktur Jalan di Desa Tapong Kecamatan Tellu Limpoe Kabupaten \r\nBone.\r\nPenelitian ini bertujuan untuk mengetahui Kebijakan Pemerintah Desa \r\nDalam Membangun Infrastruktur Jalan dan faktor-faktor yang mempengaruhi \r\nKebijakan Pemerintah Desa dalam membangun infrastruktur jalan di Desa \r\nTapong Kecamatan Tellu Limpoe Kabupaten Bone. Penelitian ini menggunakan \r\njenis penelitian deskriptif kualitatif dengan sumber data diperoleh dengan cara \r\nobservasi, wawancara, dan dokumentasi. Informan dalam penelitian ini yaitu \r\nKepala Desa, Sekertaris Desa, Aparat Desa dan Masyarakat. Adapun langkah￾langkah untuk teknik analisis data yaitu kondensasi data, penyajian data, \r\npenarikan kesimpulan dan verifikasi data. Hasil penelitian ini menunjukkan\r\nbahwa faktor pendukung pembangunan infrastruktur jalan yaitu adanya kesadaran \r\npemerintah dan masyarakat, adanya solidaritas masyarakat terhadap pembangunan \r\ninfrastruktur jalan. Adapun faktor penghambat pembangunan infrastruktur jalan \r\nyaitu kurangnya sosialisasi pemerintah terhadap masyarakat, kurangnya \r\nkoordinasi pemerintah dan masyarakat terhadap pembangunan infrastruktur jalan \r\ndan adanya faktor keegoisan.\r\nKata Kunci: Kebijakan, Pemerintah Desa, Infrastruktur Jalan','ITBA AL-GAZALI BARRU',1,2024,1,1185,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1185,'Farhan. 20191203. Kebijakan Pemerintah Desa Dalam Meningkatkan \r\nKesadaran Tertib Administrasi Kependudukan dan Pencatatan Sipil di Desa \r\nBenteng Kecamatan Mandalle Kabupaten Pangkep. Dibimbing oleh Chaliddin \r\ndan Muliati.\r\nPenelitian ini bertujuan untuk mengetahui Kebijakan Pemerintah Desa \r\ndalam Meningkatkan Kesadaran tertib Administrasi Kependudukan dan \r\nPencatatan Sipil, serta Faktor-faktor yang menjadi Penghambat di Desa Benteng \r\nKecamatan Mandalle Kabupaten Pangkep. Penelitian ini menggunakan metode \r\ndeskriptif kualitatif dengan teknik pengumpulan data melalui observasi, \r\nwawancara, dan dokumentasi. Teknik Analisis Data melalui tahap Pengumpulan \r\nData, Reduksi Data, Penyajian Data dan Penarikan Kesimpulan. Hasil penelitian \r\nmenunjukkan bahwa Kebijakan Pemerintah Desa dalam meningkatkan kesadaran \r\ntertib administrasi kependudukan dan pencatatan sipil di Desa Benteng \r\nKecamatan Mandalle Kabupaten Pangkep sudah terlaksana dengan baik, dengan \r\nterpenuhinya indikator Sosialisasi, Peningkatan Akses, Peningkatan Kualitas \r\nLayanan dan Penggunaan Teknologi. Sedangkan Faktor-faktor yang menjadi \r\nPenghambat Kebijakan Pemerintah Desa dalam meningkatkan kesadaran tertib \r\nadministrasi kependudukan dan Pencatatan Sipil di Desa Benteng Kecamatan \r\nMandalle Kabupaten Pangkep, yaitu Kualitas Sumber Daya Manusia (SDM)\r\nrendah, keterbatasan fasilitas dan Rendahnya Kesadaran Masyarakat.\r\nKata Kunci : Kebijakan, Pemerintah dan Pencatatan Sipil','ITBA AL-GAZALI BARRU',1,2024,1,1184,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1186,' Penelitian ini bertujuan untuk mengetahui : Kualitas Pelayanan UPTD\r\nKesehatan Puskesmas Ralla Kab. Barru . Jenis Data penelitian yang digunakan\r\nadalah tipe penelitian kualitatif, Lokasi dan waktu penelitian ,jenis dan sumber\r\ndata, data primer dan sekunder  tekhnik pengumpulan data diperoleh dengan cara\r\nSurvey, Wawancara, Observasi, dan Dokumentasi. Analisis data melalui tahap\r\nReduksi Data, Penyajian data dan Penarikan Kesimpulan. /verifikasi. \r\n      Hasil penelitian ini menunjukkan bahwa Kualitas Pelayanan UPTD Kesehatan\r\nPuskesmas Ralla Kab. Barru sudah berjalan dengan baik .berdasarkan hasil survey\r\nkepuasan pasien tersebut dapat di katakana bahwa setiap unsur pelayanan mulai\r\ndari loket kartu ,pemeriksaan dokter , apotek pengambilan obat,sedang berjalan\r\nsesuai dengan harapan masyarakat.\r\n','STIA AL-GAZALI BARRU',1,2022,2,1188,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1187,'Sudirman, 20191147, Kualitas Pelayanan Puskesmas Pembantu (PUSTU)\r\nDalam Meningkatkan Kepuasan Masyarakat Dusun Lemo Desa Harapan \r\nKecamatan Tanete Riaja Kabupaten Barru, yang dibimbing oleh Dian Pratiwi \r\ndan Andi Muhammad Ishak Ismail.\r\nPenelitian ini bertujuan untuk mengetahui Bagaimana kualitas pelayanan \r\nkesehatan di Puskesmas Pembantu (PUSTU) Dusun Lemo Kecamatan Tanete \r\nRiaja Kabupaten Barru dan juga untuk mengetahui faktor-faktor yang \r\nmempengaruhi kepuasan Masyarakat dalam pelayanan kesehatan di Puskesmas \r\nPembantu (PUSTU) Dusun Lemo Kecamatan Tanete Riaja Kabupaten Barru.\r\nPenelitian ini menggunakan tipe penelitian deskriptif kualitatif dengan sumber\r\ndata diperoleh dengan cara observasi, wawancara, dan dokumentasi. Hasil \r\npenelitian ini menunjukkan bahwa kualitas pelayanan kesehatan di Puskesmas \r\nPembantu (PUSTU) Dusun Lemo Kecamatan Tanete Riaja Kabupaten Barru \r\nmelalui indicator kualitas pelayanan yakni Fasilitas Fisik (tangible), Keandalan \r\n(reability), Jaminan (Assurance), Ketanggapan (Responsiveness), Perhatian \r\n(Empathy). Dalam hal ini PUSTU telah menunjukkan kemampuan pemberi\r\nlayanan semaksimal mungkin dengan memberikan pelayanan yang akan \r\nmemenuhi harapan dan kepuasan pasien meskipun sebenarnya masyarakat belum \r\nterlalu puas dikarenakan kondisi fasilitas fisik yg ada di PUSTU masih kurang \r\nmemadai, seperti kurangya tempat duduk, kasur untuk pasien, alat stering,\r\nbrangkar, tempat sampah dan lain lain yang disebabkan karna kurangnya \r\ndukungan dari pemerintah daerah; perencanaan yang tidak terintegrasi diberbagai \r\ntingkat admisistrasi di pemerintah daerah; serta kurangnya penyelenggaraan dan \r\npenganggaran diklat bagi tenaga kesehatan di PUSTU.\r\nKata kunci: Pelayanan, Puskesmas, Kesehatan, Sumber Daya Manusia','STIA AL-GAZALI BARRU',1,2023,1,1186,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1188,'ISMA GUSTIANTI, 20201097. Implementasi Kebijakan Pemerintah Dalam \r\nPenyelenggaraan Pendidikan di UPTD SDN 159 Barru Kecamatan \r\nPujananting Kabupaten Barru.Pembimbing: H. Kamaruddin Hasan dan Sri \r\nHardiyanti Lukman\r\nPenelitian ini bertujuan untuk mengetahui implementasi kebijakan \r\npemerintah dalam penyelenggaraan pendidikan di UPTD SDN 159 Barru \r\nKecamatan Pujananting Kabupaten Barru. Penelitian ini menggunakan jenis \r\npenelitian deskriptif kualitatif. Teknik pengumpulan data meliputi observasi, \r\nwawancara, dan dokumentasi. Teknik analisis data yaitu kondensisasi data, \r\npenyajian data dan penarikan kesimpulan.\r\nHasil penelitian ini menunjukkan bahwa implementasi kebijakan pemerintah \r\ndalam penyelenggaraan pendidikan di UPTD SDN 159 Barru Kecamatan \r\nPujananting Kabupaten Barru, sudah berjalan dengan cukup baik. Temuan hasil \r\npenelitian ini didasarkan dari empat indikator penelitian, hanya satu yang tidak \r\nterpenuhi, yaitu pembangunan fasilitas pendidikan, Sedangkan indikator \r\npenelitian yang terpenuhi yaitu: beasiswa pendidikan, perbaikan akses pendidikan, \r\ndan sosialisasi pendidikan. Faktor-faktor yang menghambat implementasi \r\nkebijakan pemerintah dalam penyelenggaraan pendidikan di UPTD SDN 159 \r\nBarru Kecamatan Pujananting Kabupaten Barru adalah minimnya fasilitas \r\npendidikan dan adapun faktor eksternal yaitu kurangnya kesadaran orang tua , dan\r\nketerbatasan ekonomi.\r\nKata Kunci: Implementasi Kebijakan, penyelenggaraan pendidikan','ITBA AL-GAZALI BARRU',1,2024,2,1187,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1189,'Penelitian ini  bertujuan untuk mengetahui   pelayanan Bantuan Sosial  Tunai  (BST)\r\nterhadap masyarakat miskin dan kepuasan masyarakat dalam pelayanan tersebut ,dengan\r\nmetode penelitian Kualitatif, jenis data yang digunakan terdiri dari data perimer dan data\r\nsekunder, sumber data diperoleh dengan cara observasi, wawancara, dokumentasi, Sedangkan\r\nteknik analisis data melalui tahap pengumpulan data, reduksi data, penyajian data, serta\r\npenarikan kesimpulan dan verfikasi. \r\nHasil penelitian ini menunjukkan kualitas Pelayanan Bantuan Sosial Tunai (BST)\r\nterhadap masyarakat miskin di Desa Madello sudah cukup baik dilihat dari indikator\r\nketangkapan fisik, keandalan, ketanggapan, jaminan dan kepastian, serta empati. Sedangkan\r\nKepuasan  masyarakat miskin dalam  pelayanan Bantuan Sosial Tunai (BST) di Desa Madello\r\nsudah  cukup  baik  atau  puas, berupa  Prosedur pelayanan, Persyaratan Pelayanan, Kejelasan\r\npetugas pelayanan, Kedisiplinan petugas pelayanan, Tanggung jawab petugas pelayanan,\r\nKemampuan petugas pelayanan, Kecepatan pelayanan, Keadilan mendapatkan pelayanan,\r\nKesopanan dan keramahan petugas, Kewajaran biaya pelayanan, Kepastian jadwal pelayanan,\r\nKenyamanan lingkungan, serta Keamanan Pelayanan.','STIA AL-GAZALI BARRU',1,2023,1,1190,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1190,'Rahmatia. 20181284. Pengaruh Kualitas Pelayanan Terhadap Kepuasan \r\nKonsumen Pada Jasa Lembaga Keuangan Penyaluran Modal Usaha Pt Amartha \r\nMikro Fintek Di Kelurahan Takkalasi Kecamatan Balusu Kabupaten \r\nBarru. Dibimbing oleh : Mukmin Muhammad dan Asriani\r\n Penelitian ini bertujuan untuk mengetahui pengaruh kualitas pelayanan \r\nterhadap kepuasan konsumen di PT Amartha Mikro Fintek di Kelurahan \r\nTakkalasi.Jenis penelitian yang digunakan adalah kuantitatif. Subyek penelitian \r\nadalah orang-orang yang memahami pengaruh kualitas pelayanan terhadap \r\nkepuasan konsumen Pt Amartha Mikro Fintek di Kelurahan Takkalasi. Teknik \r\npengumpulan data diperoleh dengan cara observasi, kuisioner dan dokumentasi. \r\nKemudian teknik analisis data adalah, Uji Validitas dan Reliabilitas, Analisis \r\nStatistik Deskriptif , Uji Normalitas, Linearitas, Analisis Regresi Linear \r\nSederhana, dan uji Koefisien Determinan\r\n Hasil penelitian menunjukan bahwa kualitas pelayanan berpengaruh \r\nsignifikan terhadap kepuasan konsumen pada PT Amartha Mikro Fintek di \r\nKelurahan Takkalasi Kecamatan Balusu Kabupaten Barru. Kemudian jumlah \r\npengaruh varaibel Kualitas Pelayanan (X) terhadap variabel varibel Kepuasan \r\nkonsumen (Y) dii PT Amartha Mikro Fintek Di Kelurahan Takkalasi adalah \r\nsebesar: 49 %. Hal ini berarti berdasarkan hipotesis yang diajukan, maka H1 \r\nditerima dan H0 ditolak. \r\nKata Kunci : Kualitas Pelayanan, Kepuasan Konsumen','ITBA AL-GAZALI BARRU',1,2024,1,1189,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1191,'Alfira Ihwan. 20201051. Implementasi Undang-Undang Nomor 25 Tahun 2009 \r\nTentang Pelayanan Publik Bagi Institusi Pemerintah Dalam Pengelolaan SOP\r\ndi Mal Pelayanan Publik Kabupaten Barru. Dibimbing oleh Safaruddin dan A. \r\nAriyadi\r\nPenelitian ini bertujuan untuk mengetahui implementasi Undang-Undang \r\nNomor 25 Tahun 2009 tentang pelayanan publik bagi institusi pemerintah dalam \r\npengelolaan Standar Operasional Prosedur di Mal Pelayanan Publik dan untuk \r\nmengetahui dampak Standar Operasional Prosedur (SOP) dalam penyelenggaraan \r\npelayanan publik di Mal Pelayanan Publik Kabupaten Barru. Sumber data diperoleh \r\ndengan cara observasi, wawancara, dokumentasi. Analisis data menggunakan \r\npengumpulan data, reduksi data, penyajian data dan penarikan kesimpulan. \r\nHasil penelitian ini menunjukan bahwa Standar Operasional Prosedur (SOP) \r\nyang diterapkan oleh instansi-instantsi di bawah pengelolaan Mal Pelayanan Publik \r\n(MPP) Kabupaten Barru menunjukkan berbagai karakteristik positif. Meskipun \r\nbeberapa instansi mengalami tantangan seperti kurangnya pemahaman dan \r\npembaharuan terhadap SOP yang berlaku, kepatuhan SOP terhadap hukum, serta \r\nterkait keterukuran, mayoritas instansi berhasil mengimplementasikan SOP dengan \r\nbaik. Adapun dampak dari SOP bagi instansi yaitu a) meningkatkan kualitas hasil \r\npekerjaan. b) menjamin kelancaran proses. c) meningkatakan efektivitas dan \r\nefisiensi. d) memberikan kenyamanan dan keamanan. e) mengurangi risiko \r\nkesalahan. Adapaun bagi masyarakat sebagai pengguna layanan, meskipun belum \r\nsepenuhnya memahami SOP namun masih bisa menerima layanan dengan baik.\r\nKata Kunci : Implementasi, pelayanan publik, Standar Operasional Prosedu','ITBA AL-GAZALI BARRU',1,2024,1,1192,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1192,'NURUL ANDINI APRILIANTI, 20201118. Implementasi Undang-Undang \r\nNomor 16 Tahun 2019 Tentang Perkawinan Terhadap Batas Usia Nikah Di \r\nKUA Kecamatan Barru Kabupaten Barru. Dibimbing oleh A. Ariyadi dan \r\nHerlinah Amrianah.\r\nPenelitian ini bertujuan untuk mengetahui Implementasi Undang-Undang \r\nNomor 16 Tahun 2019 di KUA Kecamatan Barru Kabupaten Barru dan juga \r\nmengenai dampak yang terjadi dari hadirnya Implementasi Undang-Undang Nomor \r\n16 Tahun 2019 Tentang Perkawinan Terhadap Batas Usia Nikah di KUA \r\nKecamatan Barru Kabupaten Barru. Metode Penelitian yang digunakan adalah \r\nMetode Penelitian Kualitatif, Sumber data diperoleh dengan cara Observasi, \r\nWawancara, dan Dokumentasi. Teknik Analisis data menggunakan pengumpulan \r\ndata, Reduksi data, Penyajian data, dan Penarikan kesimpulan. Implementasi \r\nUndang-Undang Nomor 16 Tahun 2019 tentang Perkawinan Terhadap Batas Usia \r\nNikah di KUA Kecamatan Barru Kabupaten Barru telah terimplementasi dengan \r\nbaik, meskipun masih ada indikator yang perlu diperbaiki yaitu Sumber Daya \r\nManusia lebih khusus mengenai penguasaan regulasi. Dampak positif dari hadirnya \r\nUndang-Undang Nomor 16 Tahun 2019 Tentang Perkawinan Terhadap Batas Usia \r\nNikah di KUA Kecamatan Barru adalah penurunan pernikahan dini dan \r\npeningkatan kesadaran masyarakat tentang pentingnya menikah di usia matang. \r\nNamun, dampak negatif dari hadirnya Undang-Undang ini adalah terjadinya \r\npeningkatan dispensasi kawin di pengadilan agama dan masalah ekonomi \r\npernikahan usia muda. Kementerian Agama dalam hal ini KUA Kecamatan Barru \r\ndalam pengimplementasian Undang-Undang Nomor 16 Tahun 2019, terutama \r\nterkait dengan sumber saya, disarankan agar KUA Kecamatan KUA harus \r\nmeningkatkan kualitas sumber daya melalui pelatihan dan peningkatan kapasitas \r\nstaf. Melakukan sosialisasi dan edukasi terus-menerus tentang pentingnya menikah \r\ndi usia matang dan risiko pernikahan dini. Kemudian meningkatkan kerja sama \r\nantar lembaga untuk mengurangi dampak negatif pernikahan dini. Selain itu KUA \r\nKecamatan Barru perlu melakukan monitoring dan evaluasi berkala untuk \r\nmengidentifikasi kendala dan menilai efektivitas kebijakan.Terakhir, KUA juga \r\nharus memperkuat dan memperluas program konsultasi pranikah.\r\nKata Kunci : Implementasi, Undang-Undang Nomor 16 Tahun 2019, Batas \r\nUsia Nikah','ITBA AL-GAZALI BARRU',1,2024,1,1191,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1193,'','STIA AL-GAZALI BARRU',1,2016,1,1195,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1194,'ABSTRAK\r\nDian Maulana, 20161127, Implementasi Pelayanan Publik Berbasis Aplikasi Siap Desa \r\n(Sistem Informasi Administrasi Dan Pelayanan Desa) Di Desa Corawali Kecamatan \r\nTanete Rilau Kabupaten Barru..\r\nSIAP Desa (Sistem Informasi Administrasi Pemerintah Desa) adalah sebuah Aplikasi \r\nberbasis web yang terintegrasi dengan Siskeudes besutan Dinas PMD Kabupaten Barru \r\nyang diharapkan menjadi sarana Keterbukaan Informasi Publik Desa. anda dapat \r\nmenemukan sejauh mana realisasi anggaran desa anda, apa saja yang dianggarkan oleh \r\npemerintah Desa, adakah keberpihakan anggaran desa tersebut untuk masyarakat tidak \r\nmampu, program apa saja yang direncanakan dan dikerjakan desa anda, seberapa besar \r\nPendapatan Asli Desa, dan informasi2 lainnya. anda juga dapat melihat produk hukum \r\napa saja yang sudah dibuat oleh Pemerintah desa anda di aplikasi tersebut, dan sejauh \r\nmana produk hukum trsebut dibuat untuk memajukan desa anda.\r\nData yang ada di Aplikasi SIAP Desa tersebut akan dapat diakses oleh publik. Desa \r\nCorawali merupakan salah satu dari 7 (tujuh) desa yang dipilih menjadi Pilot Project \r\nPenerapan Aplikasi SIAP Desa. Desa Corawali beserta 6 desa lainnya diundang di ruang \r\nrapat Dinas PMD guna pemaparan, penjelasan, dan pelatihan aplikasi SIAP Desa tersebut \r\nyang diwakili oleh sekdes dan kaur perencanaan desa. setelah dilakukan penerapan \r\naplikasi SIAP Desa oleh 7 (tujuh) desa yang menjadi pilot project.\r\nKata Kunci : Implementasi, Pelayanan Publik, Teknologi Informasi dan Komunikasi, dan \r\nAplikasi SIAP Desa (Sistem Informasi Administrasi dan Pelayanan Desa)','STIA AL-GAZALI BARRU',1,2022,2,1194,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1195,'KISMAWATI. 20201101. Pengaruh Program Keluarga Harapan (PKH) \r\nTerhadap Pemenuhan Kebutuhan Dasar Lanjut Usia Di Desa Bacu-Bacu \r\nKecamatan Pujananting Kabupaten Barru. Dibimbing oleh A. Pananrangi M\r\ndan Herlina Amrianah.\r\n Penelitian ini bertujuan untuk mengetahui pengaruh Program Keluarga \r\nHarapan (PKH) terhadap pemenuhan kebutuhan dasar lanjut usia di Desa Bacu￾Bacu Kecamatan Pujananting Kabupaten Barru. Jenis penelitian yang digunakan \r\nadalah kuantitatif. Teknik pengambilan sampel menggunakan sampel jenuh atau \r\ntotal sampling Teknik pengumpulan data diperoleh dengan cara observasi, \r\nkuesioner, dan dokumentasi. Kemudian teknik analisis data adalah Analisis \r\nStatistik Deskriptif, Uji validitas dan Reliabilitas, uji normalitas, uji linearitas dan \r\nuji regresi linear sederhana. Hasil penelitian menunjukkan bahwa Terdapat \r\npengaruh yang signifikan Program Keluarga Harapan (PKH) terhadap pemenuhan \r\nkebutuhan dasar lanjut usia di Desa Bacu-Bacu Kecamatan Pujananting \r\nKabupaten Barru. atau dengan kata lain hipotesis : H0 ditolak, diterima dan H1 \r\nditerima. Hasil penelitian juga menunjukkan bahwa jumlah pengaruh Program \r\nKeluarga Harapan (PKH) terhadap Pemenuhan kebutuhan dasar lanjut usia di \r\nDesa Bacu-Bacu Kecamatan Pujananting Kabupaten Barru. adalah sebesar 65%. \r\nSisanya 35 % dipengaruhi oleh faktor lain yang tidak dibahas dalam penelitian ini.\r\nKata Kunci: Pengaruh PKH, Pemenuhan Kebutuhan Dasar Lanjut Usia','ITBA AL-GAZALI BARRU',1,2024,2,1193,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1196,'Rahmatang, 20201016. Implementasi Program Industri Kecil dan Menengah \r\n(IKM) dalam Pemberdayaan Pelaku Usaha di Bidang Industri Dinas \r\nKoperasi, Usaha Kecil Menengah (UKM) dan Perdagangan Kabupaten Barru.\r\nDibimbing oleh H. A. Russeng dan Adam Malik.\r\nPenelitian ini bertujuan untuk mengetahui implementasi program Industri \r\nKecil dan Menengah (IKM) dalam Pemberdayaan Pelaku Usaha di Bidang Industri \r\nDinas Koperasi, Usaha Kecil Menengah (UKM) dan Perdagangan Kabupaten Barru \r\ndan faktor-faktor penghambat Implementasi program Industri Kecil dan Menengah \r\n(IKM) dalam Pemberdayaan Pelaku Usaha di Bidang Industri Dinas Koperasi, \r\nUsaha Kecil Menengah (UKM) dan Perdagangan Kabupaten Barru. Jenis penelitian \r\nini adalah kualitatif deksriptif. Adapun subjek dalam penelitian ini adalah Pegawai \r\nDinas Koperasi, Usaha Kecil Menengah (UKM) dan Perdagangan dan Pelaku \r\nUsaha. Teknik pengumpulan data diperoleh dengan cara observasi, wawancara, dan \r\ndokumentasi. Pemeriksaan keabsahan data adalah kredibilitas (credibility), \r\ntransferability (transfersbility), depentabilitas (depentability) dan konfirmabilitas \r\n(confirmability). Teknik analisis data menggunakan kondensasi data, penyajian \r\ndata, dan Penarikan Kesimpulan. Hasil penelitian menunjukkan bahwa \r\nimplementasi Program Industri Kecil dan Menengah (IKM) dalam Pemberdayaan \r\nPelaku Usaha di Bidang Industri Dinas Koperasi, Usaha Kecil Menengah (UKM) \r\ndan Perdagangan Kabupaten Barru sudah berjalan dengan cukup baik dengan \r\nterpenuhinya beberapa indikator yaitu komunikasi, sikap pelaksana dan struktur \r\nbirokrasi, sedangkan indikator yang tidak terpenuhi yaitu sumber daya manusia \r\n(SDM) yang jumlahnya kurang. Selain itu, faktor-faktor penghambat dalam \r\nimplementasi Program Industri Kecil dan Menengah (IKM) dalam Pemberdayaan \r\nPelaku Usaha di Bidang Industri Dinas Koperasi, Usaha Kecil Menengah (UKM) \r\ndan Perdagangan Kabupaten Barru adalah Sumber Daya Manusia (SDM) dan \r\nAnggaran.\r\nKata Kunci: Implementasi, Industri Kecil dan Menengah (IKM), Usaha.','ITBA AL-GAZALI BARRU',1,2024,1,1196,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1197,'','STIA AL-GAZALI BARRU',1,2016,1,1197,'2025-06-05 15:02:14','2025-06-05 15:02:14'),
	(1198,'Fika Novita, 20181145, Kebijakan Pemerintah Dalam Upaya Pelestarian Tradisi “Mappalili” \r\nDi Kelurahan Lanrisang Kecamatan Lanrisang Kabupaten Pinrang.\r\nHasil penelitian ini bertujuan Untuk mengetahui Kebijakan Pemerintah Dalam Upaya \r\nPelestarian Tradisi “Mappalili” di Kelurahan Lanrisang, Kecamatan Lanrisang Kabupaten\r\nPinrang. Untuk mengetahui Faktor-faktor pendukung dan penghambat pada Pemerintah \r\nDalam Upaya Pelestarian Tradisi “Mappalili” di Kelurahan Lanrisang, Kecamatan Lanrisang \r\nKabupaten Pinrang. Tipe penelitian yang digunakan adalah tipe penilitian kualitatif, sumber data \r\nyang digunakan adalah sumber data primer dan sekunder. Teknik analisis datanya yaitu pengumpulan \r\ndata,reduksi data,penyajian data dan penarikan kesimpulan. Mappalili adalah suatu tradisi yang \r\ncukup unik dan memiliki makna pengharapan luar biasa yang masih tetap dipertahankan \r\ndikenal dengan istilah Mappalili terlaksana di Kelurahan Lanrisang, Kecamatan Lanrisang \r\nKabupaten Pinrang. Ritual Mappalili adalah tradisi secara turun-temurun yang digelar \r\nsetahun sekali diyakini masyarakat setempat sebagai pedoman bagi petani untuk memulai \r\nmusim tanam padi (turun sawah atau hambur benih). Mappalili merupakan tradisi khas \r\nmasyarakat di sejumlah daerah di Sulawesi Selatan termasuk di Kabupaten Pinrang \r\nkhususnya di kalangan petani, salah satu kearifan lokal yang didukung oleh \r\npemerintah. Tradisi ini mengandung pengharapan akan kesejahteraan, dimana siratan \r\nmaknanya berupa doa agar di musim padi kali ini berjalan dengan baik dan hasil melimpah. \r\nTradisi Mappalili dipimpin oleh pemimpin adat ataupun imam yang biasa memimpin doa. \r\nKegiatan diawali dengan penggunaan alat bajak sawah mengelilingi areal sawah. Kemudian \r\ndilanjutkan dengan ritual mengelingi areal sawah yang dipimpin oleh pemimpin adat/imam \r\ndiikuti oleh para petani serta aparatur sipil yang turut serta mengambil bagian. Di separuh \r\nperjalanan, pemimpin adat/imam diikuti oleh petani kemudian berhenti untuk melafalkan doa. \r\nDoa berisi harapan agar hasil panen melimpah, mencukupi kebutuhan. Kebijakan Pemerintah \r\nDalam Upaya Pelestarian Tradisi “Mappalili” di Kelurahan Lanrisang, Kecamatan Lanrisang \r\nKabupaten Pinrang untuk melaksanakan perlu ada komunikasi dengan pemerintah pusat dan \r\ndaerah karena adanya covid-19 dan ini harus dilaksanakan karena ini adalaha agenda tahunan \r\nbagi Kelurahan Lanrisang ini. Faktor-faktor pendukung dan penghambat pada Pemerintah \r\nDalam Upaya Pelestarian Tradisi “Mappalili” di Kelurahan Lanrisang, Kecamatan Lanrisang \r\nKabupaten Pinrang. Ini adalah adanya dorongan dari masyarakat dan pemerintah untuk \r\nmelaksanakannya kalau faktor penghambatnya tergantung kondisi yang dialami sekarang.\r\nBerdasarkan hasil penelitian ada salah satu pemangku adat menyatakan bahwa melalui \r\nkegiatan mappalili masyarakat bersatu dalamvisi misi sehingga permasalahan yang dihadapi \r\nsebelumnya dapat diberikan solusi. Sebagaimana yang dikatakan bahwa mappalili itu dikenal \r\ndikalangan masyarakat pertanian khususnya di Kabupaten Pinrang di setiap desa, kelurahan, \r\nkonsep masyarakat setempat memahami bahwa sebelum melakukan penggarapan sawah, \r\nbiasanya dilakukan mappalili, budaya mappalili adalah sebuah adat dan budaya yang harus \r\ndilestarikan demi menata sebuah tatanan kondisi masyarakat pertanian.\r\nKata Kunci: Kebijakan, Kebijakan Publik, Tradisi, Tradisi Mappalili.','STIA AL-GAZALI BARRU',1,2023,2,1198,'2025-06-05 15:02:14','2025-06-05 15:02:14');
